CREATE TABLE `reviews` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `review` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `score` int(11) NOT NULL,
  `candy_id` int(10) unsigned NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `review_time` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `reviews_candy_id_foreign` (`candy_id`),
  CONSTRAINT `reviews_candy_id_foreign` FOREIGN KEY (`candy_id`) REFERENCES `candies` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1653 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

LOCK TABLES `reviews` WRITE;
/*!40000 ALTER TABLE `reviews` DISABLE KEYS */;
INSERT INTO `reviews` VALUES (1,'原材料表示を見ると、ビタミンが添加されているようだが成分表示に詳しいビタミン数値がない ＨＰでも良いので表示してもらえると分かりやすいのに',4,1,'2020-10-07 05:29:17','2020-10-07 05:29:17','ダイエッターさん','2020.07.22'),(2,'1本あたりのエネルギー172kcal、タンパク質15g、糖質6.7gで、ビタミンB群も含まれていて98円、最強のコスパ。 味はビターチョコレート風味で、食感は硬めでザクザクしており、自分好み。 箱買いしています。',5,1,'2020-10-07 05:29:17','2020-10-07 05:29:17','PBマニアさん','2020.07.20'),(3,'カロリーオフとかこういう商品は、美味しくないことが多いですが、凄く美味しかったです!チョコレート大好きですが、美味しいうえにこれでタンパク質も摂取出来るなんてとても感動しました！',5,3,'2020-10-07 05:29:17','2020-10-07 05:29:17','ちょこさん','2020.07.25'),(4,'この成分内容でこの価格。しかも美味しい。個人的に現時点で最強のプロテインバーです。',5,4,'2020-10-07 05:29:17','2020-10-07 05:29:17','たぬぱらさん','2020.08.01'),(5,'70%位のビターチョコが好きで、ビスケットの全粒粉入りのザクザク感も好みなのでリピートしています。',5,5,'2020-10-07 05:29:17','2020-10-07 05:29:17','みみみさん','2020.06.18'),(6,'板チョコクッキーが大好きで、常にストックしていたのですが見当たらず、いつもの場所に代わりにあったこちらを購入。 少ない。 よくある高カカオのエグイ大人の味かと尻込みしたものの、甘味も苦味もどっちつかずの風味。 クッキーはザックリともサクッともしておらず、存在感がない。 どの客層を狙っているのか、イマイチはっきりしない中途半端な味。 板チョコクッキーが最強のバランスと不動の美味しさだっただけに、残念で仕方ない。 まったく似て異なる商品。',2,5,'2020-10-07 05:29:17','2020-10-07 05:29:17','板チョコクッキーラブさん','2020.06.13'),(7,'甘いチョコレートとビスケットの組み合わせより ビターなこちらの方が食べやすくて好きです。 定番商品としてずっと置いてほしいです。',5,5,'2020-10-07 05:29:17','2020-10-07 05:29:17','ないろさん','2020.06.08'),(8,'以前売っていた板チョコクッキーがお気に入りだったのですが見当たらないので代わりに購入 チョコはカカオ70%の名の通りカカオが濃くて甘さはかなり控え目で大人の味付け クッキーは全粒粉のザクザク感があるけど以前の焦がしシュガーがなくて、口の水分が取られてしまう感じ 全体的に食べた後にざらっとした粉末感が残ってあまり心地よくない印象 本商品のターゲットと私の嗜好が合ってない事はパッケージから薄々感じていましたが正直あまりおいしいと感じませんでした。 本商品と板チョコクッキーがとなりに並んでいたら、間違いなく後者を選びます。',2,5,'2020-10-07 05:29:17','2020-10-07 05:29:17','板チョコクッキーさん','2020.05.31'),(9,'似たようなお菓子を食べたことがありますが、個人的にはこちらの方がサクッとしていて好きです。',5,5,'2020-10-07 05:29:17','2020-10-07 05:29:17','あゆさん','2020.05.31'),(10,'ブラックチョコだけでは、苦手ですが、ビスケットとの調和が程良く、常備して置きたい一品です。',5,5,'2020-10-07 05:29:17','2020-10-07 05:29:17','ゆみちゃんさん','2020.05.30'),(11,'乳成分を含まないチョコレートは初めてでしたが、 普段食べているものとまったく違和感なく美味しかったです。 シンプルな原材料は雑味なくスッキリした味わいで、 製菓づくりにも刻みやすかったです。',5,6,'2020-10-07 05:29:17','2020-10-07 05:29:17','小夏さん','2020.06.28'),(12,'口当たりがよくて食べやすいです。 美味しいのでついつい食べてしまいます。',4,6,'2020-10-07 05:29:17','2020-10-07 05:29:17','アロメちゃんさん','2020.06.05'),(13,'口溶けなめらかで、美味しいです。',5,6,'2020-10-07 05:29:17','2020-10-07 05:29:17','えりなさん','2020.05.19'),(14,'チョコ入りスコーン作りました。乳アレルギーがある三男が、お兄ちゃんたちと同じ憧れのチョコスコーンを食べれて大喜びです。 このお値段で買えるなんて本当にありがたいです。',5,6,'2020-10-07 05:29:17','2020-10-07 05:29:17','ちーさん','2020.05.10'),(15,'小3の息子が乳アレルギーが あり、チョコが食べれませんでしたので これは普通のチョコと変わらない味で お気に入りのおやつです 見つけた時は、とても嬉しかったです！',5,6,'2020-10-07 05:29:17','2020-10-07 05:29:17','はちさん','2020.04.01'),(16,'小麦、卵、乳、落花生アレルギーの息子がいます。バレンタイン用に購入。甘くて美味しかったです。',5,6,'2020-10-07 05:29:17','2020-10-07 05:29:17','かくしかんさん','2020.02.14'),(17,'乳成分を含まれていないけど、普通のチョコと変わらない味で美味しいと思います。私はバレンタイン用に購入したので、これで手作りチョコを作ります。',5,6,'2020-10-07 05:29:17','2020-10-07 05:29:17','kumiさん','2020.01.20'),(18,'マルチアレルギーのある息子がいます。今まではネットで注文していたのですが苦味があって普通のチョコとは少し違ったのですがこれは普通のチョコとなんにもかわりなく息子にチョコレートはこんな味と教えてあげれて嬉しかったです。箱買いしてしまいました。これからもっとデザートのはばも広がりとっても楽しみです。こんな商品を作ってくれてありがとうございました。',5,6,'2020-10-07 05:29:17','2020-10-07 05:29:17','アレママさん','2020.01.20'),(19,'乳製品アレルギーの息子が今までに食べたチョコレートはとても苦いブラックチョコだけでした。だけどこのチョコはとても美味しいと一気に一枚食べてまうほど気に入ってました、私も一口食べましたが普通のチョコとなんら変わりなくとても美味しかったです。このような商品を作ってくださって本当に感謝します。',5,6,'2020-10-07 05:29:17','2020-10-07 05:29:17','ひろさん','2019.12.23'),(20,'僕は卵・乳アレルギーの中学1年生です。唯一嫌いな食べ物が卵、乳を使っていないチョコでした。そして今回、いつもお世話になっているやさしごはんさんのチョコなので買ってみたら、最初は少し苦かったですが、途中から慣れてきて美味しく感じて今では甘くていっぱい食べています。僕の嫌いな食べ物を無くしてくれて嬉しいです。おススメです。',5,6,'2020-10-07 05:29:17','2020-10-07 05:29:17','ニクさん','2019.12.10'),(21,'乳アレルギーの娘が食べられるチョコレートを見つけて大喜びでした。 味も普通のチョコと変わらずとても美味しくて値段もお手頃で。 これからクリスマスや誕生日があるのでこれを使ってチョコレートケーキやお菓子を作ろうと思います。',5,6,'2020-10-07 05:29:17','2020-10-07 05:29:17','ママさん','2019.11.29'),(22,'乳アレの息子がいるので購入しました。 他の乳入りのチョコレートと全く変わらないお味でした。 マフィンの中に入れましたがおいしかったです。',5,6,'2020-10-07 05:29:17','2020-10-07 05:29:17','アレっ子ママさん','2019.11.05'),(23,'私は高校2年になってから大豆アレルギーを発症し、大好きだったチョコレートも大豆由来の乳化剤のために食べられなくなっていました。そんな時にたまたまみつけたこのチョコのおかげで久しぶりにチョコレートを食べることが出来ました！ 開発者の方、本当にありがとうございました。',5,6,'2020-10-07 05:29:17','2020-10-07 05:29:17','ともかさん','2019.10.28'),(24,'乳成分が入ってないという事で買ってみました。 普通のチョコレートと全く同じでびっくりです！おいしい(^o^) また買いたいと思います！',5,6,'2020-10-07 05:29:17','2020-10-07 05:29:17','えむぅさん','2019.10.14'),(25,'グミの食感とチョコの組み合わせがとても美味しくて大好きです。よく行く店舗では今年に入ってから見かけないので、取り扱いを止めてしまったのかもしれません。もう一度取り扱いして欲しいです。',5,7,'2020-10-07 05:29:17','2020-10-07 05:29:17','いよいよさん','2020.04.11'),(26,'大好きないちごグミとチョコのコラボ。とてもおいしくて、量もちょうどよく継続購入したいのですが、イオン系でもおいてある店が少なく探すのに苦労してます…ぜひ定番商品になってほしいです。',5,7,'2020-10-07 05:29:17','2020-10-07 05:29:17','かよちさん','2020.03.11'),(27,'グミの硬さ、チョコ丁度良いです。まとめ買いしちゃいました。美味しいと思います',5,7,'2020-10-07 05:29:17','2020-10-07 05:29:17','おばさん34さん','2019.11.20'),(28,'大きめボールチョコの中にイチゴグミが入っていて食べごたえがあり美味しい。似たような商品が好きな甥っ子も好きな味だと思うので、近くにイオンがないのでいった際にはまとめて購入したいです。',5,7,'2020-10-07 05:29:17','2020-10-07 05:29:17','ゆみさん','2019.11.11'),(29,'安さにつられて買ったが、あまりのまずさにびっくりした。こんなにまずいのはひさしぶり。まずチョコレートの味がひどい。甘いだけの油分でココアの香りがかすかに？みたいな感じ。アーモンドは古い味がした。お金を返して欲しい。',1,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','mogさん','2020.03.11'),(30,'チョコの味がしないまがい物。担当者は味見したのか疑うレベル',1,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','ぱんださん','2019.12.03'),(31,'最近食べたアーモンドチョコレートの中でも一番まずいです。 2度と買うことは無いと思います。チョコレートが安っぽい甘さの味です。',1,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','ジローさん','2019.11.16'),(32,'チョコレートが美味しくない。正直買って失敗しました。',1,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','けんじさん','2019.01.10'),(33,'おいしくない 外国土産でもらった日本のお菓子もどきみたい',1,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','チョコさん','2018.10.13'),(34,'アーモンドのカリッとした食感とまろやかなチョコレートのコラボ。程よいサイズ感の粒に美味しくかんじられました。',4,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','うみさん','2018.04.09'),(35,'あまりにもチョコがまずくて驚きました。 トップバリュは好きなのですが、これはひどすぎる。 こういったコメントは書いたことがありませんでしたが、 腹が立つくらいまずかったのでつい投稿しました。 これは本当にチョコレートでしょうか？',1,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','はじめさん','2018.03.09'),(36,'前に買って意外と美味しくて他のアーモンドチョコと同様に中のフィルムぺろっと剥がすタイプに感動しましたが、今回久々に買って中包装されていたので少しガッカリしました。でも他のレビュー見てると紙の匂いが移ったと書いてあるのでそのためですね。味は普通に美味しくて他のアーモンドチョコより30円やすく買えるので私はリピするかなって感じです。',4,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','sakuさん','2018.03.09'),(37,'値段も安くて量もちょうどいい！',4,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','もさん','2018.02.20'),(38,'アーモンドも美味しい',3,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','とっしーさん','2018.02.16'),(39,'安いけど甘すぎる。 新しいビターのに期待',2,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','じゃがさん','2018.01.29'),(40,'お値段で飛びついてしまいました。 率直にいうと私の方には合いませんでした。 箱の中の紙の匂いなのか?口に入れた瞬間、今まで感じたことのない風味がしました。 ただ甘いだけでチョコ本来の風味が無いと私は思いました。',1,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','チョコダイスキさん','2017.09.26'),(41,'不味い。その一言です。食べたあとムカムカしました。',1,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','hazukiさん','2017.09.04'),(42,'アーモンドチョコレート好きなので買ってみました! アーモンドの香ばしさとミルクチョコレートの相性はやはりすごくいいですね! もう少し量が入ってたらうれしいです',5,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','mokkさん','2017.07.28'),(43,'チョット内容量が少ない気もしましたが、 値段が安いし、充分においしいです アーモンドのカリカリ感がいいですよ',4,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','madotitiさん','2017.07.20'),(44,'まずい・・・損した気分。 チョコに紙のにおいが移っていて、チョコをたべているのか紙を食べているのか・・・',1,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','1さん','2017.07.20'),(45,'内容量が箱に対して3分の2程度のスカスカでガッカリ。 味もリピートしないと思います。',2,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','まるさん','2017.06.07'),(46,'箱は他社アーモンドチョコ商品と同程度の大きさだが、開けた時に中身のチョコが容器の3分の2程度のスカスカ容量でガッカリした。 甘いがチョコの味が薄く、リピートはしないと思う…。',2,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','まるさん','2017.06.05'),(47,'アーモンドの香ばしさと苦味がすごく感じられて、とても美味しかったです。いつも食べているチョコとは何かが違う気がするのですが、好き嫌いが分かれる味かもしれません。私は好きです。',4,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','プニさん','2017.05.28'),(48,'メーカー品よりいいかもと思い、買いましたが、味は今一つ。メーカー品の方がいい。',3,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','このし～さん','2017.05.05'),(49,'イオンの食品レジに並んでいる時に、レジ横で陳列されており 「あ!トップバリュのアーモンドチョコ安い!美味しそう!」 と何も見ずにカゴにポイッと入れてしまいました。 ……うーん、微妙です。 アーモンドはそんなに気にならなかったのですが、チョコがあまり美味しくないかも。不味くもないけど、多分もう買わないかな。',2,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','パピコさん','2017.03.21'),(50,'ただ一言、不味い。 お菓子は日本製が良いです。',1,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','ぷーさんさん','2017.03.06'),(51,'薄味のチョコ、少し苦味あるアーモンド。 私には向きませんでした。',1,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','ちょこさん','2017.02.14'),(52,'チョコの味が薄く、アーモンドが微妙に香ばしい。 5つ残して、自分のお腹にはムリが来ました。',1,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','さん','2017.02.12'),(53,'アーモンドが美味しくない',1,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','チョコさん','2017.02.04'),(54,'香ばしさもチョコのコクも良し。ひとつまみの、おやつにピッタリ‼︎リピ買いしています。',5,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','みもざさん','2017.01.28'),(55,'安いしおいしいし言うこと!イオンで買いましたが近所のミニストップに置いてほしいです。',5,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','いなさん','2016.12.30'),(56,'この商品は最高です。この手の商品は甘い、だけの商品しかなかったのですが、苦みがおいしい。最高。リピート購入確実です。',5,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','たけしさん','2016.12.20'),(57,'おいしい',5,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','けんけんさん','2016.12.07'),(58,'アーモンドとチョコのコラボは間違いないと思います。パクパクいけるからあっと言う間に食べました^^;これからのシーズンに更に良いですね。',5,8,'2020-10-07 05:29:17','2020-10-07 05:29:17','ユリモリさん','2016.12.06'),(59,'素敵な商品に出会えました。 初めて購入させていただいたのですが、一口食べてみてなんとも言えないほどよい苦味が口の中に広がりました。これ以上甘くなると、まだまだ食べたくなってしまい、すぐに無くなってしまうと思うのですが、このチョコレートは、多くて３つ食べれば私の中で満足感が出てくるので、食べ過ぎ防止にもなるし、美味しいしで次もまた必ずリピートしたい商品です。身体にも良さそうなのでなお良いです。 無くなる前にまた買います。',5,9,'2020-10-07 05:29:17','2020-10-07 05:29:17','かかおさん','2020.06.30'),(60,'高カカオでとても安価で継続しやすい。',5,9,'2020-10-07 05:29:17','2020-10-07 05:29:17','アサヒさん','2020.06.20'),(61,'ほかのメーカーのカカオ80%台のチョコよりも苦味が少なく、甘みがあって食べやすいです。でも糖質は他より高めなので★１つ減らしました。',4,9,'2020-10-07 05:29:17','2020-10-07 05:29:17','ムチャチャさん','2020.06.04'),(62,'今まではカカオ７０％を食べていましたが最近はこちらばかりです。 苦みも程よく、コーヒーのお供にもお酒のお供にも合います。',5,9,'2020-10-07 05:29:17','2020-10-07 05:29:17','suke_poさん','2020.05.23'),(63,'チョコの数もたくさん入っており冷蔵庫に保存もできる為食べたい時にパって食べれてとても便利でとても味も美味しいです！！ いつも買わしてもらってます！！',5,9,'2020-10-07 05:29:17','2020-10-07 05:29:17','ゆーまさん','2020.05.22'),(64,'なんと植物油脂がはいってません。 クオリティーの証です。しかも25％ほど量が多く、輸入モノは板 チョコが多いですが、こちらは手軽で食べやすい。国産だからと いうのもプラスになります。こちらに乗り換えます。 間食はダークチョコとクルミを主に食べていますが、先日血液検査 で、どこも数値に異常なし、なんていままでで考えられないことに なりました。100グラム毎日。この商品ですと、毎日4粒ですかね。',5,9,'2020-10-07 05:29:17','2020-10-07 05:29:17','赤道直下さん','2020.04.24'),(65,'健康のために食べていたはずが、血糖値の方が上昇してしまった父親に食べさせてます。',5,9,'2020-10-07 05:29:17','2020-10-07 05:29:17','おねこにすとさん','2020.02.15'),(66,'健康のため高カカオチョコレートを食べ始めましたが初めは70%から挑戦して最近は85%を食べています。今では標準のチョコレートでは物足りなく思ってます。 毎日のことなので容量も多くお得なので嬉しいです。',5,9,'2020-10-07 05:29:17','2020-10-07 05:29:17','まみぃさん','2020.01.21'),(67,'低糖質の健康習慣を実施しているものです。 こちらの商品は高カカオポリフェノールでお手頃価格なので、いいなと思いました。 実際食べてみて、なんか甘いな？と思ったら、他社製品と比べて糖質が高めのようです。 高カカオポリフェノールでも糖質が高いと意味がないですね… これで糖質が下がれば最高です。',2,9,'2020-10-07 05:29:17','2020-10-07 05:29:17','みよしさん','2020.01.16'),(68,'コーヒーに合うチョコレートを探していて、いろいろ食べてきた中で、このチョコレートを気に入ってよく買うようになりました。特にブラックコーヒーに合い美味しいです。',5,9,'2020-10-07 05:29:17','2020-10-07 05:29:17','kumiさん','2019.12.02'),(69,'どうせ間食をとるなら、健康のためにカカオポリフェノール含有のチョコレートを食べています。こちらの商品はコスパも良く、味もよく、カカオのほろ苦さがクセになります。苦いチョコは苦手な方でしたが、これなら毎日食べ過ぎず、いただけると思います。コーヒーとも合うので、朝会社で食べてます。',5,9,'2020-10-07 05:29:17','2020-10-07 05:29:17','シッポさん','2019.09.09'),(70,'チョコレートの味がバランス良い。',5,9,'2020-10-07 05:29:17','2020-10-07 05:29:17','田中光也さん','2019.08.05'),(71,'高カカオで、量もたっぷり入っているのがうれしいです。職場に置いています。',4,9,'2020-10-07 05:29:17','2020-10-07 05:29:17','おーさん','2019.07.20'),(72,'高カカオチョコレートで甘くなく、くちどけも滑らかです。単体で食べてものどにひっかららず、1個あたり5ｇというところも魅力的です。',5,9,'2020-10-07 05:29:17','2020-10-07 05:29:17','れっしーさん','2019.06.27'),(73,'純粋にチョコレートの味を楽しめます。 ブラックのコーヒーにも合います。',5,9,'2020-10-07 05:29:17','2020-10-07 05:29:17','アブシンベル寿雄さん','2019.06.19'),(74,'85パーセントが新しく出たってことで家から一番近いマックスバリュー行ったらありました。 85パーセントでも甘みも感じられるしたまには80パーセント以のチョコも食べたくなるのでお手頃価格での発売嬉しいしです(^^)',5,9,'2020-10-07 05:29:17','2020-10-07 05:29:17','バナナ。さん','2019.06.08'),(75,'たくさん入っていておいしく、安いのでいつも買っています。一口サイズで袋に入っているのでみんなで分けることができておすすめです。',4,10,'2020-10-07 05:29:17','2020-10-07 05:29:17','おまめさん','2020.06.30'),(76,'こういうタイプのチョコレートが食べたいと思った時に、ちょうどいい大きさと、量と、おいしさがあるチョコレートだと思います。カカオが多いタイプではないですが、ちょっとたべてエネルギー補給になる甘~いチョコレートが欲しいときに最適だと思います。',4,10,'2020-10-07 05:29:17','2020-10-07 05:29:17','MMMさん','2020.06.17'),(77,'よくある安くて美味しくないチョコと違いとろけて美味しい！！また書いたくなる味です',5,10,'2020-10-07 05:29:17','2020-10-07 05:29:17','あっこっこさん','2020.06.13'),(78,'一口サイズで食べやすく個包装になっているので袋から取り出す時もべたつかないから気に入っています。味も美味しいです。ついつい食べ過ぎてしまいます。',5,10,'2020-10-07 05:29:17','2020-10-07 05:29:17','kumiさん','2020.05.14'),(79,'この容量で、この値段なら大満足です。個包装になっているところもＧＯＯＤです。家族全員で食べています。飽きの来ない味で、みんな大好きです。',4,10,'2020-10-07 05:29:17','2020-10-07 05:29:17','ＷＷＧさん','2020.02.28'),(80,'かなり甘い。でもこれが、疲れている時、のどにじんわりしみて、 疲れが取れる気分です。準チョコレートでなく、チョコレートだと嬉しいです。',4,10,'2020-10-07 05:29:17','2020-10-07 05:29:17','ちょっこし仲良しさん','2019.10.27'),(81,'ピーナッツが入っていて値段の割にたくさん入っているのでコスパがいいです。味も甘めのチョコで気に入っています。',4,11,'2020-10-07 05:29:17','2020-10-07 05:29:17','おまめさん','2020.06.30'),(82,'沢山入っていてお安くて嬉しいです。 キャンディー包みになっているチョコって懐かしい感じがして好きです。',4,11,'2020-10-07 05:29:17','2020-10-07 05:29:17','なつさん','2020.06.09'),(83,'デスクワークの時につまんでいます。手が汚れず、ナッツの歯ごたえもしっかり感じることができるので、脳の疲れをとるのによいです。 チョコレートのくちどけも良いので、月に2袋は欠かせません。',5,11,'2020-10-07 05:29:17','2020-10-07 05:29:17','もも太さん','2020.01.31'),(84,'味にうるさい息子が、美味しいから買ってきてと言います。なので、我が家には常備してあり、家族みんなで食べてます。ピーナッツとチョコのバランスが良いです。',5,11,'2020-10-07 05:29:17','2020-10-07 05:29:17','猫のくぅさん','2020.01.25'),(85,'中身のピーナッツチョコレートの味のみならず パッケージのデザインも好きというこちらの製品を丸ごと愛している者です。 他のピーナッツチョコレートではなぜか満足できず ピーナッツチョコレートが欲しければトップバリュー取扱店へ ＧＯ！しています(*^-^*)。',5,11,'2020-10-07 05:29:17','2020-10-07 05:29:17','大ファンさん','2020.01.04'),(86,'口どけなめらかで ピーナッツ感もしっかりあって大満足のピーナッツチョコレートです。 とても気に入っています。',5,11,'2020-10-07 05:29:17','2020-10-07 05:29:17','まろやかさん','2019.11.24'),(87,'チョコレートの中にピーナッツの組み合わせがとてもおいしいです。噛んでも美味しい、なめていても美味しい。止まらない美味しさです。',5,11,'2020-10-07 05:29:17','2020-10-07 05:29:17','ちびまるおさん','2019.07.15'),(88,'正直、くちどけはあまりなめらかではないです。 カカオマス？なのかなんなのか、口の中で溶かしていくうちに硬い粒がでてきます。 でも味はちゃんとビターチョコなので、値段を考えれば十分満足できます。 シュガーレスでアセスルファムKが入っていないのも良い点です。 是非ホワイトチョコバージョンも作ってほしいです。',4,12,'2020-10-07 05:29:17','2020-10-07 05:29:17','にゃまさん','2020.07.20'),(89,'砂糖不使用でこの味なら充分以上です。',5,12,'2020-10-07 05:29:17','2020-10-07 05:29:17','HAL1000さん','2020.05.25'),(90,'ビターのチョコが好きなので、砂糖不使用はとても良いです！',5,12,'2020-10-07 05:29:17','2020-10-07 05:29:17','ズイオトさん','2020.05.20'),(91,'パッケージがマイナスです。鉄さびのような血痕のような。チャック付きで便利、美味しいのに残念です。',3,12,'2020-10-07 05:29:17','2020-10-07 05:29:17','かかおさん','2020.03.16'),(92,'砂糖不使用のCACAO70％のチョコレートは 高カカオで栄養価もあり、体に優しくとても素晴らしい商品です。 大変気に入っております。 あったら良いなと思っていた理想的なチョコレートです。',5,12,'2020-10-07 05:29:17','2020-10-07 05:29:17','Hana❀さん','2019.07.17'),(93,'甘すぎなくていい！砂糖ゼロで余分なものがあまり入っていないので嬉しい！',5,12,'2020-10-07 05:29:17','2020-10-07 05:29:17','ゆかさん','2019.05.11'),(94,'最近このチョコレート無いんですよねー 三件まわりました。 復帰お願いしますーーーーーーーーーー',5,12,'2020-10-07 05:29:17','2020-10-07 05:29:17','おじさんさん','2019.05.06'),(95,'これ好きです！',5,12,'2020-10-07 05:29:17','2020-10-07 05:29:17','いちごトマトさん','2019.04.16'),(96,'持ち運びにべんりです。いつもバックに入れて、 小腹がすいたら、たべています。 甘すぎないので、食べやすいです。',5,12,'2020-10-07 05:29:17','2020-10-07 05:29:17','ひよこさん','2019.04.11'),(97,'チョコのコクがあってあっさりしています。',5,12,'2020-10-07 05:29:17','2020-10-07 05:29:17','ｐｏｏｈさん','2019.03.14'),(98,'このビターチョコは、自分の中ではどのチョコよりも一番おいしいと思ってます。口どけも、甘さも、後味も、丁度いいです。それで、このお値段。とっても気に入っています。',5,13,'2020-10-07 05:29:17','2020-10-07 05:29:17','豆インコさん','2020.07.15'),(99,'苦すぎず甘すぎず ちょうどいい味で 安いので大好きです',5,13,'2020-10-07 05:29:17','2020-10-07 05:29:17','ヤッポーさん','2020.06.26'),(100,'この価格で甘すぎずおいしい。 コーヒーのおともにリピ買いしてます。',4,13,'2020-10-07 05:29:17','2020-10-07 05:29:17','pigさん','2020.06.13'),(101,'甘すぎなくて、美味しい！',4,13,'2020-10-07 05:29:17','2020-10-07 05:29:17','みきさん','2020.06.12'),(102,'チョコレートケーキを作るときに使っています。 安価なので安心してたくさん使えるので助かります。 味も満足しています。',4,13,'2020-10-07 05:29:17','2020-10-07 05:29:17','4iさん','2020.06.08'),(103,'ブラックなのに甘すぎず、苦すぎず美味しい！！ ちょっとずつ割れ目で割りつつ食べています。',4,13,'2020-10-07 05:29:17','2020-10-07 05:29:17','ゆうさん','2020.06.02'),(104,'食べやすい甘さで気に入りました。',5,13,'2020-10-07 05:29:17','2020-10-07 05:29:17','Maaさん','2020.05.24'),(105,'３月末に食べた赤い袋のチョコレートも美味かったが、もっと美味いのがこのブラックチョコレート。カカオのしっかりとした風味と程良い甘みが私の心をウキウキさせてくれた。食感も良い。しかも値段も安く、手軽に手に入れられる。こちらもすごく気に入った。',5,13,'2020-10-07 05:29:17','2020-10-07 05:29:17','車バイク好きケン君さん','2020.04.09'),(106,'ちょうど良い甘さです。 甘すぎないです！',5,13,'2020-10-07 05:29:17','2020-10-07 05:29:17','まるさん','2020.02.24'),(107,'このお値段で、このお味はすごいと思いました。 甘すぎず、とても美味しかったです。',4,13,'2020-10-07 05:29:17','2020-10-07 05:29:17','ちくままさん','2020.02.18'),(108,'ビターな味わいがとても美味しいです。 価格も手頃で、リピート購入しています。',5,13,'2020-10-07 05:29:17','2020-10-07 05:29:17','usamaruさん','2020.02.17'),(109,'チョコが大好き。リーズナブルでおいしく、そのまま食べても、お菓子作りにも良いです。',5,13,'2020-10-07 05:29:17','2020-10-07 05:29:17','猫のくぅさん','2020.01.25'),(110,'他メーカーのものより甘さが控えめで食べやすいです。',4,13,'2020-10-07 05:29:17','2020-10-07 05:29:17','アルチャンさん','2020.01.19'),(111,'この価格での提供は凄い❗',5,13,'2020-10-07 05:29:17','2020-10-07 05:29:17','mさん','2020.01.13'),(112,'苦すぎず甘さ控えめでちょうど良いです。値段もgood。',5,13,'2020-10-07 05:29:17','2020-10-07 05:29:17','だるまさんさん','2019.09.28'),(113,'美味しいです。コスパもよく、チョコ食べたい時はいつも買います。',4,13,'2020-10-07 05:29:17','2020-10-07 05:29:17','りりさん','2019.08.07'),(114,'私は甘党なので いつもは、赤いパッケージのミルクチョコレート派なのですが ちょっとカカオ感を味わいたい時もあり ブラックの方も時々お世話になっています。 甘党の私には 十分な苦さのチョコレートです。 私はTopvaluのミルクもブラックも、 味や価格のみならず チョコレートの厚みや、ブロックの大きさまでもが全て好きです。',5,13,'2020-10-07 05:29:17','2020-10-07 05:29:17','メルティーさん','2019.04.29'),(115,'ブラックチョコなので、甘さ控えめかと思いきや、めっちゃ甘いです。',4,13,'2020-10-07 05:29:17','2020-10-07 05:29:17','マッチ棒さん','2018.11.11'),(116,'値段のわりにブラックが効いててとにかく コスパが良い❗ 自宅用で 大量に買い置きです カレーを炊く時にも コーヒーにも入れて使っています。',4,13,'2020-10-07 05:29:17','2020-10-07 05:29:17','ママさんさん','2018.11.08'),(117,'甘くて美味しくて安いので いつも買ってます',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','ヤッポーさん','2020.07.27'),(118,'頻繁に購入しているぐらい好きです。 量も多いし、とにかく値段が安い！ そして、味が美味しいです。 味わいも口溶けもまろやかで、カカオの風味もしっかり。 かなりコスパが良いと思います。',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','いっこさん','2020.07.09'),(119,'いつも購入しています。 そのまま食べても甘くて美味しいです。 パイシートに包んでチョコパイを作ったりしています。',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','satopoohさん','2020.06.12'),(120,'何度も購入し続けています。他のメーカーのミルクチョコレートは私には甘すぎるのですが、こちらは口どけも良く甘すぎないところがとても気に入っています。 そしてなんといってもこのおいしさでこのお値段には驚きです！ ずっと作っていただきたい大好きな商品です。',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','おだまきさん','2020.05.28'),(121,'安いっと思って買って食べました チョコ好きの私にとっては そのまま食べると 味に物足りなさを感じました が 食パンと一緒にトーストすると 凄く美味しくなりました 今や 私のお昼ご飯ナンバーワンです',4,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','えだまめさん','2020.05.19'),(122,'このＴＶＢＰチョコレート　しっとりとした甘さとなめらかな口どけ、食べたの本日で２回目。本当に甘さもしっとりとしてて、口どけもなめらかだね。全然飽きが来ないね。しかも６８円と言う安さ。パッケージのデザインの素晴らしさ。それが私達を喜ばせてくれている。合格だ。（微笑み）',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','車バイク好きケン君さん','2020.05.13'),(123,'必ず家にストックしてあるチョコレートです。 安いのに美味しさは他のメーカーに負けず劣らず最高です。 機会あれば友達にも勧めています。 ・・・困ったことに、安いと思うとつい我慢もせずに１枚ペロリと食べてしまうことです。',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','きゃさりんさん','2020.05.07'),(124,'他社チョコレートは食べた事あるが、ＴＶＢＰチョコレート　しっとりとした甘さとなめらかな口どけはまだ食べた事とか無く、初めて買って食べた時の口どけ感や味は気持ち良い。こちらも笑顔でしっかりと拍手したくなる食べ物だ。',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','車バイク好きケン君さん','2020.03.26'),(125,'安いのに美味しい！ブラックチョコレートも苦すぎなくて好きです。 ずっと定番商品として置いてほしいです。 パッケージがいつのまにか変わってましたが、前の方がかわいかったな。',4,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','まこさん','2020.02.03'),(126,'値段に対して、味も良く量もよくお得な気持ちになります。',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','いちごさん','2020.02.01'),(127,'初めて食べたらあまりにも美味しくてビックリ‼︎なぜ今まで食べなかったのかしら？あと味もさっぱりで1枚ペロリで足りないくらいです。',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','レモングラスさん','2020.01.03'),(128,'買い物の度に定番で買ってます。買わなきゃ損ですって感じ。スイーツ作りに使ったり、そのまま食べたり美味しいです。ありがとう',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','りんさん','2019.12.26'),(129,'家族がいつもぺろっと1枚食べてしまうので、この価格が助かります。 チョコレートとしては、もう少し風味があったらいいなと思います。',4,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','タミ子さん','2019.12.16'),(130,'某有名な板チョコたちより美味しいと感じてしまった。ミルク感が強くて風味がいい！大好き。',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','てらまさん','2019.11.15'),(131,'とにかく安い。それでいておいしい！非のうちどころがないでしょう。お菓子作りに使っても、そのまま食べてもOK。',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','だるまさんさん','2019.09.28'),(132,'はじめて買った時は美味しいかな？と思いながらポチリました。 それが正解。 美味しいかった、口どけも良くてリピしました。 ひとかけらずつにして保存容器に入れています',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','でこさん','2019.07.23'),(133,'チョコレートが食べたくて、 板チョコのコーナーを見ていたら、イオンブランドチョコを見つけ値段の安さに惹かれたものの、半信半疑で一口。口の中一杯にチョコの香りとカカオの風味が広がり、なめらかにとろけていく感覚に手を止めることを忘れ、幸せな時間が過ぎて行きました。 とても美味しかったです。 また、買いたいです。',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','まーさん','2019.07.13'),(134,'エネルギー補給用に買って、小さいジップロックコンテナに割って入れて家事の合間にひとかけづつ食べてます、家庭内消費ならこれで充分、味とボリュームで決定版です',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','kurumiさん','2019.07.01'),(135,'お菓子作りのために買いましたが、子供が何かおやつない？待てない～と言ったので、食べさせました。私もひとかけら食べたら、口どけがよく、美味しくてびっくりしました。また購入したいです。',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','ゆっき～さん','2019.05.03'),(136,'めちゃくちゃ美味しくて、その上安くて、本気でオススメの商品です！もう何枚食べたか分かりません。このコスパでこの味を知ると他の物は高く感じて買えなくなりました！',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','RIOさん','2019.05.01'),(137,'とても安いのに、有名な銘柄のチョコレートに劣らない、むしろ美味しくて感動しました。もう何回もリピート購入しています。',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','ナオブラさん','2019.04.01'),(138,'初めて、近くのトップバリュでチョコレートを購入しました。 オランジェットを作るため板チョコを探していたところ、トップバリュのチョコレートに出合いました。値段もお手頃だったので12コ入りの箱買いしました。 他の板チョコより安かったので、味はどうかなと思っていたのですが、なめらかでとても美味しかったです。お陰さまで、美味しい手作りオランジェットができました。',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','ふーみんさん','2019.03.28'),(139,'このチョコ分厚くて本当に美味しい！！！！！ホワイトチョコバージョンも出してください！！！お願いします！！！！！',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','らぶりさん','2019.03.25'),(140,'甘党なもので 板チョコはヨーロッパ産の物が最高と思っていたのですが こちらの板チョコに出逢って、これからはこれがイイと思いました。 これからも買い続けたいので、生産の継続を宜しくお願いします(*^-^*)。',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','みるみるさん','2019.03.22'),(141,'思っていた以上に美味しかったので、よく買って食べています。オススメです。',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','kumiさん','2019.03.19'),(142,'シンプルな味わいで安心できる味。 価格も安くて文句なし。',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','するめさん','2019.02.28'),(143,'「美味しい板チョコが食べたい！」なと言う時にお薦めです(^-^)/濃厚な中にミルク感たっぷりで、ペロリと食べてしまいます。',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','アリエルさん','2019.02.25'),(144,'他の板チョコより安くて量も多いので購入したものの、味がとっても美味しかった！！！めっちゃリピしてます♡',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','ゆんさん','2019.02.21'),(145,'ミルクチョコレートの味わいが堪能でき、価格もリーズナブルで買い求めやすい一品です。',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','ロマンチストさん','2019.02.11'),(146,'美味しい、しかも、安い。年末に10枚買って、なくなったので、今日2/10に買いに行ったら、、、、売ってなかった。どうしたんだろう。',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','黒部太陽さん','2019.02.10'),(147,'気づいたら買い物かごへ入れちゃってます。 単純に味が好みです。お値段は安いのに美味しいです。',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','こここちさん','2019.01.29'),(148,'初めて買って 数日後すぐにもう一枚買いに走りました。 お得だからではなく 単純に美味しいからです。 甘くて冬場でも口どけも良くて 厚みもあるから食べごたえがあり 国産の板チョコはこれがイイです、私は！！',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','メルティーさん','2019.01.17'),(149,'大きめの板チョコレートを一枚 ”しっかりと”食べたいときにイイですね。 満足感あって好きです。',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','ボードさん','2019.01.13'),(150,'安くて美味しい‼️お菓子作りにも重宝します。はまってしまい 毎日食べてしまいます',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','milkさん','2018.12.26'),(151,'他社製品と比較しても安いし 安いのに1番美味しい 好みです',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','にゃーさん','2018.12.21'),(152,'ミルク味の中にもビター感があり、美味しいです。 チョコケーキ作りにも使いましたが、溶けも良く気に入りました。',5,14,'2020-10-07 05:29:17','2020-10-07 05:29:17','やこさん','2018.11.04'),(153,'甘さひかえめで、後味が良く、苦味もないので、マイルドでとても食べやすいです。',4,16,'2020-10-07 05:29:17','2020-10-07 05:29:17','まりんさん','2018.11.27'),(154,'他のチョコレートよりも原材料が安心出来るものなのと、何より美味しいので毎日食べていました。が、最近添加物の乳化剤の内容が変更になったようで、味とくちどけが変わってしまいあまり好みではなくなってしまいとても残念です。 価格が上がっても良いので乳化剤なしのチョコレートが販売されるととても嬉しいです！',3,17,'2020-10-07 05:29:17','2020-10-07 05:29:17','松本商店さん','2020.05.14'),(155,'市販のお菓子やチョコレートは添加物がたくさん入っているので、せっかくカカオが体に良いといっても、添加物や農薬だらけじゃ意味がないなと思い、現在も買えるものを色々探しながら街を歩いています(笑)。この商品は、オーガニックということでたまに買っていますが、乳化剤（大豆由来）←たぶんレシチン？これが気になるところです。だって、遺伝子組み換えの可能性が高いので。もし違うのでしたら、ちゃんと表記していただきたいです。',4,17,'2020-10-07 05:29:17','2020-10-07 05:29:17','サニー前田さん','2019.12.15'),(156,'香料が入っていないので、カカオの自然な味が味わえる。他社の香料入りのものは香りが強すぎて不自然に感じる。 高カカオだが食べやすくおいしい。',4,17,'2020-10-07 05:29:17','2020-10-07 05:29:17','のぶこさん','2019.11.14'),(157,'近くのまいばすけっとが改装したら置かれるようになって初めてフェアトレード商品を出していた事を知りました。 普段カカオ70%くらいのものを好んで食べていましたが、こちらの商品は80%でもそうと感じさせないなめらかさと甘みがあり、この品質でこの価格で更にフェアトレード、向かいにある輸入高級スーパーで買うより満足感がある！と嬉しくなりました。',5,17,'2020-10-07 05:29:17','2020-10-07 05:29:17','さとさとさん','2019.04.11'),(158,'これまで食べたハイカカオチョコレートの中で一番食べやすく、美味しく、安い。 材料にこだわって、この価格。 多少乳化剤入ってても全然きにならないですねー。',5,17,'2020-10-07 05:29:17','2020-10-07 05:29:17','メグッペさん','2019.03.11'),(159,'80%の割りに非常に食べやすくて美味しいです。 オーガニックで体にも安心です。 他メーカーの70%台のものをよく食べていましたが、カカオ率がこちらの方が高く、試しに買って食べてみたら70%台のものと変わらない食べやすさだったのでこれからはこちらを食べたいと思います。',5,17,'2020-10-07 05:29:17','2020-10-07 05:29:17','ちゃっぴーさん','2019.02.22'),(160,'国産の有名メーカーと比較してもすっきりとした後味が際立ちます。トップバリュのチョコレートは初めて買ってみましたが他の商品も試してみたいと思いました。',5,17,'2020-10-07 05:29:17','2020-10-07 05:29:17','スプーンおばさんさん','2019.02.16'),(161,'口の中に入れておいても溶けない。噛むとボソボソして、チョコレートの舌触りとは思えない。まるでオカラか何かのようだ。こんなチョコレートは初めて食べた。',2,17,'2020-10-07 05:29:17','2020-10-07 05:29:17','Yaskoさん','2019.01.06'),(162,'日本のなめらか～なチョコレートに慣れていたので、こちらは海外のチョコレートっぽいザラつきを感じます。',4,17,'2020-10-07 05:29:17','2020-10-07 05:29:17','チョコラさん','2018.11.16'),(163,'せっかくのオーガニックチョコなのに乳化剤（大豆由来）が使われるのが気になります。 大豆由来ということは大豆レシチンですよね？ この価格に提供しているということは大豆レシチンは遺伝子組み換え大豆を使用しているのではないですか？',2,17,'2020-10-07 05:29:17','2020-10-07 05:29:17','添加物。。。さん','2018.11.06'),(164,'せっかくのオーガニックなのになぜ乳化剤が入ってるんでしょう…',2,17,'2020-10-07 05:29:17','2020-10-07 05:29:17','添加物嫌いさん','2018.11.04'),(165,'オーガニックでフェアトレードでこの価格とは正直驚きです。肝心の中身は厚みもありしっかりしており、美味しい高カカオチョコレートでした！',5,17,'2020-10-07 05:29:17','2020-10-07 05:29:17','しょこらさん','2018.06.29'),(166,'おいしいです♪',5,17,'2020-10-07 05:29:17','2020-10-07 05:29:17','キミミさん','2018.05.16'),(167,'80％なのにすごく食べやすいです。 他のハイカカオチョコレートよりずっと美味しい！ 甘いチョコレートは苦手なので買うならコレと思ったのに〜 品切れで、お店の人に聞いてもなかなか入ってこないそうです。 隣に30％のチョコもあるんですが、やはりこっち。 品切れになったということは、私の他にもコレを見つけちゃった人がいるんだと思います＾＾安定供給して欲しいです。 これからも体に安全でおいしい商品をお願いします。 添加物だらけの安物はもういいです。 大手がこういう商品をもっと提供・開発してくれたら、 世の中変わっていくんじゃないかなー。 今後の期待を込めて星５つ。',5,17,'2020-10-07 05:29:17','2020-10-07 05:29:17','エンジェルさん','2018.04.07'),(168,'おいしい。ダークチョコをいろいろ食べてるんですが少し甘みを感じます。(ほんとは甘いチョコ食べたいんですけど我慢してるので)お家の近くのイオングループのスーパーで見かけないのでたまに買います。',5,17,'2020-10-07 05:29:17','2020-10-07 05:29:17','おいしいさん','2018.04.07'),(169,'深くてなめらかです、原料的にみるとコスパいいのでは ないでしょうか。定期的に買わせていただきます。',4,17,'2020-10-07 05:29:17','2020-10-07 05:29:17','セイセイさん','2018.03.02'),(170,'カカオ70%の苦味がちょうど良いし、甘いものを食べる罪悪感も少なくてすみます。買い置きしてちょこっとづつ食べてます。',5,18,'2020-10-07 05:29:17','2020-10-07 05:29:17','ともさん','2020.06.10'),(171,'甘すぎずパクパクいけました おいしいです',4,18,'2020-10-07 05:29:17','2020-10-07 05:29:17','たなさん','2020.06.08'),(172,'甘さ控えめで、美味しいです。 価格も他のお菓子メーカーよりお手頃なので、つい手が伸びます。',4,18,'2020-10-07 05:29:17','2020-10-07 05:29:17','あぽんさん','2019.09.04'),(173,'便秘予防によいアーモンドと カカオポリフェノールが一緒に摂取できるので アーモンドチョコは一石二鳥の商品。 お気に入りで、 何度もリピートしています。 カカオ７２％のアーモンドチョコの商品の中では 値段がリーズナブルですね。 要望としては、個包装にして、大袋入りが欲しいです。',5,18,'2020-10-07 05:29:17','2020-10-07 05:29:17','ひよこさん','2019.03.27'),(174,'カカオの美味しさが感じられず、私の口には合いませんでした。',1,18,'2020-10-07 05:29:17','2020-10-07 05:29:17','かぷっちょさん','2019.03.21'),(175,'ビターのアーモンドチョコは珍しい。甘ったるくなくおいしいです。',5,18,'2020-10-07 05:29:17','2020-10-07 05:29:17','たかさんさん','2018.07.10'),(176,'カカオ70%ということもあって甘すぎず、アーモンドと相性抜群です！',5,18,'2020-10-07 05:29:17','2020-10-07 05:29:17','Marie.tさん','2018.05.31'),(177,'カカオ70%商品が自分にはちょうど良く、こちらの商品もカカオ70%でしたので購入しました。 期待よりはるかに美味しく、よくあるアーモンドチョコより美味しかったです。 個包装だと自分のペースで少しずつ食べられるし、分けあっても食べられるので、袋入りも良いかなぁと思います。',5,18,'2020-10-07 05:29:17','2020-10-07 05:29:17','はるさん','2018.05.05'),(178,'ほろ苦くて美味しいが、200円はちょっと高いかな。',3,18,'2020-10-07 05:29:17','2020-10-07 05:29:17','キャンディさん','2018.04.09'),(179,'アーモンドチョコレートはもともと好きでよく食べていましたが、ここまでのビタータイプのものは初めて。ビターといっても苦すぎず、カカオの風味たっぷりで、とても美味しいです。当分はまりそうです。',5,18,'2020-10-07 05:29:17','2020-10-07 05:29:17','junko1224さん','2018.02.23'),(180,'チョコレートはすごく美味しい。なのに、中のアーモンドがおいしくないからもったいない。アーモンドの渋皮？が分厚くて硬くアーモンドの香りも薄い。アーモンドが若いみたいな…。残念…。',2,18,'2020-10-07 05:29:17','2020-10-07 05:29:17','にこさん','2018.02.18'),(181,'父が高血圧で高血圧にポリフェノールがいいと聞き購入しました。すごく苦いかな？と思いましたが全然食べれる苦さで父も食べやすいと言ってました。',4,18,'2020-10-07 05:29:17','2020-10-07 05:29:17','minionさん','2018.02.17'),(182,'高カカオのチョコレートなのでほどよい苦みがあっておいしいです。',5,18,'2020-10-07 05:29:17','2020-10-07 05:29:17','chocolaさん','2018.02.09'),(183,'こんなにおいしいチョコがあったんですね！ 夕食のあとのゆったりとした時間に大切に味わいたい大人のチョコです。 苦味もちょうど良く　ほのかな甘みとのバランスもとてもわたし好みです。 お値段を考えても　惜しみなく味わえます、豊かな心持ちになれます。 楽しみがひとつ増えました。ありがとうございます。',5,19,'2020-10-07 05:29:17','2020-10-07 05:29:17','りんごさん','2020.06.18'),(184,'この世にこれ以上美味しいチョコレートはないと思う！70%なのにこの甘み。風味。なによりパリパリとした、口に入れたときの食感が凄く良い！飴をすぐ噛んでしまうタイプの人にオススメしたい。製氷器のようにへこんだ形をしていて真ん中が薄い形状にスライスされており、噛んだときにパリンとなる。以前、箱に入っていたとき、その文房具みたいなパッケージからは想像できない、そとパリパリ、中ふんわりの二重構造のダークチョコがあまりに美味しくておどろき、大騒ぎした。が、廃盤になってしまい残念と思っていた。袋のパッケージになってチョコが薄くなり、二重構造ではないけど、味は変わらずおいしい！もっと表参道あたりで話題になっていいチョコだと思う！わたしはショーケースに入った一粒600円くらいするチョコも食べてきたけれど、本当においしいと思うチョコはこれだったりする。当たり前に売っているのが衝撃的。',5,19,'2020-10-07 05:29:17','2020-10-07 05:29:17','ワーミーさん','2020.01.29'),(185,'原材料表示を見ると、植物油脂も人工甘味料も使用されていなくて、砂糖よりカカオマスが先に書いてあり、その上お味も良くて、大変気に入っています。',5,19,'2020-10-07 05:29:17','2020-10-07 05:29:17','ひろさんさん','2019.04.29'),(186,'この商品は、70%の袋入りがない時に必ず購入します。甘過ぎず とても美味しいので、すぐ食べ切ってしまいます。安価なのも良いですね。',5,19,'2020-10-07 05:29:17','2020-10-07 05:29:17','みーささん','2019.03.03'),(187,'計算された厚みだと思います。70パーセントカカオなのに甘さとくちどけの良さを感じます',5,19,'2020-10-07 05:29:17','2020-10-07 05:29:17','SNOWMAN40さん','2019.02.24'),(188,'なんとなく、商品を買ってみたのですが、思っていたよりも、味や香りが良くてびっくりしました。厚みも薄くて食べやすいと思います。 またぜひ、購入したいと思います。',5,19,'2020-10-07 05:29:17','2020-10-07 05:29:17','よんこさん','2019.01.31'),(189,'ハイカカオのチョコは割高なのに、安い上に味も良いです お得なので何度も買っています',5,19,'2020-10-07 05:29:17','2020-10-07 05:29:17','まゆきさん','2019.01.19'),(190,'カカオ70%でありながら、ほのかな甘味があり、満足感があります。',5,19,'2020-10-07 05:29:17','2020-10-07 05:29:17','ガズーさん','2018.12.02'),(191,'板タイプで美味しかったのでお徳用袋タイプをリピートしています、コク、甘さ、口どけ…価格、大ファンでコーヒータイムに常備しています。',5,19,'2020-10-07 05:29:17','2020-10-07 05:29:17','ひらはらりさん','2018.05.22'),(192,'凄く美味しいのに安いです。 もう何度も買っているので、今では多めに買ってストックしています。 切らしたことありません。 ただ甘さ控えめで食べやすいので、気付くと1枚食べきってしまう事多々アリです！ 75％もあったらいいなあと思います。',5,19,'2020-10-07 05:29:17','2020-10-07 05:29:17','さくらさん','2018.05.20'),(193,'70%でこの価格が嬉しい！しかも美味しいです。会社に常に置いてます。',4,19,'2020-10-07 05:29:17','2020-10-07 05:29:17','もんちゃさん','2018.05.12'),(194,'安いので味に期待していなかったけど、香り・味が良く美味しかったです。一気に食べました。',5,19,'2020-10-07 05:29:17','2020-10-07 05:29:17','まーさん','2018.05.10'),(195,'カカオ70％なのに、苦くないんです。 甘過ぎもしないし、美味しいのでお気に入りです。 高カカオチョコレートは体にいいけど、苦いから苦手だと思っている人に食べて欲しい。',5,19,'2020-10-07 05:29:17','2020-10-07 05:29:17','流華さん','2018.05.10'),(196,'チョコレートが体に良いと聞いて買ってみました。 苦いのかなと思っていましたが、ブラックチョコレートのような感じで美味しいのでついつい食べ過ぎてしまいます。 イオングループのお店どこでもあるわけではないみたいで、あっても少ないので、見つけたらまとめ買いです。',4,19,'2020-10-07 05:29:17','2020-10-07 05:29:17','コロンさん','2018.04.27'),(197,'高カカオのチョコレートが手軽に買えて嬉しいです。',4,19,'2020-10-07 05:29:17','2020-10-07 05:29:17','モメラスさん','2018.02.28'),(198,'カカオの香りがしっかりと、ほろ苦いチョコレートでとてもおいしいです。このクオリティーでこのお値段は、とってもありがたい。そのまま食べても美味しいし、お菓子作りや、トーストにもおすすめです！',5,19,'2020-10-07 05:29:17','2020-10-07 05:29:17','しーぺーさん','2018.02.27'),(199,'この頃流行りの、効カカオ チョコレート。70％で、コノ値段。 実に嬉しい限りです。 リピート リピート！',3,19,'2020-10-07 05:29:17','2020-10-07 05:29:17','イオンさん','2018.02.26'),(200,'トップバリュから待望の高カカオチョコが発売されましたね。 原材料名のトップがカカオマスなのが、他のリーズナブルなチョコ菓子と違う信頼の証です。 70％なのでほろ苦さがほどよく、高カカオチョコ入門編としてもお勧め。 少量タイプのこちらを買って好みに合えば、135g入りのキューブタイプに移行するとグラム単価が安くなってお買い得になります。',4,19,'2020-10-07 05:29:17','2020-10-07 05:29:17','YUKIさん','2018.02.22'),(201,'70%カカオが入っている板チョコなのに105円で買えるのは凄く嬉しい',5,19,'2020-10-07 05:29:17','2020-10-07 05:29:17','えりちゃんさん','2018.02.20'),(202,'今注目されている高カカオチョコレートが、この価格は驚きです！ 味・香りもよく、お菓子作りにもたっぷり使えて嬉しいです。',4,19,'2020-10-07 05:29:17','2020-10-07 05:29:17','こぐまさん','2018.02.16'),(203,'ちょっとクオリティーの高さに驚きました。お値段からは想像を超えるお味と品質。このお得感ははまります。しかも食べ過ぎない板チョコ!わたしにはピッタリです。',5,19,'2020-10-07 05:29:17','2020-10-07 05:29:17','うどんこさん','2017.11.23'),(204,'ハイカカオのチョコレートにハマっているので店頭で目に留まり買ってみました。 しっかり濃いカカオの味が楽しめますね。 値段も手ごろ。 また買います。',4,19,'2020-10-07 05:29:17','2020-10-07 05:29:17','kokoneさん','2017.10.31'),(205,'カカオ70パーのチョコレートって、他ブランドだと少々お高いですが、これはコスパ良くてちょうど良いビター感で美味しいです。ビターチョコが好きでこれをよく食べます。',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','さやさん','2020.06.26'),(206,'苦すぎず、カカオの香りもよく、おすすめです！そして、カカオ70%だとお高いチョコレートが多い中、コストパフォーマンスも良いと思います！',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','チョコ大好きさん','2020.06.10'),(207,'糖質制限中なのですが、どうしても甘いものが食べたくなった時用にカカオ70のチョコレートを食べてます。高カカオの商品は結構値段が高いので大容量でこの値段はとてもお得だと思います。またリピートしようと思います。',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','あみさん','2020.06.03'),(208,'他社より値段が安く、味もよかったです！カカオ70%でこの価格はとても嬉しいです。',4,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','さとーさん','2020.05.21'),(209,'20円引きのクーポンを見つけたのを機に買いました。チョコ好きにはたまらなく美味しいです。袋を開けた時のいい香りに最初はびっくりしました。以来ストックしています。',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','みつこさん','2020.04.29'),(210,'チョコレート大好き。70％ぐらいが適当にうま味と甘みがあって、好んで買っています。最近トップバリューでみつけて、すっかりはまっています。コストパフォーマンスは優等生！',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','はっちゃんさん','2019.11.15'),(211,'高カカオ含有量のチョコレート商品としては、とてもコスパがいいと思います。',4,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','ぱんこさん','2019.08.30'),(212,'苦すぎず、カカオの風味がよく、程よい甘さがあってとても食べやすいです。',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','家猫屋さん','2019.08.10'),(213,'これは、おいしいです。チョコレートは好きだけど、一般的なチョコだと甘すぎる方には、いいです。カカオ７０％なので、健康にもよさそうですね。さらにこのお値段なのでとてもお得です。',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','ねこさん','2019.07.22'),(214,'カカオ含有量が多目のチョコは甘さがほとんど感じないものが多いけれどこのチョコレートは少し甘さが感じられて食べやすくて美味しいです。コーヒーと一緒に楽しむのが私の日課になっています。もっも量が多かったら嬉しいです。',4,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','ブルーの海さん','2019.07.03'),(215,'ハイカカオチョコにハマっているので色々食べましたが、これはコスパが良い！美味しい！',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','tommyさん','2019.07.02'),(216,'このチョコ、はじめ板チョコで出会いすぐ気に入りました。その後に一口サイズの袋入りがあると知って、今は必ず買い置きするようになりました。お茶のお供や食後に必ず口にして楽しんでいます。',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','三色すみれさん','2019.06.30'),(217,'このチョコを口に含みながらブラックコーヒーを飲む。 ほのかに甘いお願いします。大人コーヒーの味わい方だと自分だけで、 満足している。 このチョコ以外のミルクチョコで同じようにやってみたら、 このチョコでないとほんのりほんのり甘い大人コーヒーは味わえない。',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','微微甘☆大人コーヒーさん','2019.06.01'),(218,'カカオ70%なのに、かなり甘くてビックリする。 そこが罪悪感を感じなくさせてくれてるので、パクパク食べてしまう。',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','葉菜子さん','2019.05.26'),(219,'甘すぎず、苦すぎず、ちょうどいい味わいで気に入っています。コストパフォーマンスがいいのも有り難いですね。難を言えば、まいばすけっとで見かけないことぐらいでしょうか。',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','the rascalさん','2019.05.20'),(220,'味も良くリピートしています。 カカオ９０％とか、容量を増やしてよりお買い得な価格設定の商品バリエーションの展開を要望します。 売れると思います。（私なら必ず買います） よろしくお願いします。',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','すけぽちさん','2019.05.01'),(221,'他者の商品でカカオの含有率がもう少しだけ多いのがあります。 それだと、甘みがあまり楽しめません。 しかし、この70％商品はビター好きであり、甘みも楽しみたい人にとってぴったりです。 トップバリュ様の企画開発力に礼。',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','元気をくれるおいしささん','2019.04.11'),(222,'カカオ70％程度のチョコをいろいろ試しています。一粒の大きさもちょうど良く、まろやかで美味しいです。 値段も手頃なのが嬉しい。',4,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','ちぇろママさん','2019.04.10'),(223,'家族全員、健康のために毎日食べています。他の方のご意見にもあったように、80％や85％のひと口チョコもぜひ商品化してください！！ 絶対に売れると思いますし、みんなが健康になります！ 宜しくお願いします！',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','ちゃんゆのさん','2019.03.29'),(224,'甘い味も好きですが、甘さが口に残るのが嫌な時があります。甘さを取る為、いつも飲み物を摂取しますが、これなら、飲み物の無い、外出時でも持って行けます。 70％の味、気に入りました。',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','七つ星さん','2019.03.20'),(225,'ダイエット中です。健康の為に1日3〜5個食べています。甘過ぎず硬めなので、食べごたえもあり とても美味しいです。',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','みーさんさん','2019.03.03'),(226,'チョコレート中毒の私はミルクチョコレートは足らなくてカカオ含量が多くないと美味しく感じなくなっています。カカオ含量が多いチョコレートはそれなのに値段が高いのでトップバリュにあって良かったです。できれば８０%や９０%も出してほしいです。',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','みつこさん','2019.02.23'),(227,'美味しくてお買い得です。80％や90％の商品もあれば買います。 ぜひ作ってください。',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','meroさん','2019.02.19'),(228,'味もコスパも良い、欲を言えばカカオ８0%やカカオ９0%の商品も欲しいです。',4,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','ななしさん','2019.02.08'),(229,'ポリフェノールを摂取できるカカオ含有率の高いチョコは注目度が高く、当品はコスパが良いと思いました。他社製品と比較する時にポリフェノールの成分表示が無かったのがもったいないと思いました。サービス係で135g(一袋約27粒分)中に2.4165gと聞きました。1粒(約５g)中に約89.5mgの計算になると思います。ぜひパッケージに表示してほしいです。表示があると他社製品と比較してコスパがよく「買い」の商品だとわかりますが、表示が無いと表示するほどの含有量はないのかと思い、コスパ評価もできかね、買いの選択肢から外そうかと思ってしまいました。',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','つばささん','2019.02.02'),(230,'カカオポリフェノールの美肌効果を期待して、毎日5個食べています。 価格が他のブランドより安いので助かります。',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','あっこちゃんさん','2018.06.18'),(231,'高カカオは体に良さそうで他ブランドで買ってましたが、 これを見つけてリピ買いしてます お手頃価格でほのかに甘さのある苦みでちょうど良いです',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','みゆさんさん','2018.05.27'),(232,'カカオ70%以上１日に25g食べると良いと聞いて、毎日家族で5粒ずつ食べています。甘いチョコや苦いチョコが苦手な方はぜひ試してほしいです。我が家は2～3袋を常備しています。',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','ペンケースさん','2018.05.21'),(233,'この板チョコバージョン買ってましたがこちらを発見し、こちらにチェンジ！個包装で食べ過ぎ防止もでき、味も程よく甘みと苦味のバランスも好きな感じです。',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','もんちゃさん','2018.05.12'),(234,'この価格なのに本当に美味しいです。リピしてます。 甘さ控え目です。',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','はなうさぎさん','2018.05.11'),(235,'ハイカカオのチョコレートが大好きで毎日食べてるのですが少々お高い(＞＜) そんな時に見つけたのがトップバリューのこのチョコレート',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','マルさん','2018.05.08'),(236,'高カカオ商品はいまどこのメーカーも力を入れていますが、チョコレートは高い！カカオポリフェノールを摂りましょう、と巷で宣伝をしているので高齢者の方も購入しています。AEONでこちらのチョコを見つけ手頃なお値段と内容量に大満足です。70%以上だと『土』の様であまり美味しくないので、とても気に入っています。',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','はるさん','2018.02.17'),(237,'店頭で見て値段にビックリしました。 中身も27粒入っており、コスパよしです! 食べる前に、匂いを嗅ぎましたが、カカオの香りがちゃんとしますし、 味もほろ苦く、とても食べやすかったです(ノ〃´ω`〃)ノりぴしまーす!!',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','ぽぽろんさん','2017.11.13'),(238,'チョコ好きとしてはチェックして即買いです。70%そしてブラックというビター好きにはたまりません。価格以上の美味しさです。これはおすすめ。濃いめのコーヒーと合わせました。リピします。',5,20,'2020-10-07 05:29:17','2020-10-07 05:29:17','ぽちおさん','2017.10.31'),(239,'キャンディみたいにたくさん入っている大袋のチョコレートにもいろいろありますが、このチョコレートはとってもクリーミーで、かなりおいしいと思います。なのに、お値段はお安いのでコスパがいいですね。ついついもう一つ！と食べ過ぎてしまうので、早く終わってしまうのは困りますが・・・',5,21,'2020-10-07 05:29:17','2020-10-07 05:29:17','MMMさん','2020.06.17'),(240,'私は糖尿です。甘いものが大好きですが、食べ過ぎは駄目ですけれどこのチョコレートは最高に美味しく止めれません。甘すぎず、苦すぎず、なんとも言えない味が大好きです。 高級チョコレートにも絶対に負けない美味しさです。最近入荷がないのは残念です。',5,21,'2020-10-07 05:29:17','2020-10-07 05:29:17','ケンケンさん','2020.04.30'),(241,'思っていた以上に美味しく、必ずバッグに何個か入れています。量もたっぷり入っているので嬉しいです。',5,21,'2020-10-07 05:29:17','2020-10-07 05:29:17','kumiさん','2019.03.07'),(242,'以前にラウンジでいただきましたーその時、主人がとっても気に入って会社の帰宅途中の車中で糖分補給に頂いてます。',5,21,'2020-10-07 05:29:17','2020-10-07 05:29:17','nonanさん','2018.04.28'),(243,'クリーミーでとても美味しいです！トリュフみたい',5,21,'2020-10-07 05:29:17','2020-10-07 05:29:17','どらごんさん','2018.04.05'),(244,'あまり期待せずに買いましたが とても美味しかったです❗ リピートしたいチョコです❗',5,21,'2020-10-07 05:29:17','2020-10-07 05:29:17','のあさん','2017.02.10'),(245,'この商品は大好きであれこれ食してから最後は又このチョコをつまみます',5,21,'2020-10-07 05:29:17','2020-10-07 05:29:17','さん','2017.01.22'),(246,'ナッツとチョコレートが大好きで常備しているツートップが一緒に食べられて最高です。個包装なので食べ過ぎ防止、冷蔵庫保存もしやすくて良いです。フェアートレードなのも買うきっかけになりました。',5,22,'2020-10-07 05:29:17','2020-10-07 05:29:17','a-さん','2020.05.02'),(247,'アーモンドとチョコレートのバランスが絶妙。その上、価格も安く、職場での栄養補給とおやつに常備してます。',5,22,'2020-10-07 05:29:17','2020-10-07 05:29:17','Cの助さん','2018.09.24'),(248,'ほどよい甘さのチョコレートとカリカリアーモンドにハマってます！',5,22,'2020-10-07 05:29:17','2020-10-07 05:29:17','ひろみんさん','2018.08.04'),(249,'アーモンド入りがサクサクでチョコレート甘くて美味しいです。ちょっとしたおやつにいいです。体にもよいので。',5,22,'2020-10-07 05:29:17','2020-10-07 05:29:17','プリカさん','2018.06.25'),(250,'アーモンドは、体にも良いし、小腹が空いときに頂いてます。個包装されてるとこも良いです。',5,22,'2020-10-07 05:29:17','2020-10-07 05:29:17','サミーさん','2018.06.15'),(251,'個包装になっているので、食べ過ぎも防げるし、おやつに少しだけ持っていけるので重宝しています。 価格もお安くて最高です。 美味しいし人気があるのかな？いつも売り切れていることが多いです～',5,22,'2020-10-07 05:29:17','2020-10-07 05:29:17','maaさん','2018.03.16'),(252,'あいかわらずの美味しさです。止められない',5,22,'2020-10-07 05:29:17','2020-10-07 05:29:17','ゆんこさん','2018.02.16'),(253,'アーモンドの香ばしさと甘すぎないチョコレートで、好きな商品です。',5,22,'2020-10-07 05:29:17','2020-10-07 05:29:17','トンとんさん','2017.10.29'),(254,'個包装になっており、カバンにいくつか忍ばせています。 甘すぎず美味しいです!',5,22,'2020-10-07 05:29:17','2020-10-07 05:29:17','あゆいのさん','2017.04.25'),(255,'生産者と、原料・商品を適正な価格で取引し、生産者の経済的・社会的自立と環境保全を応援の商品というのがすばらしいです。 ミルクのようなまろやかな味のチョコとアーモンドの香ばしさがおいしい。',5,22,'2020-10-07 05:29:17','2020-10-07 05:29:17','アースさん','2016.11.16'),(256,'アーモンドが香ばしくて美味しいです!!大好きです♡',5,22,'2020-10-07 05:29:17','2020-10-07 05:29:17','teapotさん','2016.10.19'),(257,'もう少し価格が安いと嬉しいですが、甘いミルクチョコレートで味は美味しかったです。',4,23,'2020-10-07 05:29:17','2020-10-07 05:29:17','satopoohさん','2020.06.12'),(258,'フェアトレード商品に賛同なので、買うことで協力できるところが良い。味は普通だけど、値段は手頃。',4,23,'2020-10-07 05:29:17','2020-10-07 05:29:17','だるまさんさん','2019.09.28'),(259,'とても美味しかったです。私が子ども食べていた、チョコレートラムネに似ていて個人的には好きな味です。カカオの味が、濃すぎない味かげんになっていて、ミルクチョコの味とマッチしていました。　　　　　フェアトレードチョコさいこー',5,23,'2020-10-07 05:29:17','2020-10-07 05:29:17','コハルさん','2019.07.18'),(260,'フェアトレード商品で、生産者の方に少しでも貢献出来るのに加え、味も申し分無しです。ただ甘いチョコレートより少し苦めの方が好きという方は合わないかも。',5,23,'2020-10-07 05:29:17','2020-10-07 05:29:17','菅原さん','2018.12.23'),(261,'一口サイズなので食べ過ぎてしまうことはありません。 フェアトレードで、価格がやや高いのが難点。',4,23,'2020-10-07 05:29:17','2020-10-07 05:29:17','vigaalさん','2017.06.27'),(262,'フェアトレード カカオマスを一部使用。フェアトレード商品の購入により、生産者の生活の向上に貢献ができます。 これがいいですね。 外袋のデザインもポップで好きです。',5,23,'2020-10-07 05:29:17','2020-10-07 05:29:17','ハッピーチョコレートさん','2017.04.18'),(263,'ミルクチョコレートですが、それほど甘くないです。たくさん入っているので、家族で分け合って食べています。',4,23,'2020-10-07 05:29:17','2020-10-07 05:29:17','サナエさん','2017.02.04'),(264,'何故か味噌の風味がする。 美味しくないです。',1,23,'2020-10-07 05:29:17','2020-10-07 05:29:17','さすさん','2016.03.12'),(265,'他のチョコレートより相当安かったので買ってみましたが、甘さと脂っぽさが際立ちカカオの香りがしません。ただ甘いだけの脂をなめている気分です。',1,23,'2020-10-07 05:29:17','2020-10-07 05:29:17','さおりさん','2016.03.07'),(266,'フェアトレード商品ということで購入しました。ほどよい甘さで後味があっさりとしたチョコレートで私好み。また購入します。',5,23,'2020-10-07 05:29:17','2020-10-07 05:29:17','ハルさん','2016.02.14'),(267,'ひとくちチョコを間違えて購入。全く別物。ザラついた舌触りで味もイマイチ。家族に出しても減っていかない。子どもでもわかるようだ。',1,23,'2020-10-07 05:29:17','2020-10-07 05:29:17','あらまさん','2015.10.27'),(268,'喉が痛くなるほど甘く、チョコの味が全然しない。食感はざらざらしてなめらかな口どけとは程遠い。 以前まで『カカオの味わいひとくちチョコレート』が置いてあった棚にあったので、袋が変わっただけかと思って買ったら全くの別物で騙された気分',1,23,'2020-10-07 05:29:17','2020-10-07 05:29:17','甘すぎさん','2015.10.13'),(269,'カカオの味があまりせず、噛んだ時にざらざらとした歯ざわりがありおいしいとは言えない味です。',1,23,'2020-10-07 05:29:17','2020-10-07 05:29:17','山見さん','2015.09.20'),(270,'味は有名菓子メーカー以上の美味しさです。いつも行くイオンにはいつの間にか棚から消えていました。ピーナッツが他のメーカーの類似品より多いように思えます。',5,24,'2020-10-07 05:29:17','2020-10-07 05:29:17','うさぴょ～んＺさん','2020.05.31'),(271,'ピーナッツがたっぷり入っているので、食べごたえがあります。',5,24,'2020-10-07 05:29:17','2020-10-07 05:29:17','マッチ棒さん','2018.11.11'),(272,'味は他の有名メーカーと殆ど変らず美味しいです。何よりもお安くて嬉しいです。',5,24,'2020-10-07 05:29:17','2020-10-07 05:29:17','た～ちゃんさん','2018.05.16'),(273,'ピーナッツの香ばしさとチョコレートの甘さが絶妙なハーモニーを生んでるように思いました',5,24,'2020-10-07 05:29:17','2020-10-07 05:29:17','けーちゃんさん','2018.04.24'),(274,'ナッツチョコレート大好きでいろんなメーカーのを食べ比べてます。 チョコ自体の価格高騰で価格品質共に素晴らしいこちらの商品をいつも購入しています。 国際フェアトレード認証カカオ調達プログラムとの事で尚いいと思います。 在庫薄なのか人気なのか購入できないことがあるので、まとめ買いしたいくらいです。',5,24,'2020-10-07 05:29:17','2020-10-07 05:29:17','るうみんさん','2017.08.01'),(275,'国際フェアトレード認証カカオ調達プログラムというのが、世界の中で役に立つのがいいですね。 ピーナッツと甘いチョコの組み合わせが疲れをいやします。',4,24,'2020-10-07 05:29:17','2020-10-07 05:29:17','役に立つさん','2016.09.30'),(276,'フェアトレードは知っていましたが、食べたのは初めてです。香ばしいローストピーナッツが結構たくさん入っていました。甘さもしっかりあって美味しいです。これまではトップバリュベストセレクトのピーナッツチョコを買い続けていましたが、量が減り、その後??値上げになり、こちらとそれほど変わらない価格になったので、これからはこちらを買おうかなと思います。フェアトレードのものなので。',4,24,'2020-10-07 05:29:17','2020-10-07 05:29:17','ムサシさん','2016.01.31'),(277,'一口サイズでおいしい。お手頃価格で、食べきりやすい。するめよりも、噛みきりやすいので、歯にもはさまりにくくて、気に入ってます。',5,25,'2020-10-07 05:29:17','2020-10-07 05:29:17','むーんさん','2018.11.12'),(278,'噛んだときにスルメの味がします 一口サイズで食べやすく、 普通のスルメよりも噛み切りやすいです お手頃価格なので何パックか 買ってます',5,25,'2020-10-07 05:29:17','2020-10-07 05:29:17','猫助さん','2018.09.15'),(279,'味が美味しくなく 古い油、酸化した臭いがしてたべられませんでした。 今までポテトチップスでまずいのを食べた事ありませんでしたので、書かせていただきました。すみません。',1,26,'2020-10-07 05:29:17','2020-10-07 05:29:17','エミさん','2020.08.02'),(280,'ヘビーローテーションします。数量限定との事ですが、ぜひとも定番にして頂きたい❗️',5,26,'2020-10-07 05:29:17','2020-10-07 05:29:17','ヒロさん','2020.08.01'),(281,'知人に頂きました。 チップス自体は安定の美味しさです。 梅肉のツブツブの付き具合に斑が多く感じます。煎茶と頂くと美味しいです。 以前販売されていたプレーンな梅味が美味しかったな〜',4,26,'2020-10-07 05:29:17','2020-10-07 05:29:17','ちみさん','2020.07.27'),(282,'心地よい辛さがたまりません。とても美味しかったです。また、食べたくなりそうです。',5,27,'2020-10-07 05:29:17','2020-10-07 05:29:17','やわらさん','2020.07.27'),(283,'おやつにもちょっとした酒のつまみにもあうフレバー。 子供はちょっと辛いかな？',5,27,'2020-10-07 05:29:17','2020-10-07 05:29:17','べかちゃんさん','2020.07.24'),(284,'わさびしょうゆ味も堪能出来るこのポテトチップス。然し、わさび特有のツーンとした感じが確りと抑えられていて尚且つ手軽にパリパリとした気持ちの良い食感が楽しめる。勿論食べた事のあるしお味、のりしお味、コンソメ味の６０ｇやまだ食べた事の無い全く同じ量である抹茶塩味５５ｇと同様６８円と言う素晴らしいコスパ。今度はその５５ｇも是非買いたい。この味と抹茶塩味、パッケージに数量限定って書いてあるけど、その２種類も出来れば通常生産して欲しいなぁ。これからもファイト!!(笑)。',4,27,'2020-10-07 05:29:17','2020-10-07 05:29:17','車バイク好きケン君さん','2020.07.21'),(285,'本当に素朴で飽きのこない味！毎日でも食べたくなります。買う時は2袋余分に買って長く楽しんでます。ず~っと販売中止にならない事を願います。',5,28,'2020-10-07 05:29:17','2020-10-07 05:29:17','おかんさん','2020.06.25'),(286,'ほんのり柚子の香りがして、青唐辛子も思っていたほどピリピリとした辛さではなくて、食べやすいピリ辛味で美味しかったです。',5,30,'2020-10-07 05:29:17','2020-10-07 05:29:17','kumiさん','2020.07.06'),(287,'期間限定思わずカゴに入れました。　柚子のほのかな酸味と唐辛子の辛味がマッチして美味しいです。唐辛子辛さも控えめなので食べやすいです。　トルティーヤのパリパリ感がやっぱりいいですね。',4,30,'2020-10-07 05:29:17','2020-10-07 05:29:17','綾野ちえさん','2020.06.20'),(288,'数量限定ですが定番化してほしいです。 抹茶がけっこうたっぷりついていて、塩がマイルドでよく合います。 抹茶好きなので気に入りました。',5,31,'2020-10-07 05:29:17','2020-10-07 05:29:17','daiさん','2020.07.03'),(289,'ほのかな抹茶風味がしますが、抹茶好きにはかなりオススメ的なコメントがありましたが、かなりの抹茶好きの私にはあいませんでした。',1,31,'2020-10-07 05:29:17','2020-10-07 05:29:17','ママさん','2020.06.10'),(290,'抹茶大好きなので購入しました。抹茶の香りがして美味しかったですが、ポテチにはミスマッチな気がしました。',3,31,'2020-10-07 05:29:17','2020-10-07 05:29:17','やえさん','2020.05.23'),(291,'新商品に期待して購入したのですが、抹茶のポテチはちょっと苦手でした。',2,31,'2020-10-07 05:29:17','2020-10-07 05:29:17','なおママさん','2020.05.16'),(292,'抹茶フレーバーの珍しいポテトチップス。 余計な添加物が少なく抹茶の香りが楽しめるので、抹茶好きにはかなりオススメです。 価格もリーズナブルなのがうれしい。',5,31,'2020-10-07 05:29:17','2020-10-07 05:29:17','宇治松さん','2020.04.30'),(293,'先日初めて購入しました。 ほのかに抹茶の味がして美味しかったです。また購入したいです！',1,31,'2020-10-07 05:29:17','2020-10-07 05:29:17','ささきさん','2020.04.22'),(294,'厚切りポテトにチーズが絡んで濃厚な味わいです。 値段も安くてコスパ最強のおやつです。',4,32,'2020-10-07 05:29:17','2020-10-07 05:29:17','宇治松さん','2020.06.30'),(295,'お求め安い価格の商品です。他社のポテトチップスよ同様に、サクサク感がたまりません。気がつくと1袋なくなっていますよ。私にはちょうどよい加減のチーズテイストです。ポテトのバランスが絶妙で大好きです。オススメですよ。',4,32,'2020-10-07 05:29:17','2020-10-07 05:29:17','WWUさん','2020.06.10'),(296,'食べやすい上、やはり安い！ 今後も買います！',5,32,'2020-10-07 05:29:17','2020-10-07 05:29:17','Hydeさん','2020.06.10'),(297,'厚切りのサクッとした食感にチーズの風味がたまりません。 プライベートブランドのポテトチップスで、チーズ味はあまり見ないので販売してもらえてうれしいです。 レギュラー販売お願いします。',5,32,'2020-10-07 05:29:17','2020-10-07 05:29:17','メルさん','2020.06.06'),(298,'厚切りのためとてもザクザクしていてまた、チーズがあることによって大人の味が楽しめます。 普通のポテトチップスより断然美味しいです❗ 今、とてもはまっています',5,32,'2020-10-07 05:29:17','2020-10-07 05:29:17','さくらもちさん','2020.06.06'),(299,'チーズの風味が強くて病みつきになる濃い味付けが気に入りました。厚切りなので歯ごたえも良くて食べ応えもあります。私はお酒のおつまみとしてすっかりはまりました。子供は牛乳との組み合わせが気に入ったようで同じくはまっています。',5,32,'2020-10-07 05:29:17','2020-10-07 05:29:17','そらてりさん','2020.05.31'),(300,'チーズ感を期待して手に取ったけれど、いざ口にしたら、ちょっと物足りないかも。他社のチェダーチーズ厚切りポテトチップスは、チーズのトッピングが目で見てわかりやすいほどポテトチップスについているけれど、見た目もふつうの塩味と差がない気がする。ちょっと残念。',3,32,'2020-10-07 05:29:17','2020-10-07 05:29:17','はなかさん','2020.05.23'),(301,'コスパ最高。チーズが大好きな人には、おすすめです。カロリーは、少し気になりますが、私は、休日の贅沢と思って、ついつい買ってしまいます。最高です。',5,32,'2020-10-07 05:29:17','2020-10-07 05:29:17','にこさん','2020.05.20'),(302,'この商品のリピーターです。とにかくうまいです！チーズの味が最高でギザギザポテチがいい！値段が安くて人気がありそうなので、まとめての購入でした。',5,32,'2020-10-07 05:29:17','2020-10-07 05:29:17','ナオヤさん','2020.05.16'),(303,'価格が安くてこの美味しさ文句なしです。 チーズの香りがとても良く味も濃厚でお酒などのおつまみにもなりそうです。 絶対また買いたいです。',5,32,'2020-10-07 05:29:17','2020-10-07 05:29:17','おさるくんさん','2020.05.16'),(304,'味もコスパも良いです。 お店でお試しで1袋買って、ハマりました。 また買おうと思ったら数量限定の為かお店から無くなってました。 また買いたいです。 通常商品にして欲しいほどです。',5,32,'2020-10-07 05:29:17','2020-10-07 05:29:17','よしさん','2020.04.27'),(305,'商品を見たら買っちゃいます。',5,33,'2020-10-07 05:29:17','2020-10-07 05:29:17','トシさん','2020.07.09'),(306,'じゃがいもの味わいと塩加減がちょうどいいです。食感も良くいつもこの価格というところが嬉しいです。',5,33,'2020-10-07 05:29:17','2020-10-07 05:29:17','りなさん','2020.07.03'),(307,'コスパ最高！国産、量も満足。 薄味なので最後まで飽きずに食べれる。 ちゃんとじゃがいもの味がして美味しい♪',5,33,'2020-10-07 05:29:17','2020-10-07 05:29:17','ごままさん','2020.06.15'),(308,'塩加減もちょうど良くとても美味しいです☆しかも、安い!',5,33,'2020-10-07 05:29:17','2020-10-07 05:29:17','鏡ママさん','2020.05.30'),(309,'ポテチ大好きなので、数えきれないくらい食べてます。 今では親からこのポテチの差し入れも( ^ω^ )',5,33,'2020-10-07 05:29:17','2020-10-07 05:29:17','やみさん','2020.05.30'),(310,'ポテチ大好きなので良く購入しています。塩加減が控えめで美味しい！',5,33,'2020-10-07 05:29:17','2020-10-07 05:29:17','らららさん','2020.05.23'),(311,'美味しいです',4,33,'2020-10-07 05:29:17','2020-10-07 05:29:17','みみさん','2020.05.20'),(312,'来店すると、この商品は必ず買います。まず第一に安いです。容量やお味も他社のポテトチップスと同等です。我が家では、小５娘のおやつの定番です。賞味期限が長いので、常時、4～５個ストックしてあります。オススメですよ。',5,33,'2020-10-07 05:29:17','2020-10-07 05:29:17','ＷＷＰさん','2020.05.17'),(313,'先月はのり無しのしお味だったが本日はのりしお味を選んだ。こちらはのりの風味も味わえた。何方も塩や油の加減も良く、ポテトチップス本来のパリパリ食感、ジャガイモ等の質感の良さが楽しめた。(☺☺☺☺☺✌✌✌✌✌☆☆☆☆☆❤❤❤❤❤）',5,34,'2020-10-07 05:29:17','2020-10-07 05:29:17','車バイク好きケン君さん','2020.07.10'),(314,'小腹が空いた時に丁度良い量で、味も塩加減が丁度良いです。 値段もコスパ良く常に買い置きしてます。去年の10月から始まったダイエー独自の割引企画いつでも割３%OFFで買うので、お財布にも優しいです。これからもお世話になります。',5,34,'2020-10-07 05:29:17','2020-10-07 05:29:17','ラムさん','2020.06.04'),(315,'ぱりっとしてちょうど良い塩加減がやめられなく、ほぼ毎週買っています。うちのおやつの定番になっています。なにより安くて助かります。',5,34,'2020-10-07 05:29:17','2020-10-07 05:29:17','かなうえさん','2020.06.03'),(316,'安いから味が薄くて中身も そんなにかなーと思っていたけど 沢山入っているし味もしっかりついてて 食感もパリパリで美味しくて 買い物の度についつい買ってしまいます',5,34,'2020-10-07 05:29:17','2020-10-07 05:29:17','あーか☆*°さん','2020.05.31'),(317,'他ブランドの同商品に劣る事がありません。 おやつにもおつまみにもなる味と食感がお気に入りです。',5,34,'2020-10-07 05:29:17','2020-10-07 05:29:17','えりどんさん','2020.05.30'),(318,'すこし小腹がすいたとき１袋食べれるので常に買い置きしています。 サラダに入れてもおいしい。',5,34,'2020-10-07 05:29:17','2020-10-07 05:29:17','にこちゃんさん','2020.05.22'),(319,'主人が大好きな とっぷばりゅさん海苔味のポテトチップス。 いつもお世話になっております。 以前よりも”海苔”のイメージが反映された 新しいパッケージとても素敵ですね。 これからもお世話になります。 ありがとうございます。',5,34,'2020-10-07 05:29:17','2020-10-07 05:29:17','パリッパリ　　　　　さん','2020.04.30'),(320,'ちょうど良い塩加減、パリッとした食感が最高ですわ！',5,34,'2020-10-07 05:29:17','2020-10-07 05:29:17','主婦さん','2020.04.25'),(321,'コンソメ味もめっちゃ美味かった。と言う事で、チキンベースに香味野菜のうまみがきいたと言う言葉、私は絶対に信じる。その他にも綺麗にスライスして植物油でカリッと揚げていて、塩加減も程良いジャガイモも食感がパリッとしてて気持ち良い。しかも68円と言う低価格も物凄く気に入っている。この商品にも又の機会にお目にかかりたい。',5,35,'2020-10-07 05:29:17','2020-10-07 05:29:17','車バイク好きケン君さん','2020.07.16'),(322,'たいへんお求めやすい価格の商品です。パリパリの食感で、あっという間に完食でした。私には、ちょうどよいコンソメ加減です。小５娘も好きなようで、一緒に買い物へ行くと、こっそり買い物カゴへ入れに来ます。',4,35,'2020-10-07 05:29:17','2020-10-07 05:29:17','ＷＷＶさん','2020.07.13'),(323,'頻繁にリピート買いしてます。安いのにしっかりとコンソメの味がしてパリッとした食感が味わえます。星５つの最高評価です。',5,35,'2020-10-07 05:29:17','2020-10-07 05:29:17','なっちの人さん','2020.06.14'),(324,'毎日のおやつに重宝してます。 リーズナブルでおいしいのでポイント高いです。',5,35,'2020-10-07 05:29:17','2020-10-07 05:29:17','misaruさん','2020.06.01'),(325,'少しだけ食べたいときにほどよい量で、ポテチの中でもお手頃な金額なのでよく買っています。',5,35,'2020-10-07 05:29:17','2020-10-07 05:29:17','ぱゆさん','2020.05.31'),(326,'サクサク パリパリ 美味しい 何時も買ってしまいます',4,35,'2020-10-07 05:29:17','2020-10-07 05:29:17','夏の風さん','2020.05.29'),(327,'ポテチ大好きなので良く購入しています。他のメーカーと比べてコンソメ味が控えめな気がしますが、飽きがこないのでずっと食べてしまいます。',5,35,'2020-10-07 05:29:17','2020-10-07 05:29:17','sariさん','2020.05.23'),(328,'リニューアルしたのか以前より薄く、食感が軽くなっていました。 前の方がパリパリしてて美味しかったです。 どうかパッケージが変わる前に戻って欲しい。',2,36,'2020-10-07 05:29:17','2020-10-07 05:29:17','みみりんさん','2020.07.01'),(329,'余計な味がせず美味しいです。 ただ、以前はもう少し厚みがありカリッとした食感でもっと美味しかったです。 パッケージが変わる前から薄めの時と厚めの時があったので、たまたまかもしれませんが。 厚めが本当に美味しくて購入するので、当たり外れがあるのが残念です。 味はとても好きで、こちらの製品を知ってから塩味はいつもこちらを購入しています。',4,36,'2020-10-07 05:29:17','2020-10-07 05:29:17','るるるさん','2020.06.08'),(330,'かなりお得なので何度も購入してます！',5,36,'2020-10-07 05:29:17','2020-10-07 05:29:17','ベリーさん','2020.06.08'),(331,'ポテチが食べたい時にお世話になってます。 やはり、低価格は我らの味方です。 味は少し薄口ですかね。 充分に楽しめます。',4,36,'2020-10-07 05:29:17','2020-10-07 05:29:17','とっぴーとっしーさん','2020.05.31'),(332,'美味しい。 大袋で値段が安くお得感がある。',5,36,'2020-10-07 05:29:17','2020-10-07 05:29:17','ぴのすけさん','2020.05.21'),(333,'のりの風味と塩味がマッチしてとてもおししい。大袋でお得なのもうれしい。',5,37,'2020-10-07 05:29:17','2020-10-07 05:29:17','ユキさん','2020.06.19'),(334,'これは、量が多くて、とても美味しくて最高です。また、量に対してとても値段が安くとってもおすすめです。 のり塩がポテトチップスにマッチしていて、味がしっくり染み込んでいてとってもとても美味しいです',5,37,'2020-10-07 05:29:17','2020-10-07 05:29:17','ステキですねさん','2020.06.06'),(335,'青のりのポテチが大好きで、こちらの大容量タイプは単価が安い上に、味もとても美味しく、これから買うならTOPVALUがいいかなと思いました。',5,37,'2020-10-07 05:29:17','2020-10-07 05:29:17','ugbyさん','2020.05.17'),(336,'開封するとふんわり海苔の香り。 他ブランドのより、ちょっと厚めにストレートカットされ、 さくさく、歯ごたえのある食感です。 海苔のつき具合に多少ムラがありますが、風味は充分で、 コスパを考えるとコレは最高のポテチです。',5,37,'2020-10-07 05:29:17','2020-10-07 05:29:17','赤ラベルさん','2020.05.03'),(337,'某お菓子メーカーのポテトチップスと変わらないくらい美味しいと思います(^^) 値段も50円ほど安いですよね。 つい食べ過ぎてしまいそうなので、気をつけます。笑 なので、星4です笑',4,38,'2020-10-07 05:29:17','2020-10-07 05:29:17','かずほさん','2020.05.20'),(338,'一度買ってはまりました。薄味で、野菜の味がはっきりしているところが好みです。言い訳おやつのはずが、気づいたら言い訳もできないほど食べてしまっています。',5,39,'2020-10-07 05:29:17','2020-10-07 05:29:17','山田花子さん','2020.06.17'),(339,'さっぱりとした味つけで美味しかったです。4種類の組み合わせで、いろいろな味わいを楽しむことができて良かったです。',5,39,'2020-10-07 05:29:17','2020-10-07 05:29:17','とりにんさん','2020.05.10'),(340,'軽くて美味しくて止まらないです。',5,40,'2020-10-07 05:29:17','2020-10-07 05:29:17','ニーナさん','2020.06.18'),(341,'さくっと軽く、海苔の風味がふんわり感じ、１度食べると止まりません！ 米粉を使用しているので子供のおやつにぴったりです。',5,40,'2020-10-07 05:29:17','2020-10-07 05:29:17','あやねママさん','2020.06.13'),(342,'食べやすいサイズで軽い食感が気に入っています。味付けも塩加減も丁度良くて美味しいと思います。おやつによく食べます。',5,40,'2020-10-07 05:29:17','2020-10-07 05:29:17','kumiさん','2020.05.03'),(343,'軽い食感で、塩かげんも濃すぎず、息子も美味しいと一袋を２人で夢中になって食べました',5,40,'2020-10-07 05:29:17','2020-10-07 05:29:17','まあさんさん','2020.04.19'),(344,'小さくて軽くて薄味です。 添加物も無く、子供のおやつにちょうど良い、安心。 カロリー控えめで大人が食べてもいい感じ。のりの風味がもっと良ければ最高！',4,40,'2020-10-07 05:29:17','2020-10-07 05:29:17','ひろさん','2020.04.19'),(345,'甘いものが少し欲しい時に、小袋で丁度いい食べきりの量です。',4,41,'2020-10-07 05:29:17','2020-10-07 05:29:17','ゆまさん','2020.06.22'),(346,'最近、ナッツ類がマイブームになっていて食べ出すと止まらなくなるので、これは量もちょうどいいし、抹茶味の味も好きなので、気に入っています。',4,41,'2020-10-07 05:29:17','2020-10-07 05:29:17','せいこさん','2020.05.29'),(347,'くるみを抹茶コーティングした健康志向のおやつです。 甘さも適度で食べやすいのが気に入りました。',4,41,'2020-10-07 05:29:17','2020-10-07 05:29:17','宇治松さん','2020.03.31'),(348,'ダイエット中に重宝しています。 もう少し量がると☆5です。',4,42,'2020-10-07 05:29:17','2020-10-07 05:29:17','mark06さん','2020.05.19'),(349,'安いし思っていた以上に美味しかったです。あっという間に一袋食べてしまいました。また買います。',5,43,'2020-10-07 05:29:17','2020-10-07 05:29:17','kumiさん','2020.02.15'),(350,'イオン系列のお店「ビッグ」で税別57円で売ってました。安かったので試しに買ってみました。予想に反して「おいしい☆」濃いめの味付けがとっても良かったです。リピ買いしました。',5,43,'2020-10-07 05:29:17','2020-10-07 05:29:17','WWKさん','2019.12.19'),(351,'梅そら豆ありそうであまり見たことがないので買ってみました。梅味が凄く美味しくてハマリました。おやつにピッタリです。',5,44,'2020-10-07 05:29:17','2020-10-07 05:29:17','kumiさん','2020.02.23'),(352,'梅味がすごく強いところがとっても気に入りました。歯ごたえもあるので食べた感じもあって満足できるおやつです。これで一袋１４４キロカロリーはほんとにうれしいです。ダイエットの時のおやつにいいと思います',5,44,'2020-10-07 05:29:17','2020-10-07 05:29:17','けいこまりさん','2020.01.04'),(353,'カリッと揚がったれんこんを梅味でさっぱりと頂けます。あっという間に食べきっても、たったの70kcal！絶対また買います！',4,45,'2020-10-07 05:29:17','2020-10-07 05:29:17','隊長さん','2019.11.08'),(354,'ほのかに梅風味でおいしい',5,45,'2020-10-07 05:29:17','2020-10-07 05:29:17','poohさん','2019.11.07'),(355,'一口サイズでちょこちょこ口に入れられるので、仕事中でも食べやすくリピートしています。',4,46,'2020-10-07 05:29:17','2020-10-07 05:29:17','まりんさん','2020.06.21'),(356,'小腹が空いたときに時にぴったり！おいしいです。',4,46,'2020-10-07 05:29:17','2020-10-07 05:29:17','さくらさん','2020.06.01'),(357,'素材の風味を生かしたあっさりとした味付けなので飽きが来ず、ついつい食べ進んでしまいます。ただ、バジルの香りはもう少し強くてもよいと思います。',4,47,'2020-10-07 05:29:17','2020-10-07 05:29:17','山田花子さん','2020.06.27'),(358,'スナック菓子としてではなく、 サラダに使っています。 小さな角切りにしたトマトに、本製品をざっくり砕いてトッピングし、 シーザードレッシングをかけると サクサク食感のバジルが、とても美味しくて オススメです。',5,47,'2020-10-07 05:29:17','2020-10-07 05:29:17','るしふぁさん','2020.06.21'),(359,'美味しいですが…。正直、もう一押しのスパイスがあれば本当に最高です‼︎ですが美味しい事には変わりなしです‼︎',4,47,'2020-10-07 05:29:17','2020-10-07 05:29:17','○倉林対●木村さん','2020.05.25'),(360,'あっさり系の食べやすい味で美味しいです。',5,47,'2020-10-07 05:29:17','2020-10-07 05:29:17','kumiさん','2020.04.22'),(361,'おいしいです。 が、もっとバジルが強いと嬉しいです。 塩だけの物とはっきりとした違いが欲しいです。',3,47,'2020-10-07 05:29:17','2020-10-07 05:29:17','イオノダさん','2020.03.27'),(362,'これ、本当に美味しいです！何度もリピートしたい。',5,47,'2020-10-07 05:29:17','2020-10-07 05:29:17','たまゆらさん','2019.11.26'),(363,'プレーンよりもあっさりしていて、おいしい。',5,47,'2020-10-07 05:29:17','2020-10-07 05:29:17','poohさん','2019.10.30'),(364,'普通に食べても美味しいし、サラダに細かく砕いて乗せても美味しい。とても満足です。',5,47,'2020-10-07 05:29:17','2020-10-07 05:29:17','はるちゃんさん','2019.10.17'),(365,'マラソンを走るときに、友達に私設エイドで出してもらってます。クエン酸と糖分を摂れるので良いです。',3,48,'2020-10-07 05:29:17','2020-10-07 05:29:17','はよたさん','2018.02.22'),(366,'甘梅系が苦手な私には甘過ぎました。 甘いのが好みな人なら美味しく感じるのかな? すみませんが、私はもう買わないかと…',2,48,'2020-10-07 05:29:17','2020-10-07 05:29:17','梅にゃんこさん','2017.11.03'),(367,'きな粉風味が美味しいです。ランチの後にちょっと甘いものが食べたい時や、おやつ時間にコーヒーと一緒に。癖になります。',5,51,'2020-10-07 05:29:17','2020-10-07 05:29:17','ひなさん','2020.06.12'),(368,'きなこ風味が良くて美味しいので、あっという間に一袋食べてしまいます。大好きなきなこ菓子の１つです。',5,51,'2020-10-07 05:29:17','2020-10-07 05:29:17','kumiさん','2020.02.07'),(369,'ほくほくとしたきなこのやさしい味わいが、疲れた心をほっこり癒してくれます。国産大豆と国産きなこで安心です。',4,51,'2020-10-07 05:29:17','2020-10-07 05:29:17','隊長さん','2019.05.01'),(370,'きなこの風味がおいしいです。 ついついあと1個、あと1個と手が伸びます。',5,51,'2020-10-07 05:29:17','2020-10-07 05:29:17','ひやけさん','2018.03.28'),(371,'きな粉好きには堪らない美味しいお菓子！ きな粉好きなら買って損はないですよ！',5,51,'2020-10-07 05:29:17','2020-10-07 05:29:17','ごはんさん','2018.02.19'),(372,'歯ごたえがあっておいしい!個人的にはもうちょっと甘さ控えめでも良いかな? と思いましたが、ノンシュガーの日本茶・中国茶・紅茶他になんでも合いそうなお味。お茶請けにぴったりです。 きなこ味大好きなのでリピート決定です。',5,51,'2020-10-07 05:29:17','2020-10-07 05:29:17','うまこさん','2017.11.01'),(373,'ネットでチェックして、5店舗回ってようやくget!きな粉の風味がとてもよくてめちゃくちゃハマりました。ノングルテン、甜菜糖なのでとても幸せです。',5,51,'2020-10-07 05:29:17','2020-10-07 05:29:17','poohさん','2017.10.06'),(374,'やさしい塩味で梅の風味もあり食べやすい。',4,54,'2020-10-07 05:29:17','2020-10-07 05:29:17','poohsamaさん','2019.08.19'),(375,'数量限定で20%増量中だったので６袋まとめ買いしました。明太子を乗っけて食べたりしてます（塩分が多いのですが・・）そのままでも十分おいしいです。',5,55,'2020-10-07 05:29:17','2020-10-07 05:29:17','なぶらさん','2020.07.07'),(376,'大好きでよく買ってます。 娘との飲み会には必須になってます。 七味とマヨネーズをディップすると最高です。 塩味だけなのでトマトソース付けたりいろいろ楽しめるのもいいです。',5,55,'2020-10-07 05:29:17','2020-10-07 05:29:17','ともりさん','2020.06.21'),(377,'シンプルな味付けと素材で出来ている、大好きなチップスです。残念ながら、近隣の店舗では、取り扱い中止になってしまったので、また販売して欲しいです。',5,55,'2020-10-07 05:29:17','2020-10-07 05:29:17','peacoさん','2020.06.19'),(378,'そのまま食べても美味しいし、サラダのトッピングにしてもGood 値段も安く、よく購入してます',5,55,'2020-10-07 05:29:17','2020-10-07 05:29:17','MMさん','2020.05.28'),(379,'いつも買っちゃうんだな',3,55,'2020-10-07 05:29:17','2020-10-07 05:29:17','お肉は赤身さん','2020.04.17'),(380,'少ししょっぱく感じたのでマイナス1です サルサソースで食べるのでもう少し薄味の方が好みでした',4,55,'2020-10-07 05:29:17','2020-10-07 05:29:17','おばさん','2020.04.11'),(381,'かなり塩っぱい。 サルサソースとか何か付けたいから、塩無し素揚げも出してほしい。',3,55,'2020-10-07 05:29:17','2020-10-07 05:29:17','無化調さん','2020.01.16'),(382,'これ美味しいわ。 是非是非、大袋を作って頂きたい。',4,55,'2020-10-07 05:29:17','2020-10-07 05:29:17','トルティア大好きさん','2020.01.15'),(383,'メキシコに長く住んでいましたが、現地で売っているトルティーヤチップスに近く、塩味もバッチリ聞いており、ワカモレに合わしてよく食べています。敢えていうなら、もうすこしチップスの量を増やしていただきたいです。',4,55,'2020-10-07 05:29:17','2020-10-07 05:29:17','Yossymonさん','2019.12.14'),(384,'近くのドラッグストアで買ってます。見つけたら、５袋は買います。このままでもいいし、ケチャップやピザソース、レトルトのパスタソースなどをディップにして食べてます。お酒が止まらない！家族皆大好き。時々ある塩っ辛い個体も嬉しい。本当に飽きない。',5,55,'2020-10-07 05:29:17','2020-10-07 05:29:17','ぽんちゃんさん','2019.11.24'),(385,'これに簡単なサルサ（トマト・パクチ・玉ねぎ）を添え、とろけるチーズを乗せて食べるスナックが大好きです。ノンフライバージョンも出してください！',4,55,'2020-10-07 05:29:17','2020-10-07 05:29:17','guacamoleさん','2019.10.27'),(386,'とても香ばしくて美味しいが、塩の利き具合がまばらで、部分的にとてもしょっぱい。サラダにまぶすには丁度良い塩加減だが、単体となるともう少し全体的に塩を抑えた方がチップスの美味しさが引き立つと思う。',4,55,'2020-10-07 05:29:17','2020-10-07 05:29:17','fromOsakaさん','2019.09.21'),(387,'友達が来るとチリコンカンを作るので、付け合わせにトルティアチップスを良く買います。原料のトウモロコシはアメリカ産とのことですが、商品情報のページには遺伝子組み替えでないと書かれていたので安心しました。',5,55,'2020-10-07 05:29:17','2020-10-07 05:29:17','Bunkyokerさん','2019.08.30'),(388,'塩だけのトルティーヤチップスが近場のお店から消えた....。 あの塩味とちょど良い量が良かったのに残念。',5,55,'2020-10-07 05:29:17','2020-10-07 05:29:17','モグもんさん','2019.08.09'),(389,'プレーンなチップスは割と最近少ないので、サルサソースとかつけて食べるのに重宝しております。他の方のレビューにもありますが、無塩があるともっと良いかなと思いますね。',4,55,'2020-10-07 05:29:17','2020-10-07 05:29:17','おそばさん','2019.08.08'),(390,'美味しくて大好きなのに、最寄りの店から無くなった。なぜでしょうか？探し回っています。',4,55,'2020-10-07 05:29:17','2020-10-07 05:29:17','タジさん','2019.07.30'),(391,'よくあるごつっとしたチップスに比べてあっさりで厚さは薄め、塩気もほどよく、さらりと軽めのトルティーヤチップス。一袋の量もこれぐらいが丁度よく、買いやすい値段もありがたい点。全国ブランドでこれに代わるものはないというぐらい、これでないとという一品。サルサに合うかなと思いながら、ついそのままで食べ切ってしまうほど。',5,55,'2020-10-07 05:29:17','2020-10-07 05:29:17','はなこさん','2019.07.30'),(392,'無塩ならもっとよかった。 市販たとディップに塩分が有るので、手作りなら調製が要る。 店頭に無いことがあるのが残念。',4,55,'2020-10-07 05:29:17','2020-10-07 05:29:17','mayuさん','2019.07.20'),(393,'素朴な味で、すごく美味しいです！グリーンアイ商品なので、安心安全。旦那さんが、すごくぜかグリーンアイ商品が大好きでこだわっているので、こちらは週に2回は買いだめしています。笑　お安いし、量も一回分にピッタリ。食べすぎ防止にも！お料理にも、細かく砕いて使えます。',5,55,'2020-10-07 05:29:17','2020-10-07 05:29:17','mimiさん','2019.07.16'),(394,'素朴な味でした。 チーズと相性がいいと思いました。一緒に食べています。 フリーフロームのグリーンアイは魅力です。',3,55,'2020-10-07 05:29:17','2020-10-07 05:29:17','やさしさ素朴さん','2019.06.18'),(395,'増量中で添加物不使用とのことで購入しました。 あっさりで噛めば噛むほどコーンの味もしっかりします。ついつい手が伸びてしまい、1袋が一瞬で無くなりました。 サルサソースを作れば、パーティーやイベントにもオシャレに使えると思います！',5,55,'2020-10-07 05:29:17','2020-10-07 05:29:17','ゆあさん','2019.06.12'),(396,'ワカモレディップしても、そのままでも、シンプルに美味しいです。近隣のお店からなくなってしまって凹む。。。',5,55,'2020-10-07 05:29:17','2020-10-07 05:29:17','ナチョスさん','2019.05.06'),(397,'素朴でいいけど、以前の　ライムチリ味のほうがおいしかった・・復活してほしい',3,55,'2020-10-07 05:29:17','2020-10-07 05:29:17','kokoさん','2019.05.03'),(398,'チーズ感はありませんが、ピザ感はあるので満足です！ 何度も購入している安心の商品です',5,56,'2020-10-07 05:29:17','2020-10-07 05:29:17','ちみさん','2020.06.04'),(399,'袋を普通に開けようとして両サイドに引っ張ったら、袋の両サイドが縦に裂けて中身が飛び散りました。 今までこんな経験したことがないので、正直驚きました。 安価にするために品質を落としている部分があるかもしれませんが、正直今回はあまりのことにガッカリしました。 中身はOEMみたいな感じで同じなのかもしれませんが、こういうパッケージ品質って結構大事だと思います。',1,56,'2020-10-07 05:29:17','2020-10-07 05:29:17','lemonさん','2020.02.09'),(400,'大手メーカ製のピザポテトのようなチーズの味は感じませんが、トマト感がたっぷりでさっぱりとした味でとても美味しいです。 また容量も多いしおすすめです。',4,56,'2020-10-07 05:29:17','2020-10-07 05:29:17','ボン吉さん','2019.03.30'),(401,'あまり期待せず購入したのですが、私はチーズがない分あっさりと食べれて良かったです。ピザの味はしっかりしている印象でした。あっという間に完食してしまいましたので、また購入したいです。',4,56,'2020-10-07 05:29:17','2020-10-07 05:29:17','ジャスミンティーさん','2019.03.27'),(402,'トマト、チーズ、スパイス？で言われてみれば確かにピザ。コク(＋甘み？)が足りず、物足りなさを感じるまま食べ終えた。',3,56,'2020-10-07 05:29:17','2020-10-07 05:29:17','Eomさん','2019.03.08'),(403,'ポテトチップスが好きなのでいろいろなメーカーのものを食べ比べていますが、こちらのポテトチップスは厚みもあるし、塩味はやや強めですがとってもおいしいです。お値段が安いのでたくさん食べられる印象です。',4,57,'2020-10-07 05:29:17','2020-10-07 05:29:17','MMMさん','2020.06.17'),(404,'硬さと値段が手頃です！ たまに食べたくなります',4,57,'2020-10-07 05:29:17','2020-10-07 05:29:17','まるさん','2020.02.24'),(405,'国産の海塩とドイツの岩塩を使用してるので、他のポテチより、にがり成分が摂れるので、イオンに行ったらよく買います。',5,57,'2020-10-07 05:29:17','2020-10-07 05:29:17','せんしゅさん','2020.02.23'),(406,'はじめてこちらを買いました。 いつもは某会社のポテトチップスの塩味を食べているのですが、すごく塩辛く感じてしまいました。 すこしずつしか手が延びないのでやめられなくならないのはいいと思いますが、こんなに塩辛いと次は買わないかなと思います。',2,57,'2020-10-07 05:29:17','2020-10-07 05:29:17','みくさん','2019.12.01'),(407,'塩味しっかり効いてたまらなくおいしく、つい手がのびます。あっさり揚げてあるので、やみつきになります。たまに、しっかり揚げてある為か、お焦げありですが、おいしさには負けてしまいます。またもっと買います。大袋でお得です。',5,57,'2020-10-07 05:29:17','2020-10-07 05:29:17','ウッピィーさん','2019.08.30'),(408,'いつも買ってしまう商品です。オニオンサワークリームの味と、厚めのカットのポテトにハマってます。',5,58,'2020-10-07 05:29:17','2020-10-07 05:29:17','グーフィーさん','2020.06.05'),(409,'安くて美味しいので休日には必ず買っています。お酒にも合います。みんなに好まれるような味だと思います。是非売り続けて欲しいと思います。',5,58,'2020-10-07 05:29:17','2020-10-07 05:29:17','かなうえさん','2020.06.03'),(410,'厚切りのギザギザカットで、ザクっとした歯ごたえが良いです。 食感はあるもののそれほどまで固くはないので、お子さんでも年配の方でも特に問題はないかと思います。 サワークリームのほどよい酸味としっかりしたオニオンの風味がマッチしていて、ついつい食べ過ぎてしまうほど美味しかったです。',4,58,'2020-10-07 05:29:17','2020-10-07 05:29:17','Motoさん','2020.05.26'),(411,'凄く気に入って良く買って帰りますよおつまみにも合う後はそのまま食べています。酸味が少ないから、てが止まりません。 すぐなくなっちゃいます。',5,58,'2020-10-07 05:29:17','2020-10-07 05:29:17','あたみさん','2019.10.29'),(412,'酸っぱさとクリーム感がマッチして大好きです〜！価格も安くて◎何度もリピしてます！',4,58,'2020-10-07 05:29:17','2020-10-07 05:29:17','まらそんさん','2019.08.27'),(413,'美味しい。サワークリームオニオン味を初めて購入しましたがさっぱりして美味しい。',5,58,'2020-10-07 05:29:17','2020-10-07 05:29:17','ちかちゃんさん','2019.04.27'),(414,'新商品だったので早速買って食べてみました。お値段安くてオニオン味も美味しくて、おやつにピッタリだと思いました。もう少し量が多いと嬉しいです。',4,58,'2020-10-07 05:29:17','2020-10-07 05:29:17','kumiさん','2019.03.06'),(415,'主人と娘がポテトチップスの中でこのトップバリュのサワークリームオニオンが大好きです。味がしっかりしていて他のメーカーのポテトチップスにはない美味しさです。ちっさい袋だとすぐに食べてしまうのでこのおっきいパックをリピートしています。売り切れている事がよくあるので見つけたらたくさん買っています。',4,59,'2020-10-07 05:29:17','2020-10-07 05:29:17','amiさん','2020.01.31'),(416,'他のメーカーにはあまりないフレーバー。一度食べたら嵌ります。大容量でかなり嬉しいです。食べ過ぎ注意♪笑笑',5,59,'2020-10-07 05:29:17','2020-10-07 05:29:17','智兎瀬さん','2019.10.19'),(417,'以前から大好きな厚切りに、サワークリームオニオンの濃厚でクリーミーな美味しさをこのボリュームで味わえるなんて、大変嬉しいです！ギザギザの食感プラスこの美味しさをいつまでも味わっていたい‥。トップバリューシリーズにあるとは大変嬉しいです。毎回見かけると食べたくなりますが、買えない時は小さいサイズで我慢してます。厚切りではない方の大袋サイズの値段と同じぐらい下げてもらえると、嬉しいですし助かります。あと少しだけ安くして欲しい‥と切に希望していますが、この商品がトップバリューにあるだけでも大変感謝しています。',5,59,'2020-10-07 05:29:17','2020-10-07 05:29:17','Mint さん','2019.03.21'),(418,'僕はポテチのサワークリーム味が大好きなのですが、今までいろいろなメーカーさんの商品を食べてきました。しかし、これだ！という味には出会えずにいました。 しかし、このサワークリーム味は一味違いました。ちょうどいい！ 匂いも強すぎず、しかもこの容量でこの価格です。驚きました。 騙されたと思って一回食べてみてください。',5,59,'2020-10-07 05:29:17','2020-10-07 05:29:17','ポテチ大好きくんさん','2019.03.21'),(419,'少量では足りないのでいつも大袋を買います。同じトップバリュー塩味のポテチのほうは最近食感が変わりましたか？軽い食感が好きなのですが少し硬くなったように感じます。(もうすこし軽い食感にしてほしい)その点こちらのギザギザの厚切りカットは食感が軽くて塩味も聞いていて食べ出したら止まりません。',5,60,'2020-10-07 05:29:17','2020-10-07 05:29:17','ポテチ大好きっ子さん','2020.06.21'),(420,'とても美味しいので 買い物に行ったら、必ず買います！',5,60,'2020-10-07 05:29:17','2020-10-07 05:29:17','ハッピーさん','2020.05.29'),(421,'そのままでももちろん美味しいですが、サラダに散らしたり、スープカレーにも入れたりしています。 たっぷりなのでコスパも良し♪',5,60,'2020-10-07 05:29:17','2020-10-07 05:29:17','どびんごさん','2020.04.03'),(422,'価格が安くてボリュームがあり美味しいです。あっさりした塩味です。',4,60,'2020-10-07 05:29:17','2020-10-07 05:29:17','aiaiさん','2020.02.10'),(423,'歯ごたえ良く、塩加減も絶妙で、我が家の定番おやつです。飽きることなく主人と二人で毎回、大袋完食してます。',5,60,'2020-10-07 05:29:17','2020-10-07 05:29:17','ノアさん','2019.12.05'),(424,'味も三種類あり、大と小のタイプあり、私は家族で食べるので大を定期的に購入して皆で味わっています。大きさもぱりぱり感覚もおいしさの ポイントです。',4,60,'2020-10-07 05:29:17','2020-10-07 05:29:17','パパさんさん','2019.08.17'),(425,'子供に与えるおやつの添加物が気になり始めて購入しました。とても食べやすく美味しかったので、ポテチが食べたくなった時は必ずこれにしようと思いました！',5,61,'2020-10-07 05:29:17','2020-10-07 05:29:17','ちび子さん','2020.07.24'),(426,'ホテトチップスを購入するときは、必ずこの商品です。 価格が安いだけではなく、無添加。塩だけのシンプルな味が好みです。',5,61,'2020-10-07 05:29:17','2020-10-07 05:29:17','ホームズさん','2020.06.30'),(427,'添加物が入っていないので、安心して食べられます。 すぐに食べてしまうので、まとめ買いしています。',5,61,'2020-10-07 05:29:17','2020-10-07 05:29:17','あきさん','2020.06.14'),(428,'お値段も安く、美味しいです。塩だけで味付けとのことですが、余分なものが入っていなくて良いですね',5,61,'2020-10-07 05:29:17','2020-10-07 05:29:17','ゆかりさん','2020.06.08'),(429,'ポテトチップス好きの私ですが、 お値段も安くて、味もしっかりしてて、大満足です。おやつはこれと決めてます。',5,61,'2020-10-07 05:29:17','2020-10-07 05:29:17','チョコさん','2020.05.27'),(430,'飽きのこない、シンプルな味。',4,61,'2020-10-07 05:29:17','2020-10-07 05:29:17','ひろさん','2020.05.23'),(431,'ポテトチップスは好きですが、高血圧等のためしばらく食べずにいました。そんなときこの商品を見かけ、試しに購入。薄味でもおいしく、あっという間に完食。こどもにも食べさせられる味です。',5,61,'2020-10-07 05:29:17','2020-10-07 05:29:17','タロウさん','2020.02.19'),(432,'いつも購入させて頂いております。お値段以上!!のポテトチップスです。とにかく味がとても美味しい。塩加減。ポテトのパリパリ感。添加物などの使用もなくて安心して食べられる。そして安さ。文句無しの美味しさです。',5,61,'2020-10-07 05:29:17','2020-10-07 05:29:17','りゅんさん','2019.12.21'),(433,'味が薄い。子供にはちょうどいいかも。',2,61,'2020-10-07 05:29:17','2020-10-07 05:29:17','おだっちさん','2019.11.29'),(434,'ポテトチップス大好きなので、ポテトチップスにはうるさい方だと思ってますが、これは美味しいです。 シンプルなものほど良し悪しがよくでますが、美味しいです。 コスパもグッ！',5,61,'2020-10-07 05:29:17','2020-10-07 05:29:17','すっぴさん','2019.06.30'),(435,'すごく気に入ってます！ばれいしょと植物油と塩のみなのでシンプルで美味しい。ただ塩がキツイ。。もう少し控えめであれば文句なく星５つです！！',4,61,'2020-10-07 05:29:17','2020-10-07 05:29:17','さくらさん','2019.05.26'),(436,'子どもと一緒に食べています。余計なものが入っていないので、安心です。美味しくて、開けたらすぐになくなってしまいます。',4,61,'2020-10-07 05:29:17','2020-10-07 05:29:17','あこさん','2019.04.26'),(437,'おいしくて価格も手ごろ。毎日食べるものではないけど、も少し手に入りやすいとうれしいです。うちの最寄りはマックスバリュにはなくて、少し離れたイオンモールで買い求めます。',4,61,'2020-10-07 05:29:17','2020-10-07 05:29:17','まりえさん','2019.02.21'),(438,'美味しいのですが、まろやかな塩味とある割に私には塩がきつく感じられます。食塩量は0.6相当らしいのでポテチとしては普通なんですが、塩だけなのでダイレクトに舌にしょっぱさがくるのかな？でも美味しいので気に入ってポテチを買うなら最近はずっとコレです。',4,61,'2020-10-07 05:29:17','2020-10-07 05:29:17','とにゃーさん','2019.02.20'),(439,'全国大手ブランドのポテトチップスにも負けていないのがこれ。小ぶりの袋で中身も少なそうなのが唯一物足りない点である以外には文句なしのおいしさ。塩だけで味付け、その上あれこれ添加物もなくじゃがいものおいしさそのものを引き立てる塩加減。後味にも嫌みがなく、スナック菓子をあまり口にしない家族も欲しがる商品。',5,61,'2020-10-07 05:29:17','2020-10-07 05:29:17','はなこさん','2018.11.27'),(440,'あっさりしていて美味しいです。食べ出すと止まらなくなる美味しさです。',4,61,'2020-10-07 05:29:17','2020-10-07 05:29:17','みほりんさん','2018.11.18'),(441,'素朴かつシンプルながら、風味の良い塩味が印象的で美味しいポテトチップスです。',4,61,'2020-10-07 05:29:17','2020-10-07 05:29:17','らきあんさん','2018.11.15'),(442,'柔らかくて食べやすいです！ 干し梅って、なぜかたまーにとても食べたくなるんですよね！ 20gだとあっという間になくなるので、もっと量がたくさんだと嬉しいです！',4,62,'2020-10-07 05:29:17','2020-10-07 05:29:17','ねるぽさん','2019.05.24'),(443,'カロリーも非常に低いのでダイエット中のおやつに最適です。香ばしいごま油の香りと程よい塩味がありとても美味しいです。お通じにもいいし、ダイエット中は何個もストックしておきます。',5,63,'2020-10-07 05:29:17','2020-10-07 05:29:17','こたつこーぎーさん','2020.02.01'),(444,'ピールは、どの果物でも大好きですが…これは、また特別に美味しいです。甘すぎずに後口も、ほんのちょっとの苦味も、とても良いです。 お値段も、手頃で嬉しいです。',5,64,'2020-10-07 05:29:17','2020-10-07 05:29:17','ぷりんさん','2020.07.06'),(445,'プレーンヨーグルトに入れて、食べました。 ゆずの風味、食感が良かったです。 量も適量でした。 「いいわけおやつ」というネーミング。いいですね。',5,64,'2020-10-07 05:29:17','2020-10-07 05:29:17','ひよこさん','2019.04.11'),(446,'塩だけで味付けした、シンプルなホテトチップス。 食べ応えはありますが、少し油が強めかなと思いました。',4,65,'2020-10-07 05:29:17','2020-10-07 05:29:17','ホームズさん','2020.07.20'),(447,'美味しいです。 パリパリやめられません。 いつも1袋食べきってしまいます。',4,65,'2020-10-07 05:29:17','2020-10-07 05:29:17','yuccaさん','2020.06.21'),(448,'安いけど美味しくて結構買っちゃいます。食べ応えあり。',4,65,'2020-10-07 05:29:17','2020-10-07 05:29:17','ぽぽぽさん','2020.06.10'),(449,'塩だけの味付けで余計なものは入っておらずおいしく、安心して食べられる。固めでカリカリと食感もよい。',5,65,'2020-10-07 05:29:17','2020-10-07 05:29:17','あきさん','2020.06.10'),(450,'美味しいです。また買いたいです。',4,65,'2020-10-07 05:29:17','2020-10-07 05:29:17','あさん','2020.05.30'),(451,'カリっと硬くて噛み応えがあります。塩だけの味付けなので、安心して食べられます。',5,65,'2020-10-07 05:29:17','2020-10-07 05:29:17','chacoさん','2020.05.25'),(452,'好きです。',5,65,'2020-10-07 05:29:17','2020-10-07 05:29:17','あいまりさん','2020.04.25'),(453,'歯ごたえが有り、ビールのお供に最高！ 良く噛むので食べた感があって好きです。',4,65,'2020-10-07 05:29:17','2020-10-07 05:29:17','みみみさん','2020.04.22'),(454,'ポテチの脂質が他より低いのでこれよく買います！しかも安い(^^) 堅揚タイプが好きなので嬉しい商品です♫',5,65,'2020-10-07 05:29:17','2020-10-07 05:29:17','コアラさん','2020.03.04'),(455,'気軽にチョイスでる、なくす１０９も安心できて良さそう。味も良かったです。',3,65,'2020-10-07 05:29:17','2020-10-07 05:29:17','ワオーンけんさん','2019.12.15'),(456,'一番お気に入りのポテトチップスです。 硬さと塩加減がちょうどよくて、ポテチ買うときは必ずこれです。',5,65,'2020-10-07 05:29:17','2020-10-07 05:29:17','ゆりさん','2019.06.27'),(457,'カロリー低いから買ってみたのだけど、あっさりしてとても美味しい。塩味だけって普通買わないけど、じゃがいもが美味しいからか、十分です。食べ過ぎちゃうのは心配になるクリスピーさも良い。 リピート確実です。',5,65,'2020-10-07 05:29:17','2020-10-07 05:29:17','かりむ611さん','2019.04.10'),(458,'塩気が薄い。油っこくないのは好き。',1,65,'2020-10-07 05:29:17','2020-10-07 05:29:17','ワオン犬さん','2018.08.14'),(459,'ポテトチップスの塩味なのに、最近やたら魚のエキスやだしが入っている商品が多い中こちらはシンプルに味付けは塩のみ。 歯ごたえも良くて、 一袋の量も気持ち少なめで 全部食べてもカロリーは少なめなので、罪悪感もありません。',5,65,'2020-10-07 05:29:17','2020-10-07 05:29:17','ジャイ子さん','2018.06.17'),(460,'塩が、じゃがいもが美味しいのが、よくわかります。 食欲のない朝、野菜ジュースとコレなら、一袋食べちゃうくらいにはまっています。',5,65,'2020-10-07 05:29:17','2020-10-07 05:29:17','はっちゃんさん','2018.06.07'),(461,'シンプルに塩だけの味付けですが、じゃがいもの味がしっかり感じる事が出来ておいしいです。 何より、この固さが、よい歯ごたえでたべごたえもあり、量もちょうどいいなあと感じます。',5,65,'2020-10-07 05:29:17','2020-10-07 05:29:17','ちびさん','2018.04.15'),(462,'パリパリでとっても美味しかったです。 ただ、パーマ油を使っているのが残念。少し値上げしてもいいので、米油のみで頑張って欲しいです。',4,65,'2020-10-07 05:29:17','2020-10-07 05:29:17','つぶあんさん','2018.04.13'),(463,'素朴な味で歯ごたえもありしかもお安いしカロリーも低いので他の似たような商品よりもお買い得です！',5,65,'2020-10-07 05:29:17','2020-10-07 05:29:17','あんじーさん','2018.02.28'),(464,'塩だけのシンプルな味付けなのでじゃがいもの風味を感じる事が出来ます。 食感は某メーカーのものより堅めで個人的には好みです。 国産のじゃがいも使用という事で安心して食べられます。',5,65,'2020-10-07 05:29:17','2020-10-07 05:29:17','みっぴいさん','2017.09.20'),(465,'味、値段、量は5点 ただ、近所のマックスバリューやイオンには置いてなくて、ちょっと遠出した先のイオンでしか見たことがない 入手難易度が少し高いので、総合的には4点',4,66,'2020-10-07 05:29:17','2020-10-07 05:29:17','ハットリさん','2020.03.30'),(466,'シンプルでまさにスナック。 一つでもたっぷり入って満足してます。',5,66,'2020-10-07 05:29:17','2020-10-07 05:29:17','デッキーさん','2019.10.29'),(467,'商品量、味共にコスト的には非常に良くかなり好んで購入しております。 しかし、コストを重視するあまりでしょうか？梱包の筒の強度は弱いので、どんなに注意深く持ち帰ってもバリバリに割れていることが数多くあります。購入後その場ですぐに商品を食べたこともありますが、やはり割れていたので、もはや逃れきれない状況であると思い割り切っております。 味は、塩とサワークリームの２種類（一時期あったチリ系の辛いやつも合わせると３種類）あるので満足はしつつも今後種類が増えることを期待しております。',3,66,'2020-10-07 05:29:17','2020-10-07 05:29:17','ノッチさん','2019.08.27'),(468,'今まで何度か買いました。満足しています。 今日買って食べるとモッサリしており塩味もほとんどしません。 これ大丈夫ですか？',1,66,'2020-10-07 05:29:17','2020-10-07 05:29:17','qtaroさん','2019.01.19'),(469,'一般的なものよりも量が多くて低価格なのでとりあえず買ってみました。 開けてみるとかなりぎっしり入ってて驚きました。 チップの厚さは薄めにスライスされていて塩加減も一般的なものよりもあっさりしていて、 ついつい沢山食べてしまう自分には枚数がサクサク食べられてよかったです。 薄いポテトチップなので硬い床などにうっかり容器を落下させてしまうと中身がバラバラになってしまうのでそこは要注意です。',5,66,'2020-10-07 05:29:17','2020-10-07 05:29:17','やまわさびさん','2018.08.28'),(470,'ベーシックなポテトクリスプで好きな味でした。私の理想の価格と量、味なので買い置きしています。',5,66,'2020-10-07 05:29:17','2020-10-07 05:29:17','おけささん','2017.11.26'),(471,'クリスプらしいパリパリ感が美味しいです。枚数たっぷりなのに安くてお得です。 家族で食べるのにもよいし、蓋もあるのでちょっとずつ食べるのにも良いです。 程よい塩加減で飽きない味でした。',5,66,'2020-10-07 05:29:17','2020-10-07 05:29:17','のっちゃんさん','2017.09.18'),(472,'美味しかったです！ 味もコスパも＾0＾// いろんな味を試してみたいです！',4,67,'2020-10-07 05:29:17','2020-10-07 05:29:17','ももこもこもこさん','2019.02.28'),(473,'しっかりとした味で美味しいです。たくさん入っているけど、蓋が付いているので保存もでき嬉しいです。個人的にはハーフサイズもあればいいなと思います。',5,67,'2020-10-07 05:29:17','2020-10-07 05:29:17','もこさん','2018.11.12'),(474,'大容量で安くて、味もしっかりしています！美味しいのでついつい買ってしまいます！子供たちも大好きで、みんなで取り合いながら食べています！',5,67,'2020-10-07 05:29:17','2020-10-07 05:29:17','さゆよんさん','2018.04.30'),(475,'ポテトチップスの中でもサワークリームオニオン味がとても好きで、安くてしかも大容量のこのシリーズは非常に手軽に買えるので重宝しています。 安いのにポテトチップスのパリッとした食感もサワークリームの味もしっかりしています。是非また買いに行きたい1品です。',5,67,'2020-10-07 05:29:17','2020-10-07 05:29:17','からっと。さん','2018.02.25'),(476,'プリングルスは少し高くていつの間にか少し小さく量も減ったので最近普通の袋タイプのポテトチップスを食べていたら、ある日この商品と出会いました。!(^^)! 量も満足のいく物で、味も凄く美味しかったので凄くハマってしまいました! でも最近になって売り場で見かけなくなってしまいました....... 凄く美味しく継続して買いたいと思っていたのにどうやら販売終了?の様子。 凄く残念です。 是非再度販売して頂きたいと思います。',5,67,'2020-10-07 05:29:17','2020-10-07 05:29:17','ecoにゃさん','2017.09.24'),(477,'量がたっぷりなのに安くて、思わず買いました。 サワークリームの酸味がきいててとてもおいしいです! チップスのパリパリとオニオンの旨みがクセになります。 蓋があって保存しやすいです。',5,67,'2020-10-07 05:29:17','2020-10-07 05:29:17','真daiさん','2017.09.18'),(478,'酸味とオニオンの旨味がきいてておいしい! ハマります。 たくさん入っててお得でよかったです。 パリパリ感も美味しかったです',5,67,'2020-10-07 05:29:17','2020-10-07 05:29:17','ここなっつさん','2017.07.28'),(479,'このスナック、えんどう豆の本格的な風味と塩加減の良さ等の美味さが大いにある逸品だと私は思う。歯応えも勿論良い。しかも７８円と言う驚異的な安さ。サイコー!!イェーイ!!（☺）',5,68,'2020-10-07 05:29:17','2020-10-07 05:29:17','車バイク好きケン君さん','2020.07.18'),(480,'えんどうまめのスナック菓子が好きなので良く買います。サクサクした軽い食感で食べ飽きないです。薄めの味付けも体に良さそうで、我が家のおやつの定番になっています。',5,68,'2020-10-07 05:29:17','2020-10-07 05:29:17','ことりさん','2020.06.21'),(481,'塩辛いスナック菓子は苦手ですが、この商品は塩加減が丁度いいと思います。何度もリピート購入しています。',5,68,'2020-10-07 05:29:17','2020-10-07 05:29:17','すももさん','2020.06.08'),(482,'食感が堅めで塩加減も丁度良く美味しいです。えんどう豆の風味もしっかりしています。無駄に大きすぎない袋の大きさも良いです。',5,68,'2020-10-07 05:29:17','2020-10-07 05:29:17','みっぴいさん','2019.08.29'),(483,'これ美味しい！食べだしたら、やめられない止まらないホントに美味しいです。おやつにピッタリ！おつまみにも良いと思います。オススメです。',5,68,'2020-10-07 05:29:18','2020-10-07 05:29:18','kumiさん','2019.03.23'),(484,'初めて買いました。 カリカリ、ポリポリあとひく美味しさで手が止まりませんでした。 手頃なお値段でこの量はとてもうれしく、リピート決定です！ この素朴なお味と安心の原材料なら子供のおやつにも安心して出せます( ◠‿◠ )',5,68,'2020-10-07 05:29:18','2020-10-07 05:29:18','mapleさん','2019.03.17'),(485,'塩加減と歯ごたえが良くて美味しかった。また次も買うつもり。',5,68,'2020-10-07 05:29:18','2020-10-07 05:29:18','れーぼーさん','2018.11.17'),(486,'えんどう豆の味がしっかりして、カリカリでとてもおいしいです。 ビールのつまみにもよさそう。何よりこの味でこの値段、とてもお得です。空気パンパンで量少ないなんてこともありません。普通のポテトチップスより野菜食べてる感じが罪悪感を減らしてくれて笑、毎回買ってしまいます。',5,68,'2020-10-07 05:29:18','2020-10-07 05:29:18','たなちゃんさん','2018.10.10'),(487,'塩気やカリカリとした歯ごたえがちょうどよく、エンドウ豆の青臭さはないのにおいしさはそのままなのがお気に入りです。 食べ始めると止まらなくなっていまい、すぐなくなっちゃいます。 おやつにもお酒のおつまみにも合います。 子供たちが大好きで、うちのおやつの定番です。',5,68,'2020-10-07 05:29:18','2020-10-07 05:29:18','くうたろうさん','2018.09.18'),(488,'口コミで人気だったこの商品、私もやっと食べることができました。 「段ボール買いしたい（笑）」 一言求められたらこれです。 絶妙な塩加減だからえんどう豆感をしっかり味わえるし、量が多いから幸せ続くずっと食べていたい。 お酒が進んで困りました（笑） どうかどうか、通年販売してください！',5,68,'2020-10-07 05:29:18','2020-10-07 05:29:18','MiCoさん','2018.09.03'),(489,'えんどうまめの風味がよく、いい塩梅でついつい食べ過ぎてしまいます。 油であげていないため、指がべたつきにくいのでオフィスのおやつにもぴったりです。',5,68,'2020-10-07 05:29:18','2020-10-07 05:29:18','Yさんさん','2018.02.20'),(490,'豆系のスナックが大好きですけど、 かなり他社メーカーはしょっぱい脂っこい、 全てクリア、完璧です、食物繊維が多いのもリピートの理由です。 豆の旨味があるため気持ち塩分減らしても美味しそうですね❤ 価格も最高',5,68,'2020-10-07 05:29:18','2020-10-07 05:29:18','おはなさん','2017.08.16'),(491,'昔からよく食べている「えんどうまめのスナック」ですが、こちらはお塩だけで味付けされているそうで、だからか、より豆本来の味が感じられる気がします。「free fromシリーズのお菓子」は、シンプルな味付けなのに、従来品とほとんど味が変わらない気がするのが凄いなといつも思っています。',5,68,'2020-10-07 05:29:18','2020-10-07 05:29:18','あこさん','2017.06.29'),(492,'イオン行くと必ず買う一品です。 ビールのお供にも最高で塩味もちょうどいい。罪悪感なく食べることの出来るスナックです。',5,68,'2020-10-07 05:29:18','2020-10-07 05:29:18','カツカレーさん','2017.05.07'),(493,'シンプルな味付けですが、他社のエンドウ豆スナックに劣らない美味しさです。 このfree fromシリーズのお菓子の種類がさらに増えることを期待します。',5,68,'2020-10-07 05:29:18','2020-10-07 05:29:18','宇治松さん','2017.04.30'),(494,'固め食感でザクザクとした歯ごたえ、塩だけのシンプルさでエンドウ豆の風味が引き立っているのですごく気に入りました!',5,68,'2020-10-07 05:29:18','2020-10-07 05:29:18','つっちゃんさん','2017.04.25'),(495,'ずっと気になっていてついに購入。 豆本来の味がして美味しかったです!塩がもう少し薄くても良いかもしれません。 原材料も安心でかつ安いのでまた買います!',5,68,'2020-10-07 05:29:18','2020-10-07 05:29:18','ほっぺさん','2017.04.24'),(496,'84円という価格で、サクサクおいしい!しかも余計なものが入っていない安心感。',5,68,'2020-10-07 05:29:18','2020-10-07 05:29:18','タマさん','2017.04.14'),(497,'サクサクでなくパサパサでイマイチ。しかも輸入品だった。',1,69,'2020-10-07 05:29:18','2020-10-07 05:29:18','すなっきーさん','2020.07.14'),(498,'このクッキーはラウンジでもよく食べています。チョコが濃厚でとてもおいしい。',5,70,'2020-10-07 05:29:18','2020-10-07 05:29:18','ユウさん','2020.06.19'),(499,'チョコチップが入っているのが贅沢！美味しいです。',4,70,'2020-10-07 05:29:18','2020-10-07 05:29:18','あいみさん','2020.06.12'),(500,'個包装になっているので皆で分けて食べています。 サクサクしていて美味しいです。',4,70,'2020-10-07 05:29:18','2020-10-07 05:29:18','はるちゃんさん','2020.02.15'),(501,'個包装になっているので少し甘い物が食べたくなった時に便利だし、バニラ＆チョコ２種類入っているのでお得だと思います。サクサク食感も良いしチョコ＆バニラどっちも美味しいのでよく買います。',5,70,'2020-10-07 05:29:18','2020-10-07 05:29:18','kumiさん','2019.12.30'),(502,'サクサクのクッキーの中にチョコチップの食感がとてもおいしいです。 小分けにも丁度いいし、バニラとチョコのクッキー２つの味が楽しめます。',5,70,'2020-10-07 05:29:18','2020-10-07 05:29:18','あーちゃんさん','2019.06.17'),(503,'個包装になっているので、食べ過ぎなくて、いいです。 食感がすきです。',5,70,'2020-10-07 05:29:18','2020-10-07 05:29:18','ひよこさん','2019.04.11'),(504,'チョコチップがたっぷり入って食べごたえがあります。コスパ最高です！！',4,70,'2020-10-07 05:29:18','2020-10-07 05:29:18','よしやんさん','2019.03.31'),(505,'サクサク感がとても良いです。しっかりチョコの味が生きています。価格以上の美味しさです。個包装なのでこれからの観光のお供にいいなって思います。',5,70,'2020-10-07 05:29:18','2020-10-07 05:29:18','ぽちおさん','2017.10.31'),(506,'サクサクしててチョコチップたっぷりでおいしいです! コーヒーとよく合います。 バニラもチョコもどっちも好きです。 個包装で食べやすいのも魅力。',5,70,'2020-10-07 05:29:18','2020-10-07 05:29:18','こうさん','2017.09.21'),(507,'イオンラウンジでいただきました。 サクサクでチョコチップたっぷりです。 美味しいです!',5,70,'2020-10-07 05:29:18','2020-10-07 05:29:18','noyさん','2017.09.05'),(508,'サクサク感が好きです。 一度に5枚くらいは食べたいです、 ですので、個包装でないタイプを販売してほしいです。',4,70,'2020-10-07 05:29:18','2020-10-07 05:29:18','サクサク行こうさん','2017.06.30'),(509,'値段がやすいのにおいしい!さくさくしててチョコたっぷりです。',5,70,'2020-10-07 05:29:18','2020-10-07 05:29:18','あみさん','2017.06.17'),(510,'遺伝子組換え不分別があるのが残念。 少々ねっとり感のある感じが好きです。',4,70,'2020-10-07 05:29:18','2020-10-07 05:29:18','ポップさん','2017.02.08'),(511,'チョコチップが沢山入り、クッキーがこんもり型でとてもおいしそうに見えます。袋から出して、おさらに並べてだしたいです。 遺伝子組換え不分別でなければ、★5です。',4,70,'2020-10-07 05:29:18','2020-10-07 05:29:18','いい感じさん','2016.08.08'),(512,'サクサクしていておいしいです。チョコもたっぷりで、しっとりタイプよりこちらの方が好みなのでよく買います。',5,70,'2020-10-07 05:29:18','2020-10-07 05:29:18','samapapaさん','2016.07.22'),(513,'カントリー○ームよりも大好き! チョコチップもザクザクしていておいしくて、手が止まらない! みんな食べていてすぐなくなちゃうから隠しています笑 冷やしても自分的に美味い!',5,70,'2020-10-07 05:29:18','2020-10-07 05:29:18','お菓子大好き君さん','2016.04.09'),(514,'安くてよく買います。 チョコのザクザク感がカントリー○ームより好みです! メイプル味とかあったらいいなー',4,70,'2020-10-07 05:29:18','2020-10-07 05:29:18','しんさん','2016.02.19'),(515,'クッキーのサクサク食感とチョコチップがちょうどよくて美味しい! 甘いものが食べたくなった時に食べてます!',5,70,'2020-10-07 05:29:18','2020-10-07 05:29:18','パンダさん','2016.01.02'),(516,'チョコチップがザクザク入っていておいしい!お気に入りだったのに最近店頭に置かなくなってしまった。。。',5,70,'2020-10-07 05:29:18','2020-10-07 05:29:18','てつさん','2015.12.07'),(517,'チョコチップとクッキー生地の割合がちょうどよく満足感があります。 ホットミルクにひたして食べるとさらにおいしいです。',4,70,'2020-10-07 05:29:18','2020-10-07 05:29:18','tukiyomiさん','2015.08.16'),(518,'いつも定番で購入しています。 あまり甘すぎず、昼食後のコーヒーのお供に重宝しています。',5,70,'2020-10-07 05:29:18','2020-10-07 05:29:18','とおるさん','2015.06.26'),(519,'大好きです。甘すぎなくて止まらないです。 いつも在庫が少ないからもっと入荷してほしいなぁ。',5,70,'2020-10-07 05:29:18','2020-10-07 05:29:18','みゆさんさん','2015.06.24'),(520,'サクサク食感が美味しいです。チョコチップ入りなのに甘すぎないところもお気に入りです。',4,70,'2020-10-07 05:29:18','2020-10-07 05:29:18','サイカさん','2015.06.19'),(521,'バニラはサクサク チョコは湿気ててもそもその時がある 品質管理しっかりして!',2,70,'2020-10-07 05:29:18','2020-10-07 05:29:18','もそもそさん','2015.05.19'),(522,'何度リピートして買っているか分からない位購入してます。 職場でのおやつとして食べてます。鉄分、カルシウムも入ってるので手軽なおやつとして重宝しています！',5,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','Momoさん','2020.06.03'),(523,'鉄分カルシウム補給できるそうですが、鉄臭さも感じず、美味しくいただいています。個人的にはココアの方が好きです。チョコ感がしっかりしていて美味しいです。キャラメルも美味しいですが、いくつも食べると飽きてしまいます。とはいえ美味しく鉄分カルシウムが取れるのは嬉しいです。',4,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','大仏さんさん','2020.03.31'),(524,'キャラメル味のアーモンドの食感が病みつきになるお味です♪　ココア味も美味しいので、交互に食べてあっという間に一袋開けちゃいます。とはいえ、たっぷりサイズだし、個装の中で2枚に分かれているので、かじって粉があちこちにポロポロ・・・ということもない一口サイズでおやつに最適です♪',5,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','まふまふさん','2020.01.31'),(525,'クッキーなので食べやすくて、鉄分・カルシウムが少し不足しているときにとても役に立ちます。 何度でも購入したいと思いました。',5,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','あーちゃんさん','2019.10.17'),(526,'イオンラウンジで試食して、美味しかったので購入しています。 カロリー少し高めなのでおやつで何個も‥というわけにはいきませんが。 災害用のリュックにはいつも入れてあります。',5,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','まかろんさん','2019.10.12'),(527,'イオンラウンジで、食べました。粉っぽくて、パサパサしてました。 鉄分補給になるそうですが、買わないです。',2,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','ひよこさん','2019.04.11'),(528,'友達に頂いたのですが、 食感も味も美味しくて 早速購入しました。',5,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','kao kaoさん','2019.03.06'),(529,'美味しいですし、鉄分やカルシウムが取れて、言うことないのですが、キャラメル味の方が、キャラメル味と名付けるほどのキャラメル味ではないです。',4,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','アイアンカルシウム☆さん','2017.11.22'),(530,'鉄分やカルシウムが取れるのが良いと思い購入しました。 味は・・・粉っぽいというか、何というか、うまく表現できない不思議な感じがします。 でも、決してまずい訳ではなく、鉄分やカルシウムが取れるので、次もやっぱり購入すると思います。',3,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','violaさん','2017.10.16'),(531,'味は、もうちょっと頑張ってほしいです。歯にくっつくのもちょっと。 小さい個包装で、持ち歩きにはすごく便利で、トレッキング利用にいいです。',4,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','Stonefreeさん','2017.09.03'),(532,'鉄分は鉄分の入った食材をわざわざ用意してこないと、なかなか摂取できない気がする。 このクッキーを切らさないように常備しておけば、必ず、毎日鉄分を取れるのがいいです。 もちろんおいしいです。',5,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','☆コツコツ鉄☆さん','2017.05.28'),(533,'さっくりしていますが食べごたえのあるクッキーで小腹満たしにもちょうどよいです 鉄とカルシウム入りというのもうれしいポイント イオンラウンジでいただいてからお気に入りでたまに買うようになりました ココアもキャラメルも程よい甘さで飽きないおいしさです',5,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','だいだいさん','2017.05.12'),(534,'少々ねっとりした生地の食感が好きです。 鉄とカルシウムがとれるのが魅力的です。',5,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','栄養お菓子さん','2016.12.08'),(535,'キャラメル味は大好きですが、ココア味は苦手です。同梱されていて、しかもキャラメル味の方が数が少ないというのが大変残念です。 是非、キャラメル味だけの商品を作っていただけないでしょうか。よろしくお願いいたします。',3,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','としさん','2016.11.30'),(536,'小腹がすいたときにおすすめ!! いつも行っているイオンにはなかったのですが、最近棚に並んでいるのを見て思わず2袋買ってしまいました。',5,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','ふーさん','2016.11.26'),(537,'ココアもキャラメルもおいしいです。食べやすい大きさだし、コレで鉄分が補えるのはいいですね。',5,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','ゆずさん','2016.07.20'),(538,'イオンラウンジでいただいて美味しかったので、購入しました。 ココアはチョコチップ入りの程よい甘さ。 キャラメルはアーモンドの香ばしさとキャラメルの甘い香りが絶妙です。 サクッと割って食べやすく、 鉄分とカルシウム入りで子供のおやつにも最適です。',5,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','のんさん','2016.06.26'),(539,'おいしい!',5,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','ネコさん','2016.04.09'),(540,'これは本当にいい! 鉄分は確か貧血にいいらしいからとてもいい! おいしいし!',5,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','おやつ大好き君さん','2016.04.09'),(541,'ボリュームがあって 美味しいよね。 良いな。',5,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','アレレさん','2016.03.27'),(542,'不足がちな栄養素を補えるようなので、助かるなーと思って買いました。サクサク食感はおいしかった。キャラメルの風味は人工的できつく感じた。ココアの方は、食べ過ぎてしまうので、1日の摂取量を超えてしまい、心配になりました。',2,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','鉄分カルシウム入り?さん','2016.02.10'),(543,'嬉しい鉄分とカルシウム、味も大好きです(*^_^*)',5,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','わかさん','2015.12.26'),(544,'あまり甘すぎず小腹をみたすのに丁度よい大きさです。イオンでも置いていないお店があるので、どこででも購入出来るようにしてほしいです。',5,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','ふーさん','2015.12.09'),(545,'1日当たりの鉄・カルシウムが栄養素等表示基準値の1/6含まれているのが、うれしい。 ココア時がしっかりココア味がおいしい、キャラメル味はクラッシュアーモンドが香ばしい、2種類の味が楽しめ最高。',5,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','骨元気さん','2015.12.07'),(546,'味も気に入りました。その上(鉄分等)不足しがちな栄養も付加されていて、おすすめです。パッケージがいまいちで残念です。',4,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','さん','2015.11.18'),(547,'美味しいです。ラウンジでいただいてからファンです。カルシウムも配合されているのにおいしくて、うれしいです。 特にアーモンドの入ってるキャラメル味が好き。 出来ればこちらだけの商品を販売してほしいです。',4,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','keroppiy55さん','2015.11.08'),(548,'イオンラウンジで頂いてからファンになりました。鉄分不足の私と牛乳嫌いのカルシウム不足の2歳の娘のおやつタイムにぴったり。一口サイズで、ココア味とキャラメル味を半分ずつ二人で分け合って食べてます。',5,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','花さん','2015.10.01'),(549,'このタイプのお菓子が昔から好きで、大袋のお得用がトップバリュから出て嬉しかったです。とくにアーモンド入りが美味しい!!できたらアーモンド入りだけのも販売して欲しいくらいです。ただ、ネットスーパーでは売っていないみたいなので、すごく残念です。早くネットでも販売してほしい～。トップバリュの258円シリーズ(大袋や大箱のお得用)は、すごくよく利用しているので、これからも商品をどんどん増やして欲しいです。',4,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','鶴さん','2015.09.23'),(550,'キャラメル味には、アーモンドが入っていて、特にお気に入りです。職場で、小腹が減った時につまみやすい大きさもちょうどいいです。',4,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','サイカさん','2015.06.19'),(551,'パッケージが地味で見つけにくいが、これはおすすめ。アーモンド入りのキャラメル味が特においしい。鉄分カルシウム入りなのが嬉しい。',5,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','イチゴタルトさん','2015.06.18'),(552,'イオンラウンジで食べたけど美味しかったです。 でもまだ店舗で売ってるのを見た事がない～',5,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','コヒ豆太郎さん','2015.06.11'),(553,'腎臓病は近年増加傾向にあります。 たんぱく質と塩分を制限しないといけないので、乳製品や肉や魚をたくさん食べられず、カルシウム不足になりやすい傾向があります。 なので、カルシウムや鉄分を補える物としてとても良いと思います。',5,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','おがちゃんさん','2014.03.23'),(554,'ヘルシーだからか、1袋(個包装)ではなんとなく物足りません。 チョコ味はおいしいのですが、個人的にキャラメル&アーモンドの味が好きではないので、バニラ味など一般的な味との組み合わせが出て欲しいです。',3,71,'2020-10-07 05:29:18','2020-10-07 05:29:18','popoさん','2012.09.28'),(555,'何度リピートして買っているか分からない位購入してます。 しっとりしていて味もよく、お安いのでコスパも抜群です！みんなで分け合える個包装なのもポイントが高いですね。',5,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','Momoさん','2020.06.03'),(556,'思った以上にクッキー生地がサクサクしてて、チョコチップもしっかり入って1枚でちゃんと食べ応えがあってとても美味しい！トップバリューお菓子の中で1番好きな商品です。',5,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','にゃんねこさん','2020.05.30'),(557,'友人がこれを食べて笑ってばっかりです。美味しいです。',5,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','東京さん','2020.05.22'),(558,'しっとりしていて普通に美味しいです。子供のおやつに出しています。崩れやすいのか子供が食べるとボロボロと崩れてお菓子のくずが散らかるので少し困ります。',4,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','さくっとさん','2020.03.31'),(559,'程よくしっとりしていて、満足感がある。 内容量が多く、コストパフォーマンスがよい。',5,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','するめさん','2019.03.10'),(560,'会社の打ち上げに購入しました。味も良いし、コスパ最高！！',4,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','トンさん','2019.01.22'),(561,'さっくりと表示がありますが、あんまりさっくり感は感じませんでした。しっとりはありました。',4,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','しっとりがおいしいさん','2018.03.17'),(562,'サイズも甘すぎない味も好きです。サイズの割にはチョコチップがたくさん入っていて、中のほうにかけて柔らかい食感もいいです。',4,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','トンとんさん','2017.11.23'),(563,'バニラをイオンラウンジで頂きました。普通な感じで買おうかなと思う感じではまかったです。でもチョコチップが入っているのはよかったです。',4,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','バニラさん','2017.10.30'),(564,'しっとりって程、しっとりではなかったです。 中央部分が柔らかいという感じです。 お味は美味しいです。',4,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','おかしなお菓子さん','2017.10.26'),(565,'バニラは普通。ココアは美味。 ココアの方がチョコレート感が強く、ブラックコーヒーやストレートティーと共に食べると最高に美味しい。',5,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','violaさん','2017.10.16'),(566,'サックりしていて食感が良く甘さも丁度良いです。',5,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','クッキー子さん','2017.07.16'),(567,'すごく美味しくていつも買ってます! 買いだめ!!',5,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','みさん','2017.06.14'),(568,'もう少し、大きめにしてほしい。大きめのを1度に3個くらい食べたい。',4,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','さっくり☆さん','2017.06.05'),(569,'かずが沢山入っていたので試しに買ってみましたが、粉っぽくて口に合いませんでした。 ココア味はまだマシですがバニラ味はかなり粉っぽく改良した方がいいです…',1,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','ななしさん','2017.03.10'),(570,'イオンラウンジで頂いてから美味しくて購入しました。さっくりです。バニラもチョコもどちらも美味しいです。',5,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','mmmmさん','2016.11.26'),(571,'カントリーマアムに似てると思いきや、中が全くしっとりしていなく、全体がさっくりというよりだだ固いだけの印象でした。',1,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','Anonymousさん','2016.08.20'),(572,'イオンラウンジでいつもコーヒーのお供に美味しく頂いています。 バニラもココアもどちらも中にチョコチップが入っていてしっとり食感が美味しいです。 食べやすいサイズです。',5,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','noonさん','2016.05.15'),(573,'4回購入しました。コスパの面で、ついつい安い方を選んでしまう。チョコが多いのがうれしい。でも砂糖の味がきつい。生地が安い味がしてしまう。',3,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','さっくりしっとり?さん','2016.02.10'),(574,'レビューのランキングがよかったので、試してみました。 なるほどね～!確かにさっくりしていて、美味しいですが、お値段相応に思いました。',4,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','nayutaさん','2015.11.13'),(575,'チョコがたくさん入ってて美味しいです。似たお菓子が他メーカーから発売されていますが、劣らず美味しいのに、コスパがいいです!',4,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','りんご26さん','2015.08.11'),(576,'よく、イオンラウンジでいただいています。 しっとりとさっくりのバランスがちょうどよくて 美味しいです',5,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','nonさん','2015.07.01'),(577,'バニラはしっとり、ココアはさっくり、チョコの存在感が良好です。',5,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','おはようさん','2015.06.07'),(578,'さっくりポロポロとしていて、しっとりというより粉っぽい食感です。 ココア味はあまり香りが良くなく、バニラ味の方が美味しかった。 チョコチップがたくさん入っている所が良いです。',3,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','davidさん','2015.03.03'),(579,'oisii',5,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','TVDさん','2014.05.12'),(580,'まずい!カントリーマアムなりそこない!お金出して食べる味じゃない',1,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','あみさん','2014.03.25'),(581,'しっとりしていて美味しいです。 甘党の私にとっては甘さは良いぐらいです。',5,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','ななしさん','2012.12.16'),(582,'他のクッキーより量が多くて良いのですが、中のチョコが歯に付きやすいので食べにくいです。 また、チョコが甘すぎるので中のチョコなしでもっと量を増やすか安くして頂けたら嬉しいです。',3,72,'2020-10-07 05:29:18','2020-10-07 05:29:18','popoさん','2012.09.28'),(583,'以前販売していた物に変更したみたいな感じ。1年半前から新しいのに変更して柔らかくなったなと思って味にも慣れてきて、ハマッてたのに又、変更。最初に販売していたのが硬さも味も良かったと思います。',3,73,'2020-10-07 05:29:18','2020-10-07 05:29:18','マッキーさん','2020.07.02'),(584,'熱中症の時期、糖分にはもってこい、甘さも控え目、ダイエットにも良く美味しい、88才のお婆さんも大好きです。',5,74,'2020-10-07 05:29:18','2020-10-07 05:29:18','いずこさん','2020.07.08'),(585,'口寂しい時に最適。 程よい清涼感。',4,75,'2020-10-07 05:29:18','2020-10-07 05:29:18','するめさん','2019.03.10'),(586,'適度な清涼感があり気分転換したい時はもちろん、鼻の通りが悪い時なんかもいいですよ!!',5,75,'2020-10-07 05:29:18','2020-10-07 05:29:18','まいまいさん','2017.10.24'),(587,'ミント感が控えめなので、刺激に弱い人にはお勧めです。1粒が大きいので、長持ちしていいです。すぐに食べきってしまうので、容器入りではなく袋入りなのも嬉しいです。',4,75,'2020-10-07 05:29:18','2020-10-07 05:29:18','ルミさん','2016.08.25'),(588,'大粒タイプなので1粒でミント感が長続きし、満足感があります。ミントの強さも丁度よく、ネーミングどおりにリフレッシュ出来ます。私はこのタブレットが、大好きです。',5,76,'2020-10-07 05:29:18','2020-10-07 05:29:18','トンちゃん0707さん','2019.08.27'),(589,'コストパフォーマンスがよい。 味も癖がなく、食べやすい。',4,76,'2020-10-07 05:29:18','2020-10-07 05:29:18','するめさん','2019.03.10'),(590,'35g入って198円。さらに大きくて溶けるの遅いので、コスパはバツグンだと思います。爽快感は少ないですが、私は強すぎるミント味が苦手なので、ちょうどいいです。お店で見かけたらまた買いたい!',5,76,'2020-10-07 05:29:18','2020-10-07 05:29:18','まさんさん','2016.09.05'),(591,'ストロング以前に不味いです。失敗しました。',1,77,'2020-10-07 05:29:18','2020-10-07 05:29:18','カズさん','2019.12.30'),(592,'大容量なのに、、詰め替えなので割安＆ゴミが少なくて済みエコですね。他メーカーのボトルに入れて利用してます。味もスッキリ爽やか！運転中でのリフレッシュや眠気予防になってます！',5,77,'2020-10-07 05:29:18','2020-10-07 05:29:18','ももさん','2019.07.02'),(593,'とても美味しかったです。 わがままを言えば、サイズを小さくして国産だともっといいです！',5,78,'2020-10-07 05:29:18','2020-10-07 05:29:18','アイさん','2020.06.12'),(594,'タブレットの中で一番おいしくて店でいつも売り切れ(笑)',5,78,'2020-10-07 05:29:18','2020-10-07 05:29:18','山本大車さん','2020.05.20'),(595,'一般的なサイズのものだと、１粒では満足できないのですが、こちらの商品は大きいサイズなので１粒でちょうどいいです。 味も辛すぎず甘すぎず、大好きです。',5,78,'2020-10-07 05:29:18','2020-10-07 05:29:18','ひろさん','2020.01.25'),(596,'大きいのが嬉しい。 清涼感はあるけど、甘さがちょっと残る感じがします。',4,78,'2020-10-07 05:29:18','2020-10-07 05:29:18','ＡＫＡＲＩさん','2019.11.28'),(597,'このシリーズは、好んで買っています。 どれもお手頃価格で買っていますが、とりわけ気に入っているのが、ピンクグレープフルーツ味です。一度買ったら病みつきです。',4,78,'2020-10-07 05:29:18','2020-10-07 05:29:18','OFFさん','2019.11.18'),(598,'量がたくさん入っているのと一粒でミントの満足感があるのでいいと思います。一粒でもミントが強すぎるのでミントが苦手な人にはお勧めできない商品です。',5,80,'2020-10-07 05:29:18','2020-10-07 05:29:18','リボンさん','2020.04.28'),(599,'量が多いのに値段が安いのでイオンに行ったときは必ず買います。 口の中がスッキリするので車の運転中や食事の後に食べます。 スーっとして爽快です。',5,80,'2020-10-07 05:29:18','2020-10-07 05:29:18','ほうじ茶さん','2019.08.31'),(600,'お得な商品で、パッケージが変わっても 美味しいのは変わってなくおすすめです。',5,80,'2020-10-07 05:29:18','2020-10-07 05:29:18','tatooさん','2019.08.27'),(601,'今年に入って購入した商品が物凄く臭い 香りのために購入しているのに、臭いとかありえない',1,81,'2020-10-07 05:29:18','2020-10-07 05:29:18','ミントさん','2020.04.15'),(602,'お手頃価格で量が多いのは◎ しかし非常に硬い。噛んで食べるタイプの人は要注意。',4,81,'2020-10-07 05:29:18','2020-10-07 05:29:18','ごまだれさん','2019.10.30'),(603,'最近、近くのスーパーで取り扱いがなくなり、残念です。',4,81,'2020-10-07 05:29:18','2020-10-07 05:29:18','スガッチさん','2019.09.16'),(604,'安いのに量が多くて助かっています。 ガツンとミントの辛さを感じます。 仕事の合間のスッキリしたい時によく食べます。',5,81,'2020-10-07 05:29:18','2020-10-07 05:29:18','柊さん','2019.08.09'),(605,'４種類のフルーツ味はどれも美味しいし、ハーブもいっぱい入っているのでスッとして口の中もスッキリするので気に入っています。',5,82,'2020-10-07 05:29:18','2020-10-07 05:29:18','kumiさん','2020.05.12'),(606,'4種類の味があり色々なフルーツ味が楽しめ、ハーブが入っているのでノドもすっきりします。',5,82,'2020-10-07 05:29:18','2020-10-07 05:29:18','ワ王さん','2020.01.14'),(607,'家族からリクエストされる飴です。遺伝子組換え不分別が残念。',4,83,'2020-10-07 05:29:18','2020-10-07 05:29:18','有意義黒糖さん','2019.04.15'),(608,'イオンラウンジで出ていた、黒糖飴(^^)とても美味しかって、すぐに探して購入しました。美味しいですよ。',5,83,'2020-10-07 05:29:18','2020-10-07 05:29:18','ますPさん','2018.08.20'),(609,'沖縄県産黒糖のじゃりじゃり感を感じます。それがいい感じです。 遺伝子組換え不分別が残念です。',4,83,'2020-10-07 05:29:18','2020-10-07 05:29:18','黒糖の恩恵さん','2017.11.23'),(610,'中に黒砂糖が入っていて、一粒で二度楽しめる感じが好きです。黒砂糖は甘味が強いというかコクがあるので、満足感も得られる気がします。こちらの商品は大きすぎないのもいいです。',5,83,'2020-10-07 05:29:18','2020-10-07 05:29:18','空さん','2017.06.30'),(611,'沖縄黒糖使用で美味しく、疲れたときに口にすると、黒糖が陣割体に浸透して、疲れをいやす気がします。 遺伝子組換え不分別残念。',4,83,'2020-10-07 05:29:18','2020-10-07 05:29:18','沖縄黒糖は太陽の恵みさん','2017.05.18'),(612,'丁度いいサイズでついつい食べてしまします。 車中に置いていても特にドロドロに溶けたりしなかったので飴はいつもコレを買っています。',4,83,'2020-10-07 05:29:18','2020-10-07 05:29:18','まめ太さん','2016.11.21'),(613,'水あめが入っているとの事で、喉に感じるくらいかと期待したが、そうでもなかった。 沖縄黒糖の良質の味がする。',4,83,'2020-10-07 05:29:18','2020-10-07 05:29:18','沖縄ーいさん','2016.10.16'),(614,'黒飴の中に黒砂糖などが入っていて(飴で包んである感じ)、とっても満足感のある飴です。お腹が空いた時、口の中でゆっくりと溶かしていると、自然に空腹感がおさまって助かります。甘さもちょうど良いですし、98円で買えてありがたいです。',5,83,'2020-10-07 05:29:18','2020-10-07 05:29:18','みかんさん','2016.05.07'),(615,'この手の二重になっている黒糖飴が好きで、トップバリュ品が出る前からよく買っていました。トップバリュの品は、以前食べていたのと違い植物油脂が入っていないので嬉しいです。量的にも価格的にもそう変わらないと思うので、これからはこちらを買いたいと思います。',4,83,'2020-10-07 05:29:18','2020-10-07 05:29:18','瑞穂さん','2016.01.16'),(616,'普段はノンシュガーの飴を色々買っています。フルーツタイプの中ではやや独特の味ですが飽きがこなくて自分は好きです。「21種類のハーブエキス入り」と体にも良さそう。価格も手頃で買いやすいですね(o^-\')b',4,84,'2020-10-07 05:29:18','2020-10-07 05:29:18','ほっこりイオン君さん','2020.06.29'),(617,'味が10種類と多く、コスパも良い。',4,85,'2020-10-07 05:29:18','2020-10-07 05:29:18','あらちゅんさん','2020.05.24'),(618,'小粒ですが、フルーツの味がしっかりしてて美味しいです。 10種類も入っているので選ぶのも楽しいです。',5,85,'2020-10-07 05:29:18','2020-10-07 05:29:18','家猫屋さん','2019.08.04'),(619,'シンプルなハッカ飴ですが、飽きずに美味しいのでお気に入りです。 価格が安いのもうれしいです。',5,86,'2020-10-07 05:29:18','2020-10-07 05:29:18','めぐみさん','2020.06.09'),(620,'口の中がスッキリするし、美味しいです。はっか飴はこの商品が一番気に入って買っています。',5,86,'2020-10-07 05:29:18','2020-10-07 05:29:18','kumiさん','2020.01.02'),(621,'美味しい。ついつい食べすぎてしまいます。',5,86,'2020-10-07 05:29:18','2020-10-07 05:29:18','ぶぅちゃんさん','2019.03.25'),(622,'シンプルな材料ではっかが自然な味でおいしい。 色々のどあめがありますが、せきがとまりやすいように思います。 お店に行くと必ず買います。お安いのもうれしい。 これからも取り扱いをお願いします。',5,86,'2020-10-07 05:29:18','2020-10-07 05:29:18','エムさん','2019.02.17'),(623,'シンプルイズベストでハッカ飴しか買わない 夏は清涼感、冬は喉を潤す、これからも買い続ける商品でしょう',5,86,'2020-10-07 05:29:18','2020-10-07 05:29:18','はるさん','2019.02.02'),(624,'頭が痛い時に これを口に入れると すっきりして 痛みがやわらぎます',5,86,'2020-10-07 05:29:18','2020-10-07 05:29:18','yapooさん','2018.12.29'),(625,'程よいハッカの風味が口の中で広がり、朝起きた時や臭いの強い食べ物を食べた後等には心地よい爽快感が得られます。',4,86,'2020-10-07 05:29:18','2020-10-07 05:29:18','るきやんさん','2018.11.23'),(626,'ハッカの飴は苦手なものが多いのですが、この飴はハッカが強くなく、甘さも程よくて食べやすいですね。一つずつ個包装されているのも嬉しいですし、パッケージもシンプルでいいと思います。',5,86,'2020-10-07 05:29:18','2020-10-07 05:29:18','ももさん','2018.11.06'),(627,'はっかも辛すぎず、甘さも控えめで飽きない味です。個包装も透明な袋に入っているのでシンプルな感じが良いと思いました。',5,86,'2020-10-07 05:29:18','2020-10-07 05:29:18','ラッキーさん','2018.09.30'),(628,'ハッカのすっきり感と程良い甘さのあめ。形は扁平なので、のどに詰まる心配も和らぐと思います。量も多すぎないので余って困ることもないです。',4,86,'2020-10-07 05:29:18','2020-10-07 05:29:18','こおもさん','2018.09.19'),(629,'シップの匂いがしない昔ながらのハッカ飴を探してました。 しかも安くて美味しいです。',5,86,'2020-10-07 05:29:18','2020-10-07 05:29:18','ヨッチさん','2018.05.23'),(630,'TOPVALUさんのハッカ飴が一番好きです！湿布っぽい匂いがしないのと、ちょうどいい甘さと清涼感が最高です。',5,86,'2020-10-07 05:29:18','2020-10-07 05:29:18','apeachさん','2018.03.28'),(631,'これ美味しいね 甘さ控えめでハッカの風味がたまらん',5,86,'2020-10-07 05:29:18','2020-10-07 05:29:18','腹出しさん','2017.11.20'),(632,'お手頃な金額で、爽快な飴で大好きです♪',5,86,'2020-10-07 05:29:18','2020-10-07 05:29:18','reonaさん','2017.07.15'),(633,'ハッカの香りと、すぅ～っとする感じが好きです。甘味もしっかりしていますし、刺激が強すぎず弱すぎずな感じがとてもいいです。シンプルな原材料なので安心感もあります。これからも販売しつづけて欲しい品です。',5,86,'2020-10-07 05:29:18','2020-10-07 05:29:18','seiさん','2017.06.30'),(634,'ハッカ飴にはまり、いろいろな会社のものを試しましたが、1番美味しいと思いました! しかも価格もお手頃でとても大好きです。 いつまでも店頭にあることを願います!',5,86,'2020-10-07 05:29:18','2020-10-07 05:29:18','おでんさん','2016.08.03'),(635,'私は、胃が痛い時にミント系のものを摂るとよくなるので、こちらのハッカ飴を買ってみました。スースー具合も甘さもちょうど良かったです。シンプルな素材でできているので安心ですし、これから花粉症の季節になると大活躍すると思います。',5,86,'2020-10-07 05:29:18','2020-10-07 05:29:18','みきさん','2016.01.16'),(636,'理想のハッカ具合でなおかつ手頃な金額で購入できる喜びをかみしめています。 ハッカ味は好き嫌いが結構分かれてるイメージがあるので生産中止の心配も合わせて思うのですがずっと店頭に並んでいて欲しいです。',5,86,'2020-10-07 05:29:18','2020-10-07 05:29:18','はっかさん','2015.09.07'),(637,'シンプルな原材料、そして安価、それでいてハッカの清涼感もちゃんとする、おいしい飴です。 春日井のハッカ飴と同じくらいおいしいです。',5,86,'2020-10-07 05:29:18','2020-10-07 05:29:18','そよかぜさん','2015.02.28'),(638,'あっさりした甘みで、ガリガリ噛めるのでストレス解消です。',5,87,'2020-10-07 05:29:18','2020-10-07 05:29:18','ｐｏｏｈさん','2018.10.07'),(639,'形がふぞろいで、それがまたいい味をだしています。',5,87,'2020-10-07 05:29:18','2020-10-07 05:29:18','hanahanaさん','2018.09.06'),(640,'食事を摂る暇がなくてエネルギー切れを起こしたようなときに、さっと取り出して舐めてます。食感がひんやりとしていて、すっきりとした甘みの氷砂糖は、単なるキャンディーとしても美味しくて好きです。',5,87,'2020-10-07 05:29:18','2020-10-07 05:29:18','星さん','2017.06.30'),(641,'甘ちょばく美味しい。夏場は必ず毎日熱中症対策で舐めていました。売り場で欠品が多く、買い物に行くとなく残念な思いをした事が何度もあります。',5,88,'2020-10-07 05:29:18','2020-10-07 05:29:18','ちかちゃんさん','2019.04.29'),(642,'塩の味がもっとする方がいいです。 甘ったるいかんじでした。 甘しょっぱい感じの方が、猛暑にはいいと思います。',3,88,'2020-10-07 05:29:18','2020-10-07 05:29:18','もうどう暑ようさん','2018.07.24'),(643,'天然の海水から作られた塩が使われているためか、塩味がマイルドで甘みと絶妙にマッチしていますね。塩以外は砂糖と水あめだけなのに、なぜか甘さがきつくなくほどよいので、飽きることがありません。たいていの飴は甘すぎるので、１粒を食べきることができないのですが、このしお飴は、最後まで舐めることができます。大きさも小さめなので、一口だけ欲しいときに調度よいですね。個包装なのも持ち運びに便利です。たくさん入って１００円しないので、リーズナブルだと思います。',5,88,'2020-10-07 05:29:18','2020-10-07 05:29:18','かえでさん','2018.06.16'),(644,'長崎県五島灘の海水から作られた塩を使用しているとのことで、科学塩を避けている私にはとてもありがたい品です。これからの季節、汗をかくことが多くなるので、熱中症対策にも役立てたいと思います。甘さも丁度よく、個包装で持ち歩きに便利なのもグッドですね。',5,88,'2020-10-07 05:29:18','2020-10-07 05:29:18','moririnさん','2017.06.30'),(645,'熱中症対策にシンプルな味のしお飴を探していて、見つけました。甘さもほどよいです 個包装になっているので持ち運びにも便利でした。',5,88,'2020-10-07 05:29:18','2020-10-07 05:29:18','かあやんさん','2017.01.17'),(646,'飴を食べると鼻から喉にスーッと抜ける感じが強くもなく丁度良いので気に入っています。',5,89,'2020-10-07 05:29:18','2020-10-07 05:29:18','kumiさん','2020.07.15'),(647,'鼻に抜けるミントの強さが丁度良いです。ノンシュガーであることも気に入って花粉の飛ぶ季節には常にバッグに入れて持ち歩いています。',5,89,'2020-10-07 05:29:18','2020-10-07 05:29:18','どっとゆうさん','2020.06.10'),(648,'のど飴だけど、鼻飴っていうぐらい　鼻がすうっと通ります。しかも他社の鼻のど飴のように強烈じゃなくて　ちょうどいいです。　花粉症の時期はこれがないと困る！　常に持ち歩いています。　欠点は、包装がパツパツまで飴が入っているので（太っ腹ですが）、破って取り出しにくいこと。',5,89,'2020-10-07 05:29:18','2020-10-07 05:29:18','kokoさん','2019.05.03'),(649,'いろいろなガムを食べてきましたが、ミントが強すぎるたりフルーツガムを食べてみたりしたのですが、自分には合いませんでした。 だけどこのガムは自分に合っていておいしかったのでこの商品がある限り何度でも購入したいです。',5,90,'2020-10-07 05:29:18','2020-10-07 05:29:18','リボンさん','2020.04.18'),(650,'味が薬品臭くてダメでした。',2,90,'2020-10-07 05:29:18','2020-10-07 05:29:18','けんじさん','2019.09.21'),(651,'何度噛んでもガムが歯にくっつきにくく気分悪い時に噛むと ミントの香りも強くなくて気分も良くなりました。 噛むと最初はミントの香りが強く噛んでいくと弱くなります。',5,90,'2020-10-07 05:29:18','2020-10-07 05:29:18','あーちゃんさん','2019.06.09'),(652,'値段が手ごろなので家にあるボトルに詰め替えて噛んでいます。',3,91,'2020-10-07 05:29:18','2020-10-07 05:29:18','ともさん','2019.08.29'),(653,'安くて良いのですが、他のガムに比べると、直ぐ歯にガムがくっつく。不愉快です。',2,91,'2020-10-07 05:29:18','2020-10-07 05:29:18','けいちゃんさん','2019.02.27'),(654,'お得感はあるけど 味がすぐなくなる',3,91,'2020-10-07 05:29:18','2020-10-07 05:29:18','ゆぅさん','2016.02.13'),(655,'2,３分で溶けていって噛みごたえがない。 一度に複数食べてるので定番のガム買った方がCPと満足度良い。',1,92,'2020-10-07 05:29:18','2020-10-07 05:29:18','MKさん','2019.04.25'),(656,'主人が禁煙してからずっとお世話になっています。袋入りでエコですし、味も気に入っている様子です。トップバリュ価格で助かります。',4,92,'2020-10-07 05:29:18','2020-10-07 05:29:18','ビワママさん','2016.02.22'),(657,'噛み応えがなく、味もすぐになくなった',2,92,'2020-10-07 05:29:18','2020-10-07 05:29:18','ピッグさん','2015.12.13'),(658,'余りの口に残るの不味さに途中で捨てました。ストロング以前の問題。',1,93,'2020-10-07 05:29:18','2020-10-07 05:29:18','あいんずさん','2020.02.10'),(659,'食感がヌガーみたいだし 後味が いつまでも変な味が口に残る気がします。 他の方の評価が まずまずなので 驚きました。 某メーカーのキシリトールガムより安いので買ってみましたが 同じ感じだと 勝手に想像して買ったのが間違いだったようです。 似たようなものではなく コレはコレだと思って食べましたが ミントの感じも嫌いな味でした。 残念ながら一度食べた後、残りに手がのびません。 ミント系のガムを食べた後に 速攻で歯磨きしたくなったのは 初めてです。 評価がいいようなので私だけかもしれません。',1,93,'2020-10-07 05:29:18','2020-10-07 05:29:18','ももんがさん','2019.09.03'),(660,'有名ブランドの眠気覚ましガムより全然良い。',5,93,'2020-10-07 05:29:18','2020-10-07 05:29:18','ドライバーさん','2018.12.02'),(661,'ストロングミントの刺激で眠気が飛び、鼻がスースーして気持ちいいです。味が長持ちするようになったのが嬉しいです。',5,93,'2020-10-07 05:29:18','2020-10-07 05:29:18','空さん','2017.05.30'),(662,'ブランド品ほど強烈な刺激ではないけど味も味の持ちもいいし安いので重宝しています。ただ運転中に噛むので取り出しやすいように空き瓶に詰め替えてます。',5,93,'2020-10-07 05:29:18','2020-10-07 05:29:18','もも太郎さん','2017.04.25'),(663,'安いので購入しました。ストロングというので期待していたのですが、あまり感じられなかった。',4,93,'2020-10-07 05:29:18','2020-10-07 05:29:18','☆きゃんちゃんさん','2016.05.26'),(664,'改良されたようで味が持続するようになった気がします。',5,93,'2020-10-07 05:29:18','2020-10-07 05:29:18','ひさん','2016.03.19'),(665,'安いのが良いです。',5,93,'2020-10-07 05:29:18','2020-10-07 05:29:18','おかずさん','2016.02.18'),(666,'ちょっとやわらかすぎません? もっと噛みごたえある方が良いです。',2,93,'2020-10-07 05:29:18','2020-10-07 05:29:18','なななさん','2016.02.13'),(667,'外側のコーティングが若干柔らかい気がしますが、それ以外は気になりません。味も問題なし、持続性も問題なし。おすすめです。',4,93,'2020-10-07 05:29:18','2020-10-07 05:29:18','ケイスケさん','2016.01.31'),(668,'ずっと前からこのお味が一番好きで何度もリピートしています。',4,94,'2020-10-07 05:29:18','2020-10-07 05:29:18','ともさん','2019.08.29'),(669,'安いしとてもおいしいです。 特にコーヒーを飲む前に噛むと、コーヒーがとてもおいしく感じました。',2,94,'2020-10-07 05:29:18','2020-10-07 05:29:18','ケーキさん','2018.10.09'),(670,'長く噛んでると喉の奥に違和感が生じます。 飲み込んでないのに、喉にガムが詰まったような感じ。 しかもそれが長く取れなくてすごくいやです。 そこさえ改善されれば普通においしい。',1,94,'2020-10-07 05:29:18','2020-10-07 05:29:18','どこかのだれかさん','2018.06.17'),(671,'国産じゃないとこがきになります。 国産で安価な製品をだしてください',3,94,'2020-10-07 05:29:18','2020-10-07 05:29:18','ラブラさん','2018.02.17'),(672,'コンビニのより安くてたくさん入っているので惜しみなく噛めます。キシリトールで虫歯予防してます。',4,94,'2020-10-07 05:29:18','2020-10-07 05:29:18','kaniさん','2017.01.10'),(673,'子供たちに大人気です。おすすめですよ。',5,94,'2020-10-07 05:29:18','2020-10-07 05:29:18','ケイスケさん','2016.01.31'),(674,'量がたっぷり入っているので、家族みんなで食べても1か月はもちます。ボトルタイプより安くてお得ですし、味が3種類楽しめるのもGoodです。',5,94,'2020-10-07 05:29:18','2020-10-07 05:29:18','mioさん','2015.11.27'),(675,'夫が禁煙してからガムをかむようになり大量にいります。コンビニで小さい物を買うと高かったですが、これは個包装ではなく長持ちしますし種類もあるので助かります。',4,94,'2020-10-07 05:29:18','2020-10-07 05:29:18','サチさん','2015.11.26'),(676,'なんかクスリ臭く人工的な味がしてダメでした。',2,95,'2020-10-07 05:29:18','2020-10-07 05:29:18','ぴっちょさん','2019.08.08'),(677,'ドライマウス対策で よくガムを噛んでいます。 シュガーレス、キシリトール配合、フラボノイド入りと表示されているので 良いのかなと思い購入しました。 ミント味も強くなく ちょうど良い味で 口臭予防にもなりそうです。 価格もボトルで売っている商品より安いので 再び購入しました。',5,95,'2020-10-07 05:29:18','2020-10-07 05:29:18','ガムガムさん','2019.07.04'),(678,'フラボノイド入りということで、口臭にも効きそうな感じがしてこちらを買ってみました。ペパーミント味ですが、辛さはあまりなく、甘さがあって美味しかったです。食後の歯のためにキシリトールガムを探していましたが、空腹感を感じたときにも役立ちそうです。',5,95,'2020-10-07 05:29:18','2020-10-07 05:29:18','mirumiruさん','2016.12.26'),(679,'フラボノイドとキシリトールが入ったガムなので、虫歯予防や口臭予防に適していると思います。味もペパーミントで爽やかです。いつもボトル入りを買っていたのですが、こちらは袋入りなのでゴミが少なくて助かります。これからはこれを詰め替え用として購入したいなと思います。',5,95,'2020-10-07 05:29:18','2020-10-07 05:29:18','さこさん','2016.06.10'),(680,'食感が抜群で、とてもおいしいです。お値段もお手ごろで、我が家では、小５娘のおやつとして大活躍です。',4,96,'2020-10-07 05:29:18','2020-10-07 05:29:18','ＷＷＨさん','2020.06.24'),(681,'久しぶりに食べるとおいしい。小麦粉不使用のバージョンがあるとアレルギーでも食べられるのに～',4,96,'2020-10-07 05:29:18','2020-10-07 05:29:18','poohさん','2020.06.17'),(682,'黒糖も好きですが 断然白かりんとうが好きです。 カリサクとした歯応えもいいし お茶にもコーヒー紅茶にも合うので 我が家では登場回数が多いです。',5,96,'2020-10-07 05:29:18','2020-10-07 05:29:18','ぷくさん','2020.06.06'),(683,'さくさくっとして歯応えがあり美味しいです。しっかりと甘さがあり、お茶と一緒に食べるとほっと一息つけます。美味しすぎて手が止まりません！',5,96,'2020-10-07 05:29:18','2020-10-07 05:29:18','ピンキーさん','2020.05.16'),(684,'手頃なお値段で何度も購入しています。黒糖味が好きで、一度で食べきります。',5,97,'2020-10-07 05:29:18','2020-10-07 05:29:18','ゆまさん','2020.07.21'),(685,'美味しくてやわらかめのかりんとう。',5,97,'2020-10-07 05:29:18','2020-10-07 05:29:18','コクトウさん','2020.06.11'),(686,'懐かしい感じのシンプルな味です。 困るのは手が止まらないこと！ 美味しすぎます。',5,97,'2020-10-07 05:29:18','2020-10-07 05:29:18','GAOさん','2020.06.10'),(687,'黒糖味のかりんとうが好きで何度も購入してしまいます。 歯触りも良くボリューム感もあって小腹が空いた時にオススメです。',5,97,'2020-10-07 05:29:18','2020-10-07 05:29:18','kingさん','2020.06.10'),(688,'シンプルな昔ながらの黒糖かりんとうだと思います。黒糖のやさしい甘みがgood。かりんとう本体の太さも適度で食べ応えがあって良かったです。',5,97,'2020-10-07 05:29:18','2020-10-07 05:29:18','erinさん','2020.05.31'),(689,'サクサク食感で美味しいです。ちょっと甘い物が食べたい時に丁度いいおやつになります。',5,98,'2020-10-07 05:29:18','2020-10-07 05:29:18','kumiさん','2020.06.22'),(690,'ほんのり甘く、食べ始めたらやめられないおいしさです。ときどき無性に食べたくなります。食感がとてもいいです。',5,98,'2020-10-07 05:29:18','2020-10-07 05:29:18','MMMさん','2020.06.17'),(691,'食感がとても良かったです。ほんのりとした味わいがおいしかったです。',5,98,'2020-10-07 05:29:18','2020-10-07 05:29:18','ほろほろさん','2020.05.06'),(692,'こちらの品はイオンラウンジで出していただき、はじめて知りました。 オーソドックスな醤油せんべいですが、たまり醤油独特のコクが感じられ、とても美味しかったです。 気に入ったので、さっそく購入してしまいました。',5,99,'2020-10-07 05:29:18','2020-10-07 05:29:18','しましまさん','2020.01.17'),(693,'濃厚な醤油味とごまの食感が好きです♪',4,100,'2020-10-07 05:29:18','2020-10-07 05:29:18','YUさん','2020.07.20'),(694,'まさに、昔ながらのお煎餅という感じです。ゴマがアクセントになっていて美味しかったです。',4,100,'2020-10-07 05:29:18','2020-10-07 05:29:18','とことんこさん','2019.05.19'),(695,'SNSでこちらのせんべいを見つけました。初めて食べたのですが、ピーナッツと生地の具合がちょうど良くて、気にいりました。2枚1セットで6個入っていたので、もう少し数が少ないものや、1枚ずつ個包装されているものがあればいいと思います。',5,101,'2020-10-07 05:29:18','2020-10-07 05:29:18','かわきょうさん','2020.04.16'),(696,'個包装が開けにくいと他の方のレビューがあったので心配していましたが、刃物を使わないでも、裏側から引っ張るとすぐに開きました。 特に開けにくいとは感じなかったので、改善されているのかもしれません。 味は他の方も言われてる通りで、卵とピーナツの風味が良く、大満足でした。 リピ確定です。',5,101,'2020-10-07 05:29:18','2020-10-07 05:29:18','トリンカさん','2019.08.22'),(697,'味はおいしくて、濃い緑茶にもコーヒーにも合います。 職場の休憩所によく置いてあります。 ただ、ひとつだけ言わせてもらうと、2枚が1包装になっていて、1枚が割と大きめなので、2枚じゃなくて1枚ずつの個包装が食べやすいかなと思いました。',5,101,'2020-10-07 05:29:18','2020-10-07 05:29:18','ミンティーさん','2019.07.05'),(698,'小麦粉と卵を使った卵せんべいのようなほんのり甘い、素朴な、どこか懐かしさを感じずにはいられないそんなせんべいです。 一見固そうに見えますが意外にそうでもなくしとっさくっとした食感です。 中にはピーナツも入っており、香ばしさと歯ごたえをプラスしてくれてます。せんべいそのものとピーナツの異なる食感をたのしめることや、ピーナツの香ばしさ、せんべいの風味がよくて、気に入ってよく食べています。',5,101,'2020-10-07 05:29:18','2020-10-07 05:29:18','MONOさん','2019.05.31'),(699,'卵の風味がしっかりとしていて、思ったよりも固くなくて食べやすいです。 濃い緑茶にも、コーヒーにも合うので、お茶うけにピッタリ。常備しています。',5,101,'2020-10-07 05:29:18','2020-10-07 05:29:18','コスパ子さん','2019.04.22'),(700,'良かった点:年配の家族が、同様の他社製品が好きなのです が、私はイオンの商品を信頼と価格で比べた結 果、選んで買ってあげました。 味は焼き上げのむらがなく、焦げた風味もな く、卵の粉末材の味がして、まあまあ良かった です。 遺伝子組み換え情報が、きちんと載っているの は良かったです。 悪かった点:包装材(シュリンク)が、刃物を使わないと開 封できません!!開け方を図入りで親切に表示 して くれてはありますが、到底無理、不可能 です。 年配の家族も、開封に難儀しておりました。 いまどき、ここまで不親切なシュリンクで包装 したお菓子を出荷していること自体、驚きで す。お願いですから、せめて年配のお客が刃物なしで開封できるように、お菓子の個包装を改良していただきたいです。あと、未開封の個包装菓子が湿気やすいです!',1,101,'2020-10-07 05:29:18','2020-10-07 05:29:18','個包装の改良を希望さん','2017.07.01'),(701,'残念ながら歯ごたえが、もう少しあった方が好みです。',3,101,'2020-10-07 05:29:18','2020-10-07 05:29:18','爺さん','2017.05.04'),(702,'昔ながらの懐かしいお味です。 食べたらまた買いたくなります。 日本人の作るお菓子は、世界のどこにも負けません!',5,101,'2020-10-07 05:29:18','2020-10-07 05:29:18','ららんさん','2016.09.11'),(703,'ピーナッツ入りお煎餅、大好きです。こちらのは、ちょっとしっとりした感じがあって、歯や歯茎の弱い人でも食べられるかもしれません。ピーナッツが焙煎してあるからか、香ばしさがあります。牛乳と一緒に食べるのが好きです。',4,101,'2020-10-07 05:29:18','2020-10-07 05:29:18','ちかさん','2016.06.23'),(704,'ずーっと食べているがここ最近はパリット感が少なく感じている。福岡県の工場製品。乾燥?不十分と思う。ピーナッツ入りせんべい。',3,101,'2020-10-07 05:29:18','2020-10-07 05:29:18','ひま爺さん','2015.09.10'),(705,'とっても美味しい。本当においしい!!大好きなお菓子のひとつです。 言葉で説明するのがむずかしい独特の食感で、和風のクッキー?洋風のおせんべい?のような、優しい味のお菓子です。',5,101,'2020-10-07 05:29:18','2020-10-07 05:29:18','こぐまさん','2015.08.14'),(706,'安いし美味しいし、食べ始めたら辞められない止まらない。飲み物も問わず何にでも合うのでオススメです。',5,102,'2020-10-07 05:29:18','2020-10-07 05:29:18','kumiさん','2019.03.09'),(707,'はちみつとさつまいもの甘さ、カリカリの食感がたまらない! ジッパー付きで保存に便利ですが、保存する間もなくあっという間に食べきってしまうくらい大好きなおやつです。',5,102,'2020-10-07 05:29:18','2020-10-07 05:29:18','hakoさん','2017.06.14'),(708,'上品な甘さ。細身のスティック。はちみつ入りなのでまろやかさも感じます。美味しい。',5,102,'2020-10-07 05:29:18','2020-10-07 05:29:18','けんぴさん','2017.04.08'),(709,'安くておいしいです。でもカロリーがちょっと気になるかな。',4,102,'2020-10-07 05:29:18','2020-10-07 05:29:18','abeさん','2017.02.23'),(710,'食べだしたら止まらない、お茶にもコーヒーにもあいます。',5,102,'2020-10-07 05:29:18','2020-10-07 05:29:18','じぇーんさん','2017.02.13'),(711,'甘味あっさりで美味しいです。 芋の食感も堅すぎず柔らかすぎずちょうどよい!',5,102,'2020-10-07 05:29:18','2020-10-07 05:29:18','いも子さん','2017.01.23'),(712,'トップバリュのかりんとうが大好きで毎日食べても飽きないくらい、あっという間に一袋食べてしまうので、こちらの食べきりサイズ５袋入りを買ってみました。味は同じで美味しいんですが、表紙のかりんとうの写真を見て、いつものより若干少し細いかなって思ってみたら、いつものと変わらずの太さだったので少しガッカリしました。もう少し細くてもいいかも。',4,103,'2020-10-07 05:29:18','2020-10-07 05:29:18','kumiさん','2019.05.03'),(713,'美味しいし、５種類の味が楽しめて食べだすと止まらなくなってしまうくらい気に入っています。特に胡麻かりんとうが美味しいです。',5,104,'2020-10-07 05:29:18','2020-10-07 05:29:18','kumiさん','2019.05.01'),(714,'いろいろな味が楽しむことができるので飽きません。あっさりした味でこれからも長く楽しむことができそうな商品だなぁと思いました。',4,104,'2020-10-07 05:29:18','2020-10-07 05:29:18','ぽりまるさん','2018.12.05'),(715,'丁度よい甘さで、量も適量　価格もお財布に優しいので、購入しやすいです。',5,105,'2020-10-07 05:29:18','2020-10-07 05:29:18','フーさん','2018.09.16'),(716,'大きく太いサイズが食べ応えがあって良いです。',3,105,'2020-10-07 05:29:18','2020-10-07 05:29:18','天下一さん','2017.12.05'),(717,'えびせん大好きです。 サクサクとした食感と海鮮の香りがいいですね。 おやつとしてだけでなく、お酒のおつまみになるがいいですね。',4,106,'2020-10-07 05:29:18','2020-10-07 05:29:18','ナマステさん','2020.06.06'),(718,'小腹が空いた時や子供のおやつにおススメです。 味もしっかりした味で食べ始めると止まらなくなります。 値段もお手頃で買いやすいです。',5,107,'2020-10-07 05:29:18','2020-10-07 05:29:18','もりさん','2018.11.17'),(719,'薄緑色のせんべいが私が大の苦手なわさび味がして吐き出してしまいました。 袋の裏を見たら原材料に記載されていないようで、何故？と思いました。 その薄緑色以外は大変おいしくいただきました。',2,109,'2020-10-07 05:29:18','2020-10-07 05:29:18','monaさん','2020.06.08'),(720,'９種類の味の海鮮せんべいを味わうことができて量もいっぱい入っていてお得で安いのでよく買っています。どれも美味しいです。',4,109,'2020-10-07 05:29:18','2020-10-07 05:29:18','kumiさん','2019.05.21'),(721,'あまり種類のない海鮮せんべいの中でもお値段もお手頃でしっかりと海鮮を味わえる物だと思います。イオンに行けばいつでも買えるのが気に入りました。',5,109,'2020-10-07 05:29:18','2020-10-07 05:29:18','みっきーさんさん','2018.05.21'),(722,'ちょうどよい塩加減なので、つい何枚も食べてしまうおせんべいです。職場で疲れて塩気が欲しい時によく食べています。',5,110,'2020-10-07 05:29:18','2020-10-07 05:29:18','Momoさん','2020.06.03'),(723,'しょっぱいと言っている方もいますが、私的には酒のツマミで丁度いい味でおいしかったです！',5,110,'2020-10-07 05:29:18','2020-10-07 05:29:18','なつさん','2020.01.06'),(724,'ものすごくしょっぱいです！ 主人に「病気にする気か？」と言われてしまいました。 １枚食べるのがやっと。私も家族も誰も食べません。残ってしまったのはどうしましょう。残念です。',1,110,'2020-10-07 05:29:18','2020-10-07 05:29:18','sailaさん','2019.10.29'),(725,'塩味が濃すぎます!鰹と昆布の味わいより、塩の味わいが強烈すぎ。口どけが悪い!(この商品評価が分かれそうですね。)',1,110,'2020-10-07 05:29:18','2020-10-07 05:29:18','爺さん','2017.07.08'),(726,'自分にとってはベストな塩加減です。こういった塩味をうたっているお煎餅で稀に殆ど塩が効いていないものがありますが、この商品は満足できる塩味です。塩味のものが食べたい時はこのくらい効いていた方がいい。美味しかったです。',5,110,'2020-10-07 05:29:18','2020-10-07 05:29:18','ななよしさん','2017.04.24'),(727,'えびの風味がいいですね。食べ始めるとやめられない美味しさです。いい塩加減です。',5,110,'2020-10-07 05:29:18','2020-10-07 05:29:18','mmmmさん','2016.11.26'),(728,'”海藻からのうまみを凝縮した藻塩で味付けし、かつおと昆布のパウダーでうまみをきかせた”なんて海の恵みで美味しくなっているんですね。',4,110,'2020-10-07 05:29:18','2020-10-07 05:29:18','恵みに感謝さん','2016.10.25'),(729,'えびの風味と食感がいいかんじです。 値段もやすい。',4,110,'2020-10-07 05:29:18','2020-10-07 05:29:18','あべしさん','2016.04.27'),(730,'えびのかおりがいい。 おかきのふわっとした食感も好きです。 菜種油との相性もいいのですが、植物油脂(なたね):遺伝子組換え不分別が評価5を3にしています。',3,110,'2020-10-07 05:29:18','2020-10-07 05:29:18','えびふわさん','2016.02.24'),(731,'えびの味が美味しい。食感も良いと思います。',5,110,'2020-10-07 05:29:18','2020-10-07 05:29:18','tanisiさん','2016.02.11'),(732,'塩気が強くて辛すぎる! あともう少しほわっと感がほしい!',2,110,'2020-10-07 05:29:18','2020-10-07 05:29:18','ゆんばんさん','2016.01.17'),(733,'食感もえびの味も大好きですが塩味がきつすぎるように思います。表面の塩を落としていただきました。',2,110,'2020-10-07 05:29:18','2020-10-07 05:29:18','えびせんさん','2015.09.16'),(734,'味も食感も好き。でも塩が、もう少し控え目だといいな。',3,110,'2020-10-07 05:29:18','2020-10-07 05:29:18','みつまめさん','2015.07.24'),(735,'びっくりするほどしょっぱく、お塩を振りすぎのようなきがします。',5,110,'2020-10-07 05:29:18','2020-10-07 05:29:18','さん','2015.07.15'),(736,'食感と味はいいのですが塩分が少し強い気がします!',3,110,'2020-10-07 05:29:18','2020-10-07 05:29:18','やっさんさん','2015.05.18'),(737,'塩味とえびの香りが口の中に広がります。 ふわふわでおいしいです。',5,110,'2020-10-07 05:29:18','2020-10-07 05:29:18','さん','2015.04.20'),(738,'ありえないぐらい、しょっぱい! 表面洗って食べました',1,110,'2020-10-07 05:29:18','2020-10-07 05:29:18','さん','2015.04.18'),(739,'ふんわり軽くとてもくせになるおいしさです。 しょっぱさも丁度よく、これからの季節、ビールのつまみにも最高だと思います。子供も大好きで、親子三人で、ぺろっとたべてしまいます。',5,110,'2020-10-07 05:29:18','2020-10-07 05:29:18','トモアさん','2015.04.17'),(740,'絶品です!!',5,110,'2020-10-07 05:29:18','2020-10-07 05:29:18','ぽぢさん','2015.04.16'),(741,'塩加減が丁度良く堅くないのが私好みです。',5,111,'2020-10-07 05:29:18','2020-10-07 05:29:18','tanisiさん','2019.10.25'),(742,'塩加減も程よくサクサクで美味しい。つい食べ過ぎてしまいます。トップバリュにしては少し割高かな・・・',5,111,'2020-10-07 05:29:18','2020-10-07 05:29:18','reikazumiさん','2018.05.30'),(743,'塩味が優しく、フワフワがいいです。',4,111,'2020-10-07 05:29:18','2020-10-07 05:29:18','handleさん','2018.05.18'),(744,'黒豆が香ばしくて、サクサク美味しい！！ 大好きです！！',5,111,'2020-10-07 05:29:18','2020-10-07 05:29:18','ヤヨイさん','2018.04.30'),(745,'黒豆の含有率が多いと思う、うれしい! 遺伝子組換え不分別があるのが残念。',4,111,'2020-10-07 05:29:18','2020-10-07 05:29:18','北海道黒豆さん','2017.01.30'),(746,'さくさく感が○黒豆も香ばしくて美味しい',4,111,'2020-10-07 05:29:18','2020-10-07 05:29:18','☆きゃんちゃんさん','2016.12.03'),(747,'黒豆の香りと、しっかりとした塩気、そしてサクサク感がたまりません。軽いお煎餅なので、つい食べ過ぎてしまいます。ソフト食感なので歯や歯茎に負担がかからないのか、総入れ歯の父も普通に食べていました。',5,111,'2020-10-07 05:29:18','2020-10-07 05:29:18','ろばうんさん','2016.07.23'),(748,'ふわふわサクサクでハマりました! 一度食べてみてほしい味。',4,111,'2020-10-07 05:29:18','2020-10-07 05:29:18','たっきーさん','2016.02.13'),(749,'ふわふわサクサクした食感に、黒豆の香ばしさがアクセントになっていて、とても美味しいです。塩加減もちょうど良く、長方形なので食べやすかったです。ポタージュスープに割って入れても美味しかったですよ。もう少しお安かったら言うことなしでしょうか。',4,111,'2020-10-07 05:29:18','2020-10-07 05:29:18','さつきさん','2015.10.15'),(750,'サクッふわっ食感に黒豆の食感も加わって程よい塩気がちょうどいい。 食べ過ぎない個包装もうれしいです。',5,111,'2020-10-07 05:29:18','2020-10-07 05:29:18','サイカさん','2015.09.04'),(751,'何度も購入しています。あっさりして軽い感じ。大好きな味です。',5,111,'2020-10-07 05:29:18','2020-10-07 05:29:18','狸さん','2015.05.02'),(752,'黒豆が好き おかきが好き',5,111,'2020-10-07 05:29:18','2020-10-07 05:29:18','ぽぢさん','2015.04.16'),(753,'一般的なドライいちじくと比べると、水分が多めに含まれたソフトタイプのドライいちじくで、プルーンのようにやわらかな食感です。 しっかり乾燥させたものとはまた違う味わいで、ジューシーでもっちりした食感が味わえます。 こちらもしっとりしていて美味しいですが、歯ごたえのあるドライいちじくも取り扱っていただければあればうれしいです！（昔はあったような？）',4,114,'2020-10-07 05:29:18','2020-10-07 05:29:18','Motoさん','2020.06.29'),(754,'甘いオヤツに飽きて、かと言って塩気のものは摂りたくないので何か無いかなぁ？と探していて発見！香ばしさと噛むほどにお口に広がる美味しさで大満足です。しかも北海道産大豆使用で安心です！更に、カロリーを気にせず食べれるから嬉しい！ 飽きのこない美味しさに発見以来リピ買いです。',5,115,'2020-10-07 05:29:18','2020-10-07 05:29:18','るるるさん','2020.06.12'),(755,'アーモンド本来の味わいを楽しめる商品だと思います。食べやすくて、おいしかったです。',5,117,'2020-10-07 05:29:18','2020-10-07 05:29:18','きりぬさん','2020.04.17'),(756,'香ばしくて美味しいです。素材そのままの味を楽しむことができました。',4,119,'2020-10-07 05:29:18','2020-10-07 05:29:18','けーさん','2020.05.19'),(757,'ナッツとチーズどっちも美味しくて、チーズの入ってるものはあまり見かけないので 今回初めて買ってみたけど、美味しくてあっという間に一袋食べてしまいました。 ナッツとチーズ合うので気に入りました。今度はまとめ買いしようと思います。',5,126,'2020-10-07 05:29:18','2020-10-07 05:29:18','kumiさん','2020.05.01'),(758,'ミックスナッツはよく買っていましたがこれはチーズが入っていてとても美味しいです。個包装の量もちょうど良く買っても買っても家族みんなでよく食べるのですぐ無くなります。',5,126,'2020-10-07 05:29:18','2020-10-07 05:29:18','ぽこさん','2020.01.22'),(759,'乾燥チーズが特に気に入ってます！ ミックスナッツは色々あって好きなので良く買いますが最近TOP VALUを見つけて食べてみたらとても美味しかったです。',5,126,'2020-10-07 05:29:18','2020-10-07 05:29:18','チュウさん','2019.12.19'),(760,'毎日食べてます。いろいろな種類のナッツが一度にとれて、小分けにしてあるので食べすぎ防止に役立っています。大袋の方がお得なのはわかるのですが、あるだけ食べてしまうので小分けタイプは大変うれしいです。',4,127,'2020-10-07 05:29:18','2020-10-07 05:29:18','ヒロさん','2020.06.09'),(761,'ヘーゼルナッツの香りとカリッとした食感がとても良く、それ以外のナッツも美味しいです。お高めのマカダミアナッツも入っているので、お得感&満足感がありました。 小分けサイズのナッツは、大袋と比べると少し割高感がありますが、食べ過ぎ防止にはちょうど良いサイズで保存性が高いのが魅力です。',4,127,'2020-10-07 05:29:18','2020-10-07 05:29:18','Motokaさん','2020.04.23'),(762,'おいしくて、おやつに適量で満足、食べ過ぎ予防にもおすすめです。',5,127,'2020-10-07 05:29:18','2020-10-07 05:29:18','まめさん','2020.03.02'),(763,'オレイン酸やビタミンEを摂りたくて購入しました、糖質オフだし、何より美味しい！食べすぎ注意にもよい小分け袋で扱いもよい。リピしようと思ってます。',5,127,'2020-10-07 05:29:18','2020-10-07 05:29:18','ちかこさん','2020.01.19'),(764,'ナッツが好きでいつもイオン内にある店で購入していました。先日トップバリュのこの商品を見つけ試しに買ってみました。美味しかったです。糖質オフなのも嬉しいです。小袋なので食べ過ぎずいいですね。これからは、こちらを買うことにします。',4,127,'2020-10-07 05:29:18','2020-10-07 05:29:18','モカままさん','2020.01.12'),(765,'お茶にも珈琲にも合うし、おやつにピッタリです。食べると、ほっこりします。美味しいです。',5,128,'2020-10-07 05:29:18','2020-10-07 05:29:18','kumiさん','2020.01.25'),(766,'これ、なんの期待もせず、ただ目についたから買うたが… 美味しかったぁ❤︎ カフェオレのおともに！ これの、もう少し量が多いものも欲しいかも。',5,128,'2020-10-07 05:29:18','2020-10-07 05:29:18','え。さん','2019.11.26'),(767,'毎週買ってます。買いすぎじゃないかと思うほどに。',5,129,'2020-10-07 05:29:18','2020-10-07 05:29:18','トシさん','2020.04.01'),(768,'すごく美味しい。これまで健康のために素煎りナッツを食べていたが、ちょっと塩気がほしいなと感じこちらを購入。大正解。塩気が強すぎずちょうどよく、ナッツの歯ごたえもとてもよい。',5,129,'2020-10-07 05:29:18','2020-10-07 05:29:18','ヨーカドーさん','2019.10.29'),(769,'以前から定期的に購入しています。お値段も手ごろですし、レーズンの味もとても気に入っています。そのままいただいても美味しいのですが、我が家ではヨーグルトに入れて食べることが多いです。またパウンドケーキ等の焼き菓子にも手軽に利用できるので、使い勝手も良く気に入っています。',5,130,'2020-10-07 05:29:18','2020-10-07 05:29:18','NEKOさん','2020.06.28'),(770,'ヨーグルトに入れたり、食パンを焼くときに入れています。甘味が程よく美味しいです。',4,130,'2020-10-07 05:29:18','2020-10-07 05:29:18','リイリーイさん','2020.01.28'),(771,'普段はネットで買っていたがこれからはこちらをリピートします^ - ^すごい美味しかったです！',5,130,'2020-10-07 05:29:18','2020-10-07 05:29:18','やっさんさん','2019.09.20'),(772,'粒が揃っていて、硬すぎず食べやすい歯応えなので、そのまま食べても美味しいですし、ヨーグルトや、パンや蒸しパン等に入れたり色々使えます。',5,130,'2020-10-07 05:29:18','2020-10-07 05:29:18','家猫屋さん','2019.09.03'),(773,'安くて美味しいし国内の工場で作られているのでよく購入しています。 イオンPBのヨーグルトに入れて食べてます。',5,130,'2020-10-07 05:29:18','2020-10-07 05:29:18','yoさん','2019.06.16'),(774,'美味しい！',5,130,'2020-10-07 05:29:18','2020-10-07 05:29:18','くまさん','2019.02.07'),(775,'ふわふわ柔らかくメチャメチャ美味しい。こんなレーズン初めて。',5,130,'2020-10-07 05:29:18','2020-10-07 05:29:18','なおこさん','2018.10.05'),(776,'トップバリュ素煎り 3種のミックスナッツと混ぜて保存容器に入れてます。小腹満たし、おつまみ、ケーキ作りに…と万能で重宝してます。',5,130,'2020-10-07 05:29:18','2020-10-07 05:29:18','すずさん','2018.09.06'),(777,'シリアルに混ぜたり、カレーライスへのトッピングに合うので活用しています。味も好きです。',5,130,'2020-10-07 05:29:18','2020-10-07 05:29:18','akemiさん','2017.09.30'),(778,'オイル無しのレーズンが手軽に購入できるのでうれしいです。柔らかく自然の甘さたっぷりです。おやつにそのままで食べてます。ぶどうパンを作りたくなる美味しさ!',5,130,'2020-10-07 05:29:18','2020-10-07 05:29:18','ゆうちゃんさん','2017.07.19'),(779,'ドライフルーツは植物油脂を使用している商品が多いので、果実だけのものは嬉しいです。 酸味も少なく、そのまま食べてもおいしいです。',4,130,'2020-10-07 05:29:18','2020-10-07 05:29:18','楓さん','2017.03.15'),(780,'素煎り３種のミックスナッツ２０５ｇ入りを何時も購入していましたが、先日イオン新瑞橋店で４１０ｇ入りを見つけましたが、一度だけでその後店頭で見つけられませんとても美味しいので是非販売してほしいです。ＴＯＰＶＡＬＵ大好きです宜しくお願いします。',4,131,'2020-10-07 05:29:18','2020-10-07 05:29:18','ヤマチャンさん','2020.04.12'),(781,'健康を気にして日頃からナッツ食べているのですが、このサイズのミックスナッツは製菓店とかじゃないとなかなか無いので大容量でとても助かってます。またトップバリュー製品と言うことで安心して食べてます。',5,131,'2020-10-07 05:29:18','2020-10-07 05:29:18','みねさん','2020.02.14'),(782,'美味しくて病みつきです。お値段、贅沢な気がしましたけれど、たっぷり量が入っているので、毎日チョコチョコつまむにはこれぐらいないとですね。 素焼きなのも、より癖になります。',4,131,'2020-10-07 05:29:18','2020-10-07 05:29:18','なゆたさん','2019.10.30'),(783,'晩酌のおつまみに、いつも購入しています。 　カシューナッツの甘みも感じられるし、アーモンドのカリッと感、クルミの大きさ、気に入っています。',5,131,'2020-10-07 05:29:18','2020-10-07 05:29:18','たあちんさん','2019.08.18'),(784,'おいしいです。まいつきかっています。',5,132,'2020-10-07 05:29:18','2020-10-07 05:29:18','あづささん','2020.06.08'),(785,'カリっとしていて、とても美味しい。 以前ネットで買っていたが、こちらを食べたら格段に美味しかった。 おススメです。',5,132,'2020-10-07 05:29:18','2020-10-07 05:29:18','ナッツファンさん','2020.04.22'),(786,'妹に「アーモンドいいよ」と大袋をもらいました。 同じような物ないかと探したらイオンにありました。 それと同じ「食塩・植物油不使用となっていたので購入しています。 1袋で1か月あります。1日15グラムが多いのか少ないのかわかりませんが、カルシュウムや鉄が不足がちの私にはいいかなと思っています。 量のわりにはお安いと思います。',5,132,'2020-10-07 05:29:18','2020-10-07 05:29:18','joyさん','2020.01.22'),(787,'いつも美味しく食べさせて貰っています。',5,134,'2020-10-07 05:29:18','2020-10-07 05:29:18','秀さん','2020.05.23'),(788,'なかなか売ってなくてやっと見つけました。薄味で飽きないし、安いと思います。',5,134,'2020-10-07 05:29:18','2020-10-07 05:29:18','クッキーさん','2020.03.29'),(789,'無塩、無油で、オーガニック、というのが素晴らしいです。 変に味がついていないので、そのまま食べてもおいしいですが、薄焼き煎餅と一緒に食べるとか、チョコレートと一緒に食べるとか、ドライフルーツと一緒に食べるとかしても、おいしいです。',4,136,'2020-10-07 05:29:18','2020-10-07 05:29:18','にゃおんさん','2020.06.21'),(790,'素煎りナッツということで、妊娠中からおやつとしてよく食べてました！今も授乳中で、お腹がすくとよくつまんでます。 すごく美味しくて、ボリュームもあって、リピートしてます！',5,136,'2020-10-07 05:29:18','2020-10-07 05:29:18','miiinoさん','2020.03.08'),(791,'塩分はないのですが、ナッツの甘味でおいしくたべられます。こういうミックスナッツは、カリッとしていない商品もありますが、こういうこの商品はそういうことはなく気に入っています。',4,136,'2020-10-07 05:29:18','2020-10-07 05:29:18','チロルチョコさん','2019.12.16'),(792,'辛すぎなくて、ピーナッツがたくさん入っていて、値段も手ごろでお気に入りです',5,138,'2020-10-07 05:29:18','2020-10-07 05:29:18','kuronekoさん','2020.06.19'),(793,'以前からのファンです。大手さんのものと遜色ないですね。値段も安くて嬉しいのですが、なんといっても味が良いです。辛味といいわさび味といい自分の好みです。奥さん共々1日一個の小袋で満足です。ここ1ヶ月位商品が店頭で販売してなくて在庫が底をつきそうでしたが、最近になり購入できるようになりひと安心です。',5,138,'2020-10-07 05:29:18','2020-10-07 05:29:18','ゴルフ大好きおやじさん','2020.06.14'),(794,'値段がうれしい！あるところ・ないところがあるので、まとめて買います！',5,138,'2020-10-07 05:29:18','2020-10-07 05:29:18','ももさん','2020.06.12'),(795,'わさびの味がそれほど強くなく丁度良い味で美味しいし、お値段も安いのでよく買います。',4,138,'2020-10-07 05:29:18','2020-10-07 05:29:18','kumiさん','2019.12.22'),(796,'小分け袋が便利で、定期的に買っています。　メーカー品より安いので助かっています。',4,138,'2020-10-07 05:29:18','2020-10-07 05:29:18','たりきホーガンさん','2019.08.18'),(797,'美味しい。わさび味がもう少し効いていてもいいかなと思う。価格が手頃で嬉しい。人気の商品の為か欠品が多く残念。',4,138,'2020-10-07 05:29:18','2020-10-07 05:29:18','ちかちゃんさん','2019.04.27'),(798,'暫くの間、わさび味が店頭から失くなっており、終売かと諦めていましたが復活して良かったです。 大手メーカと遜色のない味で価格が安いので嬉しい商品です。 我が家では常にストックして好きなタイミングで食べています。 そんなに辛くないので子供から大人までおすすめです。',4,138,'2020-10-07 05:29:18','2020-10-07 05:29:18','ボン吉さん','2019.03.30'),(799,'おいしい',3,140,'2020-10-07 05:29:18','2020-10-07 05:29:18','っっkさん','2019.07.27'),(800,'桃がたくさんあって嬉しかったです 味がちょっと薄めでした',4,141,'2020-10-07 05:29:18','2020-10-07 05:29:18','こあけんさん','2020.06.30'),(801,'桃が好きなので、黄桃のゼリーも気になって食べてみました。味がしっかりしていて美味しかったです。もう少しお値段が安いと有難いなと思いました。',4,141,'2020-10-07 05:29:18','2020-10-07 05:29:18','kumiさん','2019.08.05'),(802,'黄桃のコクのある味わいで、普通のゼリーより味があり、とても美味しいです。',4,141,'2020-10-07 05:29:18','2020-10-07 05:29:18','きときとさん','2019.01.17'),(803,'有名メーカーのものと同じ味で、やめられない美味しさです。個包装なので、湿気を気にせず、気軽に食べられます。',5,142,'2020-10-07 05:29:18','2020-10-07 05:29:18','カリっこさん','2020.06.12'),(804,'味とコスパの良さに我が家の定番です☆ おかきのカリカリ感とピーナッツの塩加減も最高♪ ビールもすすむわけです！！',4,142,'2020-10-07 05:29:18','2020-10-07 05:29:18','poxさん','2020.06.09'),(805,'お酒のおつまみとして購入しました。個包装の量も多過ぎず少なすぎずな感じでちょうどいい量だと思います。こういうものってついつい食べ過ぎてしまう事があるので、個包装してくれてる方がいいですね。',5,142,'2020-10-07 05:29:18','2020-10-07 05:29:18','kojiさん','2018.05.29'),(806,'ピーナッツ入り柿の種の個包装文字が、書道系文字で格好いいです。なんでもないところに気を使われていて、素敵です。 唐辛子も微妙に聞いていておいしいです。',4,142,'2020-10-07 05:29:18','2020-10-07 05:29:18','日本のお菓子さん','2016.11.14'),(807,'旦那が好きで、よく買います。コスパよし、味よしです。',5,143,'2020-10-07 05:29:18','2020-10-07 05:29:18','ゆまさん','2020.07.21'),(808,'柿ピーが大好きで他社の商品と比べた際に240グラムで160円以下とグラム原価が一番安い商品がこれでした。小包装ではないですがチャック付きなので保存もききます。何度もリピートしています。',5,143,'2020-10-07 05:29:18','2020-10-07 05:29:18','ゆみこさん','2020.06.28'),(809,'お手頃価格で美味しく、ずっとリピート買いしてます！ チャック付きなので、お酒のおつまみにちょっと欲しいときでも食べやすいです。 感謝デーに買おうとすると売り場から消えている時も！ みんな好きなんだな～と少し嬉しくなります♪',4,143,'2020-10-07 05:29:18','2020-10-07 05:29:18','ホワイト39さん','2020.06.24'),(810,'今、食べながらつけています。 いろいろな柿の種を食べてきましたがこれが一番のお気に入りです。 柿の種もピーナッツもどっちも美味しいです。 ピリ辛の柿の種、最高です。',5,143,'2020-10-07 05:29:18','2020-10-07 05:29:18','みあかさん','2020.06.18'),(811,'値段の割に量があって良いですね。 とても気に入ってます。 比較的薄味で嫌にならないのが高評価です。 他の方も書かれていますが、チャック付きの袋もポイント高いです。',5,143,'2020-10-07 05:29:18','2020-10-07 05:29:18','MANOWAR さん','2020.06.12'),(812,'この「柿の種」はオススメです。まず、「美味しい」です。某ナショナルブランドにも引けをとりません。そして、240グラム入り158円という、圧倒的な「コスパ」の良さです。皆さんもどうぞ！',5,143,'2020-10-07 05:29:18','2020-10-07 05:29:18','すいむちゃんさん','2020.06.06'),(813,'なんと言ってもコスパ最強！袋が閉じられるのもうれしい。',5,143,'2020-10-07 05:29:18','2020-10-07 05:29:18','レスさん','2020.05.27'),(814,'安くて美味しいです。お酒のおつまみとして食べています。一度食べたら、パッケージを終わるまで食べ続いちゃうんです。逆に太りそうです。',5,143,'2020-10-07 05:29:18','2020-10-07 05:29:18','KESHABさん','2020.05.19'),(815,'毎週買っています。おつまみに最高です。 お値段よしコスパよし味よし 素晴らしい商品です。',5,143,'2020-10-07 05:29:18','2020-10-07 05:29:18','あっくんさん','2020.05.15'),(816,'原材料名のところに唐辛子とか香辛料抽出物などと書いてあるので、どれぐらい辛いんだろうとちょっと不安を感じましたが、思い切って買って食べてみたら、まったく心配などどこ吹く風。食べても食べてもやめられず、つい食べ過ぎてしまいました(^_^;)。２４０グラムも入っていて１５８円の安さには、ホントに感謝感謝してます！！',5,143,'2020-10-07 05:29:18','2020-10-07 05:29:18','ヨシヒロさん','2020.02.29'),(817,'美味しいし安いので、おやつにおつまみにピッタリなので、よく買います。',5,143,'2020-10-07 05:29:18','2020-10-07 05:29:18','kumiさん','2020.02.28'),(818,'安くて美味しい！',5,143,'2020-10-07 05:29:18','2020-10-07 05:29:18','ヨウさん','2020.02.20'),(819,'すごく、お得な商品です。値段も安いのに240gでコスパ最高ですね。',5,143,'2020-10-07 05:29:18','2020-10-07 05:29:18','みーさんさん','2019.03.03'),(820,'この柿の種は我が家の必須アイテムです。 もう何年も購入してますが飽きるということがない。',5,143,'2020-10-07 05:29:18','2020-10-07 05:29:18','はるさん','2019.02.02'),(821,'ジッパーで保存ができて食べやすい辛さなので毎日のおやつにしています。大人にはビールのお供に！20日30日の５％引きには大人買いしています！',4,143,'2020-10-07 05:29:18','2020-10-07 05:29:18','ごんちゃんさん','2018.09.05'),(822,'コスパ良すぎです。お得感でよりおいしくかんじられます。',5,143,'2020-10-07 05:29:18','2020-10-07 05:29:18','おさるのさん','2018.06.29'),(823,'大容量で値段もお買い得！たくさん食べたい方も、小分けで食べたい方もジッパー付きだから、自由自在です。 満足度満点な一品です。',5,143,'2020-10-07 05:29:18','2020-10-07 05:29:18','arishunaさん','2018.06.20'),(824,'量が多くて食べ応えがあります。ジッパー付きなので1度で食べきれなくても保存ができるので常時、ストックしておきたい1品です。',4,143,'2020-10-07 05:29:18','2020-10-07 05:29:18','ブルーライオンさん','2018.06.10'),(825,'容量が多いので、たくさん食べられてお得感が嬉しいです！！ 色々なメーカーの柿の種と比較して、こちらは一番食感がカリッとしています。 辛みもそれほど強くないので、家族みんなで楽しめる商品です。',5,143,'2020-10-07 05:29:18','2020-10-07 05:29:18','むっきぃさん','2018.05.12'),(826,'柿の種とピーナッツの量が程よく、お酒のつまみにとても合います。家族みんな好きなので、大袋でみんなで食べる事が出来ますし、ジッパー付きなので気に入っています。',5,143,'2020-10-07 05:29:18','2020-10-07 05:29:18','ふーりんさん','2018.02.25'),(827,'カットフルーツって子供でも 食べやすいし持ち運びも便利にできるからめっちゃ欲しいです!!このパインはあまり酸っぱくもなく子供からおばあちゃんおじいちゃんまでどの年代の人でもとても美味しく食べやすいものとなってて 自分も食べてみたけど、とても甘くてすぐに無くなってしまいました!!このパインは売ってるのが少ないからもう少し売って欲しいです!! 売ってるのを見つけたらいつもすぐ手に取り買ってしまうほどお気に入りのフルーツです！',5,144,'2020-10-07 05:29:18','2020-10-07 05:29:18','みいちゃんさん','2019.08.19'),(828,'ほかのスーパーと違って、いつ購入しても、甘さが充分あります。安心して買えるのがうれしいです。',5,144,'2020-10-07 05:29:18','2020-10-07 05:29:18','おーさん','2019.07.20'),(829,'カットされているのですぐに食べれます。 とても甘くおいしいです。量もちょどいいので食後のデザートとしても最適です。',4,144,'2020-10-07 05:29:18','2020-10-07 05:29:18','マッチママさん','2018.09.27'),(830,'一般的なピーナッツと比べると少し小さく、ギュッと絞ったような見た目です。 柔らかめの食感で、ほんのりミルクのような風味が感じられます。 オレイン酸が豊富ということで、おつまみの域を越えられなかったピーナッツ（バタピー）が美容食になったような気がしますね。 ただ、味は好みなのですが、若干塩加減が強いように感じられました。',4,145,'2020-10-07 05:29:18','2020-10-07 05:29:18','Motokaさん','2020.04.23'),(831,'このピーナッツを食べたら、他の同価格帯のピーナッツは食べられなくなるほど美味しいです！普通のピーナッツより少し柔らかな歯応えで塩味もちょうど良くオススメです。',5,145,'2020-10-07 05:29:18','2020-10-07 05:29:18','ちくわぶさん','2020.04.09'),(832,'以前のオーストラリア産からニカラグア産に産地が代わったのでお味は大丈夫か心配しましたが全く変わり有りませんでした、ヘルシーでとても美味しいピーナッツです、やや小振りで丸い粒です',5,145,'2020-10-07 05:29:18','2020-10-07 05:29:18','おにーるさん','2018.09.04'),(833,'今まで食べていたピーナッツはなんだったんだと思うほど美味しい☆ こっくりと濃厚な油分ですがしつこくなくぱくぱく食べられます。 とてもいいおつまみです。',5,145,'2020-10-07 05:29:18','2020-10-07 05:29:18','お豆さん','2018.08.30'),(834,'以前購入していたオーストラリア産が無くなってしまったのでこちらを購入。個人的にはオーストラリア産の方がカシューナッツみたいな食感で好きでしたが、こちらも悪くはない。ちょっと薄味です。',4,145,'2020-10-07 05:29:18','2020-10-07 05:29:18','みんみんさん','2018.08.30'),(835,'美味しい！！ 今まで食べてたピーナッツはなんだったのかと思うはど美味しい。 食感も塩加減も好みでまたリピートします。',5,145,'2020-10-07 05:29:18','2020-10-07 05:29:18','おまめさん','2018.08.21'),(836,'少量欲しかったので試しに買ってみましたが、とっても甘くてびっくりしました！リピします♪',5,146,'2020-10-07 05:29:18','2020-10-07 05:29:18','ばくばくさん','2020.06.08'),(837,'少しだけ食べたかったのと、一歳の息子に食べさせてあげたくて購入しました。甘くて美味しかったです。',5,146,'2020-10-07 05:29:18','2020-10-07 05:29:18','おしょうさんさん','2020.05.29'),(838,'この商品を初めて食べた時は、甘くてとても美味しかったです。 やっぱり、夏と言えばイオンのスイカ',3,146,'2020-10-07 05:29:18','2020-10-07 05:29:18','マイさん','2019.07.08'),(839,'ずっと気になっていて買ってみたら、甘くて美味しかったので今一番ハマっています。毎日でも食べたいくらい大好きです。カットされていて食べやすいし１個も半分も私には多いので、このカットされたスイカで丁度良い量なので気に入りました。',5,146,'2020-10-07 05:29:18','2020-10-07 05:29:18','kumiさん','2019.05.18'),(840,'カットフルーツはすぐに食べられるし､価格もお手頃♪ スイカは１玉買うと冷蔵庫もいっぱいになるし。 切ったりするのも面倒な私には有難い商品！ 食べきりサイズで試合とかにも持って行ったりして食べてます(^ー^)',4,146,'2020-10-07 05:29:18','2020-10-07 05:29:18','しのっぺさん','2018.08.08'),(841,'美味しい！',5,146,'2020-10-07 05:29:18','2020-10-07 05:29:18','イオンさん','2018.08.07'),(842,'いただくまでは…切ってあるスイカなんてどう？なんて思っていましたけど…小さな入れ物の中に、美味し〜いところだけを詰めて下さってるんです！必ず甘くてハズレがないですよ〜',5,146,'2020-10-07 05:29:18','2020-10-07 05:29:18','スイカさん','2018.07.30'),(843,'新鮮と熟、暑い天気の最高な物です',5,147,'2020-10-07 05:29:18','2020-10-07 05:29:18','ウエダさん','2019.06.15'),(844,'レタス・キュウリ・トマトしかなくても、アーモンドをザクザク刻んでパラパラするだけで、ちょっとおしゃれなサラダになります。 くるみの苦味（？）が苦手なので、アーモンド単品でこの量は嬉しいです！',5,148,'2020-10-07 05:29:18','2020-10-07 05:29:18','うにさん','2019.10.18'),(845,'塩分無添加なので、アーモンドそのものほんのりとした甘みが味わます。小腹が空いた時のおやつとしてはもちろん、サラダのトッピングや、和え物などのお料理にも使え、ヘルシーでお気に入りです。',4,148,'2020-10-07 05:29:18','2020-10-07 05:29:18','じゅんさん','2019.10.07'),(846,'歯応えもよく、塩分不使用なのでおやつにも最適です。',5,148,'2020-10-07 05:29:18','2020-10-07 05:29:18','家猫屋さん','2019.08.10'),(847,'どこでも買えるので、近所のスーパーでよく買ってます。 塩気がなくても全然おいしく食べれます。 ただ他の物に比べて、少し乾燥気味？よく喉（気管）に引っ掛かります。むせます',3,148,'2020-10-07 05:29:18','2020-10-07 05:29:18','鷹虎飛蝗さん','2019.04.22'),(848,'食感がいいです。便秘予防に、毎日食べています。',5,148,'2020-10-07 05:29:18','2020-10-07 05:29:18','ひよこさん','2019.04.11'),(849,'カリッと香ばしくてアーモンドの優しい甘味やコクがあって美味しいです♪塩が添加されていないので、アーモンドのそのものの味が味わえます。230グラム入りで量が多いですが、私はナッツ好きなのであっという間に1人で食べてしまいます。そのまま食べるのは勿論、手作りのお菓子のトッピングとして使うのも良いと思います。',4,148,'2020-10-07 05:29:18','2020-10-07 05:29:18','あっぷるろーずさん','2018.11.10'),(850,'やっぱり一番おいしい食べ方です。',5,148,'2020-10-07 05:29:18','2020-10-07 05:29:18','poohsamaさん','2018.07.27'),(851,'アーモンドが体にいいと聞いて食べています。 塩を使っていないので、塩分を気にする主人もお気に入りです。 香ばしくてカリッとした食感と風味が美味しいですね。',5,148,'2020-10-07 05:29:18','2020-10-07 05:29:18','mayさん','2018.02.21'),(852,'程よい塩加減とアーモンドの香ばしさがベストマッチでとても美味しいです。 また買います。',5,148,'2020-10-07 05:29:18','2020-10-07 05:29:18','パンダさん','2018.02.16'),(853,'食べやすく香ばしいです。値段も手ごろでいいです。',5,149,'2020-10-07 05:29:18','2020-10-07 05:29:18','ナッツ好きさん','2018.03.07'),(854,'健康のために食べ始めました。食べやすい味で続けられそうです。',5,149,'2020-10-07 05:29:18','2020-10-07 05:29:18','やすやすさん','2018.02.25'),(855,'岩手県の名物（？）くるみ餅を作るために購入しました。 すり鉢で軽く摺（す）るだけでねっとりと油分がしみ出し、いつもより簡単に、粒感が少し残ったペースト状にできました。 今までは無塩ローストクルミを使っていましたが、これからは生クルミで作ります！ ＊興味のある方はぜひ「くるみ餅」でレシピ検索してみてください。',5,151,'2020-10-07 05:29:18','2020-10-07 05:29:18','うにさん','2020.01.13'),(856,'お手頃な生クルミです。 田作りなどの料理に、お菓子作りに、加工して使っています。 量も丁度いいくらいです。 クルミ単体では食べないので星4です。',4,151,'2020-10-07 05:29:18','2020-10-07 05:29:18','おはらぎさん','2018.05.21'),(857,'カリッと香ばしくて甘さもありとても美味しいです。 ス他社のものも食べ比べましたが、トップバリュが一番！ これが売られているからイオンで買い物するくらい。(笑) オススメです♪',5,152,'2020-10-07 05:29:18','2020-10-07 05:29:18','ピスタチオママさん','2020.06.09'),(858,'適度な塩味で、味は美味しいと思いますが、完熟していれば 自然に割けてくるはずの外殻が、閉じたものが多く、とても 指先の力では開けられないのが難点です。 金具を使って殻を開く労力がかかる割に、ナッツは小さめですし、 また購入するか、正直悩む商品です。',2,152,'2020-10-07 05:29:18','2020-10-07 05:29:18','すみれさん','2019.06.04'),(859,'マカダミアナッツオンリーでお手軽に買える商品なのでよく買います。 ナッツの中でもマカダミアナッツが一番好きな私は、ミックスナッツを買っても先にマカダミアを食べつくしてしまうのですが、これだと思う存分マカダミアを堪能できます。 粒は大きく丸々としていて割れもない綺麗な一粒の状態が入っています。 味付けがまた絶妙で、マカダミアの甘やかな風味とまったりとしたコクを壊さない塩気が美味しい。 一気に食べ終わらなくてもチャック付きなので便利。 私は鞄に入れて小腹が空いた時に出先でつまんでいます。',5,153,'2020-10-07 05:29:18','2020-10-07 05:29:18','ぽぽんたさん','2018.02.23'),(860,'アーモンド、くるみ、カシューナッツと大どうの３種ナッツが楽しめます。食塩無添加の方もたまに買わせてもらいますが、こちらの商品でも薄味の塩が利いていて美味しいです。比較的アーモンドとカシューナッツの割合が多いと思いますが量も２～３人前くらいでちょうど良くお安いのでお酒のおつまみの１品として活躍します★',4,154,'2020-10-07 05:29:18','2020-10-07 05:29:18','ゆきえちゃんさん','2018.06.10'),(861,'ちょうど良い煎り加減でカリッと香ばしくも、噛んでいるうちにカシューナッツのまろやかな甘みがほのかに感じられます。 濃厚さには少し欠けるもののバランスの取れた味で、食塩・植物油不使用なので料理やお菓子作りにも向いているかもしれません。 一粒一粒が綺麗で、私が店頭で購入した限りでは、割れたり崩れたりしているものはほとんどなかったように記憶しています。',4,155,'2020-10-07 05:29:18','2020-10-07 05:29:18','Motoさん','2020.05.26'),(862,'そのまま食べても鶏のカシューナッツ炒めにしてもおいしいです',5,155,'2020-10-07 05:29:18','2020-10-07 05:29:18','ばるーなさん','2018.11.06'),(863,'やっぱり素材そのものがあじわえるのでいい。',5,155,'2020-10-07 05:29:18','2020-10-07 05:29:18','ｐｏｏｈさん','2018.07.27'),(864,'しょっぱすぎず美味しいです。チャックが付いているのか嬉しいです。',5,155,'2020-10-07 05:29:18','2020-10-07 05:29:18','エリーさん','2017.08.16'),(865,'塩気のない香ばしいアーモンドです。一人暮らしでも丁度よい91g, 何よりお求めやすい価格。ジップ付きの包装、安心のトップバリュブランドと、三重丸。 健康と美容のため、リピートしたいです。',5,157,'2020-10-07 05:29:18','2020-10-07 05:29:18','まめふくさん','2019.07.31'),(866,'ビタミンEサプリがわりに食べています(^^) 噛めば噛むほど旨味が出てきてアーモンド本来の香ばしさを味わえる！ 味つきのものは多いのですが、素煎りのタイプはなかなかなくて…(あっても量が少ない、お菓子用などで高価)トップバリュはどこのお店でも常時おいているし、コスパも最強かと思います！',5,157,'2020-10-07 05:29:18','2020-10-07 05:29:18','yocco.さん','2018.07.11'),(867,'塩分を気にしたくないので、塩無添加で、好きなナッツが３種なので、最高です。量もぱくぱく食べても何度かしっかり楽しめて、お得感があって、何度も購入しています。両親にも、プレゼントしています。甘い物もいいけど、ナッツは、健康にも良くて、保存食にもいいです。',5,158,'2020-10-07 05:29:18','2020-10-07 05:29:18','はるさん','2020.02.16'),(868,'塩味が付いていない商品を探していて、見つけました。 おいしくてついつい手が止まりません。個包装になっていると食べすぎが防げそうです。',5,158,'2020-10-07 05:29:18','2020-10-07 05:29:18','みゅんさん','2019.12.06'),(869,'素煎りなので食べやすい。ぱくぱく食べちゃいます(^ー^)',5,158,'2020-10-07 05:29:18','2020-10-07 05:29:18','ここさん','2019.10.17'),(870,'ナッツが健康に良いとのことで、おやつとして時々食べています。塩が入っておらず、体に良いと感じています。ナッツの味がおいしく、安いので見かけると購入しています。',5,158,'2020-10-07 05:29:18','2020-10-07 05:29:18','たろうさん','2018.08.30'),(871,'カシューナッツ、クルミ、アーモンドの三種類が好きなのでこのパックは嬉しい！しかも安くて美味しくて大好きな商品です。',5,158,'2020-10-07 05:29:18','2020-10-07 05:29:18','ゆりさん','2018.06.18'),(872,'美味しいです。 塩も使ってないから、ナッツその物の味でお気に入りです。 沢山入っていてお得。 いつもストックしています。',5,158,'2020-10-07 05:29:18','2020-10-07 05:29:18','流華さん','2018.06.16'),(873,'ナッツの味がそのまま生かされた、上質の商品。安いピーナッツやジャイアントコーンで　かさ増ししてある商品が多い中、３種ナッツに絞っているところが良いと思う。しかも、安い！常に常備して、紅茶　コーヒー　酎ハイのお供にしています。',5,158,'2020-10-07 05:29:18','2020-10-07 05:29:18','ともまま５４さん','2018.05.28'),(874,'量も多く、バランスよくナッツが入っているので飽きません。100均のボトルに入れて保存しています。おやつに食べていますが、気づくとなくなっています。',5,158,'2020-10-07 05:29:18','2020-10-07 05:29:18','まちゃあきさん','2018.05.03'),(875,'3種類のナッツが数の偏りなくバランス良く入っていて毎日小分けで食べるのにちょうど良かったです。味も付いてないのでナッツの甘みを感じられ、健康的に食べれると思います。',4,158,'2020-10-07 05:29:18','2020-10-07 05:29:18','モカさん','2017.07.23'),(876,'この商品はお気に入りです いつでもどこでも 食べれるし 3種類の豆の味が それぞれの特徴をだしていて ビールにも 合うので 食べ始めたらやめられません',5,158,'2020-10-07 05:29:18','2020-10-07 05:29:18','クリームさん','2017.07.21'),(877,'大粒で食塩・植物油不使用なので、マカダミアナッツの独特な食感と甘み、コクを存分に堪能できます。 ロースト加減も強すぎず弱すぎず、マカダミアナッツ本来の美味しさを引き出しているように感じました。 ついつい手が伸びてしまう美味しさですが、他のナッツと比較するとお高めなので、大事に食べるようにしています。',4,159,'2020-10-07 05:29:18','2020-10-07 05:29:18','Motoさん','2020.05.26'),(878,'量が少ないですが、マカダミアナッツ本来の味を楽しむことが出来ました♪マカダミアナッツを口に入れて噛み締めると、口の中で濃厚なコクが広がって一気に幸せな気分になれました。マカダミアナッツはナッツの中でも特に高級なナッツなので、時々自分のご褒美として買って食べようかなと思っています。今度買った時は、このマカダミアナッツと一緒に高カカオのチョコレートを頬張ってみたいです♪',4,159,'2020-10-07 05:29:18','2020-10-07 05:29:18','あっぷるろーずさん','2018.11.10'),(879,'美味しくてナッツの健康効果もあって最高',5,159,'2020-10-07 05:29:18','2020-10-07 05:29:18','ダンゴムシさん','2017.07.16'),(880,'よく見るココナッツといえば細い繊維みたいな感じですが、こちらは細くする前の固まりという感じです。味はほんのり甘いココナッツです。食感が他にないサクサク感で最初は驚きましたがクセになりました。内容量は少ないですがココナッツの繊維がシャキシャキしていてよく噛むので、少ない量で満足できます。ココナッツ好きな方にはぜひ一度召し上がっていただきたいです。',5,160,'2020-10-07 05:29:18','2020-10-07 05:29:18','あずきさん','2020.06.10'),(881,'毎日3個～5個必ず食べてます。身がしっかりしていてしかも甘すぎず美味しいです。美容健康の為何年も続けてます。アメリカのと比べて身が噛み応えが有ります。アメリカのは割とペラペラなのが多く、たまに種が入っていたりもします。トップバリューのは全く種が有ったことは無いです。安心して食べられます。しかもジップロックなので更に輪ゴムの心配いらずに詰め替える必要もなく。欠かす事なく毎週購入してます。',5,161,'2020-10-07 05:29:18','2020-10-07 05:29:18','Kayさん','2020.01.16'),(882,'この味、この食感大好きです。 種がないので五歳の娘にも安心して食べさせられ、ヨーグルトに入れて毎朝頂いてます。 健康のためにこれからも続けていこうと思います。',5,161,'2020-10-07 05:29:18','2020-10-07 05:29:18','まーさんさん','2019.10.29'),(883,'ピーマンとの炒め物によく使用しています。お値段が高いのが残念です。',3,162,'2020-10-07 05:29:18','2020-10-07 05:29:18','あっちゃんさん','2017.06.03'),(884,'ダイエットに良いと聞きおやつにナッツを食べるようにしています。 美味しいです。',5,163,'2020-10-07 05:29:18','2020-10-07 05:29:18','Maaさん','2020.05.24'),(885,'味も良いし、価格も好きです。東京のマイバスケットで購入したいのですがどうしたら？',5,163,'2020-10-07 05:29:18','2020-10-07 05:29:18','しちょうさんさん','2020.05.10'),(886,'とても美味しく、お値段も手頃で嬉しいです。',4,163,'2020-10-07 05:29:18','2020-10-07 05:29:18','うしちゃんさん','2019.11.16'),(887,'ピーナッツアレルギーで柿の種を食べるときのお供に欠かせません。3種類のバランスとボリュームも良くて食べ過ぎ注意ですよ',5,163,'2020-10-07 05:29:18','2020-10-07 05:29:18','3食昼寝姫さん','2018.02.22'),(888,'３種類のナッツの素材そのままの味が楽しめます。チャックが付いているので便利です。女性の美容にも良さそうなので　毎日続けて食べたい味です。お買得袋もあれば嬉しいです。',4,163,'2020-10-07 05:29:18','2020-10-07 05:29:18','とどくんさん','2018.02.20'),(889,'食塩無添加なのがうれしい。 量はたっぷりで値段もお手頃 コスパ最強です。',5,163,'2020-10-07 05:29:18','2020-10-07 05:29:18','宇治抹さん','2018.01.31'),(890,'身厚だけど食べにくさのないプルーンです。 種がないのでそのまま食べられます。 便秘解消の為に食べ始めましたが、好きなナッツと一緒におやつとしておいしくいただいています。',4,164,'2020-10-07 05:29:18','2020-10-07 05:29:18','ミミエさん','2020.07.31'),(891,'種なしなので、とても食べやすいです。個包装ですので、外出時にバッグに入れて持っていくこともできます。とってもヘルシーなおやつになるので気に入っています。',5,164,'2020-10-07 05:29:18','2020-10-07 05:29:18','NEKOさん','2020.06.28'),(892,'いつも仕事の休憩時間に食べています。小分けされてるので持ち運べて便利です。',5,164,'2020-10-07 05:29:18','2020-10-07 05:29:18','美奈さん','2020.06.10'),(893,'子供の便秘改善の為、購入。一つ一つ個装されているので保存しやすくおやつ感覚として渡せるので便利です。プルーンってベタベタしてドシッと感があるのもありますが、こちらはベタベタ感も少なく思ってたよりアッサリ食べれるので子供も抵抗なく美味しいと言って食べてくれます。',5,164,'2020-10-07 05:29:18','2020-10-07 05:29:18','たろうママさん','2019.03.17'),(894,'大粒で肉厚なプルーンで食べ応えがあり、また添加物不使用なのでプルーンそのものの味を堪能することができます。 もっちり＆ねっとりとした食感がとても好みで、ヨーグルトによく合います。 濃厚ではあるものの、甘みと酸味のバランスが取れており、甘ったるくないので食べやすいのも良いです。',5,165,'2020-10-07 05:29:18','2020-10-07 05:29:18','Motoさん','2020.06.27'),(895,'食物繊維と鉄分補給のために購入しました。ヨーグルトに入れて毎朝たべています。',4,165,'2020-10-07 05:29:18','2020-10-07 05:29:18','ちえこさん','2019.10.13'),(896,'キャンペーン中の50g 増で買いました。味、柔らかかさ、コスパ、問題ないのではないでしょうか。 確かに開封はチャックが便利ですが、それよりたっぷりサイズが魅力です。',5,165,'2020-10-07 05:29:18','2020-10-07 05:29:18','ナユタさん','2019.06.14'),(897,'柔らかく自然な甘さでおいしいプルーンです。 中身の品質に文句はありませんが、袋の口が密封チャック付きではないのが残念なので☆4にしました。 内容量が一度で食べきる量ではないので密封チャックを付けて欲しいです。',4,165,'2020-10-07 05:29:18','2020-10-07 05:29:18','ayuさん','2018.12.03'),(898,'どのような肥料を使って、どのような農薬をどれだけ使用して栽培されたのか、明記してほしい。',2,165,'2020-10-07 05:29:18','2020-10-07 05:29:18','pure earthさん','2018.04.15'),(899,'ドライフルーツ好きの私は、手作りパンにはレーズン入りばかりでしたが、これを使ってからはこればかり、風味もいいですが色味もいいです',5,166,'2020-10-07 05:29:18','2020-10-07 05:29:18','まあちゃんさん','2020.05.23'),(900,'機械油のような臭いがして、とてもではないけれど食べられないものが半分くらい混ざっています。',1,167,'2020-10-07 05:29:18','2020-10-07 05:29:18','upさん','2020.05.25'),(901,'最近、ドライフルーツにハマって、色々と食べていますが、このブルーベリーは「機械油臭い」です。 味も甘みが無く、かすかな酸味と強い苦みがあり、おいしいとは言い難いです。 機械油の匂いと苦みが気にならない方にはおすすめです。 （私はリピートはしません）',1,167,'2020-10-07 05:29:18','2020-10-07 05:29:18','toroさん','2018.11.21'),(902,'これまではトップバリュ グリーンアイの無漂白のアンズをよく購入していましたが、取り扱いがなくなってしまったのでこちらを購入してみました。 砂糖不使用ということもありサッパリとしていて、甘酸っぱいという言葉がぴったりな味です。 無漂白のものは干し柿のような濃厚な甘さがあったので、どちらかというとこちらの方が一般的なアンズのイメージに近いかもしれません。',4,168,'2020-10-07 05:29:18','2020-10-07 05:29:18','Motoさん','2020.06.27'),(903,'砂糖不私用の為、極端に甘いということはく食べやすい。 ただ、酸味も甘みも若干薄い気がしました。 また、表面部分に若干の苦味のようなものを感じました。',3,168,'2020-10-07 05:29:18','2020-10-07 05:29:18','さんさん','2020.05.17'),(904,'おかきの量を増やしてほしい',4,169,'2020-10-07 05:29:18','2020-10-07 05:29:18','たかさん','2019.12.28'),(905,'おつまみというより、おやつに食べます。おかきの量より、ピーナッツの割合が多いように感じます。もう少し、おかきの量を増やして欲しいかな！辛さは、さほど感じませんので、食べやすいです。',4,169,'2020-10-07 05:29:18','2020-10-07 05:29:18','nikonikoさん','2019.12.21'),(906,'何時も美味しく頂いております 味も良くて大好きです おかきの量もう少し多いといいなぁ',4,169,'2020-10-07 05:29:18','2020-10-07 05:29:18','街のパン大好きさん','2019.03.20'),(907,'たっぷり食べられるのは、嬉しいけれど… 小粒せんが もう少し「ピリ辛」の方が、美味しいと思います。',3,169,'2020-10-07 05:29:18','2020-10-07 05:29:18','暑がりさんさん','2017.09.29'),(908,'小粒かきの食感をもう少し固ければ美味しいのですが、ダイエーオリジナルの方が美味しかった',3,169,'2020-10-07 05:29:18','2020-10-07 05:29:18','さすらいの料理人さん','2016.12.06'),(909,'渋みや苦みが少なくて、粒が大きいです。 そのままでも十分美味しいですが、我が家ではキャラメリゼにしたものをケーキやクッキー生地に加えて、製菓用としても楽しんでいます。',4,170,'2020-10-07 05:29:18','2020-10-07 05:29:18','とろろさん','2017.06.19'),(910,'塩味等、余計な味がついていなくて、素材の味をそのまま味わえて満足です。',5,170,'2020-10-07 05:29:18','2020-10-07 05:29:18','くるみんさん','2017.05.24'),(911,'ナッツ類はどこでも選択肢が少なく妥協しがち。これは素煎りで味が加えられておらず、クルミらしい香ばしさと食感がしっかりと楽しめるので満足。刻んで使うのがちょっともったいないぐらい。製菓用に買ったものの、そのままでもおいしい。',5,170,'2020-10-07 05:29:18','2020-10-07 05:29:18','みちさん','2016.12.21'),(912,'余計な味付けなどなくくるみそのままのシンプルな美味しさを味わえます。 カリッとした大粒のクルミの食感とほのかな甘みの残るくるみでおいしかったです。',5,170,'2020-10-07 05:29:18','2020-10-07 05:29:18','daiさん','2016.10.28'),(913,'煎った黒大豆が好きでこれまで色々な商品を食べてきましたが、トップバリュのこちらはとにかく食べやすいのが特徴です。 固すぎずサクッとした軽い食感でモソモソせず、普通の煎り大豆にはない香ばしさが食欲をそそります。 黒大豆にはポリフェノールが含まれているそうなので、美味しいだけでなく健康にも良さそうです。 国産でお手頃価格なのも魅力です。',5,171,'2020-10-07 05:29:18','2020-10-07 05:29:18','Motoさん','2020.06.27'),(914,'実家の母の大好きな商品で、おやつ出されて時々食べていました。最近健康のために黒酢を摂るように心掛けているので、こちらの黒大豆をひたひたになるほどの黒酢につけて酢大豆にしてみたところ、食べやすい！！ そのまま食べたりサラダに入れたり、ヨーグルトにかけたりして家族それぞれ美味しい食べ方で毎日楽しんでいます。',5,171,'2020-10-07 05:29:18','2020-10-07 05:29:18','まめまめさん','2019.10.15'),(915,'香ばしく食べやすいので小腹が減った時のおやつにいつもカバンに入れています',5,171,'2020-10-07 05:29:18','2020-10-07 05:29:18','みかんさん','2019.08.28'),(916,'最高級銘柄の商品とそんなに味は変わらずとても美味しくリーズナブルで、とても満足しています。',5,171,'2020-10-07 05:29:18','2020-10-07 05:29:18','alain deroさん','2019.04.23'),(917,'塩分が少ないのに香ばしくおいしいお豆。つまみでこればかり食べすぎるほどのおいしさではないのが丁度良い。味覚を一定にするのに長け、他の邪魔にならないと思う。',5,171,'2020-10-07 05:29:18','2020-10-07 05:29:18','あずきさん','2019.01.30'),(918,'そのまま食べてすごく美味しいです。黒大豆の香ばしさが良いです。煎り大豆より量が少ないのは残念ですが、美味しさでカバーしてます。',5,171,'2020-10-07 05:29:18','2020-10-07 05:29:18','あきさん','2018.11.26'),(919,'大粒で味良く香ばしく、安価なのに原材料は国産です。最高。 美容健康目的で、口寂しいときのおやつにいただいています。アンチエイジング！ 幼稚園児の息子も大好き。もちろんリピートします。',5,171,'2020-10-07 05:29:18','2020-10-07 05:29:18','maryさん','2018.09.27'),(920,'粒が大きめで皮まで香ばしく、口寂しいときのおやつに大変重宝しています。価格も手頃で、量もちょうどいい。塩昆布や梅干しを溶かした白湯に沈めて少しふやかして食べたりするのも好きです。',5,171,'2020-10-07 05:29:18','2020-10-07 05:29:18','茶しぶさん','2018.08.31'),(921,'炒った作用なのか、香ばしさと黒大豆の甘みがあり美味しかったです。',5,171,'2020-10-07 05:29:18','2020-10-07 05:29:18','うれし香ばし黒大豆☆さん','2018.05.08'),(922,'香ばしさが食欲をそそります。原材料が国産の黒大豆だけというのが魅力的です。ポリポリしながら健康になっている感じがして、毎日少しずつ食べるようにしています。シリアルに入れても美味しかったですよ。',5,171,'2020-10-07 05:29:18','2020-10-07 05:29:18','ユウカさん','2017.10.27'),(923,'同じ商品を色々試したけどコレが一番美味しい。軽い歯ごたえ、大ぶりな黒大豆。高いメーカーに負けないと思います。',5,171,'2020-10-07 05:29:18','2020-10-07 05:29:18','アヅさん','2017.02.10'),(924,'お酒のおつまみにぴったりです。',5,171,'2020-10-07 05:29:18','2020-10-07 05:29:18','おいしゃんさん','2016.11.11'),(925,'大きな黒大豆で、ふっくらサクサクした食感が良かったです。味も、旨みがしっかりとあって、香りがとても良かったです。軽い食感なので、歯や歯茎への負担が少ないと思われ、父に勧めたいなと思いました。',4,171,'2020-10-07 05:29:18','2020-10-07 05:29:18','凛さん','2016.10.03'),(926,'140gサイズのミックスナッツを買っていましたが、登山やアウトドアで食べるのには、こちらの方が個包装で持ち運びに便利です。 塩味もちょうどいいぐらいです',5,173,'2020-10-07 05:29:18','2020-10-07 05:29:18','かあやんさん','2017.03.29'),(927,'子袋に分けて入っていて、一袋の量がちょうど良いのと、塩加減が気に入って、我が家の定番商品です。子供も大人も楽しめます。',5,173,'2020-10-07 05:29:18','2020-10-07 05:29:18','トロトロさん','2017.01.10'),(928,'ミックスナッツは、くるみが2つ入って6種類、スナック菓子が入っていないのが良い。美味しい!',5,173,'2020-10-07 05:29:18','2020-10-07 05:29:18','ケイワンさん','2016.10.23'),(929,'はじめて、ヒマワリの種を買いました。塩分が多すぎます。味は香ばしさもなく微妙でした。さけのつまみで買ってみたのですが、塩が多すぎて無理でした。塩の量は半分でいいかと思います。',1,174,'2020-10-07 05:29:18','2020-10-07 05:29:18','ナッツ好きさん','2018.03.07'),(930,'ひまわりの種がすごくおいしくてハマっています。が、塩味が邪魔です。無塩の純粋なひまわりの種だけのものを作ってほしいです。',3,174,'2020-10-07 05:29:18','2020-10-07 05:29:18','8282さん','2017.09.25'),(931,'旅行の時におやつにお友達から頂き食べました。凄く美味しかったので 空き袋片手に（裏にイオンとあったので）イオンのお菓子売り場に探しに行きました。そしたらTOPVALUの商品でした。中に入っているお菓子が全部味が良くて幸せな気分になります。この一か月で何袋も購入。 みんなに勧めています。最近TOPVALUの品は味が良いと感じます。',5,175,'2020-10-07 05:29:18','2020-10-07 05:29:18','barajamuさん','2019.12.21'),(932,'美味しいし、ちょっと小腹が空いた時のおやつにピッタリです。',4,175,'2020-10-07 05:29:18','2020-10-07 05:29:18','kumiさん','2019.09.06'),(933,'どれを食べてもおいしくてビックリしました｡とりこになりそうです。お店が遠いので通販でかえないかなーとついつい検索してしまいました。',5,175,'2020-10-07 05:29:18','2020-10-07 05:29:18','きよもんさん','2019.07.28'),(934,'一袋でいろんな味が楽しめて、おやつにお茶ともビールのおつまみにも良いので、家族みんなで食べられて、いつもストックしています♪個包装で量もちょうど良いので、おすすめです♪',5,175,'2020-10-07 05:29:18','2020-10-07 05:29:18','まにーさん','2019.03.23'),(935,'とっても美味しいです。いろいろな味が楽しめます。 分量もちょうどいいです。友達とも分けあえて、話もはずみます。',5,175,'2020-10-07 05:29:18','2020-10-07 05:29:18','ぽんたさん','2019.01.22'),(936,'色々楽しめて美味しいけど、それぞれの単品の個包装物の個袋が詰めてあるも欲しいです。',4,175,'2020-10-07 05:29:18','2020-10-07 05:29:18','このし～さん','2018.11.25'),(937,'10種類のお菓子が一袋に入っていていろいろ楽しめるのがいいです 価格も手ごろです',5,175,'2020-10-07 05:29:18','2020-10-07 05:29:18','かあちゃんちゃんさん','2017.01.29'),(938,'個包装のパッケージデザインが、内容を一層引き立てるデザインたと思います。 美味しいです。小魚によりカルシウムのおやつでとれてうれしいです。',4,175,'2020-10-07 05:29:18','2020-10-07 05:29:18','世界に広めたいさん','2016.11.01'),(939,'これ1品の中に、大好きなお菓子が詰まっていて、お楽しみ袋みたいです。ピーナッツ入り揚げ煎餅、えび揚げ煎餅、いか豆、揚げ煎餅、いか天は、単品でも購入するくらい好きなのですが、この商品を買えば、それらも入っているうえに他のお菓子も食べることができ、また、個包装になっているので食べすぎ防止になって助かります。味も、単品のものとほとんど変わらず美味しかったです。',4,175,'2020-10-07 05:29:18','2020-10-07 05:29:18','sakonaさん','2016.10.17'),(940,'色々な味が楽しめて大好きです。とくにいか天が好きなのでもう少し入っているといいな。',4,175,'2020-10-07 05:29:18','2020-10-07 05:29:18','白い月さん','2016.09.11'),(941,'大好きないか天が入って、色々な味が楽しめて大好きです。',5,175,'2020-10-07 05:29:18','2020-10-07 05:29:18','白い月さん','2016.09.07'),(942,'食べやすい味のおかきばかりが入ってて、とても美味しい!!私のお気に入りです!酎ハイのおつまみや小腹の空いたときには最高!',4,175,'2020-10-07 05:29:18','2020-10-07 05:29:18','さん','2016.08.13'),(943,'ごまとアオサ、ナッツと健康食材が1度に摂れる所が良いです。シンプルで素朴な味なのに、何度も食べたくなる美味しさです。',5,176,'2020-10-07 05:29:18','2020-10-07 05:29:18','ばっばさん','2018.05.19'),(944,'他の通販の大量売りに比べて豆の味がしっかりとしています。 なのでどうしてもイオンのものを購入することになります。 できれば500gや1kgなどの大量のパックを作って欲しいです。',5,177,'2020-10-07 05:29:18','2020-10-07 05:29:18','ミヤさん','2020.01.18'),(945,'美味しい。そのまま食べても美味しいですが酢に漬けて食べています。便秘解消に良いです。大容量が欲しいです。',5,177,'2020-10-07 05:29:18','2020-10-07 05:29:18','ちかちゃんさん','2019.04.29'),(946,'あっさりしていてるので小腹が空いたときに美味しく頂けます。 ナッツに比べてカロリーが格段に低いので、煎り大豆の旨味がおつまみとしても十分楽しめます。',5,177,'2020-10-07 05:29:18','2020-10-07 05:29:18','tacosさん','2019.03.04'),(947,'糖質制限をしてます。豆腐より歯ごたえがあり、素朴な美味しさがあります。安心して食べられるので好きです。',5,177,'2020-10-07 05:29:18','2020-10-07 05:29:18','あきさん','2018.11.26'),(948,'毎日食べています。ポリポリとそのまま食べられるのですぐになくなります。お菓子を食べるより罪悪感がないかも。',5,177,'2020-10-07 05:29:18','2020-10-07 05:29:18','みつこさん','2018.04.28'),(949,'そのままおやつとして食べています。とても美味しくてついつい食べ過ぎてしまいます。北海道産の大豆でこのお値段はお値打ちだと思います。',4,177,'2020-10-07 05:29:18','2020-10-07 05:29:18','samapapaさん','2017.10.22'),(950,'煎り大豆だけを食べたい人には嬉しいです 量が多くて一人では食べきれないのが難点',4,177,'2020-10-07 05:29:18','2020-10-07 05:29:18','ぴさん','2017.10.06'),(951,'更年期を元気に過ごすために毎日かじっています。 塩不使用なのが気に入っています。 素材の味を楽しんでいます。',4,177,'2020-10-07 05:29:18','2020-10-07 05:29:18','さらさん','2017.03.17'),(952,'非常に香ばしく歯ざわりも良い!噛んでいるうちに感じるほのかな甘さ。北海道産も好感度大。',5,177,'2020-10-07 05:29:18','2020-10-07 05:29:18','酒絶ち人生さん','2017.01.20'),(953,'単品でも十分美味しいですが、ミックスナッツに混ぜて、おやつとして食べています。手軽に、たんぱく質とイソフラボンが摂れるので、いつも鞄に常備しています!',5,177,'2020-10-07 05:29:18','2020-10-07 05:29:18','ジゼルさん','2016.12.13'),(954,'美味しいです。小腹がすいた時など噛みごたえがあるので少しの量でもいっぱい食べた気分になります。大豆だから栄養面でも⭕',4,177,'2020-10-07 05:29:18','2020-10-07 05:29:18','スーさんの嫁さん','2016.12.01'),(955,'以前書いたものですが、家のフライパンで煎ってみたら美味しくなりました。 香ばしくなるまでしっかりいってほしいです',5,177,'2020-10-07 05:29:18','2020-10-07 05:29:18','さん','2016.07.20'),(956,'前のほうが軽い食感で大豆の旨味を感じられた。これは、外が硬くてツルツルで生のを食べているみたい。 前にもどしてほしい。 量も20グラム減った。残念 大ファンだったのに。',1,177,'2020-10-07 05:29:18','2020-10-07 05:29:18','さん','2016.07.18'),(957,'いろいろ入っておいしいです。',5,178,'2020-10-07 05:29:18','2020-10-07 05:29:18','himicoさん','2020.06.30'),(958,'チャックがついているので、食べたい時に好きな量をたべられるので良いです。ピーナッツが多いような。',4,178,'2020-10-07 05:29:18','2020-10-07 05:29:18','ゆうたんたたたたたんさん','2020.03.05'),(959,'商品の味に不満はありません。 今回初めての購入ではっきりとはわかりませんが、 先の方も書かれている通り、バラツキがあるのかも知れません。 私が購入したものはピーナッツが多くを占めており、くるみ・アーモンドが極端に少ない。 特にアーモンドは10粒も入っていませんでした。 コストの面でもピーナッツ類が多いだろうとは思っていましたが、 あまりに想像していたものと違っていたので残念です。',3,178,'2020-10-07 05:29:18','2020-10-07 05:29:18','のらさん','2017.08.05'),(960,'価格は手頃だが、中身に偏りがあるようだ。先日買った袋ではアーモンドの割合が極端に少なかった。それが比較的安い理由なら、あまりお得とも言えない。',2,178,'2020-10-07 05:29:18','2020-10-07 05:29:18','aGTerさん','2017.04.29'),(961,'小腹が空いた時にちょっとつまめるものを探していました。 6種類がバランス良くミックスされているので飽きることなく食べられます。衣がけピーナッツがポイントですね',5,178,'2020-10-07 05:29:18','2020-10-07 05:29:18','かあやんさん','2017.03.29'),(962,'小腹がすいた時にはこのミックスナッツを食べます。 ナッツがバランスよく入っているし塩加減もちょうどいい',3,178,'2020-10-07 05:29:18','2020-10-07 05:29:18','イオン大好きさん','2016.08.08'),(963,'ナッツは健康に良いと聞いたので愛用しています',4,178,'2020-10-07 05:29:18','2020-10-07 05:29:18','きららさん','2016.06.13'),(964,'アーモンドとカシューナッツがバランス良く入っています。個人的にはくるみは要らないかなと思うので、２種で商品化して欲しい。 ですが、粒しっかり、量と価格設定は良心的。絶対買い！です。',5,179,'2020-10-07 05:29:18','2020-10-07 05:29:18','Teresaさん','2020.06.22'),(965,'食塩・油不使用のミックスナッツはあまり売られていないので、これを見つけたときは即買いしました。粒揃い、大袋でこの値段は驚異的です。店頭では売り切れているときも多く、見つけたら買っています。',5,179,'2020-10-07 05:29:18','2020-10-07 05:29:18','山田花子さん','2020.06.17'),(966,'美容と健康、今は妊活のために毎日素煎りナッツを食べています。ナッツ難民だった頃に色々試しましたがトップバリューはやっぱすごい。これだけ形もしっかりしたナッツが205g入ってこの価格は本当にお得だと思います！',5,179,'2020-10-07 05:29:18','2020-10-07 05:29:18','にゃんこさん','2020.06.01'),(967,'素煎り３種のミックスナッツ２０５ｇとても美味しくてもう幾度も購入しています、先日４１０ｇ入りを見つけて購入しましたが（名古屋イオン新瑞橋店）１回だけしか見つけられませんでした。トップバリューブランドはとても美味しく種類も沢山ありこれからもお値打ちな商品を提供期待しています。ＮＥＴで探して研究したいです。',4,179,'2020-10-07 05:29:18','2020-10-07 05:29:18','ヤマチャンさん','2020.04.12'),(968,'お菓子を作るのに買ったナッツでしたが、食べてみるとナッツに甘味があり、とてもおいしかったです。',5,179,'2020-10-07 05:29:18','2020-10-07 05:29:18','りんごさん','2020.04.04'),(969,'健康を考えてナッツを毎日食べています！このミックスナッツはトップバリューでお得なうえ、美味しくて家計に優しく続けていけそうです！',5,179,'2020-10-07 05:29:18','2020-10-07 05:29:18','ごんごんさん','2019.11.08'),(970,'美容のためにもう2年くらい食べています。くるみはオメガ3の脂肪酸なので健康にも良いので毎日夕食後に欠かさず食べています。素焼きで添加物なしが気に入っています。',5,179,'2020-10-07 05:29:18','2020-10-07 05:29:18','あっこちゃんさん','2019.10.27'),(971,'素煎りなので、塩分を気にせずパクパク食べられます。 ちょっと小腹がすいた時の常備品。 コスパも良いと思いますが、もっと大サイズがあったらうれしいです。',4,179,'2020-10-07 05:29:18','2020-10-07 05:29:18','pumaさん','2018.07.25'),(972,'塩分・油分などが入っていなくてナッツ自体のおいしさを楽しめる。 おいしくてすぐ食べきってしまう。',5,179,'2020-10-07 05:29:18','2020-10-07 05:29:18','ロシアンブルーさん','2018.06.05'),(973,'我が家には小動物が居るのでその子も一緒に食べています、みんなで食べると2日しか持たないのでもっと大きい袋で欲しいです。1キロとか2キロくらい。',5,179,'2020-10-07 05:29:18','2020-10-07 05:29:18','ナミママさん','2018.06.02'),(974,'ハイボールのお供にとても合うので毎日楽しみにしています。 美味しくて健康にも良いですが食べ過ぎ、飲み過ぎに注意です。',5,179,'2020-10-07 05:29:18','2020-10-07 05:29:18','NEWガチャポン1さん','2018.06.02'),(975,'健康のため、3種類ともまんべんなく食べたい。 くるみの量を増やしてほしいです。',4,179,'2020-10-07 05:29:18','2020-10-07 05:29:18','vigaalさん','2018.05.23'),(976,'コスパかなり良い！ 味もうまい！ 売り切れになってほしくないから みんなに教えたくない！ イオンのミックスナッツお買い得だよ！！',5,179,'2020-10-07 05:29:18','2020-10-07 05:29:18','不謹慎さん','2018.05.10'),(977,'色々食べた中で一番おいしくて価格も安いので家に常備しています。',5,179,'2020-10-07 05:29:18','2020-10-07 05:29:18','みっこさん','2018.03.30'),(978,'素煎りなので塩分も気にしないで美味しく食べれます。ただ食べ過ぎに気を付けないと。マカダミアナッツが入っているともっといいのですが。',5,179,'2020-10-07 05:29:18','2020-10-07 05:29:18','やこさん','2017.10.29'),(979,'カロリーが高いのはわかっていますが、美味しいので2日で一袋食べてしまいます。',5,179,'2020-10-07 05:29:18','2020-10-07 05:29:18','mayuさん','2017.04.25'),(980,'お値段もお安くなって、美味しいので、ついつい食べ過ぎちゃいます。',5,179,'2020-10-07 05:29:18','2020-10-07 05:29:18','シェルマミーさん','2017.04.20'),(981,'なんどもリピート購入しています!ちょっとおなかがすいた時にポリポリ食べています。',5,179,'2020-10-07 05:29:18','2020-10-07 05:29:18','nicoさん','2017.03.21'),(982,'美容の為、健康の為に2年ぐらい前から食べています。もちろん食塩・油不使用なので購入しています。味も飽きることなく美味しく毎日食べています。',5,179,'2020-10-07 05:29:18','2020-10-07 05:29:18','あっこちゃんさん','2017.02.20'),(983,'健康を気遣い、おやつも選んでおりますが、まさにこれはぴったりでした。美味しい。',5,179,'2020-10-07 05:29:18','2020-10-07 05:29:18','あゆいのさん','2016.11.30'),(984,'塩分の取り過ぎは注意なので、塩分不使用を選びました。 大粒でとても美味しいです。 食べ過ぎに注意したいです。',4,180,'2020-10-07 05:29:18','2020-10-07 05:29:18','ペンギンさん','2020.05.17'),(985,'食塩、油不使用のピーナッツ商品はなかなか無いので気に入ってます。間食様に常備してますが、食べ出すと止まらないので、すぐ無くなってしまいます。笑',5,180,'2020-10-07 05:29:18','2020-10-07 05:29:18','ふにゃさん','2019.01.24'),(986,'毎日20粒食べています。うす皮に糖質の吸収をブロックする効果があると聞いたので。粒が大きくてほのかな甘味があって美味しいです。私の常備食なので、品切すると困ります(笑)',5,180,'2020-10-07 05:29:18','2020-10-07 05:29:18','KOZYさん','2018.09.22'),(987,'やっぱりこれが一番です。イオンさんのキャラメルコーンと一緒に食べるとおいしいです。',5,180,'2020-10-07 05:29:18','2020-10-07 05:29:18','ｐｏｏｈさん','2018.07.27'),(988,'油や塩なし、素焼きだから、買いますが、品切れが、多発します',4,180,'2020-10-07 05:29:18','2020-10-07 05:29:18','クワ婆さん','2018.02.20'),(989,'良く購入します。皮ごと食べれて美味しい。最近在庫無くて少し焦りました。毎日10粒食べてます。',4,180,'2020-10-07 05:29:18','2020-10-07 05:29:18','ボーテさん','2017.11.10'),(990,'素煎りピーナッツは産地問わず色々食べてきましたが、トップバリュのこれは落花生の味がしっかりしていて、粒が大きくて甘みが有り、値段が安いのにとても美味しいと思っています。好みによるとは思うのですが、個人的には国産よりも気に入っています。他の方のレビューでも品切れしているとありますが、地元のイオンでも最近販売がなくなっていて残念です。',5,180,'2020-10-07 05:29:18','2020-10-07 05:29:18','Motoさん','2017.09.11'),(991,'コスパ良し。 他社製品と比べて、粒が大きいわりには安いし、美味しい。 最近、品切れ気味。近所のイオン、ミニストップでは品切れしています。',5,180,'2020-10-07 05:29:18','2020-10-07 05:29:18','kamozさん','2017.08.25'),(992,'テレビでピーナツが血管を丈夫にすると言っていたので食べ始めました。中国製なのが気になりますが、イオンを信じて食べています。',3,180,'2020-10-07 05:29:18','2020-10-07 05:29:18','あっこちゃんさん','2017.03.15'),(993,'無塩なので塩分を気にせず毎日かじってます。 少食になってしまって困っていましたが、これにたどり着きました。 隠れ栄養失調対策に最適!',4,180,'2020-10-07 05:29:18','2020-10-07 05:29:18','かん太さん','2016.08.07'),(994,'甘くて、とてもおいしいです。また購入します',4,181,'2020-10-07 05:29:18','2020-10-07 05:29:18','ゆうたんさん','2019.02.28'),(995,'大好きで、イオンに行くたび買ってしまいます！ 甘くて柔らかく、細いサイズが食べやすくて、他メーカーのものより断然お気に入りです。 価格も安くて嬉しい！',5,181,'2020-10-07 05:29:18','2020-10-07 05:29:18','あきさん','2018.02.16'),(996,'甘くておいしいです。角切りで食べやすい。子供が大好きです。',5,181,'2020-10-07 05:29:18','2020-10-07 05:29:18','すさん','2016.09.04'),(997,'国産ではないのがちょっと残念ですが、この価格でオーガニックの干し芋。固いということもなく美味しいです。',4,182,'2020-10-07 05:29:18','2020-10-07 05:29:18','おーさん','2019.07.20'),(998,'オーガニックなので、安心して美味しく食べられます。 春になると店頭で見当たらないので、年中販売して欲しいぐらい好きな商品です。',4,182,'2020-10-07 05:29:18','2020-10-07 05:29:18','彩夏さん','2016.03.20'),(999,'国内産の安納芋や紅はるかなどの干し芋と比べると甘さは控えめで、また非常に噛み応があります。 好みによるとは思いますが、個人的には固めで甘すぎない干し芋が好きなのでよく購入しています。 私はそのまま食べていますが、甘くて柔らかめの干し芋が好きな方は、トースターで少し温めると、柔らかくなり甘みも増すのでオススメです。 中国産ですが、有機栽培かつ有機JAS認定工場加工ということで、信頼して食べています。 国産のものよりもかなりお手頃なのが良いですね。',5,183,'2020-10-07 05:29:18','2020-10-07 05:29:18','Motokaさん','2019.05.30'),(1000,'ビックリするほど不味い。固いし甘くないし。これで良いと判断し販売するなんて驚くばかり。中国産だったが、有機だしグリーンアイだしと少しばかり信用したことが間違いだった。やっぱりトップバリュ商品はダメだった。',1,183,'2020-10-07 05:29:18','2020-10-07 05:29:18','カオリさん','2019.01.19'),(1001,'ぜひ食べてみてください。 普通のレーズンとは全く違って、皮がやわらかく、上品ですっきりとした甘さと香りがあります。 ヨーグルトと合わせて食べてもおいしいですよ！',5,184,'2020-10-07 05:29:18','2020-10-07 05:29:18','けいぴさん','2020.08.02'),(1002,'オイルコーティングされていなくてオーガニック、しかもマスカットって素敵ですね。 ドライでもマスカットはマスカットの香りがして、おいしいです。そのまま食べるのもおいしいですが、甘味がとても強いので、砂糖の代わりに、使うのもいいですよ。これをいれてパンケーキを焼くと、砂糖なしでも十分甘いです。',4,184,'2020-10-07 05:29:18','2020-10-07 05:29:18','にゃおんさん','2020.06.21'),(1003,'マスカットのレーズンは初めて食べましたが、ブドウのレーズンよりもスッキリした甘さで、爽やかな酸味があります。 ブドウのレーズンはあまり率先して食べないのですが、これは手が止まらなくなる美味しさです。 植物油脂や保存料（ソルビン酸等）が使われておらず、有機栽培というのも安心感があって良いですね。',4,184,'2020-10-07 05:29:18','2020-10-07 05:29:18','Motokaさん','2020.04.16'),(1004,'朝の紅茶に入れる習慣にしています。これまでいろいろなレーズンを試しましたが、これがベストです。リキュールにつけて柔らかく戻してから使いますが、歯ごたえの残る食感と程よい甘みが絶妙です。 ホットケーキに入れて焼くとまた別の美味しさがあります。',5,184,'2020-10-07 05:29:18','2020-10-07 05:29:18','キクジロウさん','2019.08.27'),(1005,'マスカットの風味があって美味しい❗️鉄分もしっかり摂れるし、レーズンが苦手な私もこれなら食べられます‼️',5,184,'2020-10-07 05:29:18','2020-10-07 05:29:18','kyounaさん','2019.03.18'),(1006,'オイルコーティングされていないレーズン探していたのですが、見当たらずこのマスカットレーズンを購入。甘さあり、酸味ありで最近はこればかり購入。お酒に合います！',5,184,'2020-10-07 05:29:18','2020-10-07 05:29:18','fheeさん','2019.01.30'),(1007,'マスカットのレーズンは初めてでしたが、通常のレーズンよりも香りが爽やかで、高級感がありました。オーガニックなのも、高品質でいいですね。',4,184,'2020-10-07 05:29:18','2020-10-07 05:29:18','ななさん','2017.06.05'),(1008,'オイルコーティングされていないので食べやすいです マスカットのさわやかな酸味でさっぱりした後味のレーズンです リフレッシュにもいいしヨーグルトなどにも合います',5,184,'2020-10-07 05:29:18','2020-10-07 05:29:18','kodaさん','2017.05.12'),(1009,'普通のレーズンとは違いますね。お勧めです。',5,184,'2020-10-07 05:29:18','2020-10-07 05:29:18','ももさん','2016.01.20'),(1010,'おいちい(*\'-\'*)',5,185,'2020-10-07 05:29:18','2020-10-07 05:29:18','ぽぽさん','2019.07.14'),(1011,'少しレンジで温めるとホクホクになりとてもおいしかったです',4,186,'2020-10-07 05:29:18','2020-10-07 05:29:18','あきさん','2020.06.11'),(1012,'これまでに色々なメーカーのむき甘栗を「大体こんなものだ」と思って食べてきました。 今回初めてこちらの商品を頂き、「美味しい！何処の？」と確認してしまいました。 「味、香り、やわらかさ」◎です。',5,186,'2020-10-07 05:29:18','2020-10-07 05:29:18','シュリシンさん','2020.01.13'),(1013,'美味しかったです。あっという間に1袋完食してしまいました。出来れば価格面でお買い得感を感じれると嬉しいです。',3,186,'2020-10-07 05:29:18','2020-10-07 05:29:18','ヒロ爺さん','2016.10.08'),(1014,'自然な甘さで美味しいです。 満足感があり、量も丁度良いです。',5,186,'2020-10-07 05:29:18','2020-10-07 05:29:18','ritoriさん','2015.09.16'),(1015,'むき栗のオーガニック商品って珍しいですね。 他にない分、ありがたいです。味は申し分ないし、良心価格だと思います。',5,186,'2020-10-07 05:29:18','2020-10-07 05:29:18','nayutaさん','2015.06.21'),(1016,'有機の栗って本当に安心で、おやつにパクパク一人で一袋食べてしまいます♪♪ むき栗も美味しいですけれど、むき甘栗の方も最高ですよぉおお～★パッケージもお洒落なのでお友達のお家へお土産で持って行っても喜ばれました!! 美味しすぎっ!!',5,186,'2020-10-07 05:29:18','2020-10-07 05:29:18','ロッタさん','2015.05.11'),(1017,'とてもおいしい。 また購入したいと思います。',5,186,'2020-10-07 05:29:18','2020-10-07 05:29:18','さん','2014.12.18'),(1018,'比較的ソフトな食感の黒いちじくです。 よく見かける白いちじくと比較すると、デーツや黒糖を彷彿とさせる濃厚な甘さがある中で、ほのかに酸味も感じられてとても美味です。 オーガニックで無添加というのも良いですね。少しお高めですが、品質は確かだと思います。 黒いちじくがスーパーで手軽に購入できてありがたいです。',5,187,'2020-10-07 05:29:18','2020-10-07 05:29:18','Motoさん','2020.06.27'),(1019,'イチジク好きのを私が、見つけたときには　嬉しかったです。 ちょうど良い甘さ、ちょうど良い量。',5,187,'2020-10-07 05:29:18','2020-10-07 05:29:18','おはなさん','2020.02.08'),(1020,'毎日のスタートに朝1.2つ食べてます。間食やおつまみにも最高です。カロリー気になる方にもオススメできます。因みに朝のコーンフレークと牛乳と一緒なら更に満足感アップ',5,187,'2020-10-07 05:29:18','2020-10-07 05:29:18','ユリモリさん','2015.06.23'),(1021,'いままでドライフルーツはトルコ産の輸入ものしか食べたことなかったですが、日本で加工した為か、品種の違いか、とってもやわらかいいちじくでした。 いつもプレーンヨーグルトにまぜて食べています。 オーガニックで気持ちがいいですね。',5,187,'2020-10-07 05:29:18','2020-10-07 05:29:18','nayutaさん','2015.06.18'),(1022,'よく買います。おつまみ系トップバリューで探します。',5,191,'2020-10-07 05:29:18','2020-10-07 05:29:18','トシさん','2020.07.09'),(1023,'甘味があっておいしいです。弾力感も最高で良かったです。',5,191,'2020-10-07 05:29:18','2020-10-07 05:29:18','かまかまさん','2020.07.03'),(1024,'一般的なドライいちじくと比べると、水分が多めに含まれたソフトタイプのドライいちじくで、プルーンのようにやわらかな食感です。 しっかり乾燥させたものとはまた違う味わいで、ジューシーでもっちりした食感が味わえます。 こちらもしっとりしていて美味しいですが、歯ごたえのあるドライいちじくも取り扱っていただければあればうれしいです！（昔はあったような？）',4,193,'2020-10-07 05:29:18','2020-10-07 05:29:18','Motoさん','2020.06.29'),(1025,'これ、おいしいですよ。私は、お酒のおつまみとして食べています。食感がよく、昆布のうまみを感じることができます。ほんのり梅味がアクセントになって、ドンドンいけますよ。オススメです。',4,195,'2020-10-07 05:29:18','2020-10-07 05:29:18','ＷＷＯさん','2020.06.19'),(1026,'新しくなってさらにおいしいです、 梅味のすっぱさと昆布の相性がとても良くて、 なめてもいいし、噛んでもいいし。 口の中でしばらくそのまま下の上にのせておくのが好きです',5,195,'2020-10-07 05:29:18','2020-10-07 05:29:18','ひろやんさん','2020.06.08'),(1027,'甘いオヤツに飽きて、かと言って塩気のものは摂りたくないので何か無いかなぁ？と探していて発見！香ばしさと噛むほどにお口に広がる美味しさで大満足です。しかも北海道産大豆使用で安心です！更に、カロリーを気にせず食べれるから嬉しい！ 飽きのこない美味しさに発見以来リピ買いです。',5,196,'2020-10-07 05:29:18','2020-10-07 05:29:18','るるるさん','2020.06.12'),(1028,'ビールにピッタリです。',5,197,'2020-10-07 05:29:18','2020-10-07 05:29:18','パエリアさん','2020.05.24'),(1029,'つまみに買いました。 美味しくて食べやすくて最高でした！！また買いたいと思いました。',5,200,'2020-10-07 05:29:18','2020-10-07 05:29:18','YAMADA さん','2018.10.01'),(1030,'価格と味に関しては最高点を叩き出しました！が、スルメそうめんの長さが均等でない為に指で沢山摘んで食べるって時に溢れたりするのが残念極まりないですね！まぁこれからも買い続けますけど',2,200,'2020-10-07 05:29:18','2020-10-07 05:29:18','しんじょうさん','2018.01.22'),(1031,'安くて美味しいです。小腹が空いた時によく食べますが、美味しいのでついつい食べすぎてしまいます。',5,203,'2020-10-07 05:29:18','2020-10-07 05:29:18','kumiさん','2020.06.21'),(1032,'いかに弾力があり美味しいです。油加減もちょうど良く後味も良いです。',5,203,'2020-10-07 05:29:18','2020-10-07 05:29:18','しちみんさん','2020.04.19'),(1033,'コリコリとした食感と少し酸味のきいた味わいがくせになります。たくさん入っているのでお得です。',5,207,'2020-10-07 05:29:18','2020-10-07 05:29:18','サマンサさん','2020.06.30'),(1034,'アーモンド本来の味わいを楽しめる商品だと思います。食べやすくて、おいしかったです。',5,211,'2020-10-07 05:29:18','2020-10-07 05:29:18','きりぬさん','2020.04.17'),(1035,'香ばしくて美味しいです。素材そのままの味を楽しむことができました。',4,213,'2020-10-07 05:29:18','2020-10-07 05:29:18','けーさん','2020.05.19'),(1036,'お酒のおつまみとして愛用しています。食感がよく、ついついお酒を飲みすぎてしますことが唯一の欠点です。小魚でカルシウムを補給し、アーモンドでビタミンＥと食物繊維を摂ることができ、子供のおやつにも最高な一品です。お魚が国産であることもうれしいですね。',4,221,'2020-10-07 05:29:18','2020-10-07 05:29:18','ＷＷＪさん','2020.03.29'),(1037,'ふんわりやわらかくてとっても」おいしいです！',5,224,'2020-10-07 05:29:18','2020-10-07 05:29:18','nicoさん','2020.05.15'),(1038,'白い脂のかたまりが結構あって、脂っこい。それ以外の部分は普通に美味しいので、残念です。',2,227,'2020-10-07 05:29:18','2020-10-07 05:29:18','ベルメールさん','2020.04.11'),(1039,'このまま食べました。生臭くて、食べられません。トースターを温めてから炙ってみましたが、生臭さはかわらなかったし、味付なので焦げてしまうほどの切り方です。以前、味がかなり辛めのもので、炙らないのもあったと思うのですが、エイヒレとってのはこういう食べ物ではないと思います。おいしくないです。',1,231,'2020-10-07 05:29:18','2020-10-07 05:29:18','あかねさん','2020.02.23'),(1040,'炙っていただきました。肉厚で、美味しくいただきましたが、いったい何処の国の素材でしょうか? 表示がないのはその理由があるのですかね?',4,231,'2020-10-07 05:29:18','2020-10-07 05:29:18','猫足さん','2017.05.01'),(1041,'めっちゃ食べやすく美味しいのに マックスバリューにはない！ イオンにもない…幻だったのか…',5,232,'2020-10-07 05:29:18','2020-10-07 05:29:18','あやさん','2020.01.28'),(1042,'やわらかくて食べやすい、さきいかだと思います。噛めば噛むほど味も出ておいしいです。',5,234,'2020-10-07 05:29:18','2020-10-07 05:29:18','五篭さん','2019.11.10'),(1043,'ナッツとチーズどっちも美味しくて、チーズの入ってるものはあまり見かけないので 今回初めて買ってみたけど、美味しくてあっという間に一袋食べてしまいました。 ナッツとチーズ合うので気に入りました。今度はまとめ買いしようと思います。',5,237,'2020-10-07 05:29:18','2020-10-07 05:29:18','kumiさん','2020.05.01'),(1044,'ミックスナッツはよく買っていましたがこれはチーズが入っていてとても美味しいです。個包装の量もちょうど良く買っても買っても家族みんなでよく食べるのですぐ無くなります。',5,237,'2020-10-07 05:29:18','2020-10-07 05:29:18','ぽこさん','2020.01.22'),(1045,'乾燥チーズが特に気に入ってます！ ミックスナッツは色々あって好きなので良く買いますが最近TOP VALUを見つけて食べてみたらとても美味しかったです。',5,237,'2020-10-07 05:29:18','2020-10-07 05:29:18','チュウさん','2019.12.19'),(1046,'毎日食べてます。いろいろな種類のナッツが一度にとれて、小分けにしてあるので食べすぎ防止に役立っています。大袋の方がお得なのはわかるのですが、あるだけ食べてしまうので小分けタイプは大変うれしいです。',4,238,'2020-10-07 05:29:18','2020-10-07 05:29:18','ヒロさん','2020.06.09'),(1047,'ヘーゼルナッツの香りとカリッとした食感がとても良く、それ以外のナッツも美味しいです。お高めのマカダミアナッツも入っているので、お得感&満足感がありました。 小分けサイズのナッツは、大袋と比べると少し割高感がありますが、食べ過ぎ防止にはちょうど良いサイズで保存性が高いのが魅力です。',4,238,'2020-10-07 05:29:18','2020-10-07 05:29:18','Motokaさん','2020.04.23'),(1048,'おいしくて、おやつに適量で満足、食べ過ぎ予防にもおすすめです。',5,238,'2020-10-07 05:29:18','2020-10-07 05:29:18','まめさん','2020.03.02'),(1049,'オレイン酸やビタミンEを摂りたくて購入しました、糖質オフだし、何より美味しい！食べすぎ注意にもよい小分け袋で扱いもよい。リピしようと思ってます。',5,238,'2020-10-07 05:29:18','2020-10-07 05:29:18','ちかこさん','2020.01.19'),(1050,'ナッツが好きでいつもイオン内にある店で購入していました。先日トップバリュのこの商品を見つけ試しに買ってみました。美味しかったです。糖質オフなのも嬉しいです。小袋なので食べ過ぎずいいですね。これからは、こちらを買うことにします。',4,238,'2020-10-07 05:29:18','2020-10-07 05:29:18','モカままさん','2020.01.12'),(1051,'食べだすと止められない止まらないくらい美味しいです。お酒のおつまみに最高です。',4,239,'2020-10-07 05:29:18','2020-10-07 05:29:18','kumiさん','2019.10.22'),(1052,'ふぞろいですが、お手頃価格、 チーズたら好きの私のビールのおつまみ！ いつも、常備してます。',4,239,'2020-10-07 05:29:18','2020-10-07 05:29:18','ピンパさん','2018.05.29'),(1053,'有名メーカーの商品となんら遜色なく、食べ出したら止まりません。 チーズのコクもあって大好きです。 ただ、保存しやすいパックにしてもらいたいです。',5,239,'2020-10-07 05:29:18','2020-10-07 05:29:18','となかいさんさん','2016.12.06'),(1054,'脂身が少なめで、おなか壊さないので、ポテトチップス感覚でもりもり食べれます。',4,240,'2020-10-07 05:29:18','2020-10-07 05:29:18','ぴのこさん','2020.02.01'),(1055,'賞味期限一週間前の商品が税込み50円であったので試しに購入。意外に美味かった(笑)',4,240,'2020-10-07 05:29:18','2020-10-07 05:29:18','とらねこさん','2017.11.10'),(1056,'トップバリュなので半信半疑で購入も意外と美味しかった。いい意味で裏切られた。他の製品もこれぐらいの質があれば。',4,240,'2020-10-07 05:29:18','2020-10-07 05:29:18','水野さん','2017.03.05'),(1057,'結構入ってて、この価格は嬉しい。 ねじねじの袋で小包装だから片手で食べやすいです。 ポクポクとした硬めの食感で食べ応えあり、味も美味しいです。',4,241,'2020-10-07 05:29:18','2020-10-07 05:29:18','まゆちゃんさん','2018.07.31'),(1058,'この値段でこの味は素晴らしいと思います。とても美味しいです^ ^',5,241,'2020-10-07 05:29:18','2020-10-07 05:29:18','あっぷるさん','2018.03.21'),(1059,'この価格なら納得できる味ですよ。スパイスを効かせて鶏胸肉の淡白な味と豚の背油の組み合わせはバランスが取れていると思います。某ＰＢのドライソーセージとは違う7。',4,241,'2020-10-07 05:29:18','2020-10-07 05:29:18','元カルパス会社勤務さん','2018.01.15'),(1060,'味は前から変わらないと思う。ふつうの味。 パッケージがよくなったのでおいしそうに思う。',3,241,'2020-10-07 05:29:18','2020-10-07 05:29:18','わかこんさん','2016.11.21'),(1061,'以前の物の方が美味しかった',1,241,'2020-10-07 05:29:18','2020-10-07 05:29:18','さん','2016.08.29'),(1062,'毎週買ってます。買いすぎじゃないかと思うほどに。',5,247,'2020-10-07 05:29:18','2020-10-07 05:29:18','トシさん','2020.04.01'),(1063,'すごく美味しい。これまで健康のために素煎りナッツを食べていたが、ちょっと塩気がほしいなと感じこちらを購入。大正解。塩気が強すぎずちょうどよく、ナッツの歯ごたえもとてもよい。',5,247,'2020-10-07 05:29:18','2020-10-07 05:29:18','ヨーカドーさん','2019.10.29'),(1064,'以前から定期的に購入しています。お値段も手ごろですし、レーズンの味もとても気に入っています。そのままいただいても美味しいのですが、我が家ではヨーグルトに入れて食べることが多いです。またパウンドケーキ等の焼き菓子にも手軽に利用できるので、使い勝手も良く気に入っています。',5,248,'2020-10-07 05:29:18','2020-10-07 05:29:18','NEKOさん','2020.06.28'),(1065,'ヨーグルトに入れたり、食パンを焼くときに入れています。甘味が程よく美味しいです。',4,248,'2020-10-07 05:29:18','2020-10-07 05:29:18','リイリーイさん','2020.01.28'),(1066,'普段はネットで買っていたがこれからはこちらをリピートします^ - ^すごい美味しかったです！',5,248,'2020-10-07 05:29:18','2020-10-07 05:29:18','やっさんさん','2019.09.20'),(1067,'粒が揃っていて、硬すぎず食べやすい歯応えなので、そのまま食べても美味しいですし、ヨーグルトや、パンや蒸しパン等に入れたり色々使えます。',5,248,'2020-10-07 05:29:18','2020-10-07 05:29:18','家猫屋さん','2019.09.03'),(1068,'安くて美味しいし国内の工場で作られているのでよく購入しています。 イオンPBのヨーグルトに入れて食べてます。',5,248,'2020-10-07 05:29:18','2020-10-07 05:29:18','yoさん','2019.06.16'),(1069,'美味しい！',5,248,'2020-10-07 05:29:18','2020-10-07 05:29:18','くまさん','2019.02.07'),(1070,'ふわふわ柔らかくメチャメチャ美味しい。こんなレーズン初めて。',5,248,'2020-10-07 05:29:18','2020-10-07 05:29:18','なおこさん','2018.10.05'),(1071,'トップバリュ素煎り 3種のミックスナッツと混ぜて保存容器に入れてます。小腹満たし、おつまみ、ケーキ作りに…と万能で重宝してます。',5,248,'2020-10-07 05:29:18','2020-10-07 05:29:18','すずさん','2018.09.06'),(1072,'シリアルに混ぜたり、カレーライスへのトッピングに合うので活用しています。味も好きです。',5,248,'2020-10-07 05:29:18','2020-10-07 05:29:18','akemiさん','2017.09.30'),(1073,'オイル無しのレーズンが手軽に購入できるのでうれしいです。柔らかく自然の甘さたっぷりです。おやつにそのままで食べてます。ぶどうパンを作りたくなる美味しさ!',5,248,'2020-10-07 05:29:18','2020-10-07 05:29:18','ゆうちゃんさん','2017.07.19'),(1074,'ドライフルーツは植物油脂を使用している商品が多いので、果実だけのものは嬉しいです。 酸味も少なく、そのまま食べてもおいしいです。',4,248,'2020-10-07 05:29:18','2020-10-07 05:29:18','楓さん','2017.03.15'),(1075,'素煎り３種のミックスナッツ２０５ｇ入りを何時も購入していましたが、先日イオン新瑞橋店で４１０ｇ入りを見つけましたが、一度だけでその後店頭で見つけられませんとても美味しいので是非販売してほしいです。ＴＯＰＶＡＬＵ大好きです宜しくお願いします。',4,249,'2020-10-07 05:29:18','2020-10-07 05:29:18','ヤマチャンさん','2020.04.12'),(1076,'健康を気にして日頃からナッツ食べているのですが、このサイズのミックスナッツは製菓店とかじゃないとなかなか無いので大容量でとても助かってます。またトップバリュー製品と言うことで安心して食べてます。',5,249,'2020-10-07 05:29:18','2020-10-07 05:29:18','みねさん','2020.02.14'),(1077,'美味しくて病みつきです。お値段、贅沢な気がしましたけれど、たっぷり量が入っているので、毎日チョコチョコつまむにはこれぐらいないとですね。 素焼きなのも、より癖になります。',4,249,'2020-10-07 05:29:18','2020-10-07 05:29:18','なゆたさん','2019.10.30'),(1078,'晩酌のおつまみに、いつも購入しています。 　カシューナッツの甘みも感じられるし、アーモンドのカリッと感、クルミの大きさ、気に入っています。',5,249,'2020-10-07 05:29:18','2020-10-07 05:29:18','たあちんさん','2019.08.18'),(1079,'おいしいです。まいつきかっています。',5,250,'2020-10-07 05:29:18','2020-10-07 05:29:18','あづささん','2020.06.08'),(1080,'カリっとしていて、とても美味しい。 以前ネットで買っていたが、こちらを食べたら格段に美味しかった。 おススメです。',5,250,'2020-10-07 05:29:18','2020-10-07 05:29:18','ナッツファンさん','2020.04.22'),(1081,'妹に「アーモンドいいよ」と大袋をもらいました。 同じような物ないかと探したらイオンにありました。 それと同じ「食塩・植物油不使用となっていたので購入しています。 1袋で1か月あります。1日15グラムが多いのか少ないのかわかりませんが、カルシュウムや鉄が不足がちの私にはいいかなと思っています。 量のわりにはお安いと思います。',5,250,'2020-10-07 05:29:18','2020-10-07 05:29:18','joyさん','2020.01.22'),(1082,'硬すぎず、程良い食感でとても美味しいです。',5,251,'2020-10-07 05:29:18','2020-10-07 05:29:18','ようちゃんさん','2020.06.15'),(1083,'出がらし。 旨味、煮出した後のイカを焙焼してあたりめにしてる感じ。 噛むほどに旨味がでない。 それなのににおいはそれなりにある。',3,251,'2020-10-07 05:29:18','2020-10-07 05:29:18','りてきさん','2019.12.10'),(1084,'イカ本来の味が最高ですよね。塩のみで美味しい。でも一昔前のスルメは匂いがキツくなかったので、少し気になりました。発酵方法が違うのかしら？',4,251,'2020-10-07 05:29:18','2020-10-07 05:29:18','刷毛来ないさん','2019.08.18'),(1085,'コスパがいいのと味付けが濃くなくてもたれません。 塩気も抑え気味なのかな？ あたりめの中では1番だと思います',5,251,'2020-10-07 05:29:18','2020-10-07 05:29:18','ロンフーさん','2018.11.14'),(1086,'容量が２割も減ったのが残念ですがおいしいです',2,251,'2020-10-07 05:29:18','2020-10-07 05:29:18','火曜日さん','2018.08.25'),(1087,'余計な味付けないからおいしい。噛み応えあってダイエットに最適。',5,251,'2020-10-07 05:29:18','2020-10-07 05:29:18','ｐｏｏｈさん','2018.07.30'),(1088,'美味しいよ！',4,251,'2020-10-07 05:29:18','2020-10-07 05:29:18','けいけいさん','2018.07.13'),(1089,'バーリアルのビールであたりめを酒の肴に、食する夕食は至福のひととき‼️あのするめをしがむ感触がたまりません‼️',4,251,'2020-10-07 05:29:18','2020-10-07 05:29:18','マルチーさん','2018.06.15'),(1090,'ちょっと小腹が空いたり、口が寂しいときに食べています。 ダイエット中には欠かせないものです！',5,251,'2020-10-07 05:29:18','2020-10-07 05:29:18','岡さんさん','2018.06.15'),(1091,'安くて美味しかった。欲を言えばもう少し塩分が欲しいかな',4,251,'2020-10-07 05:29:18','2020-10-07 05:29:18','猫さん','2018.06.14'),(1092,'たべごたえもあっていつもおいしく頂いています。今のところヘビロテ中です(^^)',5,251,'2020-10-07 05:29:18','2020-10-07 05:29:18','あーちゃんさん','2018.06.12'),(1093,'これは本当に美味しい！！！ビールのおつまみにも、子ども達のお弁当にも、サラダの飾り付けにも、本当に美味しいですよ！我が家では一袋では足りないので毎回3袋購入しております。買って損はありません。',5,253,'2020-10-07 05:29:18','2020-10-07 05:29:18','ままみひさん','2019.08.20'),(1094,'美味しかったです。手軽に口にできるのも便利です。 持ち運べるので、旅に持っていきたいです。 2018年トップバリュ商多種お世話になりました。 来年も期待しています。',5,253,'2020-10-07 05:29:18','2020-10-07 05:29:18','頂点の価値☆彡さん','2018.12.31'),(1095,'ウズラが好きな事もあり、とても味わいが深く美味しい',5,253,'2020-10-07 05:29:18','2020-10-07 05:29:18','たっちんさん','2018.05.09'),(1096,'すごく美味しいです。卵を取り出した後にパッケージにわずかに残った汁も、だしがとても美味しいので舐めてしまうほどです（お行儀悪いですが…）。小腹がちょっと空いた時にもぐもぐ食べています。味の濃さは単体で食べてちょうどよいくらいなので、おかず的というよりおやつに良いです。',5,255,'2020-10-07 05:29:18','2020-10-07 05:29:18','2月生まれさん','2019.09.30'),(1097,'お酒のあてに買ったけど当てほどではなく、、、 お酒とは別で食べた方がいいかも！！ 塩分少ない目です！！多分',2,255,'2020-10-07 05:29:18','2020-10-07 05:29:18','亜美さん','2019.05.10'),(1098,'いつも美味しく食べさせて貰っています。',5,256,'2020-10-07 05:29:18','2020-10-07 05:29:18','秀さん','2020.05.23'),(1099,'なかなか売ってなくてやっと見つけました。薄味で飽きないし、安いと思います。',5,256,'2020-10-07 05:29:18','2020-10-07 05:29:18','クッキーさん','2020.03.29'),(1100,'無塩、無油で、オーガニック、というのが素晴らしいです。 変に味がついていないので、そのまま食べてもおいしいですが、薄焼き煎餅と一緒に食べるとか、チョコレートと一緒に食べるとか、ドライフルーツと一緒に食べるとかしても、おいしいです。',4,258,'2020-10-07 05:29:18','2020-10-07 05:29:18','にゃおんさん','2020.06.21'),(1101,'素煎りナッツということで、妊娠中からおやつとしてよく食べてました！今も授乳中で、お腹がすくとよくつまんでます。 すごく美味しくて、ボリュームもあって、リピートしてます！',5,258,'2020-10-07 05:29:18','2020-10-07 05:29:18','miiinoさん','2020.03.08'),(1102,'塩分はないのですが、ナッツの甘味でおいしくたべられます。こういうミックスナッツは、カリッとしていない商品もありますが、こういうこの商品はそういうことはなく気に入っています。',4,258,'2020-10-07 05:29:18','2020-10-07 05:29:18','チロルチョコさん','2019.12.16'),(1103,'実家の両親からのお届けものでいただきました。やわらかくてたべやすくて、心も体も癒される絶品です。',5,260,'2020-10-07 05:29:18','2020-10-07 05:29:18','ととろとこころさん','2020.03.28'),(1104,'噛めば噛むほどに旨みが出てくる感じで、とっても美味しかったです。甘い味付けと香ばしさが、お酒のおつまみにピッタリだと思います。私は、お水に浸けて置いてから、汁と一緒にスープの具材にしたり、スープパスタに使ったりもします。クリームチーズとも合いそうなので、次回は合わせてみたいと思います。',4,260,'2020-10-07 05:29:18','2020-10-07 05:29:18','かかちゃんさん','2016.10.17'),(1105,'チーズも濃厚でおいしいです。お酒のお供に良く合います。',5,261,'2020-10-07 05:29:18','2020-10-07 05:29:18','ピコ。さん','2018.05.26'),(1106,'チーズが美味しいと好評!!たらの部分がうすく、チーズ好きには、止まらないです。',4,261,'2020-10-07 05:29:18','2020-10-07 05:29:18','☆きゃんちゃんさん','2016.11.26'),(1107,'塩味が強い気がする。いまは減塩指向なので、検討して欲しい。',3,261,'2020-10-07 05:29:18','2020-10-07 05:29:18','☆きゃんちゃんさん','2016.10.18'),(1108,'以前との違いは、そんなにわかりませんが・・・ 前のほうが食べあきなかったかも。',3,261,'2020-10-07 05:29:18','2020-10-07 05:29:18','nooさん','2016.07.05'),(1109,'丁度良い味付けでスパイシーで美味しいです。お酒のおつまみにピッタリだと思いました。',5,262,'2020-10-07 05:29:18','2020-10-07 05:29:18','kumiさん','2019.11.18'),(1110,'とても美味しいです。夜にお酒といっしょに食べています。良い厚さでとても気に入ってます！',5,262,'2020-10-07 05:29:18','2020-10-07 05:29:18','スヌーピーさん','2019.03.16'),(1111,'衣のしっとり感とするめの相性が抜群で、後を引くおいしさです！！',5,265,'2020-10-07 05:29:18','2020-10-07 05:29:18','銀ヤンマさん','2018.03.14'),(1112,'衣とするめのバランスの良さとやわらかくて食べやすいところが気に入っています。ビールとの相性がぴったりです。',5,265,'2020-10-07 05:29:18','2020-10-07 05:29:18','あさやんさん','2017.05.20'),(1113,'よく購入しています。価格面で、もう少しお得感が出ると嬉しいです。',3,265,'2020-10-07 05:29:18','2020-10-07 05:29:18','爺さん','2017.05.04'),(1114,'味が最高です。何より無添加で、他社製品にない差別化だったのでよく買っていました。 原材料が変わってからは買う回数が減りました。',2,268,'2020-10-07 05:29:18','2020-10-07 05:29:18','hiromiさん','2020.05.12'),(1115,'いかの燻製が大好きでよく買ってます。ジッパーがないので開封したら止まらず食べてしまうので、半分サイズがあったら嬉しいです。',4,268,'2020-10-07 05:29:18','2020-10-07 05:29:18','はるちゃんさん','2018.10.19'),(1116,'お店に行くとかなりの確率で買ってしまいます。 開けて食べ出すと止まらなくなりそうで怖いほどです。 一時期密封ジッパーついてた筈なのに、無くなって少し悲しかった。',5,268,'2020-10-07 05:29:18','2020-10-07 05:29:18','くゆるさん','2018.06.12'),(1117,'ここ最近晩酌のお供に一番食べてるオツマミ！ 歯ごたえが、丁度良い硬さで毎日食べても飽きません １袋の量が少ないので大容量パックが欲しいです',5,269,'2020-10-07 05:29:18','2020-10-07 05:29:18','しいたけさん','2020.03.29'),(1118,'おいしくてよく食べますが塩見がきついのが気になります。 原材料いかのみで塩なしのものをだしてほしい。',2,269,'2020-10-07 05:29:18','2020-10-07 05:29:18','いかさん','2019.06.26'),(1119,'子供のおやつに、よく噛んでくれるし大好物でソフトタイプでなく、こちらを好んで購入しています。 イカの皮も付いていて自然に近いのですが、私にはもう少し味が薄くても。増量で割安なものがあると助かります。',4,269,'2020-10-07 05:29:18','2020-10-07 05:29:18','ママタンさん','2018.10.24'),(1120,'値段も量も手頃。偶に入っているイカの頭の部分が味が濃い感じがして好き。ぱっと見、頭が多そうな所をついつい選んでしまう。 夜中にお腹が空いた時、他の菓子類をつまむよりかはずっと噛んでいられるので、ダイエットな気がしている。',5,269,'2020-10-07 05:29:18','2020-10-07 05:29:18','たかしさん','2018.09.10'),(1121,'味は良いのでが、どこで加工したかではなくどこのイカを使用しているか書いてほしい。',3,269,'2020-10-07 05:29:18','2020-10-07 05:29:18','りんさん','2018.07.10'),(1122,'このあたりめは余計な味が付いてなく、軽く炙ると柔らかくマヨネーズに唐辛子をかけ食べるとベスト。 後、小麦粉を水でときあたりめを10分ほどつけておき柔らかくなったら油で揚げるとさらに美味しく食べられます！',5,269,'2020-10-07 05:29:18','2020-10-07 05:29:18','Togawaさん','2018.06.26'),(1123,'いつもイオンに行くとこの「あたりめ」を買ってきます。 先日買おうと思ったところ内容量が６０ｇ出会ったものが４８ｇに減っていました。 実質２５％の値上げでした。これはやり過ぎです。2度と買いません。',1,269,'2020-10-07 05:29:18','2020-10-07 05:29:18','Dreamerさん','2018.06.25'),(1124,'歯に挟まりも半端ないが、味グー',2,269,'2020-10-07 05:29:18','2020-10-07 05:29:18','大和さん','2018.06.16'),(1125,'この価格でこの味はさすがトップバリュー！企業努力をかんじる！',3,271,'2020-10-07 05:29:18','2020-10-07 05:29:18','ゆうきさん','2018.07.04'),(1126,'もう少しお得感が欲しいです。もう少しチーズの味わいも工夫して欲しいです。',3,274,'2020-10-07 05:29:18','2020-10-07 05:29:18','翁草さん','2019.03.29'),(1127,'いつもベストプライスチーズサンド（チェダー）を買って食べています。 でも、こちらのカマンベールのほうが個のみの味でした。 どんなお酒にも合う、まろやかでクリーミーな味でした。 限定みたいですが販売を続けてほしいです。',5,274,'2020-10-07 05:29:18','2020-10-07 05:29:18','あきぷりんさん','2018.11.15'),(1128,'辛すぎなくて、ピーナッツがたくさん入っていて、値段も手ごろでお気に入りです',5,277,'2020-10-07 05:29:18','2020-10-07 05:29:18','kuronekoさん','2020.06.19'),(1129,'以前からのファンです。大手さんのものと遜色ないですね。値段も安くて嬉しいのですが、なんといっても味が良いです。辛味といいわさび味といい自分の好みです。奥さん共々1日一個の小袋で満足です。ここ1ヶ月位商品が店頭で販売してなくて在庫が底をつきそうでしたが、最近になり購入できるようになりひと安心です。',5,277,'2020-10-07 05:29:18','2020-10-07 05:29:18','ゴルフ大好きおやじさん','2020.06.14'),(1130,'値段がうれしい！あるところ・ないところがあるので、まとめて買います！',5,277,'2020-10-07 05:29:18','2020-10-07 05:29:18','ももさん','2020.06.12'),(1131,'わさびの味がそれほど強くなく丁度良い味で美味しいし、お値段も安いのでよく買います。',4,277,'2020-10-07 05:29:18','2020-10-07 05:29:18','kumiさん','2019.12.22'),(1132,'小分け袋が便利で、定期的に買っています。　メーカー品より安いので助かっています。',4,277,'2020-10-07 05:29:18','2020-10-07 05:29:18','たりきホーガンさん','2019.08.18'),(1133,'美味しい。わさび味がもう少し効いていてもいいかなと思う。価格が手頃で嬉しい。人気の商品の為か欠品が多く残念。',4,277,'2020-10-07 05:29:18','2020-10-07 05:29:18','ちかちゃんさん','2019.04.27'),(1134,'暫くの間、わさび味が店頭から失くなっており、終売かと諦めていましたが復活して良かったです。 大手メーカと遜色のない味で価格が安いので嬉しい商品です。 我が家では常にストックして好きなタイミングで食べています。 そんなに辛くないので子供から大人までおすすめです。',4,277,'2020-10-07 05:29:18','2020-10-07 05:29:18','ボン吉さん','2019.03.30'),(1135,'有名メーカーのものと同じ味で、やめられない美味しさです。個包装なので、湿気を気にせず、気軽に食べられます。',5,278,'2020-10-07 05:29:18','2020-10-07 05:29:18','カリっこさん','2020.06.12'),(1136,'味とコスパの良さに我が家の定番です☆ おかきのカリカリ感とピーナッツの塩加減も最高♪ ビールもすすむわけです！！',4,278,'2020-10-07 05:29:18','2020-10-07 05:29:18','poxさん','2020.06.09'),(1137,'お酒のおつまみとして購入しました。個包装の量も多過ぎず少なすぎずな感じでちょうどいい量だと思います。こういうものってついつい食べ過ぎてしまう事があるので、個包装してくれてる方がいいですね。',5,278,'2020-10-07 05:29:18','2020-10-07 05:29:18','kojiさん','2018.05.29'),(1138,'ピーナッツ入り柿の種の個包装文字が、書道系文字で格好いいです。なんでもないところに気を使われていて、素敵です。 唐辛子も微妙に聞いていておいしいです。',4,278,'2020-10-07 05:29:18','2020-10-07 05:29:18','日本のお菓子さん','2016.11.14'),(1139,'旦那が好きで、よく買います。コスパよし、味よしです。',5,279,'2020-10-07 05:29:18','2020-10-07 05:29:18','ゆまさん','2020.07.21'),(1140,'柿ピーが大好きで他社の商品と比べた際に240グラムで160円以下とグラム原価が一番安い商品がこれでした。小包装ではないですがチャック付きなので保存もききます。何度もリピートしています。',5,279,'2020-10-07 05:29:18','2020-10-07 05:29:18','ゆみこさん','2020.06.28'),(1141,'お手頃価格で美味しく、ずっとリピート買いしてます！ チャック付きなので、お酒のおつまみにちょっと欲しいときでも食べやすいです。 感謝デーに買おうとすると売り場から消えている時も！ みんな好きなんだな～と少し嬉しくなります♪',4,279,'2020-10-07 05:29:18','2020-10-07 05:29:18','ホワイト39さん','2020.06.24'),(1142,'今、食べながらつけています。 いろいろな柿の種を食べてきましたがこれが一番のお気に入りです。 柿の種もピーナッツもどっちも美味しいです。 ピリ辛の柿の種、最高です。',5,279,'2020-10-07 05:29:18','2020-10-07 05:29:18','みあかさん','2020.06.18'),(1143,'値段の割に量があって良いですね。 とても気に入ってます。 比較的薄味で嫌にならないのが高評価です。 他の方も書かれていますが、チャック付きの袋もポイント高いです。',5,279,'2020-10-07 05:29:18','2020-10-07 05:29:18','MANOWAR さん','2020.06.12'),(1144,'この「柿の種」はオススメです。まず、「美味しい」です。某ナショナルブランドにも引けをとりません。そして、240グラム入り158円という、圧倒的な「コスパ」の良さです。皆さんもどうぞ！',5,279,'2020-10-07 05:29:18','2020-10-07 05:29:18','すいむちゃんさん','2020.06.06'),(1145,'なんと言ってもコスパ最強！袋が閉じられるのもうれしい。',5,279,'2020-10-07 05:29:18','2020-10-07 05:29:18','レスさん','2020.05.27'),(1146,'安くて美味しいです。お酒のおつまみとして食べています。一度食べたら、パッケージを終わるまで食べ続いちゃうんです。逆に太りそうです。',5,279,'2020-10-07 05:29:18','2020-10-07 05:29:18','KESHABさん','2020.05.19'),(1147,'毎週買っています。おつまみに最高です。 お値段よしコスパよし味よし 素晴らしい商品です。',5,279,'2020-10-07 05:29:18','2020-10-07 05:29:18','あっくんさん','2020.05.15'),(1148,'原材料名のところに唐辛子とか香辛料抽出物などと書いてあるので、どれぐらい辛いんだろうとちょっと不安を感じましたが、思い切って買って食べてみたら、まったく心配などどこ吹く風。食べても食べてもやめられず、つい食べ過ぎてしまいました(^_^;)。２４０グラムも入っていて１５８円の安さには、ホントに感謝感謝してます！！',5,279,'2020-10-07 05:29:18','2020-10-07 05:29:18','ヨシヒロさん','2020.02.29'),(1149,'美味しいし安いので、おやつにおつまみにピッタリなので、よく買います。',5,279,'2020-10-07 05:29:18','2020-10-07 05:29:18','kumiさん','2020.02.28'),(1150,'安くて美味しい！',5,279,'2020-10-07 05:29:18','2020-10-07 05:29:18','ヨウさん','2020.02.20'),(1151,'すごく、お得な商品です。値段も安いのに240gでコスパ最高ですね。',5,279,'2020-10-07 05:29:18','2020-10-07 05:29:18','みーさんさん','2019.03.03'),(1152,'この柿の種は我が家の必須アイテムです。 もう何年も購入してますが飽きるということがない。',5,279,'2020-10-07 05:29:18','2020-10-07 05:29:18','はるさん','2019.02.02'),(1153,'ジッパーで保存ができて食べやすい辛さなので毎日のおやつにしています。大人にはビールのお供に！20日30日の５％引きには大人買いしています！',4,279,'2020-10-07 05:29:18','2020-10-07 05:29:18','ごんちゃんさん','2018.09.05'),(1154,'コスパ良すぎです。お得感でよりおいしくかんじられます。',5,279,'2020-10-07 05:29:18','2020-10-07 05:29:18','おさるのさん','2018.06.29'),(1155,'大容量で値段もお買い得！たくさん食べたい方も、小分けで食べたい方もジッパー付きだから、自由自在です。 満足度満点な一品です。',5,279,'2020-10-07 05:29:18','2020-10-07 05:29:18','arishunaさん','2018.06.20'),(1156,'量が多くて食べ応えがあります。ジッパー付きなので1度で食べきれなくても保存ができるので常時、ストックしておきたい1品です。',4,279,'2020-10-07 05:29:18','2020-10-07 05:29:18','ブルーライオンさん','2018.06.10'),(1157,'容量が多いので、たくさん食べられてお得感が嬉しいです！！ 色々なメーカーの柿の種と比較して、こちらは一番食感がカリッとしています。 辛みもそれほど強くないので、家族みんなで楽しめる商品です。',5,279,'2020-10-07 05:29:18','2020-10-07 05:29:18','むっきぃさん','2018.05.12'),(1158,'柿の種とピーナッツの量が程よく、お酒のつまみにとても合います。家族みんな好きなので、大袋でみんなで食べる事が出来ますし、ジッパー付きなので気に入っています。',5,279,'2020-10-07 05:29:18','2020-10-07 05:29:18','ふーりんさん','2018.02.25'),(1159,'肉質がジャーキーと思えないくらい柔らかい。ジャーキーに珍しく脂身もあり、甘く美味しい。',5,280,'2020-10-07 05:29:18','2020-10-07 05:29:18','しおりんさん','2020.07.23'),(1160,'おつまみになるのは当たり前ながら何かちょっと食べたい時に口に入れてます。よく噛むのでお腹いっぱいになった気がします',5,280,'2020-10-07 05:29:18','2020-10-07 05:29:18','イオン好きさん','2019.08.06'),(1161,'肉が柔らかく、臭みがない。 それでいて、味付けが後を引く旨さを持っていて、クセになる。 下手をすると120gでもあっという間に食べてしまいかねないほどです。 小さいサイズで物足りないと感じた方は、こちらを買うことをオススメします。',5,280,'2020-10-07 05:29:18','2020-10-07 05:29:18','アレックスさん','2018.12.09'),(1162,'一般的なピーナッツと比べると少し小さく、ギュッと絞ったような見た目です。 柔らかめの食感で、ほんのりミルクのような風味が感じられます。 オレイン酸が豊富ということで、おつまみの域を越えられなかったピーナッツ（バタピー）が美容食になったような気がしますね。 ただ、味は好みなのですが、若干塩加減が強いように感じられました。',4,281,'2020-10-07 05:29:18','2020-10-07 05:29:18','Motokaさん','2020.04.23'),(1163,'このピーナッツを食べたら、他の同価格帯のピーナッツは食べられなくなるほど美味しいです！普通のピーナッツより少し柔らかな歯応えで塩味もちょうど良くオススメです。',5,281,'2020-10-07 05:29:18','2020-10-07 05:29:18','ちくわぶさん','2020.04.09'),(1164,'以前のオーストラリア産からニカラグア産に産地が代わったのでお味は大丈夫か心配しましたが全く変わり有りませんでした、ヘルシーでとても美味しいピーナッツです、やや小振りで丸い粒です',5,281,'2020-10-07 05:29:18','2020-10-07 05:29:18','おにーるさん','2018.09.04'),(1165,'今まで食べていたピーナッツはなんだったんだと思うほど美味しい☆ こっくりと濃厚な油分ですがしつこくなくぱくぱく食べられます。 とてもいいおつまみです。',5,281,'2020-10-07 05:29:18','2020-10-07 05:29:18','お豆さん','2018.08.30'),(1166,'以前購入していたオーストラリア産が無くなってしまったのでこちらを購入。個人的にはオーストラリア産の方がカシューナッツみたいな食感で好きでしたが、こちらも悪くはない。ちょっと薄味です。',4,281,'2020-10-07 05:29:18','2020-10-07 05:29:18','みんみんさん','2018.08.30'),(1167,'美味しい！！ 今まで食べてたピーナッツはなんだったのかと思うはど美味しい。 食感も塩加減も好みでまたリピートします。',5,281,'2020-10-07 05:29:18','2020-10-07 05:29:18','おまめさん','2018.08.21'),(1168,'失敗した。硬すぎます。 げその程よい硬さを期待してましたが、これはカチコチ。普通は噛んでいくと旨味とともに徐々に柔らかくなっていきますが、全然柔らかくなりません。製造メーカー見たら有名な某社じゃなく、無名のところでした。リピートはないです。',1,282,'2020-10-07 05:29:18','2020-10-07 05:29:18','masaさん','2020.05.03'),(1169,'ゲソしか入ってないアタリメが食べたくて探していたら、ありました。 かなりカタイですが、それがまたいいです。 ただ本当にカタイので、人は選ぶと思います。 私的には大ヒット。',5,282,'2020-10-07 05:29:18','2020-10-07 05:29:18','えさん','2020.04.03'),(1170,'堅過ぎて美味しくない。この値段を出して買ったのがもったいない。',1,282,'2020-10-07 05:29:18','2020-10-07 05:29:18','tさん','2018.09.24'),(1171,'お酒好きな友人と家呑みしたとき、買ってもらいました(笑)お高い品なので自分では買うことがなかったのですが、これは美味しい!!鮭好きの私にはたまりません。やわらかくて、旨みがあって、鮭の味をしっかり楽しめます。燻製の香りも強すぎず良かったです。また食べたいな。',4,283,'2020-10-07 05:29:18','2020-10-07 05:29:18','すぐるさん','2016.04.21'),(1172,'しょうゆ豆といか豆をイオンラウンジで頂いて食べてみたのですが 食べた後に口の中が粉っぽい感じが残りあまり好感が持てませんでした。',2,284,'2020-10-07 05:29:18','2020-10-07 05:29:18','メアリストさん','2019.10.28'),(1173,'小袋にいろんな豆菓子が入っているので、お茶にコーヒーに紅茶と 飲み物も選ばず何にでも合うので、おやつにもピッタリで美味しくて気に入って食べています。',5,284,'2020-10-07 05:29:18','2020-10-07 05:29:18','kumiさん','2019.01.17'),(1174,'個別にいろいろなナッツが入って、味が楽しめる。気軽に持って食べやすい',5,284,'2020-10-07 05:29:18','2020-10-07 05:29:18','ひみつのアッコさん','2018.02.20'),(1175,'レタス・キュウリ・トマトしかなくても、アーモンドをザクザク刻んでパラパラするだけで、ちょっとおしゃれなサラダになります。 くるみの苦味（？）が苦手なので、アーモンド単品でこの量は嬉しいです！',5,285,'2020-10-07 05:29:18','2020-10-07 05:29:18','うにさん','2019.10.18'),(1176,'塩分無添加なので、アーモンドそのものほんのりとした甘みが味わます。小腹が空いた時のおやつとしてはもちろん、サラダのトッピングや、和え物などのお料理にも使え、ヘルシーでお気に入りです。',4,285,'2020-10-07 05:29:18','2020-10-07 05:29:18','じゅんさん','2019.10.07'),(1177,'歯応えもよく、塩分不使用なのでおやつにも最適です。',5,285,'2020-10-07 05:29:18','2020-10-07 05:29:18','家猫屋さん','2019.08.10'),(1178,'どこでも買えるので、近所のスーパーでよく買ってます。 塩気がなくても全然おいしく食べれます。 ただ他の物に比べて、少し乾燥気味？よく喉（気管）に引っ掛かります。むせます',3,285,'2020-10-07 05:29:18','2020-10-07 05:29:18','鷹虎飛蝗さん','2019.04.22'),(1179,'食感がいいです。便秘予防に、毎日食べています。',5,285,'2020-10-07 05:29:18','2020-10-07 05:29:18','ひよこさん','2019.04.11'),(1180,'カリッと香ばしくてアーモンドの優しい甘味やコクがあって美味しいです♪塩が添加されていないので、アーモンドのそのものの味が味わえます。230グラム入りで量が多いですが、私はナッツ好きなのであっという間に1人で食べてしまいます。そのまま食べるのは勿論、手作りのお菓子のトッピングとして使うのも良いと思います。',4,285,'2020-10-07 05:29:18','2020-10-07 05:29:18','あっぷるろーずさん','2018.11.10'),(1181,'やっぱり一番おいしい食べ方です。',5,285,'2020-10-07 05:29:18','2020-10-07 05:29:18','poohsamaさん','2018.07.27'),(1182,'アーモンドが体にいいと聞いて食べています。 塩を使っていないので、塩分を気にする主人もお気に入りです。 香ばしくてカリッとした食感と風味が美味しいですね。',5,285,'2020-10-07 05:29:18','2020-10-07 05:29:18','mayさん','2018.02.21'),(1183,'程よい塩加減とアーモンドの香ばしさがベストマッチでとても美味しいです。 また買います。',5,285,'2020-10-07 05:29:18','2020-10-07 05:29:18','パンダさん','2018.02.16'),(1184,'食べやすく香ばしいです。値段も手ごろでいいです。',5,286,'2020-10-07 05:29:18','2020-10-07 05:29:18','ナッツ好きさん','2018.03.07'),(1185,'健康のために食べ始めました。食べやすい味で続けられそうです。',5,286,'2020-10-07 05:29:18','2020-10-07 05:29:18','やすやすさん','2018.02.25'),(1186,'あまり割れてなく、大きめの粒が揃っていました。 塩分不使用なので料理やパン作りに使いやすいですし、おやつとして食べても美味しいです。',5,287,'2020-10-07 05:29:18','2020-10-07 05:29:18','家猫屋さん','2019.08.10'),(1187,'粒が大きい物ばかりはいり、感心した。 苦味がほんのりありましたが、おいしく食べやすかったです。',4,287,'2020-10-07 05:29:18','2020-10-07 05:29:18','ミラク胡桃さん','2019.06.17'),(1188,'白和えに擦って使いたくて色々なクルミで調理しました。これは、そのまま使えて苦味がありません。残ったら おつまみで食べ切れる量と価格がいいですね。',5,287,'2020-10-07 05:29:18','2020-10-07 05:29:18','よっちぃさん','2018.10.27'),(1189,'食べきりサイズなのが嬉しいです。ホームベーカリーでパンを焼いたり、お菓子作りに役立ちます。たくさん入ったサイズの他の商品を買ったこともありましたが、使い切れず結局もったいなかったです。大満足で★５つにしたいところですが、最近ナッツ類も高騰しているので、形が崩れているくるみばかり集めた商品も出て欲しいという期待を込めて、－１とさせて頂きいます。',4,287,'2020-10-07 05:29:18','2020-10-07 05:29:18','うめこつぶさん','2018.02.20'),(1190,'岩手県の名物（？）くるみ餅を作るために購入しました。 すり鉢で軽く摺（す）るだけでねっとりと油分がしみ出し、いつもより簡単に、粒感が少し残ったペースト状にできました。 今までは無塩ローストクルミを使っていましたが、これからは生クルミで作ります！ ＊興味のある方はぜひ「くるみ餅」でレシピ検索してみてください。',5,289,'2020-10-07 05:29:18','2020-10-07 05:29:18','うにさん','2020.01.13'),(1191,'お手頃な生クルミです。 田作りなどの料理に、お菓子作りに、加工して使っています。 量も丁度いいくらいです。 クルミ単体では食べないので星4です。',4,289,'2020-10-07 05:29:18','2020-10-07 05:29:18','おはらぎさん','2018.05.21'),(1192,'コリコリしていて楽しい さっぱりしていて美味しい 子どもも気に入っています',5,290,'2020-10-07 05:29:18','2020-10-07 05:29:18','あゆさん','2019.03.19'),(1193,'ドライフルーツとナッツのパウンドケーキを焼くのに購入しました。フルーツとナッツのバランスも良く美味しくできました。',5,292,'2020-10-07 05:29:18','2020-10-07 05:29:18','もにっぺさん','2020.05.31'),(1194,'ドライフルーツはフルーツそのものの甘みがあり、ナッツは塩味が軽くついている。甘じょっぱい日本人好みの味！程よい味付けで美味しい！ドライフルーツとナッツのいいとこ取り！ヨーグルトやグラノーラに入れて食べるのも美味しいと書いてあるけど、そのまま食べるのが好き！ 人気なのかいつもお店で売り切れてるのが残念！もう一度食べたい！',5,292,'2020-10-07 05:29:18','2020-10-07 05:29:18','くりっぽんさん','2019.04.16'),(1195,'ナッツとドライフルーツが数種類ずつ入っているのでいろんな味が楽しめていい！他社のものよりナッツもフルーツも入ってる種類が多かったような気がする。そのままでも食べれるし、包丁で少しカットしてクリームチーズに混ぜてクラッカーにつけて食べたり、ベーグルにサンドして食べたりするととってもいい。量も多すぎず使いやすい。',4,292,'2020-10-07 05:29:18','2020-10-07 05:29:18','はらぺこあおむしさん','2018.11.26'),(1196,'カリッと香ばしくて甘さもありとても美味しいです。 ス他社のものも食べ比べましたが、トップバリュが一番！ これが売られているからイオンで買い物するくらい。(笑) オススメです♪',5,293,'2020-10-07 05:29:18','2020-10-07 05:29:18','ピスタチオママさん','2020.06.09'),(1197,'適度な塩味で、味は美味しいと思いますが、完熟していれば 自然に割けてくるはずの外殻が、閉じたものが多く、とても 指先の力では開けられないのが難点です。 金具を使って殻を開く労力がかかる割に、ナッツは小さめですし、 また購入するか、正直悩む商品です。',2,293,'2020-10-07 05:29:18','2020-10-07 05:29:18','すみれさん','2019.06.04'),(1198,'マカダミアナッツオンリーでお手軽に買える商品なのでよく買います。 ナッツの中でもマカダミアナッツが一番好きな私は、ミックスナッツを買っても先にマカダミアを食べつくしてしまうのですが、これだと思う存分マカダミアを堪能できます。 粒は大きく丸々としていて割れもない綺麗な一粒の状態が入っています。 味付けがまた絶妙で、マカダミアの甘やかな風味とまったりとしたコクを壊さない塩気が美味しい。 一気に食べ終わらなくてもチャック付きなので便利。 私は鞄に入れて小腹が空いた時に出先でつまんでいます。',5,294,'2020-10-07 05:29:18','2020-10-07 05:29:18','ぽぽんたさん','2018.02.23'),(1199,'アーモンド、くるみ、カシューナッツと大どうの３種ナッツが楽しめます。食塩無添加の方もたまに買わせてもらいますが、こちらの商品でも薄味の塩が利いていて美味しいです。比較的アーモンドとカシューナッツの割合が多いと思いますが量も２～３人前くらいでちょうど良くお安いのでお酒のおつまみの１品として活躍します★',4,295,'2020-10-07 05:29:18','2020-10-07 05:29:18','ゆきえちゃんさん','2018.06.10'),(1200,'おやつにナッツを食べています。 甘味が感じられて、美味しいです。',5,296,'2020-10-07 05:29:18','2020-10-07 05:29:18','ひよこさん','2019.04.11'),(1201,'カシューナッツが好きで、インド産で植物油不使用というのが購入の決め手となって、いつも買っていました。いつからか、パッケージが傷だらけの商品ばかりが届くようになりました。食すものなのに傷のところから埃や異物混入の可能性を考えると気持ち悪く、購入するのが憚られるようになりました。パッケージも含めた商品価値が台無しです。',2,296,'2020-10-07 05:29:18','2020-10-07 05:29:18','ポリシーさん','2018.07.02'),(1202,'やわらかいかみごたえで、毎日続けて食べられます。',5,296,'2020-10-07 05:29:18','2020-10-07 05:29:18','vigaalさん','2017.10.23'),(1203,'ちょうど良い煎り加減でカリッと香ばしくも、噛んでいるうちにカシューナッツのまろやかな甘みがほのかに感じられます。 濃厚さには少し欠けるもののバランスの取れた味で、食塩・植物油不使用なので料理やお菓子作りにも向いているかもしれません。 一粒一粒が綺麗で、私が店頭で購入した限りでは、割れたり崩れたりしているものはほとんどなかったように記憶しています。',4,297,'2020-10-07 05:29:18','2020-10-07 05:29:18','Motoさん','2020.05.26'),(1204,'そのまま食べても鶏のカシューナッツ炒めにしてもおいしいです',5,297,'2020-10-07 05:29:18','2020-10-07 05:29:18','ばるーなさん','2018.11.06'),(1205,'やっぱり素材そのものがあじわえるのでいい。',5,297,'2020-10-07 05:29:18','2020-10-07 05:29:18','ｐｏｏｈさん','2018.07.27'),(1206,'しょっぱすぎず美味しいです。チャックが付いているのか嬉しいです。',5,297,'2020-10-07 05:29:18','2020-10-07 05:29:18','エリーさん','2017.08.16'),(1207,'塩気のない香ばしいアーモンドです。一人暮らしでも丁度よい91g, 何よりお求めやすい価格。ジップ付きの包装、安心のトップバリュブランドと、三重丸。 健康と美容のため、リピートしたいです。',5,299,'2020-10-07 05:29:18','2020-10-07 05:29:18','まめふくさん','2019.07.31'),(1208,'ビタミンEサプリがわりに食べています(^^) 噛めば噛むほど旨味が出てきてアーモンド本来の香ばしさを味わえる！ 味つきのものは多いのですが、素煎りのタイプはなかなかなくて…(あっても量が少ない、お菓子用などで高価)トップバリュはどこのお店でも常時おいているし、コスパも最強かと思います！',5,299,'2020-10-07 05:29:18','2020-10-07 05:29:18','yocco.さん','2018.07.11'),(1209,'塩分を気にしたくないので、塩無添加で、好きなナッツが３種なので、最高です。量もぱくぱく食べても何度かしっかり楽しめて、お得感があって、何度も購入しています。両親にも、プレゼントしています。甘い物もいいけど、ナッツは、健康にも良くて、保存食にもいいです。',5,300,'2020-10-07 05:29:18','2020-10-07 05:29:18','はるさん','2020.02.16'),(1210,'塩味が付いていない商品を探していて、見つけました。 おいしくてついつい手が止まりません。個包装になっていると食べすぎが防げそうです。',5,300,'2020-10-07 05:29:18','2020-10-07 05:29:18','みゅんさん','2019.12.06'),(1211,'素煎りなので食べやすい。ぱくぱく食べちゃいます(^ー^)',5,300,'2020-10-07 05:29:18','2020-10-07 05:29:18','ここさん','2019.10.17'),(1212,'ナッツが健康に良いとのことで、おやつとして時々食べています。塩が入っておらず、体に良いと感じています。ナッツの味がおいしく、安いので見かけると購入しています。',5,300,'2020-10-07 05:29:18','2020-10-07 05:29:18','たろうさん','2018.08.30'),(1213,'カシューナッツ、クルミ、アーモンドの三種類が好きなのでこのパックは嬉しい！しかも安くて美味しくて大好きな商品です。',5,300,'2020-10-07 05:29:18','2020-10-07 05:29:18','ゆりさん','2018.06.18'),(1214,'美味しいです。 塩も使ってないから、ナッツその物の味でお気に入りです。 沢山入っていてお得。 いつもストックしています。',5,300,'2020-10-07 05:29:18','2020-10-07 05:29:18','流華さん','2018.06.16'),(1215,'ナッツの味がそのまま生かされた、上質の商品。安いピーナッツやジャイアントコーンで　かさ増ししてある商品が多い中、３種ナッツに絞っているところが良いと思う。しかも、安い！常に常備して、紅茶　コーヒー　酎ハイのお供にしています。',5,300,'2020-10-07 05:29:18','2020-10-07 05:29:18','ともまま５４さん','2018.05.28'),(1216,'量も多く、バランスよくナッツが入っているので飽きません。100均のボトルに入れて保存しています。おやつに食べていますが、気づくとなくなっています。',5,300,'2020-10-07 05:29:18','2020-10-07 05:29:18','まちゃあきさん','2018.05.03'),(1217,'3種類のナッツが数の偏りなくバランス良く入っていて毎日小分けで食べるのにちょうど良かったです。味も付いてないのでナッツの甘みを感じられ、健康的に食べれると思います。',4,300,'2020-10-07 05:29:18','2020-10-07 05:29:18','モカさん','2017.07.23'),(1218,'この商品はお気に入りです いつでもどこでも 食べれるし 3種類の豆の味が それぞれの特徴をだしていて ビールにも 合うので 食べ始めたらやめられません',5,300,'2020-10-07 05:29:18','2020-10-07 05:29:18','クリームさん','2017.07.21'),(1219,'大粒で食塩・植物油不使用なので、マカダミアナッツの独特な食感と甘み、コクを存分に堪能できます。 ロースト加減も強すぎず弱すぎず、マカダミアナッツ本来の美味しさを引き出しているように感じました。 ついつい手が伸びてしまう美味しさですが、他のナッツと比較するとお高めなので、大事に食べるようにしています。',4,301,'2020-10-07 05:29:18','2020-10-07 05:29:18','Motoさん','2020.05.26'),(1220,'量が少ないですが、マカダミアナッツ本来の味を楽しむことが出来ました♪マカダミアナッツを口に入れて噛み締めると、口の中で濃厚なコクが広がって一気に幸せな気分になれました。マカダミアナッツはナッツの中でも特に高級なナッツなので、時々自分のご褒美として買って食べようかなと思っています。今度買った時は、このマカダミアナッツと一緒に高カカオのチョコレートを頬張ってみたいです♪',4,301,'2020-10-07 05:29:18','2020-10-07 05:29:18','あっぷるろーずさん','2018.11.10'),(1221,'美味しくてナッツの健康効果もあって最高',5,301,'2020-10-07 05:29:18','2020-10-07 05:29:18','ダンゴムシさん','2017.07.16'),(1222,'よく見るココナッツといえば細い繊維みたいな感じですが、こちらは細くする前の固まりという感じです。味はほんのり甘いココナッツです。食感が他にないサクサク感で最初は驚きましたがクセになりました。内容量は少ないですがココナッツの繊維がシャキシャキしていてよく噛むので、少ない量で満足できます。ココナッツ好きな方にはぜひ一度召し上がっていただきたいです。',5,302,'2020-10-07 05:29:18','2020-10-07 05:29:18','あずきさん','2020.06.10'),(1223,'これはいつも、かばんに常備しています。 酸っぱさが爽やかで大好きです。',4,303,'2020-10-07 05:29:18','2020-10-07 05:29:18','さわらさん','2019.08.29'),(1224,'手はベタつかず簡単に食べられます！ 夏の日差しに疲れた肌に ぴったりの商品。 残暑疲れも吹っ飛ぶ酸味で 美味しいです！',4,303,'2020-10-07 05:29:18','2020-10-07 05:29:18','KNZYさん','2019.08.23'),(1225,'最近、ドライフルーツにハマって、トップバリューのドライフルーツを一つずつ制覇中。 レモンは、酸味控えめで皮の苦みがしっかり。 後味がべたべたしないので、スッキリ食べられます。',4,303,'2020-10-07 05:29:18','2020-10-07 05:29:18','toroさん','2018.11.22'),(1226,'美味しいです↑↑ 国産で探していました。 酸味とこの苦みがいいんです♡ すぐリピすると思います。',5,303,'2020-10-07 05:29:18','2020-10-07 05:29:18','チーバちゃんさん','2018.05.09'),(1227,'最初はおいしい2枚3枚と食べていくと悶絶する苦さで残念。',2,303,'2020-10-07 05:29:18','2020-10-07 05:29:18','レモン大好きさんさん','2018.03.29'),(1228,'肉厚な果肉がしっとりと甘酸っぱく、とてもおいしいです。',5,303,'2020-10-07 05:29:18','2020-10-07 05:29:18','ニコさん','2018.02.27'),(1229,'美味しい(σ≧▽≦)σ',5,303,'2020-10-07 05:29:18','2020-10-07 05:29:18','あきさん','2017.06.11'),(1230,'ルイボスティーに入れて、毎日1枚食べてます。国産であることと、生レモンより日持ちする所が気に入っていて、味、食感も良いです。価格は少し高めですが、国産ならば納得かな。',4,303,'2020-10-07 05:29:18','2020-10-07 05:29:18','ミーさん','2017.06.06'),(1231,'レモンを買うつもりが売り切れだったのでこちらを購入。刻んでヨーグルトに入れたり、紅茶に浮かべたりしていますが、とても美味しいのでリピートします。',5,304,'2020-10-07 05:29:18','2020-10-07 05:29:18','フジタリカさん','2019.12.31'),(1232,'最近、ドライフルーツにハマり、トップバリューのドライフルーツを順番に制覇中。 オレンジは、同じかんきつ類のレモンと比べて、酸味はなく食べやすい感じ。 果肉の甘さと皮の苦みがちょうどよいですが…時々苦みの強い物が混じっていて、”苦っ！”てなります。',4,304,'2020-10-07 05:29:18','2020-10-07 05:29:18','toroさん','2018.11.22'),(1233,'爽やかな酸味があり、果肉感たっぷりで 、ジューシーで大満足です。 ヨーグルトにトッピングするのにはまってます。',5,304,'2020-10-07 05:29:18','2020-10-07 05:29:18','yukanoさん','2018.05.14'),(1234,'柑橘類が好きな私には好みの味でした。香りも良くて癒されます。溶かしたチョコレートをコーティングしたら、より美味しく、見た目もよりオシャレになりました。',5,304,'2020-10-07 05:29:18','2020-10-07 05:29:18','sakuraさん','2017.09.28'),(1235,'ジューシーで美味しかったです。半生タイプと書いてあるとおり、果物感がたくさん残っています。ただ私はもう少し甘さが控えめでもいいかなと思いました。',5,304,'2020-10-07 05:29:18','2020-10-07 05:29:18','ななよしさん','2017.06.16'),(1236,'毎日3個～5個必ず食べてます。身がしっかりしていてしかも甘すぎず美味しいです。美容健康の為何年も続けてます。アメリカのと比べて身が噛み応えが有ります。アメリカのは割とペラペラなのが多く、たまに種が入っていたりもします。トップバリューのは全く種が有ったことは無いです。安心して食べられます。しかもジップロックなので更に輪ゴムの心配いらずに詰め替える必要もなく。欠かす事なく毎週購入してます。',5,305,'2020-10-07 05:29:18','2020-10-07 05:29:18','Kayさん','2020.01.16'),(1237,'この味、この食感大好きです。 種がないので五歳の娘にも安心して食べさせられ、ヨーグルトに入れて毎朝頂いてます。 健康のためにこれからも続けていこうと思います。',5,305,'2020-10-07 05:29:18','2020-10-07 05:29:18','まーさんさん','2019.10.29'),(1238,'パイナップル感(ちょっと舌がピリピリする感じ)があってとても気に入ってリピート中です。 一口サイズではあるけど、もっと小さいサイズでちまちまと楽しめたらいいのになと思います…(クランベリーのふた回り大きいくらい)',5,306,'2020-10-07 05:29:18','2020-10-07 05:29:18','123さん','2020.03.25'),(1239,'ドライフルーツだけど程よくソフトでジューシーで美味しい！！ 買い占めたくなるくらいヒット！！ とってもオススメです！！',5,306,'2020-10-07 05:29:18','2020-10-07 05:29:18','チャンさん','2019.10.16'),(1240,'他の商品より内容量が多く購入。 そのまま食べても甘くて非常に美味しい！ 手もベタつかず食べ易いです！ 肉料理やカレーのソースに 隠し味として入れても旨い！ 山登りでの一休みにも 小腹がすいた仕事の合間にも 最適です！',5,306,'2020-10-07 05:29:18','2020-10-07 05:29:18','KNZYさん','2019.08.23'),(1241,'ドライフルーツは、外国産が多いので、まず、国産である事に安心感があり、購入。 適度な甘さと素材の味の良さがあります。量もちょうど良く価格に納得です。 たくさん入って価格が高いと購入しずらいのですが、絶妙だと思います。 そのままで、ヨーグルトに入れて、焼き菓子に等、色々使えて我が家の常備品となってます。',5,307,'2020-10-07 05:29:18','2020-10-07 05:29:18','オレンジオレンジさん','2020.06.28'),(1242,'とても美味しいです。りんごと思って食べると甘すぎかもしれないですが、ドライフルーツとして食べると良く出来ていると思いました。レビューが相反してますが、私はリピ予定です。ウィスキーなどのあてにもピッタリです。下手なお菓子よりよっぽど健康的だと思います。',5,307,'2020-10-07 05:29:18','2020-10-07 05:29:18','みぃぽんさん','2019.05.29'),(1243,'あんまり　期待してなかったのに　めちゃくちゃ美味い! 最近食が細くなった　母親が　よく食べてくれました。 りんごが好きな母親も　歯が悪くなって　りんごをすりおろして 食べさせるようだったので　喜んで　くれました。',5,307,'2020-10-07 05:29:18','2020-10-07 05:29:18','うーままさん','2019.04.28'),(1244,'入っているりんごの量が多く満足です。 味は少し甘すぎるかなとは思いますが、私は美味しいと思います。',4,307,'2020-10-07 05:29:18','2020-10-07 05:29:18','りんごさん','2019.02.25'),(1245,'最近、ドライフルーツにハマり、トップバリューのドライフルーツを制覇中。 柑橘系2種の後に食べたせいか、ものすごく甘いです。 ドライフルーツではなく、グラッセ？みたいな感じ。 中のリンゴは触感も風味も悪くないのですが、表面の砂糖が全てを台無しに… 半生タイプで水分が多く、保存のためには砂糖漬けにする必要があるのかもしれませんが、もう少し工夫できなかったでしょうか。 素が美味しいフルーツなだけに、残念です。',3,307,'2020-10-07 05:29:18','2020-10-07 05:29:18','toroさん','2018.11.22'),(1246,'ぞわぞわするくらいに甘すぎ！ どこがほどよい甘みなのでしょうか！？ りんごの良さがまったく活かされいません！',1,307,'2020-10-07 05:29:18','2020-10-07 05:29:18','奥さん','2018.10.02'),(1247,'甘すぎます。せっかくのりんごの風味が台無し 体に良さそうと思い買いましたが、糖尿病になりそうです。 食べたあとお茶が要ります。',2,307,'2020-10-07 05:29:18','2020-10-07 05:29:18','ゆーたんママさん','2018.02.18'),(1248,'植物油にグレープシードオイルが使われているおかげか、アーモンドとマカダミアの自然な旨味と香ばしさがより引き立てられていてとても美味しかったです。 塩加減もちょうど良く、食べきりサイズなのも食べ過ぎ防止に良いですね。 小腹が空いた時に食べましたが、お酒のおつまみにも合いそうです。',5,310,'2020-10-07 05:29:18','2020-10-07 05:29:18','Motoさん','2020.07.28'),(1249,'アーモンドもマカダミアもどっちも好きなので両方入っているのは最高! シンプルな塩味がナッツの香ばしい美味しさを引き立ててくれておつまみにもちょうどよいです。 旅先で購入しましたが食べやすいサイズもよかったです。',5,310,'2020-10-07 05:29:18','2020-10-07 05:29:18','daoさん','2017.04.27'),(1250,'私も他の方がレビューにかかれているのと同様です‼️ 塩味がついていなく素煎りのモノを探し求めてたどり着いたのがこちらの商品です。 小粒といっても、形もよく粒が揃っていて、アーモンドの風味をしっかりと味わえ食べごたえもあります。ボリュームパックでこのお値段はお買い得です(^^) 母娘で毎日、数粒ずつ食べてます！',5,311,'2020-10-07 05:29:18','2020-10-07 05:29:18','ちゃんさん','2019.12.14'),(1251,'身体にいいのでアーモンドをよく食べますが、炒るのに油を使ってないのが嬉しいです。 アーモンド自体お値段が高めですが、こちらの商品は量が入っていて他に比べてお安いです。 ナッツの自然な甘みもあって香ばしく美味しいので、ついつい食べすぎてしまいます。 食べると満足感があるのでおやつにもよく食べますし、アーモンドプードルや、アーモンドペーストにしたりしてよく使っています！',5,311,'2020-10-07 05:29:18','2020-10-07 05:29:18','ユユさん','2019.08.27'),(1252,'トップバリューにナッツがあるのは知っていたが、アーモンド単品で味付けしていないものがあるのはしらなかった。美味しい。ぜひ続けてほしい。',5,311,'2020-10-07 05:29:18','2020-10-07 05:29:18','shiiroomさん','2019.04.20'),(1253,'塩味のないアーモンドを探していました。容量も多く、ヨーグルトかけたり、サラダに入れたり出来てとても良かったです。変な油分の味も無く、すごく美味しかったです。',5,311,'2020-10-07 05:29:18','2020-10-07 05:29:18','まりおんさん','2019.04.20'),(1254,'たくさん量が入っているのに値段が安いので何度も購入しています。 塩味がないので物足りない方もいるかもしれないですが、素材の味が楽しめるのでいつもそのままで美味しく食べています。',5,311,'2020-10-07 05:29:18','2020-10-07 05:29:18','ゆめさん','2018.07.05'),(1255,'この生のクルミは値段が安くて量もたっぷりと入っているので、お気に入りの商品です♪イオンで生のクルミを買う時は、必ずこの商品を買っています。おやつやご飯としてそのまま食べたり、サラダのトッピングやお菓子を作る時にも使っています。この生のクルミの味は、他のメーカーの生のクルミの味と特に変わりは無いです。コクがあり噛めば噛むほどクルミの味が出て来るので美味しいです。数あるイオンのプライベートブランドの商品の中で、この商品は一押しです！',4,312,'2020-10-07 05:29:18','2020-10-07 05:29:18','あっぷるろーずさん','2018.11.10'),(1256,'味わいは良いのですが、価格が少し高くて気軽に購入できません。価格面でお買い得感を出して頂けると嬉しいです。',3,312,'2020-10-07 05:29:18','2020-10-07 05:29:18','ひろさん','2017.08.04'),(1257,'ピーマンとの炒め物によく使用しています。お値段が高いのが残念です。',3,313,'2020-10-07 05:29:18','2020-10-07 05:29:18','あっちゃんさん','2017.06.03'),(1258,'ダイエットに良いと聞きおやつにナッツを食べるようにしています。 美味しいです。',5,314,'2020-10-07 05:29:19','2020-10-07 05:29:19','Maaさん','2020.05.24'),(1259,'味も良いし、価格も好きです。東京のマイバスケットで購入したいのですがどうしたら？',5,314,'2020-10-07 05:29:19','2020-10-07 05:29:19','しちょうさんさん','2020.05.10'),(1260,'とても美味しく、お値段も手頃で嬉しいです。',4,314,'2020-10-07 05:29:19','2020-10-07 05:29:19','うしちゃんさん','2019.11.16'),(1261,'ピーナッツアレルギーで柿の種を食べるときのお供に欠かせません。3種類のバランスとボリュームも良くて食べ過ぎ注意ですよ',5,314,'2020-10-07 05:29:19','2020-10-07 05:29:19','3食昼寝姫さん','2018.02.22'),(1262,'３種類のナッツの素材そのままの味が楽しめます。チャックが付いているので便利です。女性の美容にも良さそうなので　毎日続けて食べたい味です。お買得袋もあれば嬉しいです。',4,314,'2020-10-07 05:29:19','2020-10-07 05:29:19','とどくんさん','2018.02.20'),(1263,'食塩無添加なのがうれしい。 量はたっぷりで値段もお手頃 コスパ最強です。',5,314,'2020-10-07 05:29:19','2020-10-07 05:29:19','宇治抹さん','2018.01.31'),(1264,'身厚だけど食べにくさのないプルーンです。 種がないのでそのまま食べられます。 便秘解消の為に食べ始めましたが、好きなナッツと一緒におやつとしておいしくいただいています。',4,315,'2020-10-07 05:29:19','2020-10-07 05:29:19','ミミエさん','2020.07.31'),(1265,'種なしなので、とても食べやすいです。個包装ですので、外出時にバッグに入れて持っていくこともできます。とってもヘルシーなおやつになるので気に入っています。',5,315,'2020-10-07 05:29:19','2020-10-07 05:29:19','NEKOさん','2020.06.28'),(1266,'いつも仕事の休憩時間に食べています。小分けされてるので持ち運べて便利です。',5,315,'2020-10-07 05:29:19','2020-10-07 05:29:19','美奈さん','2020.06.10'),(1267,'子供の便秘改善の為、購入。一つ一つ個装されているので保存しやすくおやつ感覚として渡せるので便利です。プルーンってベタベタしてドシッと感があるのもありますが、こちらはベタベタ感も少なく思ってたよりアッサリ食べれるので子供も抵抗なく美味しいと言って食べてくれます。',5,315,'2020-10-07 05:29:19','2020-10-07 05:29:19','たろうママさん','2019.03.17'),(1268,'大粒で肉厚なプルーンで食べ応えがあり、また添加物不使用なのでプルーンそのものの味を堪能することができます。 もっちり＆ねっとりとした食感がとても好みで、ヨーグルトによく合います。 濃厚ではあるものの、甘みと酸味のバランスが取れており、甘ったるくないので食べやすいのも良いです。',5,316,'2020-10-07 05:29:19','2020-10-07 05:29:19','Motoさん','2020.06.27'),(1269,'食物繊維と鉄分補給のために購入しました。ヨーグルトに入れて毎朝たべています。',4,316,'2020-10-07 05:29:19','2020-10-07 05:29:19','ちえこさん','2019.10.13'),(1270,'キャンペーン中の50g 増で買いました。味、柔らかかさ、コスパ、問題ないのではないでしょうか。 確かに開封はチャックが便利ですが、それよりたっぷりサイズが魅力です。',5,316,'2020-10-07 05:29:19','2020-10-07 05:29:19','ナユタさん','2019.06.14'),(1271,'柔らかく自然な甘さでおいしいプルーンです。 中身の品質に文句はありませんが、袋の口が密封チャック付きではないのが残念なので☆4にしました。 内容量が一度で食べきる量ではないので密封チャックを付けて欲しいです。',4,316,'2020-10-07 05:29:19','2020-10-07 05:29:19','ayuさん','2018.12.03'),(1272,'どのような肥料を使って、どのような農薬をどれだけ使用して栽培されたのか、明記してほしい。',2,316,'2020-10-07 05:29:19','2020-10-07 05:29:19','pure earthさん','2018.04.15'),(1273,'ふっくらジューシーで美味しいです。そのままでも、ヨーグルトでもよく合います',4,316,'2020-10-07 05:29:19','2020-10-07 05:29:19','りんごさんさん','2018.02.20'),(1274,'柔らかくて、ふっくらしていて、ジューシーで、甘くて、すごく美味しいです。プルーンを食べるとお通じが良くなるので、ヨーグルトやアイスと一緒に食べています。',5,316,'2020-10-07 05:29:19','2020-10-07 05:29:19','よっちゃんさん','2017.09.28'),(1275,'ドライフルーツ好きの私は、手作りパンにはレーズン入りばかりでしたが、これを使ってからはこればかり、風味もいいですが色味もいいです',5,317,'2020-10-07 05:29:19','2020-10-07 05:29:19','まあちゃんさん','2020.05.23'),(1276,'機械油のような臭いがして、とてもではないけれど食べられないものが半分くらい混ざっています。',1,318,'2020-10-07 05:29:19','2020-10-07 05:29:19','upさん','2020.05.25'),(1277,'最近、ドライフルーツにハマって、色々と食べていますが、このブルーベリーは「機械油臭い」です。 味も甘みが無く、かすかな酸味と強い苦みがあり、おいしいとは言い難いです。 機械油の匂いと苦みが気にならない方にはおすすめです。 （私はリピートはしません）',1,318,'2020-10-07 05:29:19','2020-10-07 05:29:19','toroさん','2018.11.21'),(1278,'今まで食べたむき栗の中で一番美味しい‼️やめられません。 イオンのお店に売っている物は私がすべて買っているかもw',5,319,'2020-10-07 05:29:19','2020-10-07 05:29:19','おばちゃんさん','2019.06.19'),(1279,'おいしい、健康的、持ち運び便利。小腹すいた時に大活躍です',5,319,'2020-10-07 05:29:19','2020-10-07 05:29:19','たここさん','2017.10.30'),(1280,'小分けしてあるので好きな分だけ頂けます。お得感もあり味も美味しいです。おやつ代わりにもなり味やサイズのばらつきもないですね(^^)',5,319,'2020-10-07 05:29:19','2020-10-07 05:29:19','ユリモリさん','2016.12.14'),(1281,'ナッツの中に空炒りした豆類が入っており、いいアクセントになります！少しお値段は少し高めですが、美味しいです。パンの材料にもしましたが、良かったです。',5,320,'2020-10-07 05:29:19','2020-10-07 05:29:19','fumuufumu さん','2019.09.30'),(1282,'皮が固すぎなく、とっても食べやすいです。ヨーグルトと一緒に食べたり、パンケーキの中に入れて、焼いたり、カボチャサラダのトッピングにしたりと我が家では出番が多いです。他メーカーのものよりも本当にクセがなく、何にでも相性がよいので、必ずストックしておく商品です。',5,321,'2020-10-07 05:29:19','2020-10-07 05:29:19','kaさん','2020.06.19'),(1283,'毎朝ヨーグルトに入れて食べているのですが、こちらが一番コスパが良いので何度もリピしています。',5,321,'2020-10-07 05:29:19','2020-10-07 05:29:19','デイジーさん','2020.06.08'),(1284,'レーズンのりんご酢漬けを作ってヨーグルトに入れて毎朝食べています。 ドライ具合がとても良いです。 量もうれしいです。',5,321,'2020-10-07 05:29:19','2020-10-07 05:29:19','にょんさん','2020.05.06'),(1285,'とても美味しいです。硬くもなく、柔らかすぎでもなく、未もしっかりして大きい。甘すぎもせず、良い感じです。ヨーグルトやシリアルに入れて食べてます。毎週欠かせず購入してます。',5,321,'2020-10-07 05:29:19','2020-10-07 05:29:19','Kayさん','2020.01.16'),(1286,'この量で、この値段はお値打ちです。オイルコーティングもなくて、そのままパン作りに使っています。人参のサラダなどにも、重宝します。',5,321,'2020-10-07 05:29:19','2020-10-07 05:29:19','むーんさん','2019.09.01'),(1287,'オイルコーティングされていなくてコスパも良いので何度もリピしています。自然な味わいで良いです。 近くのマックスバリュには置いていないので遠くのイオンまで車で買いに行かないといけないのが難点です。',5,321,'2020-10-07 05:29:19','2020-10-07 05:29:19','dorikawwaさん','2018.11.29'),(1288,'量がたっぷりと入っていますし値段も安いので気に入っているレーズンです。味も甘くて美味しいので、おやつとしてそのまま食べているとあっという間に無くなります。そのままレーズンだけを食べるのも勿論美味しいですし、生のクルミやアーモンドと一緒に食べるのも美味しくて気に入っています。レーズン好きの方におすすめの商品です♪',4,321,'2020-10-07 05:29:19','2020-10-07 05:29:19','あっぷるろーずさん','2018.11.10'),(1289,'レーズン好きにはたまりません。柔らかくておいしい！お酒のおつまみ、小腹が空いた時のおやつにしています。',5,321,'2020-10-07 05:29:19','2020-10-07 05:29:19','はるるぽんさん','2018.08.12'),(1290,'そのままだと少し硬いですが、一度お湯にくぐらせて、残っている枝などを取り除き、ラム酒を大さじ2杯振りかけておくと、翌日にはふっくらと美味しいレーズンになります。',4,321,'2020-10-07 05:29:19','2020-10-07 05:29:19','マリーさん','2018.06.21'),(1291,'干しぶどう酢を作るのに利用しています。 オイルコーティングもされておらず、すぐに使えるので気に入っています。',4,321,'2020-10-07 05:29:19','2020-10-07 05:29:19','あおさん','2018.05.24'),(1292,'レーズン入り食パンを焼くために購入しました。 袋に表示されてある通りでふっくらしていて潰れてないところが気に入りました。',5,321,'2020-10-07 05:29:19','2020-10-07 05:29:19','ちびこさん','2018.02.26'),(1293,'レーズンは日本原産国ではなかたような気がするので、ドライレーズンにすると栄養価も豊富ですし、何の中でも入れることができて助かっっています。',5,321,'2020-10-07 05:29:19','2020-10-07 05:29:19','さん','2016.12.01'),(1294,'これまではトップバリュ グリーンアイの無漂白のアンズをよく購入していましたが、取り扱いがなくなってしまったのでこちらを購入してみました。 砂糖不使用ということもありサッパリとしていて、甘酸っぱいという言葉がぴったりな味です。 無漂白のものは干し柿のような濃厚な甘さがあったので、どちらかというとこちらの方が一般的なアンズのイメージに近いかもしれません。',4,322,'2020-10-07 05:29:19','2020-10-07 05:29:19','Motoさん','2020.06.27'),(1295,'砂糖不私用の為、極端に甘いということはく食べやすい。 ただ、酸味も甘みも若干薄い気がしました。 また、表面部分に若干の苦味のようなものを感じました。',3,322,'2020-10-07 05:29:19','2020-10-07 05:29:19','さんさん','2020.05.17'),(1296,'他のミックスナッツ商品と比べて種類が豊富で、色々な味を楽しめます。 塩気がちょうど良くて、おいしいです。',5,323,'2020-10-07 05:29:19','2020-10-07 05:29:19','よたんみたんさん','2018.08.11'),(1297,'とっても美味しく我が家には必ず2袋常備しています(^_-)-☆',5,323,'2020-10-07 05:29:19','2020-10-07 05:29:19','haruharumiさん','2018.05.04'),(1298,'やめられない止まらない(≧∇≦) ミックスナッツ最高ですね。しかもこの価格は嬉しい限りです。買いだめたい(^^)',5,323,'2020-10-07 05:29:19','2020-10-07 05:29:19','ユリモリさん','2016.12.11'),(1299,'最近 近くのビックで販売されなくなり イオン見つけるたびに探してしまいます(笑) 秋の夜長にお茶のとも 探さなきゃ 美味しくて全然あきません',5,326,'2020-10-07 05:29:19','2020-10-07 05:29:19','さんちいごさん','2019.10.14'),(1300,'色んな味が楽しめて最高です！ 一度食べ出すと止まらなくなり 買い物に行くたびに買います ずっと販売してほしいなぁ〜！',5,326,'2020-10-07 05:29:19','2020-10-07 05:29:19','さんちゃんさん','2019.03.06'),(1301,'個包装がなくたっぷり入っていて便利　しょうゆのあげせんがおいしい',5,326,'2020-10-07 05:29:19','2020-10-07 05:29:19','しょうゆあげせん好きさん','2018.12.09'),(1302,'いろんな味が入ってて楽しめます！！とってもおいしいです！★５！！！！',5,326,'2020-10-07 05:29:19','2020-10-07 05:29:19','べびちゃんさん','2018.07.03'),(1303,'先日、鹿児島へ旅行に行ったときに発見!!いつもはお好みミックス個別包装しかなくてそればかりを買っていましたが、とてもお得で食べごたえありでよかったです。他府県でもぜひ販売してください。',5,326,'2020-10-07 05:29:19','2020-10-07 05:29:19','てんちゃんさんさん','2018.05.27'),(1304,'止まらない美味しさ！大好きです！！',5,326,'2020-10-07 05:29:19','2020-10-07 05:29:19','めがねさん','2018.02.17'),(1305,'ピーナッツが多めですが、クルミやビッグコーン等も入っており色々な味を楽しめます。このお値段でこれだけ沢山食べられるので、我が家では何度もリピート買いしています♪',4,331,'2020-10-07 05:29:19','2020-10-07 05:29:19','まいさん','2020.06.23'),(1306,'中身を見ない値段と量の評価だけなら★5なのですが ほかの方も書いている通りピーナッツだらけです。 値段相当の商品だとは思います。 ピーナッツが入っていないミックスナッツ…大抵入っていませんよ。 代わりに価格層が70gで400～700円前後になりますが。',2,331,'2020-10-07 05:29:19','2020-10-07 05:29:19','あびさん','2019.06.01'),(1307,'この量で低価格なので、我が家ではヘビロテです。ナッツではないですが、ビッグコーンが入ってるのが気に入っています。',5,331,'2020-10-07 05:29:19','2020-10-07 05:29:19','エリごんさん','2019.05.05'),(1308,'他の方のレビューでピーナッツが多いとか批判的な意見がありますが、どこのメーカでもミックスナッツには入っているので全く問題ありません。というかピーナッツが入っていないミックスナッツを教えてほしいぐらい。 私は、むしろこの商品にはクルミが多く入っているのでこの商品のコストパフォーマンスの良さに感動しています。 クラフトビール、ワイン、スパークリングワインなどによく合います。 おすすめです。',4,331,'2020-10-07 05:29:19','2020-10-07 05:29:19','ボン吉さん','2019.03.30'),(1309,'ピーナッツが多いのでもう少しクルミやアーモンドを増やして欲しいところですが、値段が安めなので、リピートしてます。',4,331,'2020-10-07 05:29:19','2020-10-07 05:29:19','スケポチさん','2019.02.17'),(1310,'ピーナッツってナッツではなく豆類ですが。。。 ミックスナッツにピーナッツ沢山いれてごまかすのはどうかと思います。',2,331,'2020-10-07 05:29:19','2020-10-07 05:29:19','ピーナッツさん','2018.11.16'),(1311,'245gでこの値段とミックスの内容もいい',5,331,'2020-10-07 05:29:19','2020-10-07 05:29:19','トップやすさん','2018.04.25'),(1312,'おかきの量を増やしてほしい',4,332,'2020-10-07 05:29:19','2020-10-07 05:29:19','たかさん','2019.12.28'),(1313,'おつまみというより、おやつに食べます。おかきの量より、ピーナッツの割合が多いように感じます。もう少し、おかきの量を増やして欲しいかな！辛さは、さほど感じませんので、食べやすいです。',4,332,'2020-10-07 05:29:19','2020-10-07 05:29:19','nikonikoさん','2019.12.21'),(1314,'何時も美味しく頂いております 味も良くて大好きです おかきの量もう少し多いといいなぁ',4,332,'2020-10-07 05:29:19','2020-10-07 05:29:19','街のパン大好きさん','2019.03.20'),(1315,'たっぷり食べられるのは、嬉しいけれど… 小粒せんが もう少し「ピリ辛」の方が、美味しいと思います。',3,332,'2020-10-07 05:29:19','2020-10-07 05:29:19','暑がりさんさん','2017.09.29'),(1316,'小粒かきの食感をもう少し固ければ美味しいのですが、ダイエーオリジナルの方が美味しかった',3,332,'2020-10-07 05:29:19','2020-10-07 05:29:19','さすらいの料理人さん','2016.12.06'),(1317,'美味しいです 塩が使われていないのが良いです 小分けの袋にも栄養情報の記載が欲しいです',4,333,'2020-10-07 05:29:19','2020-10-07 05:29:19','くるみパンさん','2019.04.03'),(1318,'お腹が空いた時におやつとして食べています。 塩が使われていないので安心ですし、小分けされているので食べ過ぎ防止になります。 いつでも開封したてを食べられるのも気に入っています。 7袋あって、中身に多少のバラツキがあるのがほんの少しのマイナス点。',4,333,'2020-10-07 05:29:19','2020-10-07 05:29:19','kotokoさん','2018.10.02'),(1319,'渋みや苦みが少なくて、粒が大きいです。 そのままでも十分美味しいですが、我が家ではキャラメリゼにしたものをケーキやクッキー生地に加えて、製菓用としても楽しんでいます。',4,334,'2020-10-07 05:29:19','2020-10-07 05:29:19','とろろさん','2017.06.19'),(1320,'塩味等、余計な味がついていなくて、素材の味をそのまま味わえて満足です。',5,334,'2020-10-07 05:29:19','2020-10-07 05:29:19','くるみんさん','2017.05.24'),(1321,'ナッツ類はどこでも選択肢が少なく妥協しがち。これは素煎りで味が加えられておらず、クルミらしい香ばしさと食感がしっかりと楽しめるので満足。刻んで使うのがちょっともったいないぐらい。製菓用に買ったものの、そのままでもおいしい。',5,334,'2020-10-07 05:29:19','2020-10-07 05:29:19','みちさん','2016.12.21'),(1322,'余計な味付けなどなくくるみそのままのシンプルな美味しさを味わえます。 カリッとした大粒のクルミの食感とほのかな甘みの残るくるみでおいしかったです。',5,334,'2020-10-07 05:29:19','2020-10-07 05:29:19','daiさん','2016.10.28'),(1323,'煎った黒大豆が好きでこれまで色々な商品を食べてきましたが、トップバリュのこちらはとにかく食べやすいのが特徴です。 固すぎずサクッとした軽い食感でモソモソせず、普通の煎り大豆にはない香ばしさが食欲をそそります。 黒大豆にはポリフェノールが含まれているそうなので、美味しいだけでなく健康にも良さそうです。 国産でお手頃価格なのも魅力です。',5,338,'2020-10-07 05:29:19','2020-10-07 05:29:19','Motoさん','2020.06.27'),(1324,'実家の母の大好きな商品で、おやつ出されて時々食べていました。最近健康のために黒酢を摂るように心掛けているので、こちらの黒大豆をひたひたになるほどの黒酢につけて酢大豆にしてみたところ、食べやすい！！ そのまま食べたりサラダに入れたり、ヨーグルトにかけたりして家族それぞれ美味しい食べ方で毎日楽しんでいます。',5,338,'2020-10-07 05:29:19','2020-10-07 05:29:19','まめまめさん','2019.10.15'),(1325,'香ばしく食べやすいので小腹が減った時のおやつにいつもカバンに入れています',5,338,'2020-10-07 05:29:19','2020-10-07 05:29:19','みかんさん','2019.08.28'),(1326,'最高級銘柄の商品とそんなに味は変わらずとても美味しくリーズナブルで、とても満足しています。',5,338,'2020-10-07 05:29:19','2020-10-07 05:29:19','alain deroさん','2019.04.23'),(1327,'塩分が少ないのに香ばしくおいしいお豆。つまみでこればかり食べすぎるほどのおいしさではないのが丁度良い。味覚を一定にするのに長け、他の邪魔にならないと思う。',5,338,'2020-10-07 05:29:19','2020-10-07 05:29:19','あずきさん','2019.01.30'),(1328,'そのまま食べてすごく美味しいです。黒大豆の香ばしさが良いです。煎り大豆より量が少ないのは残念ですが、美味しさでカバーしてます。',5,338,'2020-10-07 05:29:19','2020-10-07 05:29:19','あきさん','2018.11.26'),(1329,'大粒で味良く香ばしく、安価なのに原材料は国産です。最高。 美容健康目的で、口寂しいときのおやつにいただいています。アンチエイジング！ 幼稚園児の息子も大好き。もちろんリピートします。',5,338,'2020-10-07 05:29:19','2020-10-07 05:29:19','maryさん','2018.09.27'),(1330,'粒が大きめで皮まで香ばしく、口寂しいときのおやつに大変重宝しています。価格も手頃で、量もちょうどいい。塩昆布や梅干しを溶かした白湯に沈めて少しふやかして食べたりするのも好きです。',5,338,'2020-10-07 05:29:19','2020-10-07 05:29:19','茶しぶさん','2018.08.31'),(1331,'炒った作用なのか、香ばしさと黒大豆の甘みがあり美味しかったです。',5,338,'2020-10-07 05:29:19','2020-10-07 05:29:19','うれし香ばし黒大豆☆さん','2018.05.08'),(1332,'香ばしさが食欲をそそります。原材料が国産の黒大豆だけというのが魅力的です。ポリポリしながら健康になっている感じがして、毎日少しずつ食べるようにしています。シリアルに入れても美味しかったですよ。',5,338,'2020-10-07 05:29:19','2020-10-07 05:29:19','ユウカさん','2017.10.27'),(1333,'同じ商品を色々試したけどコレが一番美味しい。軽い歯ごたえ、大ぶりな黒大豆。高いメーカーに負けないと思います。',5,338,'2020-10-07 05:29:19','2020-10-07 05:29:19','アヅさん','2017.02.10'),(1334,'お酒のおつまみにぴったりです。',5,338,'2020-10-07 05:29:19','2020-10-07 05:29:19','おいしゃんさん','2016.11.11'),(1335,'大きな黒大豆で、ふっくらサクサクした食感が良かったです。味も、旨みがしっかりとあって、香りがとても良かったです。軽い食感なので、歯や歯茎への負担が少ないと思われ、父に勧めたいなと思いました。',4,338,'2020-10-07 05:29:19','2020-10-07 05:29:19','凛さん','2016.10.03'),(1336,'夫の好物で、我が家ではいつも買い置きしています。 ビールのおつまみに最高です。',4,343,'2020-10-07 05:29:19','2020-10-07 05:29:19','いつも前向きさん','2020.07.18'),(1337,'5%オフの時にまとめ買いしてます！',5,343,'2020-10-07 05:29:19','2020-10-07 05:29:19','yossyさん','2018.02.20'),(1338,'いつもは98円の商品を購入していますが、先日あまりにおいしそうなパッケージを見つけて、思わず購入しました。 味の違いは…あまり分かりませんでしたが、チャック付きなので、保存が便利です。',3,343,'2020-10-07 05:29:19','2020-10-07 05:29:19','みみさん','2017.01.07'),(1339,'140gサイズのミックスナッツを買っていましたが、登山やアウトドアで食べるのには、こちらの方が個包装で持ち運びに便利です。 塩味もちょうどいいぐらいです',5,344,'2020-10-07 05:29:19','2020-10-07 05:29:19','かあやんさん','2017.03.29'),(1340,'子袋に分けて入っていて、一袋の量がちょうど良いのと、塩加減が気に入って、我が家の定番商品です。子供も大人も楽しめます。',5,344,'2020-10-07 05:29:19','2020-10-07 05:29:19','トロトロさん','2017.01.10'),(1341,'ミックスナッツは、くるみが2つ入って6種類、スナック菓子が入っていないのが良い。美味しい!',5,344,'2020-10-07 05:29:19','2020-10-07 05:29:19','ケイワンさん','2016.10.23'),(1342,'はじめて、ヒマワリの種を買いました。塩分が多すぎます。味は香ばしさもなく微妙でした。さけのつまみで買ってみたのですが、塩が多すぎて無理でした。塩の量は半分でいいかと思います。',1,345,'2020-10-07 05:29:19','2020-10-07 05:29:19','ナッツ好きさん','2018.03.07'),(1343,'ひまわりの種がすごくおいしくてハマっています。が、塩味が邪魔です。無塩の純粋なひまわりの種だけのものを作ってほしいです。',3,345,'2020-10-07 05:29:19','2020-10-07 05:29:19','8282さん','2017.09.25'),(1344,'旅行の時におやつにお友達から頂き食べました。凄く美味しかったので 空き袋片手に（裏にイオンとあったので）イオンのお菓子売り場に探しに行きました。そしたらTOPVALUの商品でした。中に入っているお菓子が全部味が良くて幸せな気分になります。この一か月で何袋も購入。 みんなに勧めています。最近TOPVALUの品は味が良いと感じます。',5,346,'2020-10-07 05:29:19','2020-10-07 05:29:19','barajamuさん','2019.12.21'),(1345,'美味しいし、ちょっと小腹が空いた時のおやつにピッタリです。',4,346,'2020-10-07 05:29:19','2020-10-07 05:29:19','kumiさん','2019.09.06'),(1346,'どれを食べてもおいしくてビックリしました｡とりこになりそうです。お店が遠いので通販でかえないかなーとついつい検索してしまいました。',5,346,'2020-10-07 05:29:19','2020-10-07 05:29:19','きよもんさん','2019.07.28'),(1347,'一袋でいろんな味が楽しめて、おやつにお茶ともビールのおつまみにも良いので、家族みんなで食べられて、いつもストックしています♪個包装で量もちょうど良いので、おすすめです♪',5,346,'2020-10-07 05:29:19','2020-10-07 05:29:19','まにーさん','2019.03.23'),(1348,'とっても美味しいです。いろいろな味が楽しめます。 分量もちょうどいいです。友達とも分けあえて、話もはずみます。',5,346,'2020-10-07 05:29:19','2020-10-07 05:29:19','ぽんたさん','2019.01.22'),(1349,'色々楽しめて美味しいけど、それぞれの単品の個包装物の個袋が詰めてあるも欲しいです。',4,346,'2020-10-07 05:29:19','2020-10-07 05:29:19','このし～さん','2018.11.25'),(1350,'10種類のお菓子が一袋に入っていていろいろ楽しめるのがいいです 価格も手ごろです',5,346,'2020-10-07 05:29:19','2020-10-07 05:29:19','かあちゃんちゃんさん','2017.01.29'),(1351,'個包装のパッケージデザインが、内容を一層引き立てるデザインたと思います。 美味しいです。小魚によりカルシウムのおやつでとれてうれしいです。',4,346,'2020-10-07 05:29:19','2020-10-07 05:29:19','世界に広めたいさん','2016.11.01'),(1352,'これ1品の中に、大好きなお菓子が詰まっていて、お楽しみ袋みたいです。ピーナッツ入り揚げ煎餅、えび揚げ煎餅、いか豆、揚げ煎餅、いか天は、単品でも購入するくらい好きなのですが、この商品を買えば、それらも入っているうえに他のお菓子も食べることができ、また、個包装になっているので食べすぎ防止になって助かります。味も、単品のものとほとんど変わらず美味しかったです。',4,346,'2020-10-07 05:29:19','2020-10-07 05:29:19','sakonaさん','2016.10.17'),(1353,'色々な味が楽しめて大好きです。とくにいか天が好きなのでもう少し入っているといいな。',4,346,'2020-10-07 05:29:19','2020-10-07 05:29:19','白い月さん','2016.09.11'),(1354,'大好きないか天が入って、色々な味が楽しめて大好きです。',5,346,'2020-10-07 05:29:19','2020-10-07 05:29:19','白い月さん','2016.09.07'),(1355,'食べやすい味のおかきばかりが入ってて、とても美味しい!!私のお気に入りです!酎ハイのおつまみや小腹の空いたときには最高!',4,346,'2020-10-07 05:29:19','2020-10-07 05:29:19','さん','2016.08.13'),(1356,'ごまとアオサ、ナッツと健康食材が1度に摂れる所が良いです。シンプルで素朴な味なのに、何度も食べたくなる美味しさです。',5,347,'2020-10-07 05:29:19','2020-10-07 05:29:19','ばっばさん','2018.05.19'),(1357,'他の通販の大量売りに比べて豆の味がしっかりとしています。 なのでどうしてもイオンのものを購入することになります。 できれば500gや1kgなどの大量のパックを作って欲しいです。',5,348,'2020-10-07 05:29:19','2020-10-07 05:29:19','ミヤさん','2020.01.18'),(1358,'美味しい。そのまま食べても美味しいですが酢に漬けて食べています。便秘解消に良いです。大容量が欲しいです。',5,348,'2020-10-07 05:29:19','2020-10-07 05:29:19','ちかちゃんさん','2019.04.29'),(1359,'あっさりしていてるので小腹が空いたときに美味しく頂けます。 ナッツに比べてカロリーが格段に低いので、煎り大豆の旨味がおつまみとしても十分楽しめます。',5,348,'2020-10-07 05:29:19','2020-10-07 05:29:19','tacosさん','2019.03.04'),(1360,'糖質制限をしてます。豆腐より歯ごたえがあり、素朴な美味しさがあります。安心して食べられるので好きです。',5,348,'2020-10-07 05:29:19','2020-10-07 05:29:19','あきさん','2018.11.26'),(1361,'毎日食べています。ポリポリとそのまま食べられるのですぐになくなります。お菓子を食べるより罪悪感がないかも。',5,348,'2020-10-07 05:29:19','2020-10-07 05:29:19','みつこさん','2018.04.28'),(1362,'そのままおやつとして食べています。とても美味しくてついつい食べ過ぎてしまいます。北海道産の大豆でこのお値段はお値打ちだと思います。',4,348,'2020-10-07 05:29:19','2020-10-07 05:29:19','samapapaさん','2017.10.22'),(1363,'煎り大豆だけを食べたい人には嬉しいです 量が多くて一人では食べきれないのが難点',4,348,'2020-10-07 05:29:19','2020-10-07 05:29:19','ぴさん','2017.10.06'),(1364,'更年期を元気に過ごすために毎日かじっています。 塩不使用なのが気に入っています。 素材の味を楽しんでいます。',4,348,'2020-10-07 05:29:19','2020-10-07 05:29:19','さらさん','2017.03.17'),(1365,'非常に香ばしく歯ざわりも良い!噛んでいるうちに感じるほのかな甘さ。北海道産も好感度大。',5,348,'2020-10-07 05:29:19','2020-10-07 05:29:19','酒絶ち人生さん','2017.01.20'),(1366,'単品でも十分美味しいですが、ミックスナッツに混ぜて、おやつとして食べています。手軽に、たんぱく質とイソフラボンが摂れるので、いつも鞄に常備しています!',5,348,'2020-10-07 05:29:19','2020-10-07 05:29:19','ジゼルさん','2016.12.13'),(1367,'美味しいです。小腹がすいた時など噛みごたえがあるので少しの量でもいっぱい食べた気分になります。大豆だから栄養面でも⭕',4,348,'2020-10-07 05:29:19','2020-10-07 05:29:19','スーさんの嫁さん','2016.12.01'),(1368,'以前書いたものですが、家のフライパンで煎ってみたら美味しくなりました。 香ばしくなるまでしっかりいってほしいです',5,348,'2020-10-07 05:29:19','2020-10-07 05:29:19','さん','2016.07.20'),(1369,'前のほうが軽い食感で大豆の旨味を感じられた。これは、外が硬くてツルツルで生のを食べているみたい。 前にもどしてほしい。 量も20グラム減った。残念 大ファンだったのに。',1,348,'2020-10-07 05:29:19','2020-10-07 05:29:19','さん','2016.07.18'),(1370,'1袋で8種類もの味が楽しめるのでお得感と満足感があります。 この手のお菓子ってどのメーカーも同じ味なのでは…と思っていましたが、この商品はなぜか特筆して美味しく感じられるので、職場のお菓子用としてよく購入しています。 小腹が空いたときにちょうど良いサイズなのも気に入っています。',5,349,'2020-10-07 05:29:19','2020-10-07 05:29:19','Motoさん','2020.05.26'),(1371,'どの味も美味しいです。子供達も自分で好きな豆菓子を選んで食べています。ちょうど良い量なので小腹が空いた時に食べると満足感があります。',5,349,'2020-10-07 05:29:19','2020-10-07 05:29:19','まめこさん','2020.03.31'),(1372,'美味しい！なんかでも食べれそうです',5,349,'2020-10-07 05:29:19','2020-10-07 05:29:19','ゆうさん','2018.02.23'),(1373,'イオンのラウンジで出された製品を食べてからとても気に入ってもう１０袋以上買って食べています、特に夫に買ってくるようにせがまれています。 食べたい分だけ開けられると言っても夫の場合一度で１０袋は開けています。 とにかく美味しいんです、お勧めです！！',5,349,'2020-10-07 05:29:19','2020-10-07 05:29:19','あしたのりょうさん','2018.02.20'),(1374,'その時の気分で食べるものを変えられる楽しみがあります。 小袋なので複数個食べても罪悪感は少ない…かな?',4,349,'2020-10-07 05:29:19','2020-10-07 05:29:19','羽音さん','2017.08.29'),(1375,'小魚ピーナッツは小魚がやわらかくおいしい。 ピーナッツもおいしいが、小魚の大きさと相性がよくない気がする。 小魚スナックで硬くて、口の中を刺すような商品があるが、この商品はそれが無く、安心です。',4,349,'2020-10-07 05:29:19','2020-10-07 05:29:19','柔らかい小魚さん','2016.12.06'),(1376,'個包装の中に多めに入っていると思う、これがいい。 食べた気がする。',4,349,'2020-10-07 05:29:19','2020-10-07 05:29:19','小腹を少々満たすさん','2016.10.06'),(1377,'もちチーズ&黒こしょう、いか豆の2種がお気に入りです。 これらは、大袋で独立して個包装せず、販売してほしく、たくさん食べたい。遺伝子組換え不分別なら☆5でした。',4,349,'2020-10-07 05:29:19','2020-10-07 05:29:19','ペッパーチーズ餅もちさん','2016.09.10'),(1378,'いろいろ入っておいしいです。',5,350,'2020-10-07 05:29:19','2020-10-07 05:29:19','himicoさん','2020.06.30'),(1379,'チャックがついているので、食べたい時に好きな量をたべられるので良いです。ピーナッツが多いような。',4,350,'2020-10-07 05:29:19','2020-10-07 05:29:19','ゆうたんたたたたたんさん','2020.03.05'),(1380,'商品の味に不満はありません。 今回初めての購入ではっきりとはわかりませんが、 先の方も書かれている通り、バラツキがあるのかも知れません。 私が購入したものはピーナッツが多くを占めており、くるみ・アーモンドが極端に少ない。 特にアーモンドは10粒も入っていませんでした。 コストの面でもピーナッツ類が多いだろうとは思っていましたが、 あまりに想像していたものと違っていたので残念です。',3,350,'2020-10-07 05:29:19','2020-10-07 05:29:19','のらさん','2017.08.05'),(1381,'価格は手頃だが、中身に偏りがあるようだ。先日買った袋ではアーモンドの割合が極端に少なかった。それが比較的安い理由なら、あまりお得とも言えない。',2,350,'2020-10-07 05:29:19','2020-10-07 05:29:19','aGTerさん','2017.04.29'),(1382,'小腹が空いた時にちょっとつまめるものを探していました。 6種類がバランス良くミックスされているので飽きることなく食べられます。衣がけピーナッツがポイントですね',5,350,'2020-10-07 05:29:19','2020-10-07 05:29:19','かあやんさん','2017.03.29'),(1383,'小腹がすいた時にはこのミックスナッツを食べます。 ナッツがバランスよく入っているし塩加減もちょうどいい',3,350,'2020-10-07 05:29:19','2020-10-07 05:29:19','イオン大好きさん','2016.08.08'),(1384,'ナッツは健康に良いと聞いたので愛用しています',4,350,'2020-10-07 05:29:19','2020-10-07 05:29:19','きららさん','2016.06.13'),(1385,'ピーナッツ（バタピー）が大好きで色々なメーカーのものを食べていますが、トップバリュのこの商品は大粒で豆の甘みと旨味がしっかりと感じられ、塩加減も控えめでバランスが取れていて本当に美味しいです。 バタピーというとお菓子やおつまみのイメージが先行してしまいますが、これはパッケージの上品さも相まって、他のナッツ類（アーモンドやカシューナッツ）のように健康食品感覚で購入しています。',5,351,'2020-10-07 05:29:19','2020-10-07 05:29:19','Motoさん','2020.07.28'),(1386,'塩味が強すぎず、量も丁度いい',5,351,'2020-10-07 05:29:19','2020-10-07 05:29:19','うしくんさん','2020.02.14'),(1387,'美味しくてコスパも良いので大大満足です。',5,351,'2020-10-07 05:29:19','2020-10-07 05:29:19','イサンさん','2019.02.25'),(1388,'軽い塩味で素朴な美味しさのピーナッツです。味付けがシンプルなのが好印象です。',5,351,'2020-10-07 05:29:19','2020-10-07 05:29:19','こるとんさん','2018.11.02'),(1389,'粒が大きくて、塩が控えめでピーナッツ本来の味を感じることができて美味しいです♪',5,351,'2020-10-07 05:29:19','2020-10-07 05:29:19','ピーナッツ子さん','2017.11.02'),(1390,'食感と塩加減更に価格のコスパ言うことなし。',5,352,'2020-10-07 05:29:19','2020-10-07 05:29:19','タッチさん','2019.01.30'),(1391,'粒が大きく甘みが有り、塩味もほんのり感じる程度で、落花生の味もちゃんとして、全体的にとてもバランスが良く美味しいため、定期的によく買っていましたが、最近よく行く店舗でことごとく取り扱いがなくなってしまい、とても悲しいです。 バタピーはコンビニでも安く売っていますが、うす皮つきで食塩のみというのは、デパートの国産のもの以外はなかなか買うことができない&国産は高くて頻繁には買えないので、もっと取り扱い店舗が増えてくれたらうれしいです。 トップバリュの素煎りうす皮つきピーナッツも好きですが、こちらも本当に美味しいです。',5,352,'2020-10-07 05:29:19','2020-10-07 05:29:19','Motoさん','2017.09.11'),(1392,'アーモンドとカシューナッツがバランス良く入っています。個人的にはくるみは要らないかなと思うので、２種で商品化して欲しい。 ですが、粒しっかり、量と価格設定は良心的。絶対買い！です。',5,353,'2020-10-07 05:29:19','2020-10-07 05:29:19','Teresaさん','2020.06.22'),(1393,'食塩・油不使用のミックスナッツはあまり売られていないので、これを見つけたときは即買いしました。粒揃い、大袋でこの値段は驚異的です。店頭では売り切れているときも多く、見つけたら買っています。',5,353,'2020-10-07 05:29:19','2020-10-07 05:29:19','山田花子さん','2020.06.17'),(1394,'美容と健康、今は妊活のために毎日素煎りナッツを食べています。ナッツ難民だった頃に色々試しましたがトップバリューはやっぱすごい。これだけ形もしっかりしたナッツが205g入ってこの価格は本当にお得だと思います！',5,353,'2020-10-07 05:29:19','2020-10-07 05:29:19','にゃんこさん','2020.06.01'),(1395,'素煎り３種のミックスナッツ２０５ｇとても美味しくてもう幾度も購入しています、先日４１０ｇ入りを見つけて購入しましたが（名古屋イオン新瑞橋店）１回だけしか見つけられませんでした。トップバリューブランドはとても美味しく種類も沢山ありこれからもお値打ちな商品を提供期待しています。ＮＥＴで探して研究したいです。',4,353,'2020-10-07 05:29:19','2020-10-07 05:29:19','ヤマチャンさん','2020.04.12'),(1396,'お菓子を作るのに買ったナッツでしたが、食べてみるとナッツに甘味があり、とてもおいしかったです。',5,353,'2020-10-07 05:29:19','2020-10-07 05:29:19','りんごさん','2020.04.04'),(1397,'健康を考えてナッツを毎日食べています！このミックスナッツはトップバリューでお得なうえ、美味しくて家計に優しく続けていけそうです！',5,353,'2020-10-07 05:29:19','2020-10-07 05:29:19','ごんごんさん','2019.11.08'),(1398,'美容のためにもう2年くらい食べています。くるみはオメガ3の脂肪酸なので健康にも良いので毎日夕食後に欠かさず食べています。素焼きで添加物なしが気に入っています。',5,353,'2020-10-07 05:29:19','2020-10-07 05:29:19','あっこちゃんさん','2019.10.27'),(1399,'素煎りなので、塩分を気にせずパクパク食べられます。 ちょっと小腹がすいた時の常備品。 コスパも良いと思いますが、もっと大サイズがあったらうれしいです。',4,353,'2020-10-07 05:29:19','2020-10-07 05:29:19','pumaさん','2018.07.25'),(1400,'塩分・油分などが入っていなくてナッツ自体のおいしさを楽しめる。 おいしくてすぐ食べきってしまう。',5,353,'2020-10-07 05:29:19','2020-10-07 05:29:19','ロシアンブルーさん','2018.06.05'),(1401,'我が家には小動物が居るのでその子も一緒に食べています、みんなで食べると2日しか持たないのでもっと大きい袋で欲しいです。1キロとか2キロくらい。',5,353,'2020-10-07 05:29:19','2020-10-07 05:29:19','ナミママさん','2018.06.02'),(1402,'ハイボールのお供にとても合うので毎日楽しみにしています。 美味しくて健康にも良いですが食べ過ぎ、飲み過ぎに注意です。',5,353,'2020-10-07 05:29:19','2020-10-07 05:29:19','NEWガチャポン1さん','2018.06.02'),(1403,'健康のため、3種類ともまんべんなく食べたい。 くるみの量を増やしてほしいです。',4,353,'2020-10-07 05:29:19','2020-10-07 05:29:19','vigaalさん','2018.05.23'),(1404,'コスパかなり良い！ 味もうまい！ 売り切れになってほしくないから みんなに教えたくない！ イオンのミックスナッツお買い得だよ！！',5,353,'2020-10-07 05:29:19','2020-10-07 05:29:19','不謹慎さん','2018.05.10'),(1405,'色々食べた中で一番おいしくて価格も安いので家に常備しています。',5,353,'2020-10-07 05:29:19','2020-10-07 05:29:19','みっこさん','2018.03.30'),(1406,'素煎りなので塩分も気にしないで美味しく食べれます。ただ食べ過ぎに気を付けないと。マカダミアナッツが入っているともっといいのですが。',5,353,'2020-10-07 05:29:19','2020-10-07 05:29:19','やこさん','2017.10.29'),(1407,'カロリーが高いのはわかっていますが、美味しいので2日で一袋食べてしまいます。',5,353,'2020-10-07 05:29:19','2020-10-07 05:29:19','mayuさん','2017.04.25'),(1408,'お値段もお安くなって、美味しいので、ついつい食べ過ぎちゃいます。',5,353,'2020-10-07 05:29:19','2020-10-07 05:29:19','シェルマミーさん','2017.04.20'),(1409,'なんどもリピート購入しています!ちょっとおなかがすいた時にポリポリ食べています。',5,353,'2020-10-07 05:29:19','2020-10-07 05:29:19','nicoさん','2017.03.21'),(1410,'美容の為、健康の為に2年ぐらい前から食べています。もちろん食塩・油不使用なので購入しています。味も飽きることなく美味しく毎日食べています。',5,353,'2020-10-07 05:29:19','2020-10-07 05:29:19','あっこちゃんさん','2017.02.20'),(1411,'健康を気遣い、おやつも選んでおりますが、まさにこれはぴったりでした。美味しい。',5,353,'2020-10-07 05:29:19','2020-10-07 05:29:19','あゆいのさん','2016.11.30'),(1412,'塩分の取り過ぎは注意なので、塩分不使用を選びました。 大粒でとても美味しいです。 食べ過ぎに注意したいです。',4,354,'2020-10-07 05:29:19','2020-10-07 05:29:19','ペンギンさん','2020.05.17'),(1413,'食塩、油不使用のピーナッツ商品はなかなか無いので気に入ってます。間食様に常備してますが、食べ出すと止まらないので、すぐ無くなってしまいます。笑',5,354,'2020-10-07 05:29:19','2020-10-07 05:29:19','ふにゃさん','2019.01.24'),(1414,'毎日20粒食べています。うす皮に糖質の吸収をブロックする効果があると聞いたので。粒が大きくてほのかな甘味があって美味しいです。私の常備食なので、品切すると困ります(笑)',5,354,'2020-10-07 05:29:19','2020-10-07 05:29:19','KOZYさん','2018.09.22'),(1415,'やっぱりこれが一番です。イオンさんのキャラメルコーンと一緒に食べるとおいしいです。',5,354,'2020-10-07 05:29:19','2020-10-07 05:29:19','ｐｏｏｈさん','2018.07.27'),(1416,'油や塩なし、素焼きだから、買いますが、品切れが、多発します',4,354,'2020-10-07 05:29:19','2020-10-07 05:29:19','クワ婆さん','2018.02.20'),(1417,'良く購入します。皮ごと食べれて美味しい。最近在庫無くて少し焦りました。毎日10粒食べてます。',4,354,'2020-10-07 05:29:19','2020-10-07 05:29:19','ボーテさん','2017.11.10'),(1418,'素煎りピーナッツは産地問わず色々食べてきましたが、トップバリュのこれは落花生の味がしっかりしていて、粒が大きくて甘みが有り、値段が安いのにとても美味しいと思っています。好みによるとは思うのですが、個人的には国産よりも気に入っています。他の方のレビューでも品切れしているとありますが、地元のイオンでも最近販売がなくなっていて残念です。',5,354,'2020-10-07 05:29:19','2020-10-07 05:29:19','Motoさん','2017.09.11'),(1419,'コスパ良し。 他社製品と比べて、粒が大きいわりには安いし、美味しい。 最近、品切れ気味。近所のイオン、ミニストップでは品切れしています。',5,354,'2020-10-07 05:29:19','2020-10-07 05:29:19','kamozさん','2017.08.25'),(1420,'テレビでピーナツが血管を丈夫にすると言っていたので食べ始めました。中国製なのが気になりますが、イオンを信じて食べています。',3,354,'2020-10-07 05:29:19','2020-10-07 05:29:19','あっこちゃんさん','2017.03.15'),(1421,'無塩なので塩分を気にせず毎日かじってます。 少食になってしまって困っていましたが、これにたどり着きました。 隠れ栄養失調対策に最適!',4,354,'2020-10-07 05:29:19','2020-10-07 05:29:19','かん太さん','2016.08.07'),(1422,'ぜひ食べてみてください。 普通のレーズンとは全く違って、皮がやわらかく、上品ですっきりとした甘さと香りがあります。 ヨーグルトと合わせて食べてもおいしいですよ！',5,356,'2020-10-07 05:29:19','2020-10-07 05:29:19','けいぴさん','2020.08.02'),(1423,'オイルコーティングされていなくてオーガニック、しかもマスカットって素敵ですね。 ドライでもマスカットはマスカットの香りがして、おいしいです。そのまま食べるのもおいしいですが、甘味がとても強いので、砂糖の代わりに、使うのもいいですよ。これをいれてパンケーキを焼くと、砂糖なしでも十分甘いです。',4,356,'2020-10-07 05:29:19','2020-10-07 05:29:19','にゃおんさん','2020.06.21'),(1424,'マスカットのレーズンは初めて食べましたが、ブドウのレーズンよりもスッキリした甘さで、爽やかな酸味があります。 ブドウのレーズンはあまり率先して食べないのですが、これは手が止まらなくなる美味しさです。 植物油脂や保存料（ソルビン酸等）が使われておらず、有機栽培というのも安心感があって良いですね。',4,356,'2020-10-07 05:29:19','2020-10-07 05:29:19','Motokaさん','2020.04.16'),(1425,'朝の紅茶に入れる習慣にしています。これまでいろいろなレーズンを試しましたが、これがベストです。リキュールにつけて柔らかく戻してから使いますが、歯ごたえの残る食感と程よい甘みが絶妙です。 ホットケーキに入れて焼くとまた別の美味しさがあります。',5,356,'2020-10-07 05:29:19','2020-10-07 05:29:19','キクジロウさん','2019.08.27'),(1426,'マスカットの風味があって美味しい❗️鉄分もしっかり摂れるし、レーズンが苦手な私もこれなら食べられます‼️',5,356,'2020-10-07 05:29:19','2020-10-07 05:29:19','kyounaさん','2019.03.18'),(1427,'オイルコーティングされていないレーズン探していたのですが、見当たらずこのマスカットレーズンを購入。甘さあり、酸味ありで最近はこればかり購入。お酒に合います！',5,356,'2020-10-07 05:29:19','2020-10-07 05:29:19','fheeさん','2019.01.30'),(1428,'マスカットのレーズンは初めてでしたが、通常のレーズンよりも香りが爽やかで、高級感がありました。オーガニックなのも、高品質でいいですね。',4,356,'2020-10-07 05:29:19','2020-10-07 05:29:19','ななさん','2017.06.05'),(1429,'オイルコーティングされていないので食べやすいです マスカットのさわやかな酸味でさっぱりした後味のレーズンです リフレッシュにもいいしヨーグルトなどにも合います',5,356,'2020-10-07 05:29:19','2020-10-07 05:29:19','kodaさん','2017.05.12'),(1430,'普通のレーズンとは違いますね。お勧めです。',5,356,'2020-10-07 05:29:19','2020-10-07 05:29:19','ももさん','2016.01.20'),(1431,'少しレンジで温めるとホクホクになりとてもおいしかったです',4,357,'2020-10-07 05:29:19','2020-10-07 05:29:19','あきさん','2020.06.11'),(1432,'これまでに色々なメーカーのむき甘栗を「大体こんなものだ」と思って食べてきました。 今回初めてこちらの商品を頂き、「美味しい！何処の？」と確認してしまいました。 「味、香り、やわらかさ」◎です。',5,357,'2020-10-07 05:29:19','2020-10-07 05:29:19','シュリシンさん','2020.01.13'),(1433,'美味しかったです。あっという間に1袋完食してしまいました。出来れば価格面でお買い得感を感じれると嬉しいです。',3,357,'2020-10-07 05:29:19','2020-10-07 05:29:19','ヒロ爺さん','2016.10.08'),(1434,'自然な甘さで美味しいです。 満足感があり、量も丁度良いです。',5,357,'2020-10-07 05:29:19','2020-10-07 05:29:19','ritoriさん','2015.09.16'),(1435,'むき栗のオーガニック商品って珍しいですね。 他にない分、ありがたいです。味は申し分ないし、良心価格だと思います。',5,357,'2020-10-07 05:29:19','2020-10-07 05:29:19','nayutaさん','2015.06.21'),(1436,'有機の栗って本当に安心で、おやつにパクパク一人で一袋食べてしまいます♪♪ むき栗も美味しいですけれど、むき甘栗の方も最高ですよぉおお～★パッケージもお洒落なのでお友達のお家へお土産で持って行っても喜ばれました!! 美味しすぎっ!!',5,357,'2020-10-07 05:29:19','2020-10-07 05:29:19','ロッタさん','2015.05.11'),(1437,'とてもおいしい。 また購入したいと思います。',5,357,'2020-10-07 05:29:19','2020-10-07 05:29:19','さん','2014.12.18'),(1438,'オーガニックのピーナッツがこの価格で買える事、そしてとても美味しい！ ただ、扱っている店舗が少ないのが残念です。 見つけた時はまとめ買いしてます。',5,358,'2020-10-07 05:29:19','2020-10-07 05:29:19','にんもさん','2019.09.30'),(1439,'カリカリ感と香ばしい味が一般的なピーナッツより美味しいです。 この値段でこのお味はオススメです。',5,358,'2020-10-07 05:29:19','2020-10-07 05:29:19','クウちゃんさん','2018.11.03'),(1440,'大容量だし、オーガニックなのでいつもの定番おやつとなっています！',5,358,'2020-10-07 05:29:19','2020-10-07 05:29:19','きらこさん','2018.08.13'),(1441,'油臭いなくて食べやすいと思います。料理に使っても安心ですね',5,358,'2020-10-07 05:29:19','2020-10-07 05:29:19','くまちゃんさん','2015.07.29'),(1442,'栄養補給に毎日少しずつかじります。 安くて大容量の怪しいピーナッツとは味が比べ物になりません。 安心と美味しさが詰まっています。',4,358,'2020-10-07 05:29:19','2020-10-07 05:29:19','さくらさん','2015.07.05'),(1443,'オーガニックて言っても基準が曖昧だしなぁ！ 何をどれだけ、量、期間なども示してくれたらより一層安心です。 だけど、安いんだよ、此れが！！！',4,359,'2020-10-07 05:29:19','2020-10-07 05:29:19','わん！さん','2020.04.19'),(1444,'私の知る限り、この殻付きピーナッツは国産物より旨い。 旨さと価格のバランスでは、ケチのつけようがないと思う。',5,359,'2020-10-07 05:29:19','2020-10-07 05:29:19','殻付き最高さん','2020.04.08'),(1445,'お店に行くと必ず購入します。美味しくてお手頃価格なので。（安くはないけれど）感謝デーなどで割引の時は多めに買ってしまいます。',5,359,'2020-10-07 05:29:19','2020-10-07 05:29:19','おじんさん','2019.07.15'),(1446,'殻付き落花生大好き人間です。今まで国内産しか食べなかったんですが先日イオンさんで見つけまして、原産国中国なので随分迷いましたがイオンさんを信頼して購入しました。粒が大きく香ばしくて美味しかったので今後やみ付きになりそうです。イオンさん中国農生産消毒のご安全確認をよろしくお願い致します。',5,359,'2020-10-07 05:29:19','2020-10-07 05:29:19','たけしさん','2018.10.17'),(1447,'旨味があってやみつきです！毎週1回1袋買って夕食後のおやつにしてますハイボールと共にうまあ！',5,359,'2020-10-07 05:29:19','2020-10-07 05:29:19','ぷううさん','2018.07.13'),(1448,'安いし試しにと思って、袋開けて香ばしくてびっくり！食べてびっくり！甘味は？ですが、サクサクして好きなタイプの落花生です。千葉産のを結構食べつくしましたが、高いばっかりで大しておいしくないのも多い中、もしかしたら一番◎かも！オーガニックなのもがんばっていると思います。',5,359,'2020-10-07 05:29:19','2020-10-07 05:29:19','カピバラさん','2018.03.12'),(1449,'国産ではないけれど乾燥状態もよく毎日おいしく食べています 何より安価なのがいいです お客様感謝デーのときにまとめ買いしています',4,359,'2020-10-07 05:29:19','2020-10-07 05:29:19','かあちゃんちゃんさん','2017.03.14'),(1450,'国産品はバカ高いので試しに買ってみましたが、美味しいです。 くせになってしまいました。 認証マークを信じます。',5,359,'2020-10-07 05:29:19','2020-10-07 05:29:19','いいものさがしさん','2017.01.29'),(1451,'家族全員大好物です。国産ではありませんが、安心してむきむきして楽しいひとときを過ごせるわが家必須アイテムです。やみつきです。',5,359,'2020-10-07 05:29:19','2020-10-07 05:29:19','かりりぃ～んぬ。さん','2016.02.11'),(1452,'毎月GGデーで購入。少しずつ毎日食べて1日10円、国産ではないが充分満足!!',5,359,'2020-10-07 05:29:19','2020-10-07 05:29:19','おじんさん','2015.09.16'),(1453,'香ばしくてやめられなくなります。 お値段もお手頃!!',5,359,'2020-10-07 05:29:19','2020-10-07 05:29:19','ミキティさん','2015.06.26'),(1454,'香ばしくとても美味しかったです。',5,359,'2020-10-07 05:29:19','2020-10-07 05:29:19','わかままさん','2015.06.12'),(1455,'比較的ソフトな食感の黒いちじくです。 よく見かける白いちじくと比較すると、デーツや黒糖を彷彿とさせる濃厚な甘さがある中で、ほのかに酸味も感じられてとても美味です。 オーガニックで無添加というのも良いですね。少しお高めですが、品質は確かだと思います。 黒いちじくがスーパーで手軽に購入できてありがたいです。',5,360,'2020-10-07 05:29:19','2020-10-07 05:29:19','Motoさん','2020.06.27'),(1456,'イチジク好きのを私が、見つけたときには　嬉しかったです。 ちょうど良い甘さ、ちょうど良い量。',5,360,'2020-10-07 05:29:19','2020-10-07 05:29:19','おはなさん','2020.02.08'),(1457,'毎日のスタートに朝1.2つ食べてます。間食やおつまみにも最高です。カロリー気になる方にもオススメできます。因みに朝のコーンフレークと牛乳と一緒なら更に満足感アップ',5,360,'2020-10-07 05:29:19','2020-10-07 05:29:19','ユリモリさん','2015.06.23'),(1458,'いままでドライフルーツはトルコ産の輸入ものしか食べたことなかったですが、日本で加工した為か、品種の違いか、とってもやわらかいいちじくでした。 いつもプレーンヨーグルトにまぜて食べています。 オーガニックで気持ちがいいですね。',5,360,'2020-10-07 05:29:19','2020-10-07 05:29:19','nayutaさん','2015.06.18'),(1459,'食感が抜群で、とてもおいしいです。お値段もお手ごろで、我が家では、小５娘のおやつとして大活躍です。',4,361,'2020-10-07 05:29:19','2020-10-07 05:29:19','ＷＷＨさん','2020.06.24'),(1460,'久しぶりに食べるとおいしい。小麦粉不使用のバージョンがあるとアレルギーでも食べられるのに～',4,361,'2020-10-07 05:29:19','2020-10-07 05:29:19','poohさん','2020.06.17'),(1461,'黒糖も好きですが 断然白かりんとうが好きです。 カリサクとした歯応えもいいし お茶にもコーヒー紅茶にも合うので 我が家では登場回数が多いです。',5,361,'2020-10-07 05:29:19','2020-10-07 05:29:19','ぷくさん','2020.06.06'),(1462,'さくさくっとして歯応えがあり美味しいです。しっかりと甘さがあり、お茶と一緒に食べるとほっと一息つけます。美味しすぎて手が止まりません！',5,361,'2020-10-07 05:29:19','2020-10-07 05:29:19','ピンキーさん','2020.05.16'),(1463,'手頃なお値段で何度も購入しています。黒糖味が好きで、一度で食べきります。',5,362,'2020-10-07 05:29:19','2020-10-07 05:29:19','ゆまさん','2020.07.21'),(1464,'美味しくてやわらかめのかりんとう。',5,362,'2020-10-07 05:29:19','2020-10-07 05:29:19','コクトウさん','2020.06.11'),(1465,'懐かしい感じのシンプルな味です。 困るのは手が止まらないこと！ 美味しすぎます。',5,362,'2020-10-07 05:29:19','2020-10-07 05:29:19','GAOさん','2020.06.10'),(1466,'黒糖味のかりんとうが好きで何度も購入してしまいます。 歯触りも良くボリューム感もあって小腹が空いた時にオススメです。',5,362,'2020-10-07 05:29:19','2020-10-07 05:29:19','kingさん','2020.06.10'),(1467,'シンプルな昔ながらの黒糖かりんとうだと思います。黒糖のやさしい甘みがgood。かりんとう本体の太さも適度で食べ応えがあって良かったです。',5,362,'2020-10-07 05:29:19','2020-10-07 05:29:19','erinさん','2020.05.31'),(1468,'サクサク食感で美味しいです。ちょっと甘い物が食べたい時に丁度いいおやつになります。',5,363,'2020-10-07 05:29:19','2020-10-07 05:29:19','kumiさん','2020.06.22'),(1469,'ほんのり甘く、食べ始めたらやめられないおいしさです。ときどき無性に食べたくなります。食感がとてもいいです。',5,363,'2020-10-07 05:29:19','2020-10-07 05:29:19','MMMさん','2020.06.17'),(1470,'食感がとても良かったです。ほんのりとした味わいがおいしかったです。',5,363,'2020-10-07 05:29:19','2020-10-07 05:29:19','ほろほろさん','2020.05.06'),(1471,'予想していたより美味しかった。この価格ならコスパ良いと思う。',5,364,'2020-10-07 05:29:19','2020-10-07 05:29:19','610さん','2020.06.16'),(1472,'しっとりふっくらでよかった。 ほかの十勝小豆のあんことは何かちがった',5,364,'2020-10-07 05:29:19','2020-10-07 05:29:19','ちげさん','2020.06.03'),(1473,'スーパーで売っているどら焼きの中ではまぁまぁ美味いと思いました。 あんと皮の割合も丁度良く飽きずに食べれました。',4,364,'2020-10-07 05:29:19','2020-10-07 05:29:19','しげぞうさん','2020.06.01'),(1474,'とても美味しいです。家族にも評判いいです。お供えにもよく買わせて頂いています。',5,365,'2020-10-07 05:29:19','2020-10-07 05:29:19','なつさん','2020.06.23'),(1475,'あずきがさっぱりしていながら、コクもあり、とても美味しい。やわらかいどら焼の生地にも合っていて良かったです。',5,365,'2020-10-07 05:29:19','2020-10-07 05:29:19','さらとさん','2020.04.03'),(1476,'他メーカーの最中系和菓子よりもＴＶＢＰのこの最中系和菓子の方が美味い。お彼岸のお供え物用にも最適だと私も思う。最中生地とお餅とあんこの味わいと食感が超良質だね。しかも５８円と言う買い易さ。こちらも気に入った。（☺☺☺☺☺✌✌✌✌✌☆☆☆☆☆❤❤❤❤❤)',5,366,'2020-10-07 05:29:19','2020-10-07 05:29:19','車バイク好きケン君さん','2020.06.21'),(1477,'お餅も大変柔らかく、また甘さもちょうどよい感じで大変美味しいです！ 和菓子系がとても好きなのでトップバリュさんから出てくれてとても嬉しいです！',5,366,'2020-10-07 05:29:19','2020-10-07 05:29:19','まるひろさん','2020.04.18'),(1478,'お彼岸のお供え物にかいました。柔らかいお餅が入っていて、甘さも丁度い感じでした。お値段も安くて買いやすいです。',5,366,'2020-10-07 05:29:19','2020-10-07 05:29:19','さこさん','2020.03.30'),(1479,'この粒あん最中も同ブランドのＣａｌｏｒｉｅ　Ｏｆｆ　Ｃｉｄｅｒとの相性の良さにべた褒めだね。２１日日曜日に食べた餅入りタイプと堂々のほのかな甘さとコンパクトなサイズと持ち易い軽さと５８円と言う御求め易い価格。勿論御彼岸用にも最適だね。(ニッコリ)',5,367,'2020-10-07 05:29:19','2020-10-07 05:29:19','車バイク好きケン君さん','2020.06.23'),(1480,'事務所へ来られるお客様用のお茶うけとして購入しています。個人的には、あんこのネットリ感が大好きで、賞味期限が近づくと、私自身が消費しています。',4,367,'2020-10-07 05:29:19','2020-10-07 05:29:19','WWVさん','2020.06.13'),(1481,'ネットリ系の餡がたっぷりで嬉しい。 外の皮は軟らかくしっとりとしていました。 ネットリ＆しっとりで 心が和むお気に入りの粒あんもなかです。 少しずつ買い足せる一個売りという点も気に入っています。」',5,367,'2020-10-07 05:29:19','2020-10-07 05:29:19','お家もなかさん','2020.04.17'),(1482,'大好きなトップバリュブランドから 粒あん最中が出ていることは 実は知らなかった時に、 他の誰かがお買い上げされているのを見て知らされるに至りました。 その後一度に3つ買いました。 中の餡はしっかり甘くて、しかもシッカリ詰まっています。 皮の香ばしさと餡の甘さの相性も抜群に感じています。 こちらの商品が気に入ったので、離れたくないのですが お餅入りバージョンの方もその内、試させていただきますね(^_-)-☆。',5,367,'2020-10-07 05:29:19','2020-10-07 05:29:19','ぱりもっちさん','2020.04.06'),(1483,'粒あんがとにかくおいしい。粒あんだけでも食べたくなるくらいです。また、食べようと思いました。',5,367,'2020-10-07 05:29:19','2020-10-07 05:29:19','天下一さん','2020.03.27'),(1484,'ふんわり生地で、しっとりしていて美味しい！甘さ控えめです。',4,369,'2020-10-07 05:29:19','2020-10-07 05:29:19','まきさん','2020.05.23'),(1485,'食べた感じのしないカステラがある中、食べやすい柔らかい食感で、食べると重厚感もあるので最高です。',5,369,'2020-10-07 05:29:19','2020-10-07 05:29:19','はんぺいたさん','2020.02.15'),(1486,'このふんわり焼き上げたかすてらミルク味も初めてだ。ＴＶのカフェラテ　マイルドを飲みながら食べたらカステラもカフェラテによく合うなぁと実感した。カステラ本来の美しい見た目とふんわりとした食感、ほのかな甘さが味わえた。こちらも又食べたい。最高ランク★★★★★だ。',5,370,'2020-10-07 05:29:19','2020-10-07 05:29:19','車バイク好きケン君さん','2020.05.27'),(1487,'このふんわり焼き上げたかすてら　チョコマーブルも初めてだ。他メーカーのスティックコーヒーを飲みながら食べた。こちらも物凄くふんわりとしてて美味いね。しかもコンパクトなサイズだね。こちらにもボーナスポイント、是非欲しいなぁ。トップバリュさん、こちらも有難う。ご苦労様。これからも宜しくね。（★★★★★☺✌）',5,371,'2020-10-07 05:29:19','2020-10-07 05:29:19','車バイク好きケン君さん','2020.05.29'),(1488,'串団子であんをすくいながら食べられるのが良いです。自分で加減しながら食べられるので美味しいです。幅広い人にうけると思います。',5,375,'2020-10-07 05:29:19','2020-10-07 05:29:19','へんしんまんさん','2019.09.15'),(1489,'甘くて美味しかったです。 ただ、もう少し量が多いといいなと思います。',4,376,'2020-10-07 05:29:19','2020-10-07 05:29:19','ごまさん','2019.11.13'),(1490,'栗の味が濃くて美味しいです！ ただ、5個入りだと少なく感じます。',4,376,'2020-10-07 05:29:19','2020-10-07 05:29:19','オラフさん','2019.10.16'),(1491,'一口サイズで食べやすく甘すぎないので美味しいです。オススメです。',5,376,'2020-10-07 05:29:19','2020-10-07 05:29:19','kumiさん','2019.09.16'),(1492,'ほっくり、やさしい甘さで美味しい！仕事のお供に最適！',5,376,'2020-10-07 05:29:19','2020-10-07 05:29:19','せっちゃんさん','2019.09.14'),(1493,'ほんのりマロンの味がしてしっとり美味しい！',5,376,'2020-10-07 05:29:19','2020-10-07 05:29:19','まちゃさん','2019.08.22'),(1494,'好き嫌いあるかもしれませんが、 最高です。次回買いだめします。',5,376,'2020-10-07 05:29:19','2020-10-07 05:29:19','にゃ～さん','2019.08.16'),(1495,'サツマイモの風味はほんのり程度でしたが、甘くしっとりとしていて美味しかったです。',3,377,'2020-10-07 05:29:19','2020-10-07 05:29:19','ふうさん','2020.06.27'),(1496,'小腹がすいたときにちょうどいい',5,377,'2020-10-07 05:29:19','2020-10-07 05:29:19','あっこさん','2020.05.22'),(1497,'１個食べてみてハマってしまいました。おやつにと買ってきたけど、美味しいので小腹が空いた時についついつまみ食いしてしまうくらい気に入ってしまいました。',5,377,'2020-10-07 05:29:19','2020-10-07 05:29:19','kumiさん','2019.09.16'),(1498,'スキな味♡ こんなに美味しいなんて驚き。お値段もお手頃だし、マロンと両方食べてます。',5,377,'2020-10-07 05:29:19','2020-10-07 05:29:19','ポテト&マロンさん','2019.09.10'),(1499,'甘すぎず、さつま芋の味がして美味しかった♡リピ決定！',5,377,'2020-10-07 05:29:19','2020-10-07 05:29:19','akiさん','2019.09.09'),(1500,'冷やして食べたらサイコーに美味しい！！ お手頃価格でこんなに美味しいとは思わなかった。 すごくオススメです！',5,377,'2020-10-07 05:29:19','2020-10-07 05:29:19','こもちこんぶさん','2019.09.09'),(1501,'小腹が空くときに、つまみ食いをしています。チョコレートとか洋菓子よりカロリーが低くていいかなって思っています。',5,378,'2020-10-07 05:29:19','2020-10-07 05:29:19','にわさん','2020.07.15'),(1502,'自然な甘さでおいしかったです。食べきりサイズです。',4,378,'2020-10-07 05:29:19','2020-10-07 05:29:19','りんごさん','2019.11.08'),(1503,'ちょっとサツマイモが食べたくなった時に便利。大きさも丁度良くて味も美味しいのでよく買っています。',4,378,'2020-10-07 05:29:19','2020-10-07 05:29:19','kumiさん','2019.09.16'),(1504,'柔らかくて美味しいです。 量もちょうど良くて食べきりサイズです。',5,378,'2020-10-07 05:29:19','2020-10-07 05:29:19','ぺこさん','2019.09.03'),(1505,'味もおいしです、カロリーも押さえぎみで女性にはとっても有り難い商品です。',4,378,'2020-10-07 05:29:19','2020-10-07 05:29:19','ねこさん','2019.08.15'),(1506,'ほどよい甘さで小腹がすいたときにぴったりです。小さくても満足な食べごたえがあり美味しいです。',4,379,'2020-10-07 05:29:19','2020-10-07 05:29:19','ゆうみさん','2019.08.31'),(1507,'手軽に食べれて価格もリーズナブルで非常に気にいってます。',5,380,'2020-10-07 05:29:19','2020-10-07 05:29:19','きゅーちゃんさん','2019.09.07'),(1508,'一人暮らしの母は沢山の量は困るので一口で食べられる　 この羊羹がぴったり！甘すぎず食べ過ぎず美味しくて、安価なのが魅力です。',5,380,'2020-10-07 05:29:19','2020-10-07 05:29:19','しあわせまるさん','2019.08.16'),(1509,'あっさりとしていてとても美味しいです。これならいくつでも食べられそうです。',5,380,'2020-10-07 05:29:19','2020-10-07 05:29:19','ちびたろうさん','2019.08.10'),(1510,'SNSでこちらのせんべいを見つけました。初めて食べたのですが、ピーナッツと生地の具合がちょうど良くて、気にいりました。2枚1セットで6個入っていたので、もう少し数が少ないものや、1枚ずつ個包装されているものがあればいいと思います。',5,381,'2020-10-07 05:29:19','2020-10-07 05:29:19','かわきょうさん','2020.04.16'),(1511,'個包装が開けにくいと他の方のレビューがあったので心配していましたが、刃物を使わないでも、裏側から引っ張るとすぐに開きました。 特に開けにくいとは感じなかったので、改善されているのかもしれません。 味は他の方も言われてる通りで、卵とピーナツの風味が良く、大満足でした。 リピ確定です。',5,381,'2020-10-07 05:29:19','2020-10-07 05:29:19','トリンカさん','2019.08.22'),(1512,'味はおいしくて、濃い緑茶にもコーヒーにも合います。 職場の休憩所によく置いてあります。 ただ、ひとつだけ言わせてもらうと、2枚が1包装になっていて、1枚が割と大きめなので、2枚じゃなくて1枚ずつの個包装が食べやすいかなと思いました。',5,381,'2020-10-07 05:29:19','2020-10-07 05:29:19','ミンティーさん','2019.07.05'),(1513,'小麦粉と卵を使った卵せんべいのようなほんのり甘い、素朴な、どこか懐かしさを感じずにはいられないそんなせんべいです。 一見固そうに見えますが意外にそうでもなくしとっさくっとした食感です。 中にはピーナツも入っており、香ばしさと歯ごたえをプラスしてくれてます。せんべいそのものとピーナツの異なる食感をたのしめることや、ピーナツの香ばしさ、せんべいの風味がよくて、気に入ってよく食べています。',5,381,'2020-10-07 05:29:19','2020-10-07 05:29:19','MONOさん','2019.05.31'),(1514,'卵の風味がしっかりとしていて、思ったよりも固くなくて食べやすいです。 濃い緑茶にも、コーヒーにも合うので、お茶うけにピッタリ。常備しています。',5,381,'2020-10-07 05:29:19','2020-10-07 05:29:19','コスパ子さん','2019.04.22'),(1515,'良かった点:年配の家族が、同様の他社製品が好きなのです が、私はイオンの商品を信頼と価格で比べた結 果、選んで買ってあげました。 味は焼き上げのむらがなく、焦げた風味もな く、卵の粉末材の味がして、まあまあ良かった です。 遺伝子組み換え情報が、きちんと載っているの は良かったです。 悪かった点:包装材(シュリンク)が、刃物を使わないと開 封できません!!開け方を図入りで親切に表示 して くれてはありますが、到底無理、不可能 です。 年配の家族も、開封に難儀しておりました。 いまどき、ここまで不親切なシュリンクで包装 したお菓子を出荷していること自体、驚きで す。お願いですから、せめて年配のお客が刃物なしで開封できるように、お菓子の個包装を改良していただきたいです。あと、未開封の個包装菓子が湿気やすいです!',1,381,'2020-10-07 05:29:19','2020-10-07 05:29:19','個包装の改良を希望さん','2017.07.01'),(1516,'残念ながら歯ごたえが、もう少しあった方が好みです。',3,381,'2020-10-07 05:29:19','2020-10-07 05:29:19','爺さん','2017.05.04'),(1517,'昔ながらの懐かしいお味です。 食べたらまた買いたくなります。 日本人の作るお菓子は、世界のどこにも負けません!',5,381,'2020-10-07 05:29:19','2020-10-07 05:29:19','ららんさん','2016.09.11'),(1518,'ピーナッツ入りお煎餅、大好きです。こちらのは、ちょっとしっとりした感じがあって、歯や歯茎の弱い人でも食べられるかもしれません。ピーナッツが焙煎してあるからか、香ばしさがあります。牛乳と一緒に食べるのが好きです。',4,381,'2020-10-07 05:29:19','2020-10-07 05:29:19','ちかさん','2016.06.23'),(1519,'ずーっと食べているがここ最近はパリット感が少なく感じている。福岡県の工場製品。乾燥?不十分と思う。ピーナッツ入りせんべい。',3,381,'2020-10-07 05:29:19','2020-10-07 05:29:19','ひま爺さん','2015.09.10'),(1520,'とっても美味しい。本当においしい!!大好きなお菓子のひとつです。 言葉で説明するのがむずかしい独特の食感で、和風のクッキー?洋風のおせんべい?のような、優しい味のお菓子です。',5,381,'2020-10-07 05:29:19','2020-10-07 05:29:19','こぐまさん','2015.08.14'),(1521,'安いし美味しいし、食べ始めたら辞められない止まらない。飲み物も問わず何にでも合うのでオススメです。',5,382,'2020-10-07 05:29:19','2020-10-07 05:29:19','kumiさん','2019.03.09'),(1522,'はちみつとさつまいもの甘さ、カリカリの食感がたまらない! ジッパー付きで保存に便利ですが、保存する間もなくあっという間に食べきってしまうくらい大好きなおやつです。',5,382,'2020-10-07 05:29:19','2020-10-07 05:29:19','hakoさん','2017.06.14'),(1523,'上品な甘さ。細身のスティック。はちみつ入りなのでまろやかさも感じます。美味しい。',5,382,'2020-10-07 05:29:19','2020-10-07 05:29:19','けんぴさん','2017.04.08'),(1524,'安くておいしいです。でもカロリーがちょっと気になるかな。',4,382,'2020-10-07 05:29:19','2020-10-07 05:29:19','abeさん','2017.02.23'),(1525,'食べだしたら止まらない、お茶にもコーヒーにもあいます。',5,382,'2020-10-07 05:29:19','2020-10-07 05:29:19','じぇーんさん','2017.02.13'),(1526,'甘味あっさりで美味しいです。 芋の食感も堅すぎず柔らかすぎずちょうどよい!',5,382,'2020-10-07 05:29:19','2020-10-07 05:29:19','いも子さん','2017.01.23'),(1527,'トップバリュのかりんとうが大好きで毎日食べても飽きないくらい、あっという間に一袋食べてしまうので、こちらの食べきりサイズ５袋入りを買ってみました。味は同じで美味しいんですが、表紙のかりんとうの写真を見て、いつものより若干少し細いかなって思ってみたら、いつものと変わらずの太さだったので少しガッカリしました。もう少し細くてもいいかも。',4,383,'2020-10-07 05:29:19','2020-10-07 05:29:19','kumiさん','2019.05.03'),(1528,'美味しいし、５種類の味が楽しめて食べだすと止まらなくなってしまうくらい気に入っています。特に胡麻かりんとうが美味しいです。',5,384,'2020-10-07 05:29:19','2020-10-07 05:29:19','kumiさん','2019.05.01'),(1529,'いろいろな味が楽しむことができるので飽きません。あっさりした味でこれからも長く楽しむことができそうな商品だなぁと思いました。',4,384,'2020-10-07 05:29:19','2020-10-07 05:29:19','ぽりまるさん','2018.12.05'),(1530,'値段が安いので、あまり味に期待していませんでしたが、コレはしっとり美味しいカステラです。お値段以上。 パサパサしていません。 同価格帯のカステラなら間違いなくコレを買います。そんじょそこらのカステラに引けを取らない美味しさです。',5,385,'2020-10-07 05:29:19','2020-10-07 05:29:19','柊さん','2019.08.09'),(1531,'しっとりしてて十分甘く、値段の割に美味しいです。 家族のおやつ、食後のデザートにはこれで十分満足できると思います。',5,385,'2020-10-07 05:29:19','2020-10-07 05:29:19','お世話になってますさん','2017.12.21'),(1532,'食べやすい。しっとりしてておいしかった',5,385,'2020-10-07 05:29:19','2020-10-07 05:29:19','たここさん','2017.10.30'),(1533,'思ったより、しっかりとした味でした。ややあっさりめでしつこくなく、食べれました(^-^)/',4,385,'2020-10-07 05:29:19','2020-10-07 05:29:19','あらまぁさん','2017.05.20'),(1534,'やわらかくてフワフワで美味しいです。クリームも良かったなぁ。',5,386,'2020-10-07 05:29:19','2020-10-07 05:29:19','くりーむさん','2020.06.24'),(1535,'昔食べた事のある某大手有名他メーカーのロールケーキよりこちらのロールケーキの方が元気の源になるくらい美味い。その秘訣は、ロールケーキ生地と生クリームのふんわりとした食感と丁度良い甘さ、そして片手で持って食べれるサイズと量、食欲が湧いて来てくれそうなユニークな袋ラベルのデザイン。それが私をにこやかにさせてくれる。本格的洋菓子だね。サイコー！！超ラッキー！！イェーイ！！',5,386,'2020-10-07 05:29:19','2020-10-07 05:29:19','車バイク好きケン君さん','2020.06.22'),(1536,'バターの風味がよくて、食べやすいサイズ。 コスパがとてもよく、ファミリーに最適ですね。 こまったら、コレ。',4,387,'2020-10-07 05:29:19','2020-10-07 05:29:19','かっぱちゃんさん','2020.07.26'),(1537,'食べやすい大きさで美味しかったです。バターの香りがして良かったです。',4,387,'2020-10-07 05:29:19','2020-10-07 05:29:19','みほりんさん','2020.05.25'),(1538,'このクッキー、同ブランドのＢＰの缶カフェオレ１８５㌘を飲みながら食べたらルンルン気分になった。しかもプロテインが豊富でただ美味いだけではなく、栄養価も高いね。おやつ好きで体の事も確り考えている方にはこれが向いていると私は思う。まだこのクッキー食べた事の無い方で食べてみたいなぁと思う方は気が向いたらゆっくり食べてみて、そしたら美味さと体への配慮性が無完全でも 実感出来ると思う。（ニッコリ）',5,388,'2020-10-07 05:29:19','2020-10-07 05:29:19','車バイク好きケン君さん','2020.06.20'),(1539,'サクサクっとしたクッキーで食べ応えがあります。 タンパク質が豊富なので栄養満点で嬉しいです。',5,388,'2020-10-07 05:29:19','2020-10-07 05:29:19','ピンキーさん','2020.05.16'),(1540,'普通過ぎる',3,389,'2020-10-07 05:29:19','2020-10-07 05:29:19','マロンさん','2020.05.19'),(1541,'程よい甘さでしっとりとしていて美味しかったです。また購入したいと思います♪',4,390,'2020-10-07 05:29:19','2020-10-07 05:29:19','あゆさん','2020.06.06'),(1542,'シリーズで買っていたので、どんな味か気になり購入しました。 ほうじ茶の味というより、ア－モンド感と粉砂糖味って感じでした。 でも、美味しいtea breakできそうなおやつでした。',4,391,'2020-10-07 05:29:19','2020-10-07 05:29:19','りんさん','2020.07.11'),(1543,'今朝、行き付けのイオン福岡伊都店で買って店内の１階の休憩所で食べた。ほうじ茶の香ばしさとアーモンドボール生地とその周りに満遍無くかかっている粉砂糖のほのかな甘さとサクサクした食感、食べ易い量やサイズが私をにこやかにさせてくれた。又の機会に食べたい（',5,391,'2020-10-07 05:29:19','2020-10-07 05:29:19','車バイク好きケン君さん','2020.06.09'),(1544,'シリーズ商品のほうじ茶風味ですね。ほうじ茶の風味が弱く、アーモンドと合っていない感じでした。もっと、ほうじ茶を前面に出した方がいいかもです。',2,391,'2020-10-07 05:29:19','2020-10-07 05:29:19','あべしさん','2020.05.31'),(1545,'ほのかにほうじ茶？！ アーモンド味だけの方が好きです',4,391,'2020-10-07 05:29:19','2020-10-07 05:29:19','あっこさん','2020.05.22'),(1546,'ほうじ茶の味が少ない',3,391,'2020-10-07 05:29:19','2020-10-07 05:29:19','マロンさん','2020.03.24'),(1547,'おいしい',3,392,'2020-10-07 05:29:19','2020-10-07 05:29:19','マロンさん','2020.03.24'),(1548,'あっさりしていてふわふわでおいしいです',5,393,'2020-10-07 05:29:19','2020-10-07 05:29:19','ネットスーパーマニアさん','2020.06.25'),(1549,'こんな珍しい味が出てたの知らなかったー！ナッツの風味と香りが生地と相性がよく美味しいです',5,393,'2020-10-07 05:29:19','2020-10-07 05:29:19','さくらさん','2020.04.16'),(1550,'口に入れると、アーモンドの香ばしい香りが広がります。 しっとりしていて上品な甘さ。ちょうどよい食べ切りサイズです。',5,393,'2020-10-07 05:29:19','2020-10-07 05:29:19','とん平さん','2020.04.09'),(1551,'とても美味しいです。アーモンドミルクがこんなに美味しいのを初めて知りました。いい発見ができました。',5,393,'2020-10-07 05:29:19','2020-10-07 05:29:19','さらりさん','2020.04.07'),(1552,'パサツキがなくしっとりして食べやすいです。さっぱりしたレモン味で上品な味なのに、お値段も手頃なのがいいですね。',5,394,'2020-10-07 05:29:19','2020-10-07 05:29:19','ringoさん','2020.06.10'),(1553,'美味しいです。ちょっと甘い物が食べたい時に丁度良いサイズなので、アイスティーと一緒によく食べます。',5,394,'2020-10-07 05:29:19','2020-10-07 05:29:19','kumiさん','2020.06.04'),(1554,'しっとりとして食べ応えのあるバウムにレモンの爽やかな酸味がマッチして、とても美味しい！おやつはもちろん朝食としていただいています。',5,394,'2020-10-07 05:29:19','2020-10-07 05:29:19','チャティさん','2018.06.19'),(1555,'発売されるのを心待ちにしていました！すごくおいしいです。',4,394,'2020-10-07 05:29:19','2020-10-07 05:29:19','りーさんさん','2018.05.29'),(1556,'友人から頂きました。 甘みが程よく、紅茶と一緒に頂戴しましたが、後味もスッキリしておりました。 美味しいお菓子のお陰で、会話も弾みました！',4,394,'2020-10-07 05:29:19','2020-10-07 05:29:19','RKさん','2018.05.29'),(1557,'ほんのり甘くレモンと相性がばっちりで何個でも食べています。１度食べたらはまっちゃいますよ。是非とも御賞味あれ。',5,394,'2020-10-07 05:29:19','2020-10-07 05:29:19','モグモグさん','2018.05.26'),(1558,'ホロホロとした食感とほのかに甘酸っぱいラズベリーが最高！ケーキ屋さんの焼き菓子に匹敵する美味しさだと思います。それでこのお値段。コスパ良し！！',5,395,'2020-10-07 05:29:19','2020-10-07 05:29:19','ききんきんさん','2020.06.11'),(1559,'この洋菓子も初めてだ。何の躊躇いも無く口にした時のラズベリーとアーモンドの香りと味わいの良質さ。又食べたくなるね。こちらも',5,395,'2020-10-07 05:29:19','2020-10-07 05:29:19','車バイク好きケン君さん','2020.05.26'),(1560,'歯触りがよく味は甘すぎずいつまでも食べていたいです。 小袋ですがカロリー高いですね。食べ過ぎに気をつけます。',5,395,'2020-10-07 05:29:19','2020-10-07 05:29:19','ミドリさん','2018.08.31'),(1561,'色は可愛いけど味はラズベリー感がほぼ無いので、そこに期待してしまうと残念に感じるかも。味も通常のアーモンドボールとほとんど変わらない。',4,395,'2020-10-07 05:29:19','2020-10-07 05:29:19','まこさん','2018.06.26'),(1562,'これ本当においしい。しばらくなくさないでね！',5,395,'2020-10-07 05:29:19','2020-10-07 05:29:19','みどりふぐさん','2018.06.17'),(1563,'ラズベリーが好きで、期待して２つ購入しましたが、ラズベリーの香りがほとんど感じられず、残念です。',1,395,'2020-10-07 05:29:19','2020-10-07 05:29:19','yukaさん','2018.06.16'),(1564,'前作に続いて、美味!の一言♪ コーヒーブレイクのお供決定! ラズベリーほキツくなく、風味がほんのり。 色もほんのりピンクでかわいらしい♪',5,395,'2020-10-07 05:29:19','2020-10-07 05:29:19','mamさん','2018.06.12'),(1565,'ラズベリーのフレーバーが大好きなので、お店で見つけたときは嬉しかったです。値段もお手頃で美味しい 。買い占めたいくらいです！',5,395,'2020-10-07 05:29:19','2020-10-07 05:29:19','まいさん','2018.06.08'),(1566,'お店できれいな色にひかれて購入。ラズベリーの風味が心地よく、一口サイズで食べやすい。アーモンドの歯ごたえもアクセントになって美味しかったです！リピ決定！',5,395,'2020-10-07 05:29:19','2020-10-07 05:29:19','すずさん','2018.06.07'),(1567,'サクサクしてくちどけがよく、テカロリーなので、ダイエット中のかたにもオススメです。',5,395,'2020-10-07 05:29:19','2020-10-07 05:29:19','ふねさん','2018.06.07'),(1568,'賞味期限間近のものを、お買い得価格で購入したからかもしれませんが 意外とパサパサしていました。 程よい厚みと甘さで、おやつの時間にもぴったり。 個包装なので保存も便利です。',4,396,'2020-10-07 05:29:19','2020-10-07 05:29:19','Humiさん','2020.07.04'),(1569,'しっとりとしていながら外側がサクッとしているのでバランスが良く、その食感が美味しいです。',5,396,'2020-10-07 05:29:19','2020-10-07 05:29:19','さわなりさん','2020.03.03'),(1570,'コーヒータイムのお供に重宝しています。個人的にはメープル味が好きです‼️',4,398,'2020-10-07 05:29:19','2020-10-07 05:29:19','チーコさん','2020.01.31'),(1571,'以前から買いたかった夢が本日、遂に叶った。何時も飲んでいるＴＶＢＰのコーヒー微糖１８５ｇとベストマッチしている。豆乳と蜂蜜とドーナツ生地のしっとりさも甘党の私を喜ばせてくれている。とても気に入った。（スマイル）',5,400,'2020-10-07 05:29:19','2020-10-07 05:29:19','車バイク好きケン君さん','2020.05.05'),(1572,'甘さはちょうど良かったのですが、食べている間も食べ終わった後も油っぽさがかなり気になりました。',3,400,'2020-10-07 05:29:19','2020-10-07 05:29:19','りなさん','2020.04.03'),(1573,'ほんのり甘くておいしいけど、やや油っぽいのが少し残念。米粉ベースだったらもっちりしているのに。',4,400,'2020-10-07 05:29:19','2020-10-07 05:29:19','poohさん','2020.01.19'),(1574,'この値段でこの味であれば上出来だと思います。 ただうちの近くのイオン、もう一か月以上欠品状態です。 どうにかならないものか。',4,401,'2020-10-07 05:29:19','2020-10-07 05:29:19','nishiさん','2020.03.10'),(1575,'糖質も少なく、乳酸菌も100億入っていて、甘すぎず、太ることを気にせずおいしく食べることが出来ました！',4,401,'2020-10-07 05:29:19','2020-10-07 05:29:19','あやままさん','2020.03.07'),(1576,'甘すぎず食べやすいショコラ味なので、ちょっと小腹が空いた時のおやつにピッタリだと思いました。美味しいです。',5,401,'2020-10-07 05:29:19','2020-10-07 05:29:19','kumiさん','2020.02.04'),(1577,'さっぱりとショコラを食べることができました。ちょっと食べたい時には、ピッタリだと思います。',4,401,'2020-10-07 05:29:19','2020-10-07 05:29:19','ごんたさん','2020.01.22'),(1578,'はちみつタイプよりあっさりしているのでおいしい。米粉だったらもっちりしておいしいのに作ってほしい。',4,401,'2020-10-07 05:29:19','2020-10-07 05:29:19','poohさん','2020.01.19'),(1579,'とてもしっとりしているのが自分好みで、美味しいと思います。 値段も安いので、お得だと思います。',5,403,'2020-10-07 05:29:19','2020-10-07 05:29:19','あっしゅさん','2019.08.11'),(1580,'上はしっとり感もありますが、中はキメが荒くボソボソはしてませんが、ぽろぽろします。香料感がなくて食べやすかったです。私ももっと甘さ控えめにしてほしいです。この半分でもいいくらい。低糖質や塩マフィンなんてあってもいいかも。、',4,403,'2020-10-07 05:29:19','2020-10-07 05:29:19','nicoさん','2018.05.31'),(1581,'国産小麦を使用しているというので安心です。 しっとりしていてとても美味しいのですが、一個当たりのカロリーが気になるのでもう少し甘さを控えめにしてもらえると嬉しいです。',4,403,'2020-10-07 05:29:19','2020-10-07 05:29:19','みゅんさん','2018.02.23'),(1582,'安くておいしいです。一般的なものこの倍くらいの値段なのに、パサパサしていますが、こちらはシットリシテいておいしい