020-10-07 05:29:19','クウさん','2018.02.16'),(1609,'ちょっとしたおやつに最適です。さくさく具合が非常に私好みです。',5,406,'2020-10-07 05:29:19','2020-10-07 05:29:19','しろさん','2017.11.01'),(1610,'レジ近くにあったので気になって購入させていただきました。 本当に、サクサクの食感で甘くて美味しいので、疲れた時に食べています。 価格も105円なのでリーズナブルです。',5,406,'2020-10-07 05:29:19','2020-10-07 05:29:19','ビタミンママさん','2017.10.25'),(1611,'このクオリティで100円は凄すぎ!勉強のお供に最適です',5,406,'2020-10-07 05:29:19','2020-10-07 05:29:19','最高!!さん','2017.02.04'),(1612,'丸いクッキーです めっちゃ旨いです 仕事の休憩時間につまむのに 最適です❤',5,406,'2020-10-07 05:29:19','2020-10-07 05:29:19','しらたまさん','2016.12.30'),(1613,'しっとり食感　北海道チーズ蒸しケーキも美味いが、このチーズケーキはもっと美味い。北海道産ゴーダチーズとケーキ生地のふんわりさと心地良い味わい。あるカラオケ屋さんの赤いテーブルで、ＢＰのカフェオレ１８５ｇ缶を飲みながら食べた。その後沢山好きな曲を歌ったらスッキリした。(笑)',5,407,'2020-10-07 05:29:19','2020-10-07 05:29:19','車バイク好きケン君さん','2020.06.29'),(1614,'ふんわりと、しっとりとしていて、食べやすく美味しかったです。',5,407,'2020-10-07 05:29:19','2020-10-07 05:29:19','ユキさん','2020.06.05'),(1615,'封をあけるとチーズの香りが漂い、ふんわりとやわらかいスポンジがとてもおいしい逸品です！',5,407,'2020-10-07 05:29:19','2020-10-07 05:29:19','マリオさん','2020.05.25'),(1616,'しっとり美味しいです。',5,407,'2020-10-07 05:29:19','2020-10-07 05:29:19','さわさん','2019.07.15'),(1617,'しっとりふんわり、チーズが効いてまろやか。カステラとシフォンの中間のような感じかな。見た目よりも美味しかったです！',5,407,'2020-10-07 05:29:19','2020-10-07 05:29:19','nicoさん','2018.06.13'),(1618,'価格の割には美味しかったです',5,407,'2020-10-07 05:29:19','2020-10-07 05:29:19','ジジさん','2017.03.30'),(1619,'パサパサで不味い レビューに騙された',2,408,'2020-10-07 05:29:19','2020-10-07 05:29:19','カイさん','2020.05.30'),(1620,'安くて沢山入ってて、シンプルで美味しい サイズも食べきりやすいので、小腹空いたときにピッタリ トップバリュで一番好きです',5,408,'2020-10-07 05:29:19','2020-10-07 05:29:19','バッキゴン横田さん','2020.01.07'),(1621,'美味しいです。おやつに朝食に食べたりしています。',5,408,'2020-10-07 05:29:19','2020-10-07 05:29:19','kumiさん','2019.08.10'),(1622,'イオンに行ったら必ず買う商品。 この値段でこのクオリティ、すごいと思います。口寂しくてちょこっと甘いの食べたいときには、ほんと良い量です。甘さほどよくて、しっとりしてて美味しい。',5,408,'2020-10-07 05:29:19','2020-10-07 05:29:19','明奈さん','2018.09.11'),(1623,'うまい。',5,408,'2020-10-07 05:29:19','2020-10-07 05:29:19','やのさん','2018.04.30'),(1624,'量とサイズと食べやすさに持ち運び便利でもちろんしっとりふんわり感と甘すぎないホッとする味が良いと思います。シェアしてもいいのでお茶請けやおやつに最適',5,408,'2020-10-07 05:29:19','2020-10-07 05:29:19','ユリモリさん','2017.08.27'),(1625,'子供が好きなので買い置きしています。 しっとりしていておいしいです。 コーヒーと一緒に食べると相性抜群です。',5,408,'2020-10-07 05:29:19','2020-10-07 05:29:19','マックスさん','2017.08.24'),(1626,'しっとりした食感もいいし、美味しいです。 個別包装になっているので、手も汚れにくく、食べやすく、出かける時に持って行くのにも便利です。',5,408,'2020-10-07 05:29:19','2020-10-07 05:29:19','むーちょんさん','2017.06.05'),(1627,'ちょっと冷蔵庫で冷やして食べても美味しかったです。夏でも、ひんやりスイーツで美味しいですよ。',5,409,'2020-10-07 05:29:19','2020-10-07 05:29:19','kumiさん','2020.06.05'),(1628,'しっとり食感と甘さ控えめで、食べやすかったです。小腹がすいたときのおやつに、紅茶と一緒にほっとできる美味しさでした。',4,409,'2020-10-07 05:29:19','2020-10-07 05:29:19','バウムクーヘン！！さん','2020.01.16'),(1629,'普通でした。今、おいしいバウムクーヘンがある中、旧型の味のバウムクーヘンでした。',3,409,'2020-10-07 05:29:19','2020-10-07 05:29:19','新型未来へ♡さん','2018.03.11'),(1630,'このバウムクーヘンは、売り場で「釘付け」になりました。袋ごと手に取ってみると、どっしりと厚みがあって思わず買いたくなります。 絶対に「美味しそう」としか思えないので購買意欲がわきます。バウムクーヘンの輪の中心部分がまた美味しいんです。ちょっと香ばしくてクッキーのような香りと味わい。その周りはしっとりとした口当たりと食感で、ついつい食べ過ぎてしまう美味しさです。 口どけのよさとなめらかさがよくて、とても美味しいバウムクーヘンですよ。',5,409,'2020-10-07 05:29:19','2020-10-07 05:29:19','mananさん','2017.06.30'),(1631,'商品名どおり、とてもしっとりしています。 4個入りで213円というお値段にしては美味しいと思います。 ただ、少しコクが足りない気がします。',4,410,'2020-10-07 05:29:19','2020-10-07 05:29:19','しーさん','2017.08.25'),(1632,'この「しっとりマフィン」は名前の通りしっとりとして美味しいんです! 小さい子供でも高齢者でも手に取って食べやすい上に、北海道牛乳のまろやかな味わいと口どけで、口に入れると乳製品の上品な香りもして微笑みがこぼれます。 それにお値段も1袋に4つ入って200円程度なんて、お買い得で家計に優しいので、大助かりです。 忙しい朝の朝食にもできますし、受験生の夜食にもぴったりですね。いつもこの「しっとりマフィン」が家庭にあると、なんだかほっこりまろやか～な気分になれるんです。美味しいですよ!',5,410,'2020-10-07 05:29:19','2020-10-07 05:29:19','まなさん','2017.06.30'),(1633,'娘と一緒に作るちょっとしたおやつ用に購入しています。イオンのホイップクリームをのせて、トッピング用のカラフルなチョコなどを飾ってミニカップケーキを作って食べています。サイズがちょうどいいのと、価格の割に美味しいので、娘のお友達が遊びに来た時も、とても喜ばれます。子供たちは、作る事が好きですが、あまり面倒な準備はしたくない時にとても便利です。',5,411,'2020-10-07 05:29:19','2020-10-07 05:29:19','こころんさん','2020.05.31'),(1634,'イオン倉敷店で購入しました 近所の店舗では見かけなかったので、初めて購入しましたが とっても美味しかったです。大きさも丁度よく、価格も良心価格なので、また購入したいです。',5,411,'2020-10-07 05:29:19','2020-10-07 05:29:19','tomotomoさん','2017.11.21'),(1635,'バターの香りがして、とても美味しかったです。紅茶と一緒にいただきました。',4,412,'2020-10-07 05:29:19','2020-10-07 05:29:19','ユキさん','2020.07.13'),(1636,'甘さもバターの風味もちょうどよくとても美味しくて、何度もリピートしてます。値段も手頃です。',5,412,'2020-10-07 05:29:19','2020-10-07 05:29:19','あけあけさん','2019.12.22'),(1637,'朝、珈琲と一緒に食べています。とても美味しいので、このサイズなら２個入りもあると良いなと思いました。珈琲や紅茶によく合います。',4,412,'2020-10-07 05:29:19','2020-10-07 05:29:19','kumiさん','2019.12.01'),(1638,'バターが優しく感じられてとても美味しかったです。 あの量じゃ足りないくらい美味しくて、もっと大きくして欲しいと思ったので星4です。',4,412,'2020-10-07 05:29:19','2020-10-07 05:29:19','ものさん','2018.09.25'),(1639,'名前のとおり柔らかく口に入れるとレモンの香りが広がり、爽やかです。 アーモンドの香ばしさも、またおいしい。 こちらのシリーズは色々購入していますが、今はこれが一番お気に入りです。',5,415,'2020-10-07 05:29:19','2020-10-07 05:29:19','さくらさん','2019.03.18'),(1640,'散らしてあるアーモンドが食感のアクセントになっていて良かった',3,415,'2020-10-07 05:29:19','2020-10-07 05:29:19','まこさん','2018.06.26'),(1641,'バターとレモンの風味がバランス良いです。 紅茶のお供に良く合います。 しっとりしたマドレーヌなので癒される美味しさです',5,415,'2020-10-07 05:29:19','2020-10-07 05:29:19','ダチョウさん','2017.09.05'),(1642,'プレーンでほどよい甘さがおいしいです。 ふわふわしっとりな食感も、おやつにちょうどよい大きさも気に入りました。 少しトースターなどであたためるのもおススメです。 焼き立てのようにほかほか。甘いいい風味もアップします。',5,416,'2020-10-07 05:29:19','2020-10-07 05:29:19','だいさん','2017.04.27'),(1643,'しっとりしているのですが、バターっぽさがくどいことはなく、 おやつに調度いいスィーツだと思います。 レーズンもしっかり入っていますし、手軽で美味しので、何度も リピしています。',5,417,'2020-10-07 05:29:19','2020-10-07 05:29:19','すみれさん','2018.10.16'),(1644,'お腹が空くかもしれない、でも食べる所がないし、時間も無いし～という不安払拭のため、ビジネスバッグにいつも入れておく一個です。日持ちするし、小さくて満腹感あるし助かります。',5,417,'2020-10-07 05:29:19','2020-10-07 05:29:19','ろんさん','2018.06.07'),(1645,'これは美味しい!厚みもサイズも十分あるのに、価格は手頃で大満足。 しっとり柔らかく、洋酒の香り・風味もしっかり感じます。レーズンはジューシーで、レモンの香りが心地いいです。 日持ちするのでまとめ買いもできそう。次回も購入します。',5,417,'2020-10-07 05:29:19','2020-10-07 05:29:19','こぐまさん','2017.04.27'),(1646,'国産小麦粉と発酵バターが使われているからか、味だけでなく香りも良かったです。フルーツが入っていて贅沢感もあり、優雅なティータイムになりました。こちらの「ひとときスイーツ」シリーズは、大きさ的にもちょうど良くて助かっています。(大きすぎないので食べすぎ防止になっています)',5,417,'2020-10-07 05:29:19','2020-10-07 05:29:19','yoroさん','2017.02.06'),(1647,'普段のおやつにちょうど良いです。また、登山の時に行動食として持っていくと、かさばらないのにカロリーがあり、甘いものを食べると元気が出ます。個包装なので保存もできて重宝しています。',5,417,'2020-10-07 05:29:19','2020-10-07 05:29:19','かあやんさん','2016.09.30'),(1648,'ブラックココアでか、ココアの風味が見た目より少なく感じますが、 甘さ控えめで上品なお味です。 他メーカーの類似商品よりしっとり感は少ないですが、 厚みがありしっかり満足できました。',4,418,'2020-10-07 05:29:19','2020-10-07 05:29:19','葵さん','2020.05.21'),(1649,'おやつに食べるのに丁度良いサイズで、コーヒーや紅茶にも合って美味しいです。',5,418,'2020-10-07 05:29:19','2020-10-07 05:29:19','kumiさん','2020.05.07'),(1650,'甘党の私にとって、又良質で低価格の物が買えた。しかし、今度は何時も買ってる物とは違うトップバリュ、その名はひとときスイーツ しっとりココアのマーブルパウンドだ。昔から飲んでるココアを実感させてくれる味わいと生地のしっとりさ。べた褒めしたくなるね。と言う事でこちらも５つ星を差し上げたい。（ニッコリ）',5,418,'2020-10-07 05:29:19','2020-10-07 05:29:19','車バイク好きケン君さん','2020.03.29'),(1651,'おやつに食べるのに、ちょうどいいです。',4,418,'2020-10-07 05:29:19','2020-10-07 05:29:19','ユキさん','2020.01.04'),(1652,'見た目は美しいです。 普段からお菓子作りをしますが、 それに比べるとしっとり感は欠けるように思います。 せっかくの発酵バターや、アーモンドの風味もあまり感じることができず、残念でした。',3,418,'2020-10-07 05:29:19','2020-10-07 05:29:19','楓さん','2017.04.10');
